(1, '3939440000087590003', 'ساره النعيمي', 'sarah-alnuaimi', '<p><b>ساره النعيمي</b> شاعرة وفنانة ومصورة إماراتية. شاركت في عدد من الجلسات الشعرية باللغة الإنجليزية ومنها ليلة الشعر <br></p><p>الرمضانية والصوفية التي أقامتهما مكتبة بيت الحكمة في عام ،2024 وفي مهرجان الإمارات للآداب. تم نشر مجموعتها<br></p><p>الشعرية التي تُظهر حبها العميق لألجداد والحنين إلى الماضي مع دار نشر سيل في عام 2022 .<br></p><p>تعاونت سار ه مع مؤسسة الشارقة للفنون و مكتبات دبي وعدة مؤسسات أخرى عبر تقديم ورشات عمل متنوعة في مجال الفن<br></p><p>والرسم والأدب. في عام ،2020 كانت واحدة من الفنانين المشاركين مع معرض عكاس للفنون البصرية.<br></p><p>تم نشر أعمالها في مجلة سكّة ومجموعة أمريكية.<br></p><p>تحمل سارة درجة البكالوريوس في الهندسة الصناعية و اإلدارة الهندسية من جامعة الشارقة، وتسعى لدمج الإبداع البصري<br></p><p>والأدبي والارتقاء بهم إلى أبعد الحدود.<br></p>', NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(2, '3939440000010821146', 'جيف كيني', 'jeff-kinney', '<p>جيف كيني هو مؤلف سلسلة \"مذكرات طالب\" وسلسلة \"مذكرات طالب رائع حقاً\" وهو من أكثر المؤلفين مبيعاً بحسب \"نيويورك تايمز\". نال كيني جائزة اختيار الأطفال من قناة \"نيكلوديون\" ست مرات في فئة الكتاب المفضل، كما تم اختياره كواحد من أكثر 100 شخصية تأثيراً في العالم وفقاً لمجلة \"تايم\". أمضى طفولته في واشنطن العاصمة وانتقل إلى نيو إنجلاند؛ حيث يمتلك هو وزوجته مكتبة تسمى \"قصة غير متوقعة\". <br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
