(25, '3939440000076841006', 'أحمد الصادق', 'ahmed-alsadek', '<p>أحمد الصادق، قاص وروائي، من مواليد القاهرة. درس الفلسفة بكلية الآداب، ويعمل محرراً أدبياً وكاتباً حراً في عدد من المنصات الإلكترونية في قسمي الثقافة والفنون. صدر له خمسة أعمال أدبية، آخرها رواية \"دُوار العالَم\" عن دار العين للنشر 2023. حصد العديد من الجوائز الأدبية الرفيعة، أهمها جائزة الدولة التشجيعية في الآداب عام 2021 عن رواية \"هيدرا.. أوديسا الفناء والخلود\"، كما حصل على عدد من المنح الأدبية من مؤسسة آفاق، ومن وزارة الثقافة، وشارك في عدد من الورش الأدبية والفعاليات الثقافية في بيروت وبشري ومراكش والرباط والدوحة. <br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(26, '3939440000010822056', 'كلير ماكنتوش', 'clare-mackintosh', '<p>صاحبة أكثر الكتب مبيعًا المؤلفة <b>كلير ماكينتوش</b> التي باعت أكثر من مليوني نسخة من كتبها في جميع أنحاء العالم، حازت العديد من الجوائز لروايتها السبع الأكثر مبيعاً وفقاً لصحيفة \"صنداي تايمز\"، كما حازت روايتها \"تركتك ترحلين\" على جائزة \"Theakston Old Peculier\" لرواية الجريمة في عام 2016. نالت سلسلة \"\"دي سي فيون مورجان\" وهي سلسة جرائم جديدة تروي قصة محقق من بلد \"ويلز\"، استحسان النقاد فيما تمكن كل من كتاب \"الحفلة الأخيرة\" وكتاب \"لعبة الأكاذيب\" من الوصول إلى المراكز العشر الأولى في تصنيفات صحيفة \"صنداي تايمز\". نشرت ماكنتوش مذكراتها في عام 2024 تحت عنوان \"أعدك لن يؤذيك دائمًا كهذه المرة\".<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
