(32, '3939440000098406002', NULL, 'waleed-eltayeb-gubara', '<p>الرئيس التنفيذي والشريك الإداري في تيك لاين، إحدى أبرز وكالات سرد القصص في المنطقة. وهو ناشر ومؤسس مشارك لـعصر العمل الخيري، وهو مصدر رئيسي للأخبار والرؤى والمقابلات الخيرية في العالم العربي. وهو أيضًا ناشر كتاب \"كيف تفعل الخير\"، وهو عبارة عن مجموعة من المقالات الملهمة من فاعلي الخير والمشاهير وقادة الفكر الذين يسعون جاهدين لتحسين العالم من خلال العطاء الخيري وبرامج التأثير. <br></p><p>مع أكثر من 25 عامًا من الخبرة في استراتيجية العلامة التجارية والمحتوى والاتصالات، أدار وليد مشاريع تحويلية للحكومات والمكاتب العامة والعلامات التجارية العالمية على حد سواء. كان مخرجًا وكاتبًا وشاعرًا شغوفًا، شارك في إخراج وإنتاج وتأليف فيلم \"الرئيس والتنين\" الذي يروي تاريخ 40 عامًا من القضاء على مرض دودة غينيا، بقيادة الرئيس الأمريكي الراحل<b> جيمي كارتر</b>. كما كتب وأنتج وشارك في إخراج فيلم \"الماس وحقائب الظهر وعلبة الثقاب\"، وهو فيلم وثائقي تدعمه المفوضية السامية للأمم المتحدة لشؤون اللاجئين ويقدم نظرة ثاقبة قوية على تجارب وحياة اللاجئين في المخيمات في جميع أنحاء الأردن ولبنان.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(33, '3939440000090149040', 'وليام زيمرلي', 'william-zimmerle', '<p>هو محاضر أول في برامج العالم القديم والتراث في جامعة نيويورك أبوظبي. وهو مؤسس مكتبة \"رائحة\": المكتبة التراثية الرقمية للبخور العربي والعطريات القديمة والروائح الطيبة. وهو يدير مشاريع الإثنوغرافيا التي توثق تراث مباخر البخور في شبه الجزيرة العربية. كما أدار العمل الميداني الأثري وأنتج معرضًا ثقافيًا عن فن الصخور من عام 2016 إلى عام 2019: مشروع فن الصخور والنقوش العربية في ظفار: مبادرة إنسانية رقمية. يتم تمويل هذا المشروع التراثي حاليًا من قبل جامعة نيويورك والإمارات العربية المتحدة، ويشمل دراسة النقوش الصخرية في شبه الجزيرة العربية بما في ذلك الإمارات العربية المتحدة وعمان.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(34, '3939440000099544001', NULL, 'abdullah-jalal-ostadi', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(35, '3939440000099005010', NULL, 'dabke-group', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(36, '3939440000076100051', 'نجوى ذبيان', 'najwa-zebian', '<p>نجوى ذبيان هي مؤلفة ومتحدثة ومعلمة لبنانية كندية حاصلة على دكتوراه في التربية، اشتهرت بعملها في توجيه القراء لتجاوز المشاعر الصعبة ونشرت أربعة كتب آخرها \"الثابت الوحيد\". لديها مجموعة من المحاضرات على \"تيد إكس\" بعنوان \"العثور على الوطن من خلال الشعر\" وبودكاست \"إن ذا كلير\" وتركز في طرحها على تضمين نهجها الذي يركز على الشفاء، ظهرت أعمالها في عدة صحف مثل \"نيويورك تايمز\" و\"جلامور\" و\"هاف بوست\" وغيرها. <br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(37, '3939440000010824098', 'فيصل عباس', 'faisal-j-abbas', '<p>فيصل عباس هو رئيس تحرير صحيفة \"عرب نيوز\" اليومية التي تتخذ من الرياض مقراً لها ونائب رئيس \"جمعية الصحفيين السعوديين\"، كما أنه كاتب عمود مشهور في الشؤون العربية ويظهر بانتظام على شبكة \"سي إن إن\" و\"بي بي سي وورلد\" ومنصات أخرى. نشر عباس في يونيو 2024 كتابه \"حكايا عربي أنجلوفوني\" الذي أشاد به مدير مجلس تعزيز التفاهم العربي ـ البريطاني كريس دويل نظراً لأنه كتاب يعزز التفاهم بين الثقافات، حظي الكتاب بتأييد من السفير السعودي في المملكة المتحدة الأمير خالد بن بندر والسير بن إليوت ووزير الدولة البريطاني لشؤون الشرق الأوسط وشمال أفريقيا السابق أليستير بيرت. <br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(38, '3939440000010823122', 'ميثاء الخياط', 'maitha-al-khayat', '<p><b>ميثاء الخياط</b>، أم إماراتية ومؤلفة عالمية، رسامة قصص أطفال ومدربة في أدب الطفل. أصدرت نحو 200 كتاب للأطفال واليافعين، تُرجمت بعضها إلى الإنجليزية والتركية والإيطالية، واعتمدت كتبها كمناهج دراسية في مدارس حكومية وخاصة. فازت بجوائز مرموقة، منها جائزة اتصالات لعام 2024 عن رواية “ابنة غواص اللؤلؤ وعقد البعو”، وجائزتان في مهرجان الشارقة القرائي للطفل 2024: أفضل كتاب عربي “سأصطاد فطوري” وأفضل كتاب إنجليزي “لؤلؤة عائشة“. ميثاء أيضاً تكتب برامج تلفزيونية وهي مستشارة في مسارة الآداب واللغات في مؤسسة ربع قرن. <br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
