(53, '3939440000062046001', 'سارة لورا نيستي ويلارد', 'sarah-laura-nesti-willard', '<p>سارة إل. نيستي ويلارد هي منسقة برنامج بكالوريوس الآداب في الدراسات البصرية والصناعات الإبداعية في جامعة الإمارات العربية المتحدة، تعمل في تدريس نقد الفن والتصميم الرقمي والرسم ودورات الاستوديو الأخرى. سارة مرشحة للحصول على درجة الدكتوراه في \"جامعة بليموث\" وتركز أبحاثها على الرسوم المتحركة والرسوم التوضيحية والقصص المصورة في الشرق الأوسط، عملت سارة في الرسوم الإيضاحية لكتب الأطفال لناشرين بما فيهم \"بيكون بوكس\" و\"راندوم هاوس\"، أسست شركة \"أرتوركسيس\" في عام 2006 وهي شركة تُنفذ أعمال الفنون الجدارية وتواصل عملها فيها بصفتها رسامة جدارية. <br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(54, '3939440000083611002', 'شيرين مالهيربي', 'shereen-malherbe', '<p>شيرين مالهيربي هي كاتبة بريطانية فلسطينية ومدافعة عن صوت الحق، تكتب روايات وسلسلة كتب للأطفال وتعمل حالياً على سلسلة روايات بوليسية للأطفال في المرحلة المتوسطة. تُرجمت كتبها إلى لغات متعددة وهي تظهر دائماً في لقاءات في المهرجانات الأدبية، تعمل شيرين على تدريب الكتاب الطموحين لتحقيق أهدافهم في النشر.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(55, '3939440000086955072', 'ناظم الزهاوي', 'nadhim-zahawi', '<p>ولد ناظم الزهاوي في بغداد وفرّ مع عائلته إلى المملكة المتحدة عندما كان في الحادية عشرة من عمره. بعد حصوله على شهادة في الهندسة الكيميائية من \"جامعة لندن\"، انتقل ناظم إلى مجال الأعمال التجارية، حيث أسس واحدة من أكبر شركات استطلاعات الرأي وأبحاث السوق نجاحاً على مستوى العالم \"يو قوف\" في عام 2000 وكان الرئيس التنفيذي لها حتى عام 2010 عندما تنحى ليصبح عضواً في البرلمان عن ستراتفورد أبون إيفون، خدم في البرلمان حتى تقاعده في عام 2024. واصل ناظم العمل كمستشار للخزانة وهو أحد أعلى المناصب في الحكومة البريطانية. أصبح ناظم رئيساً غير تنفيذي لمجموعة \"فيري قروب\" منذ تركه السياسة. <br></p><p><br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(56, '3939440000076108026', 'أنتوني ساتين', 'anthony-sattin', '<p><b>أنتوني ساتين</b> هو صحفي بريطاني وكاتب في أدب الرحلات، تناولت معظم أعماله مواضيع عن منطقة الشرق الأوسط وشمال أفريقيا؛ بما في ذلك العديد من الكتب المشهورة حول التاريخ والسفر. كما عمل على سيرتين ذاتيتين مثل \"شتاء على النيل\" و\"الشاب لورانس\". تتضمن اعماله الإذاعية أفلاماً وثائقية عن مواضيع متنوعة مثل \"القداس القبطي\" و\"مجنون ليلى\"، من أحدث إصداراته \"البدو: الرحّل الذين شكلوا عالمنا\" الذي وصف بأنه \"عمل مهم وكُتب بجمالٍ وسخاء\" ونال لقب كتاب العام في كلٍ من \"ذا تايمز\" و\"ذا صنداي تايمز\" و\"ذا سبيكتور\".<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(57, '3939440000010823207', 'ريحان خان', 'rehan-khan', '<p>يهتم ريحان خان بكيفية انتقال الأفكار عبر الثقافات وهو مؤلف \"ثلاثية تيودور التركية\" التي تدور أحداثها في الإمبراطورية العثمانية وإنجلترا تيودور، تجمع السلسلة التي رشحت لـ \"ميدالية كارنيجي\" بين المغامرة والتأملات في الفضيلة. أما أحدث كتبه فهو \"قبر الإمبراطوريات\" التي تدور أحداثها قبل 2000 عام في دمشق والقدس والبتراء خلال فترة من الصراع على موارد الشرق الأوسط. <br></p><p><br></p>', 'Litfest 2025', 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(58, '3939440000033858531', 'هيلين فارمر', 'helen-farmer', '<p><b>هيلين فارمر</b> هي كاتبة ومذيعة اشتهرت بمساعدة الأمهات على إجابة السؤال الذي يكرره صغارهن \"أين تذهب ماما طوال اليوم؟”؛ حيث ألّفت كتاب الأطفال الشهير \"مغامرات أمي السرية\" لتجيب الأطفال عن سؤالهم. تناقش هيلين عدة مواضيع عن المدينة النابضة بالحياة، دبي، من التمويل ووصولاً إلى الطعام، في برنامجها الإذاعي على \"دبي آي 103.8\"، كما تشارك هيلين مقتطفات من حياتها على مواقع التواصل الاجتماعي مثل الحياة في دبي والسفر والأناقة ولحظات حقيقية تعكس الأمومة والأبوة بشكل واقعي.<br></p>', 'Litfest 2025', 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(59, '3939440000010808096', 'دانابيل جوتيريز', 'danabelle-gutierrez', '<p>دانابيل جوتيريز هي كاتبة وممثلة ومصورة وفنانة حائزة على جوائز، ظهرت أعمالها في \"ذا كومون\" و\"مراجعة شعر الكوردايت\" و\"فوغ أريبيا\" وغيرهم من الصحف. ألّفت \"دموع عبر الأرض\" و\"حتى تأتي الأحلام\" و\"أشتاق أن أكون نهراً\"، بالإضافة إلى \"في النهاية يستسلم النهر\" و\"أكثر نعومة\"، نُشرت أحدث مجموعاتها \"الكلمة F\" في عام 2024. ولدت في لاس بيناس ونشأت في القاهرة وفيينا ومسقط وتقيم حالياً في دبي. <br></p>', 'Litfest 2025', 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(60, '3939440000033691575', 'إيفيت جادج', 'yvette-judge', NULL, NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(61, '3939440000098773016', NULL, 'ramesh-cidambi', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(62, '3939440000098726049', NULL, 'niall-mcloughlin', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(63, '3939440000010813176', 'سعادة مروة العقروبي', 'marwa-al-aqroubi', '<p>رئيسة المجلس الإماراتي لكتب اليافعين؛ والمديرة التنفيذية لبيت الحكمة بالشارقة؛ وعضو مجلس إدارة هيئة الشارقة للكتاب؛ وإحدى قيادات العمل الثقافي بدولة الإمارات. تتمتع بسجل إنجازات حافل في قطاع النشر، وبخاصة كتب الأطفال واليافعين. اختيرت عضواً بلجنة تحكيم \"جائزة معرض بولونيا الدولي لكتب الأطفال\" بإيطاليا عام 2017، وكذلك في مجلس أمناء المجلس الدولي لكتب اليافعين. ألفت العديد من الكتب والقصص الخاصة بالأطفال، وتواصل جهودها لترسيخ القراءة كعادة يومية بين الأطفال، وإثراء المشهد الثقافي وتعزيز حضور الثقافة في الحياة الاجتماعية.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(64, '3939440000010791057', 'سعادة الدكتور علي بن تميم', 'ali-bin-tamim', '<p>رئيس مركز أبوظبي للغة العربية <br></p><p>يشغل سعادة الدكتور علي بن تميم منصب رئيس مركز أبوظبي للغة العربية، وهو الأمين العام لجائزة الشيخ زايد للكتاب منذ عام 2011 ، ورئيس تحرير مجلة المركز للدراسات العربية الصادرة عن دار بريل العالمية للنشر.<br></p><p>شغل بن تميم العديد من المناصب والمهام، منها: رئيس مجلس إدارة مركز جامع الشيخ زايد الكبير، وعضو لجنة تحكيم برنامج \"أمير الشعراء\". كما كان عضواً في اللجنة العليا لجائزة الدولة التقديرية، وعضواً محكّما في عدة جوائز ثقافية بدولة الإمارات أهمها جائزة دبي الثقافية، وجائزة خليفة التربوية. كذلك شغل إدارة مشروع كلمة للترجمة، وتولى منصب مدير عام شركة أبوظبي للإعلام من 2016 إلى 2019، ورئيس اللجنة التنفيذية وعضو مجلس إدارة الأرشيف الوطني- أبوظبي من 2015 وحتى 2018.<br></p><p>حصل بن تميم على درجة الدكتوراه في النقد الأدبي من جامعة اليرموك، بالأردن عام 2005، ودرجة الماجستير في اللغة العربية وآدابها من الجامعة الأردنية عام 2001. كما أسهم في العديد من المبادرات إعلامياً وثقافياً بدولة الإمارات العربية المتحدة.<br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
