(83, '3939440000098073009', 'جورج والاس', 'george-wallace', '<p>جورج والاس شاعر مقيم في مدينة نيويورك وله 42 كتيبًا وخمسة ألبومات من الشعر المنطوق يتم بثها في جميع أنحاء العالم. وهو محرر العديد من المنشورات الأدبية، بما في ذلك خلج الشعر ومجلة لونغ آيلاند الفصلية وركن والت والطقس الرائع لوسائل الإعلام؛ وحائز على جائزة البيت الوطني&nbsp; مدى الحياة؛ وكاتب مقيم في مسقط رأس <b>والت ويتمان</b>. وقد ساهم جورج بشكل كبير في مجتمعات الشعر في جميع أنحاء الولايات المتحدة في السنوات الأخيرة، وحصل على جوائز كبرى في المهرجانات في جميع أنحاء العالم ونال تكريمات كبرى؛ وفي عام 2024 حصل على الدكتوراه الفخرية. من غرفة الفنانين والكتاب الدوليين والأكاديمية الملكية الإسبانية..<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(84, '3939440000010818116', 'حصة المهيري', 'hessa-almehairi', '<p><b>حصة المهيري</b> كاتبة ورسامة في أدب الأطفال واليافعين، حاصلة على درجة البكالوريوس في تعليم الطفولة المبكرة ودرجة الماجستير في الإدارة والسياسة التعليمية، من أهم إنجازاتها هي قصة \"الدينوراف\" والتي فازت بجائزة الشيخ زايد للكتاب عام 2018 ثم تم إطلاق نسخة مترجمة لثلاث لغات في السنة التي تليها، انضمت المهيري مؤخراً إلى أكاديمية الفنون لمتابعة حلمها في إنتاج أجود أنواع كتب الأطفال الإماراتية، تعمل الآن كمؤلفة ورسامة لكتب الأطفال واليافعين، نشر أول عمل لها كرسامة في كتاب \"ابنة غواص اللؤلؤ وعقد البعو\" للكاتبة <b>ميثاءالخياط،</b> ما زالت المهيري تشارك ككاتبة ورسامة في معارض الكتاب المختلفة وتقدم ورش عمل للصغار والكبار<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(85, '3939440000097041001', 'فادي غندور', 'fadi-ghandour', '<p>الرئيس التنفيذي لمجموعة ومضة، وهي منصة تستثمر وترعى وتبني النظم البيئية لريادة الأعمال في منطقة الشرق الأوسط وشمال أفريقيا. كان فادي أيضًا أحد مؤسسي شركة أرامكس، إحدى الشركات العالمية الرائدة في مجال الخدمات اللوجستية ومقرها في دبي. أمضى فادي السنوات الثلاثين الأولى من حياته العملية كرئيس تنفيذي لشركة أرامكس، حيث قام ببناء الشركة لتصبح واحدة من الشركات اللوجستية الرائدة في الأسواق الناشئة، وجعلها أول شركة من العالم العربي يتم إدراجها في بورصة ناسداك. <br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(86, '3939440000098432001', NULL, 'shaikha-al-marri', '<p>تبلغ <b>شيخة المري</b> من العمر 24 عامًا، وهي طيار تجاري أول مرخص في طيران الإمارات، ومؤلفة تنشر أعمالها بنفسها لأول مرة. تروي مذكراتها \"رحلة إلى السماء\" مسارها من شغف الطفولة بالطيران إلى تحقيق حلمها بالتحليق في السماء. من خلال قصتها، تشارك شيخة رسالة عن العزيمة والأمل، وتشجع الآخرين على تحقيق تطلعاتهم الخاصة، بغض النظر عن مدى بعد هذه الطموحات. <br></p><p>بصفتها شابة إماراتية، تحرص شيخة على تمكين الأجيال القادمة من احتضان أحلامهم بكل إخلاص. وتأمل أن تشجع رحلتها القراء -وخاصة الفتيات الصغيرات- على عدم التخلي عن طموحاتهم أبدًا.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(87, '3939440000096676011', 'نجيب محمد العلي', 'najeeb-al-ali', '<p><b>نجيب محمد العلي</b> هو المدير التنفيذي لهيئة إكسبو سيتي دبي، وكان يشغل سابقًا منصب المدير التنفيذي لإكسبو 2020 حيث عمل نائبًا للمفوض العام معالي الشيخ <b>نهيان مبارك آل نهيان</b>. كما شغل مناصب في مجلس الإمارات للتنافسية، ومكتب رئيس الوزراء الإماراتي، والمجلس التنفيذي لإمارة دبي، ومجموعة تيكوم وشركة الإمارات للاتصالات المتكاملة (دو) وغيرها. ولعب أدوارًا رئيسية في مبادرات حكومة الإمارات العربية المتحدة، بما في ذلك رؤية الإمارات 2021 وسياسات دبي الخضراء. <br></p><p>يحمل نجيب درجة الماجستير في إدارة الابتكار التكنولوجي من جامعة ساسكس والبكالوريوس في هندسة الاتصالات من جامعة هيرتفوردشاير.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(88, '3939440000076128024', 'تشاران رانجاناث', 'charan-ranganath', '<p><b>تشاران رانجاناث</b> هو مؤلف وأستاذ في مركز علم الأعصاب وقسم علم النفس ومدير مختبر الذاكرة الديناميكية في \"جامعة كاليفورنيا\" في ديفس. <br></p><p><br></p><p>ألّف رانجاناث كتابه \"لماذا نتذكر؟\" والذي تم تصنيفه بأنه الأكثر مبيعاً، وفقاً لصحيفة \"نيويورك تايمز\". قضى رانجاناث أكثر من 25 عاماً لدراسة الآليات الموجودة في الدماغ التي تسمح لنا بتذكر أحداث الماضي من خلال استخدام تقنيات تصوير الدماغ والنمذجة الحسابية ودراسات المرضى الذين يعانون من اضطرابات الذاكرة. حصل رانجاناث على العديد من الجوائز مثل زمالة \"جوجنهايم\" وزمالة كلية \"فانيفار بوش\".<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(89, '3939440000013339004', 'سارة حمدان', 'sara-hamdan', '<p><b>سارة حمدان،</b> خريجة بيركلي وكولومبيا، وهي مصرفية سابقة في ميريل لينش، وصحفية في صحيفة نيويورك تايمز، ومحررة في جوجل. بعد فوزها بجائزة نيتفليكس للقصة القصيرة، حصلت على الفصل الأول: زمالة الإمارات للآداب وصِدِّيقي للكتّاب عن روايتها الأولى، ماذا سيفكر الناس؟ سارة فلسطينية أمريكية، نشأت في اليونان، وتقيم في دبي منذ عشرين عامًا. عندما لا تقوم بالكتابة على الكمبيوتر المحمول الخاص بها، فإنها تحب قضاء بعض الوقت على الشاطئ مع زوجها وطفليها.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(90, '3939440000086685074', 'روتانا الحسنات', 'rotana-al-hasanat', '<p>متطوعة نشطة في ويكيبيديا، تساهم بطرق مختلفة مثل إنشاء المحتوى وتحريره ودعم المشاريع المجتمعية التي تهدف إلى إثراء المنصة. كما تعمل كعضو مجلس إدارة في مجموعة مستخدمي ويكيميديا ​​الكويت<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(91, '3939440000086973029', 'تريكسي دانييل', 'trixie-danielle', '<p>تريكسي دانييل هي فنانة متعددة التخصصات تقيم في الإمارات العربية المتحدة، يتعمق عملها في الهجرة والهوية والانتماء بشكل أساسي من خلال المسرح والشعر ورواية القصص بينما تستكشف الشتات الفلبيني وتعزز الاتصال عبر الثقافات، تعيد دانييل تصور الذكريات الشخصية والجماعية في سعيها إلى وحدة المجتمع والتعاون الإبداعي. هي عضو في مجموعة \"نومو 2024\" في مركز الفنون بـ \"جامعة نيويورك أبوظبي\"، ساهمت في \"Sulyap\" بصفتها عضواً أساسياً في \"ترايب كريتيفز\"، كما ساهمت في مشاريع مثل \"مذكرات مترو\" و\"الجدة باسيانغ\" كونها عضواً أساسياً في \"+63Kolektib\" في الإمارات العربية المتحدة و\"متحف الذكريات المهاجرة\". <br></p><p><br></p>', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(92, '3939440000089659001', 'اشي سينغ', 'aashi-singh', '<p>آشي سينج، كاتبة هندية تبلغ من العمر 14 عاماً وطالبة في الصف التاسع في أكاديمية جيمز مودرن في دبي، هي متعددة المواهب. مجموعة شعرها الأولى Into a Teenage Heart: What Keeps Me Awake at Night تستكشف تقلبات مرحلة المراهقة، متناولةً مواضيع مثل اكتشاف الذات، والحب، وتحطيم القلب، والهوية بصدق وعفوية. من خلال كتاباتها، تعكس سينج التزامها بالمساواة، والعدالة، والتعاطف، والسلام، وهي المبادئ التي تلهم قصائدها. بدأت في تعلم الرقص الباليه منذ سن الرابعة، كما أنها تستمتع بالغناء والملاكمة. بالإضافة إلى ذلك، أسست \"شعراء من أجل السلام\"، وهي منصة رقمية تجمع الأصوات الشابة من جميع أنحاء العالم، بهدف إلهام التغيير الإيجابي.<br></p>', NULL, NULL, 'Litfest 2025', NULL, NULL, 'Litfest 2025', 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(93, '3939440000097567007', NULL, 'raffae-hassan', NULL, NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(94, '3939440000098089017', NULL, 'jennifer-malton', NULL, NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(95, '3939440000097541004', NULL, 'ayla-hassan', NULL, NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(96, '3939440000098077034', NULL, 'abdallah-mukhairez', NULL, NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(97, '3939440000010822231', 'د. رفيعة غباش', 'rafia-ghubash', '<p>\"للدكتورة رفيعة غباش تاريخ حافل ومسيرة تكللت بالنجاح الكبير في الأوساط الأكاديمية، وقد تقلدت العديد من المناصب القيادية، فهي مؤسِسة متحف المرأة، وعميدة كلية الطب والعلوم الصحية في جامعة الإمارات العربية المتحدة من 1992-2000، وأول امرأة عربية تتولى رئاسة جامعة الخليج العربي من 2001-2009، إذ أكملت بنجاح ثماني سنوات في هذا المنصب وحققت العديد من الإنجازات والابتكارات في التعليم الطبي. <br></p><p><br></p><p>تبرز مساهمات الدكتورة غباش التعليمية والاجتماعية والفكرية العديدة والمتنوعة من خلال عضويتها ومساهماتها لدى عدد كبير من المنظمات الوطنية والإقليمية والدولية والجمعيات المهنية والمنظمات المدنية.<br></p><p><br></p><p>ألفت الكتب التي ترصد وتوثق التراث والتاريخ الإماراتي، والشعر النبطي في الإمارات، أبرزها موسوعة المرأة الإماراتية، والطب في الإمارات، وصفحات تاريخية من حياة الشاعر حسين بن ناصر لوتاه، والمرأة التي سبقت عصرها عوشة بنت خليفة السويدي.<br></p><p>حصلت الدكتورة غباش على العديد من الأوسمة والجوائز.\"<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(98, '3939440000095913002', 'بدر جعفر', 'badr-jafar', '<p>رجل أعمال تنفيذي إماراتي ورائد أعمال اجتماعي. يشغل منصب الرئيس التنفيذي لشركة الهلال للمشاريع، والمبعوث الخاص للأعمال والعمل الخيري في دولة الإمارات العربية المتحدة. وهو عضو في مجلس أمناء جامعة زايد والمجلس الدولي للجامعة الأمريكية في بيروت والمجلس الاستشاري للتنمية والتواصل للجامعة الأمريكية في الشارقة. طلق مبادرة بيرل في سبتمبر 2010 في الأمم المتحدة، وهي مبادرة يقودها القطاع الخاص لتعزيز حوكمة الشركات والمساءلة والشفافية في منطقة الخليج والشرق. وهو الراعي المؤسس لمركز العمل الخيري الاستراتيجي في جامعة كامبريدج ومبادرة العمل الخيري الاستراتيجي في جامعة نيويورك أبوظبي. <br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(99, '3939440000093568037', 'تاي ويجينز', 'ty-wiggins', '<p>خبير في القيادة ومتحمس لإعداد رؤساء تنفيذيين جدد لتحقيق النجاح. بصفته رئيساً عالمياً لقسم الرئيس التنفيذي والانتقالات&nbsp; في شركة راسل رينولدز أسوسييتس، فهو يساعد الرؤساء التنفيذيين الرائدين عالميًا على الانتقال بنجاح إلى أدوارهم، لإطلاق العنان للنجاح التجاري (والشخصي) - بشكل أسرع. <br></p><p>تاي هو واحد من القلائل الحاصلين على درجة الدكتوراه في انتقالات القيادة على مستوى العالم . ويسخر خلفيته الأكاديمية والاستشارية العميقة لتزويد الرؤساء التنفيذيين ومجالس الإدارة والقيادة العليا في مختلف الصناعات بالمشورة والدعم والبصيرة اللازمة للبدء بشكل جيد والأداء بسرعة.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(100, '3939440000093647001', 'إيف ورسوكي موريس', 'eve-wersocki-morris', '<p>مؤلفة كتب أطفال مرشحة لجائزة ورائدة في المبيعات. على الرغم من تشخيص إصابتها بعُسر القراءة عندما كانت في الثانية عشرة من عمرها، كتبت أول رواية كاملة لها في سن الثالثة عشرة. وقد تم ترشيح أول رواية لها بعنوان مغني العصافير (2022) المستوحاة من تراثها البولندي، لجائزة برانفورد بويز. كما تم اختيار كتابها الثاني لعنة العاصفة البرية من قبل وكالة القراءة لتحدي القراءة الصيفي&nbsp; لعام 2024. عملت إيف مع مؤسسة مؤسسة كورام بينستالك الخيرية لمحو الأمية وكانت رئيسة لجنة التحكيم في مسابقة الكتاب الشباب الصغار في مهرجان ويمبلدون للكتاب. كتابها الثالث هو غابة السحر الممنوع. إيف هي مديرة إي دبليو إم للعلاقات العامة، حيث تقدم حملات العلاقات العامة والفعاليات للناشرين.<br></p>', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(101, '3939440000096039010', 'تريسي هرموش', 'tracy-harmoush', '<p>تحولت تريسي، وهي مصرفية استثمارية سابقة، إلى متحدثة مشهورة ورائدة أعمال ومستثمرة نشطة. بعد مسيرة مهنية استمرت عقدًا من الزمان في مجال التمويل، انتقلت إلى ريادة الأعمال في عام 2018 وأصبحت منذ ذلك الحين واحدة من رواد الأعمال الرائدين في مجال العافية في دول مجلس التعاون الخليجي مع حضور متزايد على وسائل التواصل الاجتماعي. <br></p><p>أسست شركة \"أنتريسيبل\"، وهي شركة عافية ونمو شخصي، اجتذب أحدث برنامج لها 10000 مشترك عبر الإنترنت في الربع الأول. مشروعها الأخير هو ماما بوزا، وهي علامة تجارية تقليدية للآيس كريم العربي من مواليد الإمارات العربية المتحدة، حيث تعمل كمساهم نشط ومدير تسويق ورئيس استراتيجية.<br></p><p>تريس هي أيضًا الشريك الإداري لشركة الإنتاجات الخامسة، حيث تؤمن صفقات عالمية كبرى وموظفين للوكالة. بالإضافة إلى ذلك، تقدم بودكاست ما لا يقولونه لنا، حيث تشارك رؤى ومهارات حياتية لا تُحصى من خلال تجارب شخصية ومقابلات مع خبراء الصناعة.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(102, '3939440000018781001', 'إيزابيل أبو الهول', 'isobel-abulhoul', '<p>إيزابيل أبو الهول شخصية ثقافية وتعليمية رائدة في الإمارات العربية المتحدة. جاءت إلى دبي في عام 1968 ومثلت جزءًا أساسيًا في تأسيس سلسلة متاجر الكتب \"ماجرودي\" في عام 1975، التي لا تزال مزدهرة حتى اليوم بسبعة عشر متجرًا في جميع أنحاء الدولة. <br></p><p>كما شاركت في تأسيس مدرسة الاتحاد الخاصة في عام 1975، على أرض تبرع بها الشيخ<b> راشد بن سعيد آل مكتوم </b>رحمه الله. في عام 2008، أسست مهرجان طيران الإمارات الدولي للآداب، وهو أكبر احتفال بالكلمة المكتوبة والمنطوقة في الشرق الأوسط.<br></p><p>في عام 2013، أصدر سمو الشيخ <b>محمد بن راشد آل مكتوم</b> مرسومًا بإنشاء مؤسسة الإمارات للآداب، وعين إيزابيل كواحدة من أمناء المجلس. حتى مارس 2023، شغلت منصب الرئيس التنفيذي للمؤسسة، وهي الآن مستشارة وأمينة.<br></p><p>تشغل إيزابيل أيضًا منصب أمينة مجلس جائزة الرواية العربية الدولية ومديرة في مجلس إدارة مكتبة محمد بن راشد. تم تعيينها عضوًا في المجلس الاستشاري للشرطة لخدمة المجتمع وفي سبتمبر 2021، رئيسة لأحد المجالس العالمية التي تركز على أهداف التنمية المستدامة للأمم المتحدة.<br></p><p>حصلت إيزابيل على العديد من الجوائز والتكريمات، بما في ذلك جائزة شخصية العام الثقافية من سمو الشيخ <b>سلطان بن محمد القاسمي</b>، وجائزة وسام الإمبراطورية البريطانية من سمو الملكة الراحلة<b> إليزابيث الثانية</b>، وجائزة الريادة من سمو الشيخ <b>محمد بن راشد آل مكتوم</b>.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(103, '3939440000095619001', NULL, 'emma-quintin', '<p>ممثلة معروفة عالميًا اشتهرت بلعب دور \"بيلا\" في برنامج توينيز، وهو برنامج تلفزيوني للأطفال حائز على جوائز من إنتاج هيئة الإذاعة البريطانية. <br></p><p>مع مسيرة مهنية ناجحة امتدت لأكثر من 30 عامًا، ضمن شغف إيما المطلق والتزامها بالصناعة رسخت نفسها ليس فقط كممثلة متعددة الاستخدامات وقابلة للتكيف فحسب، ولكن أيضًا كفنانة متفانية ومجتهدة.<br></p><p>تقيم في الإمارات العربية المتحدة منذ عام 2013 وهي رئيسة التعليم في مركز إثراء المسرح. تواصل تقديمها وأدائها في جميع أنحاء العالم.<br></p>', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(104, '3939440000083527004', 'فادي قطان', 'fadi-kattan', '<p>فادي قطان هو شيف ومدير فنادق ومؤلف، عُرف بأنه صوت رائد في المطبخ الفلسطيني الحديث. ولد في بيت لحم لعائلة فلسطينية عريقة ويعكس أسلوبه في الطهي شغفاً عميقاً بتربة المنطقة. أصبح مطعمه \"فودا\" في بيت لحم المفضل محلياً، كما شارك في تأسيس مطعم \"عكوب\" وهو أول مطعم فلسطيني حديث في لندن يُقدم فيه النكهات الفلسطينية الأصيلة. يكشف كتابه الفردي الأول للطهي \"بيت لحم: احتفال بالطعام الفلسطيني\" عن جواهر الطهي المخفية في المدينة. سيطلق فادي مطعم \"لوف\" في نوفمبر في تورنتو بكندا، حيث يعرض لمسته الفريدة على النكهات والنبيذ الفلسطيني. <br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(105, '3939440000016086029', 'أمانديب بهانجو', 'amandeep-bhangu', '<p><b>أمانديب بهانجو </b>مذيعة بريطانية حائزة على عدة جوائز ولديها خبرة تزيد عن عقد من الزمان مع قناة بي بي سي الإخبارية في مدينتها لندن. انتقلت إلى الإمارات العربية المتحدة قبل اثني عشر عامًا كمراسلة دولية، وصورت في أكثر من 30 دولة. بعد أن غيرت حياتها المهنية بعد الوباء، أصبحت أمانديب الآن مُحاورة معروفة للأحداث والمؤتمرات الدولية، والتي تضم رؤساء دول وكبار الوزراء ومبتكرين في الصناعة وقادة فكريين عالميين. محاورة ماهرة للغاية، تدير مناقشات جماعية حول مواضيع متنوعة وتوفر تدريبًا إعلاميًا تنفيذيًا من خلال شركتها فويس ميديا ​​لندن التي تتخذ من الإمارات العربية المتحدة مقراً لها. حصلت أمانديب على درجة البكالوريوس والماجستير في الأدب الإنجليزي من جامعة كامبريدج.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(106, '3939440000092360001', 'مريم برتوي', 'maryam-bartawi', '<p>أمضت <b>مريم برتوي</b> تسع سنوات في بناء مسيرتها المهنية في عالم الشركات قبل أن تتخذ قرارًا جريئًا في سن السابعة والعشرين بالابتعاد عن الأمان الذي توفره هذه المهنة. انطلقت في رحلة تحويلية لاكتشاف الذات، سعياً إلى مواءمة حياتها مع الغرض الحقيقي لروحها. وعلى طول الطريق، أصبحت الحياة أعظم معلم لها، حيث قدمت لها تجارب عميقة شكلت رؤيتها وتطلعاتها. إنها لا تتابع دراستها لتصبح معالجة استشارية فحسب، بل تتطورفي الوقت نفسه كسيدة أعمال، حيث تمزج روحها الريادية مع شغف عميق بتمكين الأفراد، ومساعدتهم على إيجاد الوضوح والشفاء والوفاء في حياتهم.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(107, '3939440000037037012', 'إبراهيم الهاشمي', 'ibrahim-alhashmi', '<p>عضو مجلس إدارة مكتبة محمد بن راشد والمدير التنفيذي لمؤسسة سلطان بن علي العويس الثقافية. <br></p><p>شاعر وباحث في التراق والهويات، وله عدد من الإصدرات الشعرية وكتاب في المعتقدات الشعبية في دولة الإمارات العربية المتحدة، وعدد من كتب التراجم لبعض شعراء الإمارات وحاصل على عدد من الجوائز، كما ترجمت قصائده إلى عدد من اللغات.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(108, '3939440000090137060', 'فيرونيكا سوليفان', 'veronica-sullivan', '<p>فيرونيكا سوليفان هي مديرة مهرجان ومنسقة أدبية من مدينة ملبورن، أستراليا. هي المديرة الحالية لمهرجان ملبورن الكتابي. وقد شغلت سابقاً منصب رئيسة البرمجة في مركز \"وييلر\" للكتب والكتابة والأفكار.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(109, '3939440000011427057', 'أنابيل كانتاريا', 'annabel-kantaria', '<p>فازت أنابيل كانتاريا بـ \"جائزة مونتيغرابا\" في \"مهرجان طيران الإمارات للآداب\"، نشرت خمس روايات نفسية تشويقية مع \"إتش كيو ستوريز\" في هاربر كولينز بالمملكة المتحدة، سواء باسمها الحقيقي أو باسم مستعار \"آنا كينت\" وستُنشر روايتها السادسة في يوليو 2025. تعمل أنابيل حالياً كمرشدة كتابة مقيمة في \"زمالة الإمارات للآداب وصِدِّيقي للكتّاب\" التابعة لـ \"مؤسسة الإمارات للآداب\" في الإمارات العربية المتحدة، كما تعمل مدربة تحريرية وتقدم ورش تدريبية عن الكتابة والتحرير وتتحدث وتدير الجلسات الحوارية في المهرجانات الأدبية حول العالم. <br></p><p><br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(110, '3939440000076893002', 'هالة جوراني', 'hala-gorani', '<p><b>هالة جوراني</b> هي مذيعة ومراسلة حائزة على عدة جوائز وتتمتع بخبرة تزيد عن 25 عاماً. <br></p><p><br></p><p>عملت هالة في تغطية قصص وأحداث تاريخية وتعمل حالياً مراسلة أجنبية لقناة \"إن بي سي نيوز\". كانت مذيعة في برنامجها الخاص، \"هالة جوراني الليلة\"، على قناة \"سي إن إن\" حتى عام 2022 وهي واحدة من أكثر الأسماء المعروفة عالمياً في مجال الصحافة.<br></p><p><br></p><p>نشرت مذكرتها \"لكنك لا تبدين عربية\" في عام 2024، تعيش جوراني حالياً مع زوجها في لندن وتعمل على كتابها الثاني بجانب عملها الصحفي.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(111, '3939440000042983056', 'أحمد وراشد بن شبيب', 'ahmed-rashed-bin-shabib', '<p>متخصصان في التخطيط العمراني، وقد كلفا نفسيهما على مدى السنوات العشر الماضية بتعزيز الهوية الحضرية للشرق الأوسط المعاصر. وهما باحثان حائزان على جوائز ويمتلكان القدرة الفريدة على سرد القصص من خلال أبحاثهما العميقة حول الموضوعات، مما أدى إلى وصول كتبهما ومقالاتهما التي جمعتها دار براونبوك إلى تداول أكثر من مليون نسخة. وقد تم تكريم أحمد وراشد على إنجازاتهما من خلال ترشيحهما لجائزة الآغا خان للهندسة المعمارية في عامي 2010 و2018. كما فازا&nbsp; بجائزة الأسد الذهبي للهندسة المعمارية في البندقية عام 2020 لمساهمتهما في كتابهما \"تشريح السبخات\". وكلاهما خريج جامعة أكسفورد في مجال الجغرافيا. <br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(112, '3939440000080947002', 'صفية سنكلير', 'safiya-sinclair', '<p>صفية سنكلير المولودة في مونتيغو باي، جامايكا، هي مؤلفة المذكرات الشهيرة \"كيف تقول بابل: مذكرات جامايكية\" الحائزة على جائزة \"دائرة نقاد الكتب الوطنية\" و\"جائزة أو سي إم بوكاس للأدب الكاريبي\". كانت مذكرتها من بين المرشحين النهائيين لـ \"جائزة المرأة للكتاب الروائي\" وظهرت في العديد من قوائم \"أفضل الكتب\"، بما في ذلك صحيفة \"نيويورك تايمز\" و\"تايم\"، كما كانت واحدة من الكتب المفضلة للرئيس أوباما لعام 2023. <br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(113, '3939440000080377001', 'خيراني باروكا', 'khairani-barokka', '<p>خيراني باروكا هي كاتبة وفنانة ومستشارة مقيمة في جاكرتا، يتمحور عملها حول العدالة للأشخاص من ذوى الإعاقة والتطبيق العملي المناهض للاستعمار والعدالة البيئية. تم تكريم خيراني بعدة جوائز شرف مثل جائزة \"القائد الشاب الإندونيسي\" لـ \"صندوق الأمم المتحدة للسكان\" وإقامة \"مؤسسة دلفينا\" و\"منتدى آرت فوروم - يجب رؤيتها\" كما كانت أول شاعرة مقيمة ومحررة في مجلة \"الشعر الحديث في الترجمة\" وتأهلت&nbsp; للقائمة النهائية لجائزة \"المرأة الآسيوية للإنجاز\" لعام 2023. آخر إصداراتها الأدبي \"Ultimatum Orangutan and amuk\"<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(114, '3939440000079554006', 'عبداللطيف يوسف', 'abdulatif-yousef', '<p>شاعر سعودي لديه ثلاث إصدارات شعرية حائز على جائزة الأمير عبدالله الفيصل العالمية للشعر العربي فرع التجربة الشعرية بالإضافة إلى جوائز وإشادات أخرى<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(115, '3939440000083548001', 'أسماء عزايزة', 'asmaa-azaizeh', '<p>شاعرة وكاتبة ومحررة. صدر لها أربع مجموعات شعريّة آخرها \"الجسد الّذي تسلّقتُه يوماً\" عن الدار الأهليّة، وكتاب نثريّ هو \"عام المتاحف الصغيرة\" عن دار روايات، الإمارات. <br></p><p>حصلت مجموعتها الشعرية الأولى \"ليوا\" على جائزة الكاتب الشاب في حقل الشعر من مؤسسة عبد المحسن القطان عام 2010.<br></p><p>صدرت مجموعتها \"لا تصدّقوني إن حدّثتكم عن الحرب\" عن دار المتوسط عام 2019 باللغتين الهولنديّة والسويديّة، وستصدر هذا العام بالفرنسية عن دار زيم في مارسيليا.<br></p><p>تشارك في أنطولوجيّات ومهرجانات شعريّة في العالم، وقد ترجم بعض من قصائدها إلى الإنجليزية والألمانية والفرنسية والفارسية والسويدية والإسبانية والتركية وغيرها.<br></p><p>عملت لسنوات في الإذاعة والتلفزيون وأدارت مشاريع ثقافية. تعمل اليوم محررة لقسم فلسطين في موقع رصيف22.<br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(116, '3939440000080043001', 'نبيل سليمان', 'nabil-suleiman', '<p>ولد الكاتب عام 1945، تخرج من جامعة دمشق، كلية الآداب قسم اللغة العربية عام 1967. <br></p><p>للكاتب سبعة وخمسون كتاباً منها ثلاث وعشرون رواية، وثمانية وعشرون كتاباً في النقد الأدبي، وستة كتب في الشأن العام، وقد صدر ثلاثة عشر كتاباً حول أعماله، والعديد من المقالات والأطروحات الجامعية. حصل نبيل سليمان على العديد من الجوائز والتكريمات آخرها جائزة سلطان العويس عام 2021، كما شارك في التحكيم لعدد من الجوائز وترأس لجنة تحكيم الجائزة العالمية للرواية العربية عام 2024.<br></p><p>حاضر في العديد من الجامعات العربية والعالمية، وشارك في العديد من المؤتمرات والندوات، وقد صدر عن رواياته عدد من الكتب والأطروحات الجامعية.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(117, '3939440000097100009', NULL, 'wet-grass', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(118, '3939440000042588013', 'كاي ديبينديكتيس', 'kai-debenedictis', NULL, NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(119, '3939440000041956011', 'إشا ناير', 'isha-nair', NULL, NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(120, '3939440000059888011', 'آيات منهاس', 'ayat-minhas', NULL, NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(121, '3939440000010813126', 'جوليا ويلر', 'julia-wheeler', '<div><b>جوليا ويلر</b> كاتبة وصحفية تتمتع بخبرة كبيرة وقدرة متميزة على المحاورة، عملت في هيئة الإذاعة البريطانية \"بي بي سي\" لأكثر من 15 عاما، مراسلة لمنطقة الخليج العربي. <br><br> تدير العديد من المؤتمرات و المهرجانات الدولية، أبرزها مهرجان شلتنهام (للآداب والعلوم)، مهرجان سترانفوردز لكتّاب الرحلات، ومهرجان لندن، أولمبيا، ومهرجان ستراتفورد الأدبي. <br><br> تترأس مجالس خاصة بالمكتبة البريطانية، على متن كونراد كوين ماري 2. وأعضاء المنظمات الدولية.\nومهرجان القصص المسائية بالاشتراك مع نتفلكس. <br><br> وقد استضافت وحاورت كوكبة كبيرة من المشاهير، منهم، جراهام نورتون، بوب مورتيمر، بول وايتهاوس ، روبرت ويب، صوفي إليس-بيكستور، دارسي بوسيل، جوليان كلاري، ألكسندر ماكول سميث، ريتشارد أوسمان، روري بريمنر، ديفيد باديل، بن ميلر، ميل جيدرويك، جيني إكلير، جانيت وينترسون، كيت همبل، راشيل جونسون، مارييلا فروستروب، سيمون أرميتاج، إليف شافاك، أنتوني هورويتز، روبرت هاريس، وغيرهم! <br><br> شاركت في جولة المسرح والكتاب مع أماندا أوين. وهي مؤلفة الكتاب الحائز على الجوائز، \" رواية الحكايات التاريخ الشفهي لدبي؟ <br><br> تخصصت جوليا في التاريخ الاجتماعي والاقتصادي قبل التحاقها ببرنامج جامعة سيتي لندن للدراسات العليا في الصحافة الإذاعية.</div>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(122, '3939440000086492004', 'ريم خورشيد', 'reem-khorshid', '<p>ريم خورشيد مهندسة معمارية وباحثة حضرية تقيم في لندن، تركز أعمالها على التاريخ الحديث والمعاصر للمدن العربية.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55');
INSERT INTO `ar_authors` (`id`, `authorid`, `full_name`, `author_slug`, `author_blurb`, `author_as_year`, `moderator_as_year`, `launchpad_young_author_as_year`, `launchpad_author_as_year`, `performer_as_Year`, `Host_as_Year`, `Website_Status`, `created_at`, `updated_at`) VALUES
(123, '3939440000076879001', 'حنين الصايغ', 'haneen-al-sayegh', '<p>حنين الصايغ شاعرة وروائية لبنانية من مواليد جبل لبنان. حاصلة على إجازة في اللغة الإنكليزية وآدابها، وشهادة ماجستير في تدريس مناهج اللغة الإنكليزية من الجامعة الأميركية في بيروت. تعمل في التدريس والترجمة الأدبية. صدرت لها ثلاث مجموعات شعرية: \"فليكن\" صدرت عام 2016، و\"روح قديمة\" عام 2018، و\"منارات لتضليل الوقت\" الصادرة عن \"دار النهضة العربية\" في بيروت. ميثاق النساء هي روايتها الأولى والتي صدرت في لبنان عن دار الآداب في أيلول 2023 وقد ترجمت إلى الألمانية وصدرت في مارس 2024 عن دار dtv. <br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(124, '3939440000060250003', 'عمار شمس', 'ammar-shams', '<p>بنى عمار شمس مسيرة مهنية متنوعة في مختلف الصناعات بعد تخرجه بدرجة البكالوريوس في الاقتصاد، تشمل مسيرته المهنية مجالات مثل النفط والغاز والحكومة والخدمات المصرفية والإعلام. حصل على درجة الدكتوراه من \"كلية الدراسات الشرقية والإفريقية\" في لندن وأجرى أبحاثاً عن تقاطع حقوق النوع الاجتماعي والشريعة الإسلامية، بالإضافة إلى تدريسه لقانون الأسرة في الجامعات المحلية. عمار متزوج ولديه ابنة واحدة. <br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(125, '3939440000056792046', 'نزار حبش', 'nizar-habash', '<p>نزار حبش أستاذ علوم الحاسوب في جامعة نيويورك أبوظبي ومدير مختبر المقاربات الحاسوبية لنمذجة اللغة (CAMeL). يختص في معالجة اللغة الطبيعية واللغويات الحاسوبية، مع خبرة بحثية واسعة في معالجة اللغة العربية حاسوبياً، بما في ذلك الترجمة الآلية، والتحليل الصرفي، ونمذجة اللهجات. قبل انضمامه إلى جامعة نيويورك أبوظبي في عام 2014، كان باحثاً علمياً في جامعة كولومبيا. يحمل دكتوراه في علوم الحاسوب من جامعة ماريلاند، وشهادتي بكالوريوس في هندسة الحاسوب واللغويات. حصل الأستاذ حبش على العديد من الجوائز، منها جائزة أكاديمية الملك سلمان للغة العربية وجائزة أنطونيو زامبولي.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(126, '3939440000078809001', 'مها أبو العينين', 'maha-abouelenein', '<p><b>مها أبو العينين</b> هي خبيرة استراتيجية ومتحدثة معروفة وعضوة في مجلس الإدارة العالمي لوكالة \"أسوشيتيد برس\"، تمتد خبرتها في مجال الاتصالات العالمي لأكثر من ثلاثين عاماً. قدمت مها أبو العينين استشارات لكبرى الشركات العالمية والقطاعات الحكومية والرؤساء التنفيذيين وأصحاب الثروات العالية. هي الرئيسة التنفيذية لشركة \"ديجتال أند ساڤي\" المتخصصة في الاستشارات ولديها مكاتب في الإمارات العربية المتحدة والولايات الأمريكية المتحدة. تتمتع أبو العينين بخبرة واسعة في إدارة العلامات التجارية الشخصية وإدارة السمعة وقوة سرد القصص، كانت الرئيس السابق للاتصالات العالمية والسياسة العامة في شركة \"جوجل\" والمدير الإداري لشركة \"ويبير شاندويك\"، كما عملت في شركة \"جينرال ميلز\" قبل دخولها إلى عالم ريادة الأعمال.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(127, '3939440000090423009', 'اسراء الملا', 'esra-almulla', '<p>أديبة وباحثة في اللغة العربية والتراث الثقافي، رفيقة الكلمة والكتاب، تبحر بين صفحات الكتب لتستخرج كنوز اللغة العربية. نشأت في عالم تملؤه الكتب منذ طفولتها، فكانت الأوراق رفيقتها، والحكايات زادها اليومي. لديها مكتبة ثرية، تحوي الأدب بأنواعه. حاصلة على ليسانس اللغة العربية وآدابها، ودبلوم الأرشفة الإلكترونية، وتتابع دراستها للماجستير في اللغة العربية. تشغل منصب مدير إدارة المدرسة الدولية للحكاية بمعهد الشارقة للتراث، وسبق أن تولت مسؤولية قسم الأرشيف. لديها إصدارات أدبية تتنوع بين نصوص ومقالات أدبية وكتابات في أدب الطفل، إلى جانب مشاركاتها في مهرجانات وملتقيات ثقافية دولية في دولة الإمارات وخارجها. تطمح إلى ترسيخ حب الحكاية، وتنظر إلى القلم والكتاب دوماً، تحلم بعالم تُروى فيه حكايات لا تنتهي.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(128, '3939440000090187010', 'عائشه الشامسي', 'aysha-alshamsi', '<p>الدكتورة عائشة الشامسي <br></p><p>ناقدة وأستاذة جامعية وشاعرة<br></p><p>رئيس قسم اللغة العربية في جامعة محمد بن زايد للعلوم الإنسانية، لديها العديد من المؤلفات النقدية والشعرية منها: \"الشعر الإماراتي من منظور النقد البيئي\"، وكتاب \"حبر أبيض\"، ومن الدواوين الشعرية ديوان \"جمر\" وديوان \"ما لم تقله عائشة\".<br></p><p><br></p>', 'Litfest 2025', 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(129, '3939440000097100014', NULL, 'basma-choir', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(130, '3939440000092809001', 'علاء معصراني', 'alaa-maasarani', '<p>يمتلك <b>علاء معصراني</b>&nbsp;خبرة طويلة تمتد لأكثر من 14 عاماً في مجال الاتصال المؤسسي وإنشاء تحرير المحتوى العربي، وسرد وكتابة القصص والترجمة، والاستشارات الثقافية والجيوسياسية. تتضمن مسيرته المهنية العمل مع مجموعة من المنظمات مثل القنصلية العامة للبنان في مونتريال، وMSL Group في الشرق الأوسط، وأكاديمية أنور قرقاش في دولة الإمارات العربية المتحدة. ويمتلك سجلاً حافلاً في مجال التواصل الاجتماعي والظهور على الشاشات التلفزيونية والمقابلات الإذاعية، وإدارة الحوارات الثقافية والمجتمعية مع مجموعة واسعة من الشخصيات الإدارية والاجتماعية والأدبية والثقافية. يحمل درجة الماجستير في العلاقات الدولية من جامعة UQAM في كندا، كما يعمل حالياً على تحضير رسالة الدكتوراه في مجال العلاقات الدبلوماسية.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(131, '3939440000089934031', 'عمير كيداوي', 'umair-kidwai', '<p>عمير كيدواي هو طالب في الصف التاسع في مدرسة جيمز مودرن أكاديمي في دبي، وهو من مدينة لكناو في الهند. يحب طعام المدينة ولديه شغف بالقراءة، والبرمجة، وكرة السلة، والتنس، والشطرنج، وفن السرد القصصي. استلهم عمير أول كتاب له من دروسه في التاريخ حول الثقافة اليونانية، وقد بدأ اهتمامه بالأدب الخيالي والفانتازيا من خلال أفلام مثل ذا هوبيت وسيد الخواتم. بدعم من عائلته، وخاصة عمه، قام بالتنقل في عملية الكتابة والنشر. يهدف أمير في المستقبل إلى استكشاف الأدب الواقعي، وتوسيع جمهوره بينما يطور مهاراته الإبداعية وفن السرد القصصي.<br></p>', NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(132, '3939440000089882034', 'رالف طوق', 'ralf-tawk', '<p>رالف طوق، طفل نشيط يبلغ من العمر سبع سنوات، يجلب الفرح والطاقة إلى كل مكان يدخل إليه. شغوف بكرة السلة، يتبع أسلوب حياة نشط ويعبّر عن إبداعه من خلال الرسم والقراءة. يقدّر رالف الوقت الذي يقضيه مع العائلة والأصدقاء، ويستمتع بالرياضات، واللعب الخيالي، وسرد القصص. في المدرسة، يحب بشكل خاص الرياضيات والتربية البدنية، مما يعزز حلمه في أن يصبح مهندساً معمارياً. وعيه البيئي يجعله يدافع عن تقليل استخدام الورق، مما يظهر حساً ناضجاً بالاستدامة. مدعوماً من عائلته، يعمل رالف على كتابة كتاب مستوحى من أعماله المفضلة مثل \"بيغ نيت\" و\"دوج مان\"، ويواجه كل يوم بفرح وفضول.<br></p>', NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(133, '3939440000089438110', 'رومينيشن', 'rumination', '<p>تم تأسيس \"رومينيشن\" في 1 أكتوبر 2021، بدافع الشغف المشترك تجاه الثقافة والفن الشرقي. في عالم حيث يُعتبر الاتصال بالثقافة أمراً أساسياً لكل فرد، تسعى رومينيشن إلى إحياء فن السرد القصصي، خاصة القصص البدوية التي لم تُحكَ بعد. من خلال جمع الموسيقيين من جميع أنحاء العالم، تهدف المنصة إلى إلهام تحول من الفردية إلى التناغم الجماعي، وتعزيز السلام من خلال اختيار قصص بدوية متنوعة. تتخيل رومينيشن مستقبلاً حيث يتبنى الناس الثقافة والفن كوسيلة للبقاء والوحدة، صدىً لأفكار جلال الدين الرومي: \"التعاطف أفضل من التحدث بلغة واحدة\". <br></p><p><br></p>', NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(134, '3939440000010807016', 'الكساندر مكناب', 'alexander-mcnabb', '<p>ألكسندر ماكناب عمل كصحفي ومحرر وناشر مجلات في منطقة الشرق الأوسط لأكثر من 38 عاماً. في أوقات فراغه، عرف بكونه كاتباً لروايات الإثارة التي تدور أحداثها في منطقة الشرق الأوسط والمملكة المتحدة وأيرلندا. اهتمامه العميق في استكشاف تاريخ الإمارات قاده في بعض الأحيان إلى طرق غير متوقعة، لكنه أيضاً أدى إلى اكتشاف قصة مذهلة ظلت تقريباً غير معروفة. عندما لا يكون مشغولاً بكتابة الكتب، يدير ألكسندر استشاريته التي تركز بشكل رئيسي على الإعلام والنشر والاتصالات الرقمية.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(135, '3939440000093407085', 'باسل اليافي', 'basel-yafi', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(136, '3939440000090058011', 'فاطمة الحمادي', 'fatima-al-hammadi', '<p>متخصصة في علوم البيئة والاستدامة، تعمل كمحللة التقييم والتحليل البيئي في هيئة البيئة في أبوظبي. <br></p><p>كاتبة ومؤلفة قصص قصيرة للأطفال. عضوة في مجلس شباب اللغة العربية ومؤثرة على وسائل التواصل الاجتماعي. من مؤلفاتها قصة قصيرة خيالية بعنوان \"برقع جدتي\"، والتي فازت بها بالمركز الأول في مسابقة \"قصتي\" على مستوى دولة الإمارات العربية المتحدة 2017، وقصة الغافة السحرية 2024.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(137, '3939440000018192011', 'دعاء خضر', 'duaa-khidir', '<p>بأكثر من سنتين من الخبرة في حركة ويكيميديا، <b>دعاء خضر</b> متفانية في تعزيز المشاركة المجتمعية، والتمكين الرقمي، ومشاركة المعرفة. بصفتها منسقة التواصل والمشاركة في ويكيميديا الإمارات، تقود المبادرات التي تهدف إلى تعزيز ويكيبيديا ومشاريعها الشقيقة، وتنظيم ورش العمل، والتعاون مع الشركاء لتوسيع نطاق الوصول إلى المعرفة الحرة. <br></p><p><br></p>', 'WikiArabia2024', 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(138, '3939440000010816171', 'محمد بن دخين المطروشي', 'mohamed-almatrooshi', '<p>يشغل <b>محمد بن دخين المطروشي</b> حالياً منصب أمين صندوق جمعية الناشرين الإماراتيين وعضو في الجمعية للفترة بين عامي 2023 و 2025. من عام 1989 إلى عام 1992، شغل منصب رئيس التحرير ثم أصبح فيما بعد رئيس تحرير مجلة \"القوات الجوية\".بين عامي 1992 و1997، شغل منصب مدير إدارة الإعلام في مركز الإمارات للدراسات والبحوث الاستراتيجية، بينما كان أيضاً رئيس تحرير النشرة الإخبارية اليومية \"أخبار الساعة\".من عام 1999 إلى عام 2005 كان المرافق الصحفي لصاحب السمو حاكم الشارقة ومدير مكتب وكالة انباء الامارات بالشارقة، ومدير تحرير دورة إخبارية بدسك الاخبار بأبوظبي. خلال الفترة بين عامي 2005 و 2010، شغل محمد منصب مدير المركز الإعلامي في جامعة الشارقة.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(139, '3939440000089904044', 'غيث عبد الله', 'gaith-abdulla', '<p>غيث عبد الله&nbsp; هو متخصص في دراسات الخليج، ومؤسس مشارك لمنصة \"Engage 101\" لجمع البيانات والبحث، و\"بيت الممزر\" (BAM)، وهي مساحة فنية مستقلة في دبي. <br></p><p><br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(140, '3939440000096360004', NULL, 'alhadi-gebreel', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(141, '3939440000093904026', 'باولو سلوبودا', 'paulo-sloboda', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(142, '3939440000093903008', 'رومينا ساتفاتمانيش', 'romina-satvatmanesh', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(143, '3939440000093883009', 'نادين بسيوني', 'nadine-basiony', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(144, '3939440000093870009', 'نسيمة فرنسيس', 'nassimah-francis', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(145, '3939440000093861007', 'ماثيو كوربيت', 'matthew-corbett', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(146, '3939440000093855042', 'ريا صموئيل', 'ria-samuel', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(147, '3939440000093423060', 'كيثيلن جميلي', 'kethy-kist', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(148, '3939440000093345057', 'جون شينتون', 'john-shenton', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(149, '3939440000076466042', 'روان عقيلة', 'rawan-akkila', '<p>محترفة ذات خبرة في التعليم وإدارة الفعاليات، تعمل حاليًا في مجموعة كلمات. تشمل أبرز إنجازاتها المهنية تنسيق البرامج الثقافية، وقيادة مبادرات محو الأمية، وتطوير الفعاليات التي تركز على الطلاب مثل قافلة القراءة التابعة لمؤسسة الإمارات للآداب والبرنامج التعليمي لمعرض أبو ظبي الدولي للكتاب. مع بكالوريوس الآداب في اللغة الإنجليزية وآدابها، يعكس عمل روان الثقافة في مجال رواية القصص والتعلم وتعزيز التجارب المؤثرة في قطاعي التعليم والنشر.<br></p>', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(150, '3939440000018192006', 'علياء المنصوري', 'alyaa-almansoori', '<div class=\"align-right\" style=\"text-align: right\">إعلامية ومقدمة برامج حوارية وثقافية في هيئة الشارقة للإذاعة والتلفزيون. معدة ومقدمة البرنامج الثقافي مكتبات الحائز على جائزة العويس للإبداع لأفضل برنامج ثقافي لعام 2023 . خريجة تخصص علاقات دولية من الجامعة الأميركية في الشارقة، وجامعة ولنغونغ في دبي، مع أطروحة في الدبلوماسية الثقافية. مهتمة بالعلوم الاجتماعية والإنسانية، إلى جانب الأدب والفكر. محاورة وعريفة حفل باللغة العربية والإنجليزية<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(151, '3939440000010809351', 'واسيني الأعرج', 'waciny-laredj', '<p>الكاتب واسيني الأعرج هو روائي وأكاديمي بارز يعمل أستاذاً في جامعة السوربون، وواحد من أهم الأسماء في الأدب العربي المعاصر. له أكثر من 30 رواية مترجمة إلى أكثر من 20 لغة، ومن أبرز أعماله: كتاب الأمير (جزء 1 و 2)، ليالي العصفورية، حيزيا، شرفات بحر الشمال، حكاية العربي الأخير، والليلة السابعة بعد الألف. نال العديد من الجوائز الرفيعة تقديراً لمسيرته الأدبية، منها جائزة الشيخ زايد للكتاب، جائزة الإبداع العربي، جائزة كتارا للرواية العربية، جائزة السلطان قابوس، وجائزة نوابع العرب، مما يعكس مكانته المرموقة وإسهاماته العميقة في الأدب العربي.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(152, '3939440000054456001', 'راشد بن شبيب', 'rashed-bin-shabib', NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(153, '3939440000086955121', 'ميكالر ووكر', 'micallar-walker', '<p>ميكالار ووكر هي استشارية تسويق تتمتع بخبرة واسعة في تنفيذ حملات مؤثرة في المملكة المتحدة ومنطقة الشرق الأوسط وشمال إفريقيا. كانت سابقاً رئيسة قسم التسويق في فرونت رو فيلمد إنترتينمنت، ورئيسة قسم الفعاليات في بيكتشرهاوس سينيماز قبل ذلك، تمتلك أكثر من 20 عاماً من الخبرة التي تسهم في تطوير استراتيجيات وحملات التسويق. تشمل أعمال ميكالار الاستشارية التعاون مع فاني برودكشنز، بالإضافة إلى بيكتشرهاوس سينيماز، حيث تقدم دعماً مستمراً للوصول إلى الجمهور الأسود وتطويره. في عام 2021، أسست ميكالار وكالة التسويق الشاملة الحائزة على جوائز دارك ماتر لربط الجمهور الأسود بالثقافة والفنون. <br></p><p><br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(154, '3939440000076414027', 'مروى ملحم', 'marwa-melhem', '<p>كاتبة، ناشطة ومديرة فعاليات ثقافية. <br></p><p>مديرة البرامج العربية لدى مؤسسة الإمارات للآداب ومهرجان طيران الإمارات للآداب.<br></p><p>حائزة على عدة جوائز أدبية منها جائزة الشارقة للإبداع عام 2018، جائزة معهد غوته للقصة القصيرة، وجائزة مؤسسة آنا لينده ومعهد البحر المتوسط للقصة القصيرة.<br></p><p>نشرت مجموعتها القصصية الأولى \"عين ثالثة\" عن هيئة الشارقة للكتاب، كما نشر لها قصص وقصائد على عدة منصات عربية وعالمية.<br></p><p>تعمل أيضاً في التحرير والترجمة والصحافة.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(155, '3939440000093416081', 'عبد العزيز محمد علي', 'abdulaziz-mohamad-ali', '<p>كاتب و مؤسس دار قصة للنشر والتوزيع لدي ٣ إصدارات ومحارب للسرطان ٥ مرات. <br></p><p>دار قصة نجحت في نشر أكثر من ١٠٠ عنوان خلال أقل من ٣ سنوات.<br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(156, '3939440000094679001', 'فاطمة الخطيب', 'fatma-alkhatib', '<p><b>فاطمة الخطيب</b> تعمل في المجال الطبي كفنية أشعة طبية تشخيصية منذ 17 عامًا. كما عملت في التحرير والتدقيق وتنظيم الفعاليات الثقافية. في عام&nbsp;2021 أسست منشورات سدرة التي تهتم بترجمة أهم الكتب العالمية من لغات متعددة إلى اللغة العربية، حتى أصبحت هذه الدار إحدى<br></p><p>أهم دور النشر المحلية والعربية والتي تشارك في جميع معارض الكتب الخليجية والعربية. منذ عام 2022 وهي عضو في مجلس إدارة&nbsp;<br></p><p>جمعية الناشرين الإماراتيين وشاركت في معارض دولية عديدة<br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(157, '3939440000090014003', 'محمد قنديل', 'mohamed-kandil', '<p>المهندس محمد قنديل هو الرئيس التنفيذي لدار ملهمون للنشر والتوزيع، و\"E90 ديجيتال\"، و\"ليتل بَفن\"، وموقع \"موكا بوك\". قبل أن يصبح الرئيس التنفيذي في عام 2016، كان قنديل مديراً للتسويق الرقمي في شركته السابقة، حيث كان مسؤولاً عن تطوير استراتيجيات ترويج منتجات الشركة أو العلامة التجارية.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(158, '3939440000081025001', 'سو بريدجمان', 'su-bridgman-jd', '<p>سو بريدجمان هي خبيرة في صناعة الاتصالات ومؤسسة ورئيسة تنفيذية لشركة \"سبيك فلوينس قلوبال\"، كتابها \"حافة الذكاء التواصلي\" من أكثر الكتب مبيعاً على موقع \"أمازون\"، كانت بريدجمان رائدة في مجال الذكاء التواصلي لمعالجة مخاوف التحدث أمام الجمهور والقلق الاجتماعي. عملها مهم بشكل خاص في العصر الرقمي المتأثر بالذكاء الاصطناعي. بعد نجاحها في الانطلاق من \"تايمز سكوير\"؛ تقود بريدجمان مناقشات حول تمكين الأفراد من خلال استراتيجيات الاتصال المبتكرة. <br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(159, '3939440000080813001', 'رنا المطوع', 'rana-almutawa', '<p>رنا المطوع هي أستاذة مساعدة في \"جامعة نيويورك أبوظبي\"، حصلت على درجة الدكتوراه من \"جامعة أكسفورد\" في عام 2021. نُشر كتابها \"الحياة اليومية في المدينة المذهلة\" مع \"دار جامعة كاليفورنيا للنشر\" في عام 2024. <br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(160, '3939440000010821206', 'نورة الخوري', 'noura-al-khoori', '<p>نورة الخوري هي ناشطة بيئية حاصلة على بكالوريوس في علوم البيئة، تجمع بين الكتابة في أدب الطفل والعمل التطوعي المجتمعي في الأمومة والطفولة المبكرة. نورة شغوفة بتضمين البيئة الطبيعية والثقافة المحلية في قصصها وتقيم بانتظام حلقات قراءة مدرسية وورش تدريبية وأنشطة في معارض الكتب في جميع أنحاء الإمارات العربية المتحدة، كما تعمل نورة مترجمة بين اللغتين العربية والإنجليزية في مجال أدب الأطفال. <br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(161, '3939440000090138033', 'كلوي بيري', 'chloe-pierre', '<p><b>كلوي بيير </b>هي مؤلفة معروفة عالمياً وذات منشورات واسعة، وهي مؤلفة كتاب Take Care، وهو دليل للرفاهية يسلط الضوء على حالة رفاهية النساء من أصول أفريقية وملونة، وهو منظور ضروري يكاد يكون غائباً في مشهد الرفاهية. كما أنها مؤسسة منصة الرفاهية المبتكرة thy.self التي تهدف إلى تجسيد مفهوم العناية الذاتية سواء عبر الإنترنت أو في الحياة الواقعية، بالإضافة إلى إدخال التنوع في مجتمع الرفاهية على مستوى العالم. تعمل thy.self على توسيع الوصول إلى الرفاهية للمجتمعات التي كانت في السابق غير قادرة أو غير واعية أو ممثلة بشكل ناقص في صناعة الرفاهية، بالإضافة إلى خلق مساحة آمنة لفتح المحادثات حول القضايا الثقافية من أجل رفاهية شاملة وجعل التنوع أولوية.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(162, '3939440000058458003', 'موكسي أندرسون', 'moxie-t-anderson', '<p>بفضل عشقها للجنوب الأمريكي وتقديرها العميق له، موكسي ت. أندرسون كاتبة مغرمة بأدب الرعب والجريمة. تعيش مع كلب إنقاذ صبور جداً، وقطّ شوارع عنيد لا يتردد في استفزاز الكلب الصبور، وشريك داعم لها يشجعها في تحقيق جميع أهدافها. عاشت أندرسون في تكساس ولويزيانا وتينيسي، وتحب الجنوب رغم عيوبه. في عام 2021، حصلت على زمالة \"الفصل الأول\" للكتّاب مع مؤسسة الإمارات للآداب، وأتيحت لها الفرصة لإكمال روايتها The Seven تحت إشراف كاتب الجريمة البريطاني المتميز مارك بيلينجهام. حالياً، تمثلها الوكالة الأدبية Luigi Bonomi Associates. <br></p><p><br></p>', NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(163, '3939440000011233022', 'فاطمة المزروعي', 'fatima-almazrouei', '<p><b>فاطمة المزروعي</b>:أديبة وروائية وشاعرة وقاصة وباحثة في التراث والتاريخ. ورئيس قسم الأرشيفات التاريخية في الأرشيف والمكتبة الوطنية. <br></p><p>حاصلة على بكالوريس في التاريخ والآثار من جامعة الإمارات، وماجستير في العلوم السياسة من جامعة زايد.<br></p><p>تكتب في الرواية والبحث التاريخي والنقد والمقال والسينما والمسرح وقصص الأطفال والشعر. لديها أكثر من 20 إصدار في الشعر والمسرح والقصة والرواية والمقال. وقد فازت بجوائز عدة&nbsp; في مجال الأدب والثقافة أهمها:<br></p><p>1-جائزة العويس لأفضل عمل ابداعي وثقافي لعام 2013&nbsp; عن رواية \"العتمة\".<br></p><p>2-جائزة الشيخة شمسة بنت سهيل للأدب والثقافة عام 2013.<br></p><p>3- جائزة الإمارات للرواية عام 2017 عن روايتها قصتي الأخرى.<br></p><p>لديها أعمدة في صحيفة البيان الإماراتية والعين الإخبارية.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(164, '3939440000010791022', 'أليكس برون', 'alex-broun', '<p>أليكس براون هو كاتب ومخرج ومنتج أسترالي متخصص في المسرح والأوبرا والمسرحيات الموسيقية، نال شهرته في دول مجلس التعاون الخليجي ومن أبرز أعماله مسرحية \"ممزق\" و\"المدينة العمياء\" و\"السيدة فراشة\"، أخرج مسرحية \"نغني للوطن\" في إثراء بالدمام وهي واحدة من الفعاليات الرئيسية في اليوم الوطني لعام 2023، براون ايضاً كاتب مسرحي معترف به عالمياً في كتابة نصوص العشر دقائق؛ حيث أنتج أكثر من 100 مسرحية في أكثر من 40 دولة. <br></p>', NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(165, '3939440000010825011', 'عادل خزام', 'adel-khozam', '<p>يعد <b>عادل خزام</b> اليوم أحد أهم الشعراء العرب النشطين على المستوى الدولي، وهو أحد مؤسسي تجربة الحداثة الشعرية وقصيدة النثر. قام بتمثيل دولة الإمارات في العشرات من المناسبات والمهرجانات الأدبية لنحو 40 سنة. أصدر 20 كتاباً موزعة ما بين الشعر والرواية والفلسفة وفاز بجوائز عالمية مرموقة في الشعر والأدب من بينها جائزة أفضل شاعر دولي للعام 2021 من الصين والميدالية الذهبية من منظمة كتاب العالم، وجائزة توليولا الإيطالية وجائزة مهرجان طريق الحرير الذي ترعاه الأمم المتحدة. أطلق في 2024 الملحمة الشعرية العالمية \"مانسيرة\" التي شارك في تأليفها 86 شاعراً من 50 دولة. في حدث هو الأول على مستوى الشعر العالمي. <br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(166, '3939440000010813196', 'ناتالي حنظل', 'nathalie-handal', '<p>الشاعرة والكاتبة المسرحية وكاتبة المقالات الأدبية وأدب الرحلات، <b>ناتالي حنظل</b>، نشأت في أمريكا اللاتينية، وفرنسا، والشرق الأوسط، وتلقت تعليمها في آسيا والولايات المتحدة والمملكة المتحدة. من مجموعاتها الشعرية: \"الحياة في ألبوم بلد\"، \"الجمهوريات\"، \"شاعر في الأندلس\"، و\"الحب والخيول الغريبة\"، الفائزة بجائزة الميدالية الذهبية لجائزة الناشر المستقل للكتب. هي مؤلفة لثماني مسرحيات ومحررة لاثنين من الكتب الجماعية، بما في ذلك الكتاب الكلاسيكي الرائد: \"شعر النساء العربيات: أنطولوجيا معاصرة\"، الفائز بجائزة بِن أوكلاند جوزيفين مايلز للكتب. تكتب عمود أدب الرحلات الأدبي \"المدينة والكاتب\" لموقع كلمات بلا حدود. هي أستاذة في جامعة كولومبيا، وكاتبة ضيف في الجامعة الأمريكية في روما. <br></p><p><br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(167, '3939440000016159017', 'مصطفى الراوي', 'mustafa-alrawi', '<p>مصطفى الراوي هو صحفي وكاتب ومذيع وهو مساهم منتظم في \"ذا ناشونال\" و\"Axios.com\" و\"مجلة وإذاعة مونوكول\"، أجرى مقابلات مع شخصيات مشهورة مثل الكوميدي تريفور نوح والحائز على جائزة بوليتزر دانيال يرجين والمخترع توني فاضل. كان مصطفى زميلاً في الفصل الأول من \"زمالة مؤسسة الإمارات للآداب وصِدِّيقي للكتّاب\" في عام 2022. أحدث أعماله هو \"كيف تحل جريمة قتل في بلاد ما بين النهرين\" وهي لعبة مغامرات تفاعلية مع لمحة من لغز جريمة قتل.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(168, '3939440000010813181', 'محمد احمد المر', 'mohammed-ahmed-al-murr', '<p>\"\"\"معالي محمد أحمد المر <br></p><p>شغل معالي محمد المر منصب رئيس المجلس الوطني الاتحادي سابقاً، ويشغل حالياً منصب رئيس مجلس إدارة مؤسسة مكتبة محمد بن راشد آل مكتوم. وتصب إسهامات المر في مجالات متعددة كالسياسة والثقافة، ويعتبر من أبرز الشخصيات الثقافية التي برزت في عوالم والأدب والفكر والثقافة والشعر والخط العربي والفنون بمختلف صورها وفروعها في دولة الإمارات.<br></p><p>أسهم معالي محمد المر بفاعلية في ازدهار الحركة الثقافية والأدبية في دولة الإمارات منذ بداية الثمانينات ولغاية تاريخه. وتضمنت إسهاماته العديد من الكتابات والمقالات التي تمحورت حول المجتمع المحلي والأدباء والكتاب الإماراتيين، إلى جانب جهوده في توثيق اللهجات الإماراتية التي أسهمت في ترجمة الثقافة والمخزون المعرفي للدولة على المستوى المحلي والإقليمي والدولي، مما جعله مَعلم ومَرجع ثري في الشؤون الثقافية في الدولة.<br></p><p>أصدر معالي محمد المر أكثر من 20 كتاب ورواية ترجم العديد منها إلى لغات كالإنجليزية والهندية مثل \"\"غمزة الموناليزا\"\" و\"\"أقاصيص من دبي\"\". كما تم تدريس اثنين من كتبه ضمن المناهج الدراسية في جامعات مختلفة في الدولة.<br></p><p>شارك معالي محمد المر في تأسيس عدد من المشاريع الثقافية التي أسهمت في إبراز المكانة الثقافية لدولة الإمارات في العالم، ومنها متحف الاتحاد ودار الأوبرا وجائزة الشيخ زايد للكتاب وندوة الثقافة ومجلة حروف عربية التي تعنى بشؤون الخط العربي.\"<br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(169, '3939440000010814022', 'عفراء عتيق', 'afra-atiq', '<p>الدكتورة عفراء عتيق هي شاعرة وباحثة وفنانة إماراتية، أمضت السنوات العشر الماضية في قطاعي التعليم والثقافة. أكملت درجة الدكتوراه في الصناعات الإبداعية في \"جامعة الإمارات العربية المتحدة\" وحصلت على درجة الماجستير في الدبلوماسية، يستكشف عملها الفني مجموعة من الموضوعات بما في ذلك التراث والثقافة والإرث، حصلت الدكتورة عفراء على جوائز عن شعرها وظهرت على مسارح في جميع أنحاء العالم. تكتب وتؤدي باللغات الإنجليزية والعربية والفرنسية ونُشرت مجموعتها الشعرية الأولى \"عن النخل والسماء\" في عام 2024. <br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(170, '3939440000033691718', 'شيخة المطيري', 'shaikha-almteiri', '<div><b>شيخة عبدالله بن جاسم المطيري</b> <br></div><div>تحمل بكالوريوس في اللغة العربية&nbsp; والماجستير في علم المكتبات والمعلومات&nbsp; كما أنها طالبة دكتوراة في التاريخ والحضارة الإسلامية<br></div><div>رئيس قسم الثقافة الوطنية والوثائق بمركز جمعة الماجد للثقافة والتراث حاصلة على لقب سفير أبوظبي فئة المشاهير ، تكتب الشعر الفصيح وعلى جائزة الشيخة شمسة بنت سهيل للنساء المبدعات وجائزة الريشة الذهبية الإيطالية&nbsp; وجائزة المنجزين العرب في شرم الشيخ 2016م<br></div><div>شاركت في برنامج أمير الشعراء وحصلت على (المركز الثاني) وصافة الشعر عام 2019م وهي أول شاعرة عربية تصل لهذا المستوى<br></div><div>حصلت على المركز الأول في جائزة الشارقة لإبداعات المرأة الخليجية في مجال الشعر 2022 وتُرجمت بعض قصائدها للإنجليزية والفرنسية والألمانية والبرتغالية والروسية<br></div><div><br></div>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(171, '3939440000086997058', 'نعمه النور', 'nima-elnour', '<p>نيما النور هي شاعرة أمريكية سودانية ومبتكرة محتوى وصاحبة رؤية إبداعية تتفوق في تنفيذ رؤاها الإبداعية وإضفاء الحيوية على الكلمات، تكتب نيما الشعر منذ عام 2017 وبدأت في الإلقاء في عام 2022. تستمد الإلهام من تجربتها الفريدة كمغتربة أمريكية سودانية في مدينة دبي، يركز عملها على موضوعات مثل الحب والقرابة وغالباً ما يتضمن نبرة انتقادية ذاتية، نُشرت أول مقطوعة شعرية لها بالتعاون مع شبكة \"يوسو بيم\" بعنوان \"التوت الأسود\" في عام 2020 وتعمل حالياً على أول كتاب شعري لها. <br></p>', NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(172, '3939440000086645002', 'أدريان كالفوبولو', 'adrianne-kalfopoulou', '<p>أدريان كالفوبولو هي أستاذة مشاركة في الكتابة الإبداعية في \"معهد روتشستر للتكنولوجيا\" بدبي ومؤلفة لثلاث مجموعات شعرية، بما فيهم \"تاريخ الكثير جداً\" التي نشرتها في 2018، كما نشرت ثلاثة كتب نثرية ولديها مجموعة مقالات متنوعة قادمة بعنوان \"العودة إلى الملجأ\" ومن المقرر إصدارها في مايو 2025 بواسطة دار \"ريد هين للنشر\". حاز عمل أدريان على استشهاد بـ \"أفضل المقالات الأمريكية\" وترشيحات متعددة لـ \"أفضل المقالات على الإنترنت\"، وظهرت كتاباتها في مجموعة من الصحف والمجلات مثل \"هارفارد ريفيو أون لاين\" و\"المسلم الناقد\" و\"مجلة بيلويت للشعر\" وغيرهم. <br></p>', NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(173, '3939440000086908066', 'محمد أمير', 'mohamed-amir', '<p>محمد أمير هو شاعر ماهر في توجيه صراعات طفولته ومصاعب حياته الشخصية إلى تعبيرات عميقة، نشأ في عزلة فوجد العزاء في الشعر الحر الذي يمنح صوتاً للعواطف التي عجز عن التعبير عنها، أسرت قصيدته الأولى \"الرجل في الغرفة الأخرى\" جمهوره في وتعالت أصوات التصفيق الحار. يُعبر شعره عن موضوعات مثل آثار الصدمة وفقدان البراءة، حين لا يكون أمير منشغلاً بمسح الدموع من دفتر ملاحظاته فإنه لا بد منشغل بالحصول على درجة البكالوريوس في إدارة الأعمال الدولية ويعمل على مبادرات الطلاب لتوجيه ورفع مستوى طلابه الصغار. <br></p>', NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(174, '3939440000010822281', 'شمه البستكي', 'shamma-albastaki', '<p>شما البستكي هي شاعرة إماراتية حائزة على عدة جوائز واشتهرت بعملها على تعزيز الثقافة الإماراتية وهويتها، حصلت على درجة الماجستير من \"جامعة هارفارد\"، وفازت مجموعتها الشعرية \"المجاز: معبر\" بجائزة أفضل أطروحة من \"مركز دراسات الشرق الأوسط\"، حصلت على درجة البكالوريوس في الأدب وعلم الاجتماع من \"جامعة نيويورك أبوظبي\". نالت مجموعتها الشعرية الأولى \"بيت لبيت\" على \"جائزة الإبداع\" من \"مجموعة أبوظبي للثقافة والفنون\" في عام 2019. كما حصلت شما على درجة الدبلوم العالي في الدبلوماسية وعملت سفيرة في متحف \"اللوفر أبوظبي\". شاركت في تأسيس \"مجموعة جارة\" وتقود حالياً السرد الاستراتيجي لجناح دولة الإمارات العربية المتحدة في \"إكسبو 2025\" في أوساكا.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(175, '3939440000017060009', 'تركي الزعابي', 'turki-alzaabi', '<p>\"تركي الزعابي: محاضر ومدرّب في مجال القراءة وعلومها، له اهتمامات ثقافية مختلفة، يهوى قراءة الأدب العالمي والكتب الأخرى في مختلف المجالات بلغات مختلفة، إذ أنه يجيد اللغات العربية والانجليزية والفرنسية والإيطالية. <br></p><p><br></p><p>قدم العديد من المحاضرات وشارك في ندوات ولقاءات للحديث عن المطالعة وأهميتها في المجتمع، سواءً في معارض الكتاب، أو في المهرجانات الأدبية.<br></p><p><br></p><p>يدير ويقدم جلسات في مهرجان طيران الإمارات للآداب منذ عام 2017 حيث أدار في السنوات الأخيرة عدة حوارات مع كبار الكتّاب أبرزهم: إبراهيم نصر الله، خالد خليفة، يوسف رخا، ديمة ونوس، وليد طاهر، حمد الحمادي، ريم الكمالي، حسين المطوع، علي الشعالي، وعبدالله الجمعة.<br></p><p><br></p><p>يناقش الكتب الأدبية وينشر مقتطفات منها عبر حساباته في انستغرام وسناب شات ومواقع التواصل الاجتماعي الأخرى.<br></p><p>نشر روايته الأولى بعنوان \"\"عريـم\"\"، عام 2021.\"<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(176, '3939440000010811251', 'منير الحايك', 'mounir-elhayek', '<p>منير ملحم الحايك <br></p><p>روائي لبناني يحمل شهادة الدكتوراه في اللغة العربية وآدابها.<br></p><p>من مؤلفاته الروائية: يوميات عقيمة، جامع أعقاب السجائر، القبر رقم 779، مترو دبي.<br></p><p>من مؤلفاته النقدية: أدبية المكان في الرواية الفلسطينية.<br></p><p><br></p><p>يكتب مقالات حول الإصدارات الأدبية في العالم العربي في منشورات عدة منها جريدة الأخبار وجريدة الديار، لبنان - جريدة أخبار الأدب، مصر - جريدة البيان، الإمارات العربية المتحدة.<br></p><p><br></p><p>رئيس قسم اللغة العربية \"أ\" في مدرسة ديرة الدولية ومحاضر في جامعة سنت جوزف في دبي.<br></p><p><br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(177, '3939440000016841008', 'حارث البستاني', 'hareth-al-bustani', '<p>حارث البستاني هو مستشار ثقافي أول في قسم الفنون والثقافة في شركة بيرسون. إماراتي الجنسية، وقد صمم ونفذ استراتيجيات اتصال شاملة لعدد من المشاريع الفنية والثقافية الطموحة في المنطقة، بما في ذلك \"نور الرياض\"، أكبر مهرجان فنون ضوء في العالم؛ و\"زرقاء اليمامة\"، أول أوبرا سعودية؛ و\"ديرية آرت فيوتشرز\"، أول مركز لفنون الوسائط الجديدة في منطقة الشرق الأوسط وشمال إفريقيا؛ و\"ضي دبي\"، أول مهرجان فني ضوئي بقيادة إماراتية. عمل سابقاً كصحفي، وكان محرر الفنون والثقافة في \"ذا ناشيونال\"، وألف كتاب \"نيرو وفن الطغيان\" الذي أصبح من أكثر الكتب مبيعاً في أمازون في تاريخها. <br></p><p><br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(178, '3939440000032755030', 'لوسي تشاو', 'lucy-chow', '<p>لوسي تشاو هي قائدة معروفة في منظومة ريادة الأعمال في الإمارات العربية المتحدة، يستكشف كتابها \"تغيير اللعبة\" التقنيات الرقمية وتأثيرها على مستقبل العمل. تم اختيارها في \"لينكدإن توب فويس\" بصفتها واحدة من النساء المؤثرات في الرؤساء التنفيذيين في الشرق الأوسط، ساهمت تشاو في تأليف \"الحياة في الحركة\" و\"مشروع الاحتمالات\"، أشادت بها \"أريبيان بزنس\" كأفضل قائدة أعمال نسائية. <br></p><p><br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(179, '3939440000044031001', 'زينب القيسي', 'zainab-al-qaisi', '<p>د. زينب القيسي <br></p><p>حاصلة على درجة الدكتوراه في تخصص الأدب الإنجليزي وأطروحة بعنوان \"رسم خرائط المقاومة في الشعر الفلسطيني الأمريكي: خرائط الذاكرة المولّدة والفضاء الثالث\" من الجامعة الأردنية. تعمل د. زينب القيسي كمترجمة ومحرّرة أدبية. وهي محررة على نطاق واسع مع مجلة واسافيري منذ عام 2022. هي المؤسِّسة والمديرة التنفيذية لشركتين ناشئتين: منصة النقش المجتمعية لكتب أدب الأطفال واليافعين منذ عام 2020، وغرفة الكتابة منذ عام 2021. مهتمة بالدراسات الأدبية والثقافية، والدراسات المقارنة في مجالات دراسات المرأة، والذاكرة المولّدة، والفضاء الثالث. باحثة في مجال الشعر المعاصر والدراسات الجغرافية الإنسانية.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(180, '3939440000010792046', 'علي الشعالي', 'ali-alshaali', '<p>علي الشعالي شاعر إماراتي له حضور مميز في الساحة الثقافية والأدبية، له خمس مجموعات شعرية؛ نحلة وربابة، وجوه وأخرى متعبة، للأرض روح واحدة، دلوني على الكهف، والعشب يشبهنا والغيم. كما أصدر رواية بعنوان الحي الحي ومجموعة قصصية بعنوان حيوات بنكهة الرمان، بالإضافة إلى كتاب مقالات هو \"حجرات ذات نوافذ\". <br></p><p><br></p><p>نال تكريماً خاصاً من صاحب السمو الشيخ الدكتور سلطان بن محمد القاسمي، حاكم الشارقة، تقديراً لإبداعاته في الشعر والأدب. هو خريج برنامج زمالة الكتّاب الدوليين في أيوا، وزمالة الناشرين في معرض فرانكفورت للكتاب. كما أنه ناشر أسس في عام 2011 مجموعة الهدهد للنشر والتوزيع، التي تشمل دار الهدهد للأطفال واليافعين، ودار اللوهة للكبار، ومكتبة فلامنجو<br></p><p><br></p>', 'Litfest 2025', 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(181, '3939440000084609001', 'شانتي ألارد', 'shanti-allard', '<p>شانتي ألارد، كاتبة ورسامة تبلغ من العمر 16 عاماً من مدرسة الراحة الدولية في أبوظبي، تمزج بين حبها للطبيعة والفن والشعر في كتابها الأول \"لمسة الجذور\". من خلال القصائد المعبرة والرسوم التوضيحية، تبرز شانتي أشجار القرم في الإمارات، داعية القراء من جميع الأعمار لتقدير الجمال من حولنا والتفكير فيه. تأمل أن يلهم عملها الوعي البيئي ويشجع الناس على العثور على معنى أعمق من خلال التواصل مع الطبيعة. بعيداً عن مساعيها الإبداعية، تستمتع شانتي بالعزف على الجيتار، وكرة القدم، والسفر، وتجربة الأطعمة الجديدة، وبالطبع القراءة. حلمها النهائي هو مشاركة عملها على نطاق واسع والمساهمة بشكل إيجابي في كوكب الأرض. <br></p><p><br></p>', NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(182, '3939440000083585017', 'لمياء الصيقل', 'lamya-alsaiqal', '<p>لمياء الصيقل هي شاعرة إماراتية ومقدمة فعاليات وبرامج تلفزيونية، وتُعرف بأعمالها الشعرية المميزة. لها ديوان شعري يحمل عنوان \"لجام السعدة\"، الذي يعكس جانباً من إبداعها الأدبي والشعري. <br></p><p><br></p><p>لمياء لها حضور مميز في الساحة الثقافية الإماراتية، وتساهم بشكل كبير في تنظيم وتقديم العديد من الفعاليات الثقافية والإعلامية، مما يجعلها شخصية بارزة في المشهد الأدبي والتلفزيوني في الإمارات.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(183, '3939440000011238028', 'أمل السهلاوي', 'amal-al-sahlawi', '<p>أمل السهلاوي شاعرة إماراتية من إمارة الشارقة، تكتب الشعر العربي الكلاسيكي والشعر الحر. صدر لها ديوان بعنوان كان علي أن أوجلك الذي لقي إقبالاً واسعاً في الوطن العربي. <br></p><p><br></p><p>تألقت قصيدتها \"غرائب العمر\" حين غُنّيت في متحف المتروبوليتان في نيويورك، ونُشرت الأغنية على موقع المتحف في يوتيوب. كما أدت فنانة الأوبرا الإماراتية فاطمة الهاشمي أغنية أخرى مستوحاة من قصيدة لها عن المغفور له الشيخ زايد بن سلطان.<br></p><p><br></p><p>شاركت السهلاوي في العديد من الفعاليات الثقافية والشعرية المرموقة، مثل معرض الكتاب في غوادالاخارا بالمكسيك، ومهرجان الشباب الشعري لدول البريكس في الصين، وفعاليات شعرية متنوعة في الخليج العربي. تتميز قصائدها بمعالجة قضايا نسوية وفلسفية معاصرة، تعكس هموم الإنسان المعاصر وتروي قصته بأسلوب مؤثر وحسٍّ عميق.<br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(184, '3939440000084620001', 'أوليفيا بالك', 'olivia-palk', '<p>أوليفيا بالك، وُلدت في جنوب أفريقيا في أبريل 2008، وقد عاشت في الإمارات العربية المتحدة منذ عام 2018 وهي الآن طالبة في مدرسة الراحة الدولية. قارئة وكاتبة شغوفة، تستمتع بكتابة القصص في مجالات الغموض، والرومانسية، والفانتازيا، والخيال. كما أن أوليفيا عازفة بيانو شغوفة وعازفة فلوت مبتدئة، وتجد في الموسيقى متنفساً مريحاً. بالإضافة إلى الكتابة والموسيقى، تحب التمثيل في المسرح وممارسة الرياضات مثل كرة الشبكة و\"الرجبي\". إيمانها بالمثابرة، إلى جانب دعم عائلتها وأصدقائها، يعزز من تفانيها في النمو الشخصي ويحفزها على تقديم أفضل ما لديها دائماً. <br></p><p><br></p>', NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(185, '3939440000076886001', 'حوراء النداوي', 'hawra-al-nadawi', '<p>كاتبة عراقية ولدت في بغداد وغادرتها مع اسرتها بعد عام&nbsp; 1991، ليستقر بهم المقام في الدنمارك. نشأت تتحدث أكثر من لغة وتعلمت العربية الفصحى كتابة وقراءة في المنزل، بمساعدة والديها. نشرت روايتها الأولى \"تحت سماء كوبنهاغن\" عام 2010، وتم إدراجها في القائمة الطويلة للجائزة العالمية للرواية العربية لعام 2012. <br></p><p>اصدرت روايتها الثانية \"قسمت\" عام 2017. لها ترجمات عن الدنماركية وتكتب المقال والقصة القصيرة. لها تحت الطبع رواية وكتاب عن الأقليات والهوية.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(186, '3939440000080064001', 'نورة الكربي', 'noura-alkarbi', '<p>أكاديمية ورئيسة قسم العلاقات المجتمعية للبحث العلمي بجامعة الشارقة. حاصلة على الدكتوراه في علم الاجتماع من جامعة كومبلتنسي بمدريد باللغة الاسبانية مبتعثة من مكتب البعثات الدراسية بديوان الرئاسة. <br></p><p>لها خبرة سابقة منها قسم البحوث بالمجلس الأعلى للأسرة بالشارقة، وممثلة رسمية للشباب لدولة الإمارات في مجلس الشباب العربي في جامعة الدول العربية، وسفيرة جائزة الشيخة فاطمة بنت مبارك للشباب العربي.<br></p><p>لها عدد من البحوث في شؤون التسامح وقضايا المرأة والسياسات الاجتماعية، ولها مساهمات ثقافية منها دعم مبادرة وثيقة المليون متسامح.<br></p><p>هي عضو هيئة سفراء زايد الدولية في إسبانيا، وعضو متطوع في المؤسسة الأوروبية العربية بغرناطة. نالت العديد من الجوائز، منها: جائزة الإمارات للعمل الإنساني، وجائزة الإمارات للشباب، وجائزة المبتعث المتميز من وزارة الداخلية، وجائزة الباحثين الإماراتيين الشباب، وجائزة الشارقة للعمل التطوعي.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(187, '3939440000080501001', 'سوسن بنعرفة', 'sawsane-benarafa', '<p>سوسن بنعرفة هي مؤلفة الرواية التاريخية من يتذكر قراصنة سلا؟، الصادرة عن دار النشر الباريسية لارماتان. نشأت في المغرب، واهتمت بتراثها الثقافي مبكراً، مما ألهمها قصصاً ترتكز على تفاعلها مع ثقافات متعددة، نتيجة إقامتها في عدة دول. <br></p><p><br></p><p>تتقن سوسن ثلاث لغات، مما يثري أسلوبها القصصي، وهي تقيم حالياً في الإمارات العربية المتحدة، حيث تعمل على تطوير السرديات الخاصة بعالم العطور. تعكس أعمالها شغفها ببناء روابط ثقافية وقدرتها على إحياء التاريخ بأسلوب سردي مشوق.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(188, '3939440000084074001', 'نهلة الفهد', 'nahla-al-fahad', '<p>نهلة الفهد هي مخرجة سينمائية ومنتجة من دبي، وعضو في المجلس الاستشاري لصناعة المحتوى ضمن مجلس دبي للإعلام. تعد من الرواد في مجال الإخراج السينمائي وصناعة المحتوى في الإمارات والخليج، حيث تميزت بأعمالها في الأفلام السينمائية والوثائقية. حصلت على درجة الماجستير بامتياز في إدارة الإبداع والتغيير من جامعة حمدان بن محمد الذكية، وعلى شهادة البكالوريوس بمرتبة الشرف في إدارة الأعمال – التسويق من جامعة دبي، بالإضافة إلى شهادات متخصصة في الإخراج السينمائي وصناعة الأفلام الوثائقية من الولايات المتحدة. <br></p><p><br></p><p>أخرجت العديد من الأعمال الوثائقية المهمة، من أبرزها فيلم \"حجاب\" الذي شارك في مهرجانات عربية وعالمية، وفيلمها الإماراتي الجديد \"خلف جدار الصمت\"، الذي يمثل أول أعمالها الروائية الطويلة في مجال الإخراج السينمائي.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(189, '3939440000010809241', 'نادية النجار', 'nadia-al-najjar', '<p>نادية النجار كاتبة إماراتية، حاصلة على شهادة البكالوريوس في علوم الحاسب الآلي. لها إصدارات في مجال الرواية والقصة القصيرة وأدب الطفل. عضو استشاري في المجلس الإماراتي لكتب اليافعين. حصلت على جوائز عديدة منها: \"جائزة معرض الشارقة للكتاب لأفضل كتاب إماراتي\"، و\"جائزة الإمارات للرواية\" و\"جائزة العويس\"، و\"جائزة الدكتور عبدالعزيز المنصور\"، ورشح عدد من كتبها لجائزة الشيخ زايد للكتاب. أدرجت قصتها: \"النمر الأرقط\" ضمن منهج اللغة العربية - الصف الرابع في دولة الإمارات العربية المتحدة.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(190, '3939440000089408056', 'حمدان بن ﺷﻔّﻴﺎن العامري', 'hamdan-bin-shfayan-alameri', '<p>كاتب ومدرب إماراتي حاصل على درجة الماجستير تقدير امتياز مع مرتبة الشرف في تخصص الذكاء الاصطناعي والبيانات الضخمة من جامعة ESCP. وصفته أحلام مستغانمي بالكاتب العميق الذي يدمج الفلسفة والتساؤلات في نصوصه الأدبية وذلك خلال مشاركته في خلوة الكتابة. مثّل الإمارات في العديد من المحافل الدولية رئيساً للعديد من الوفود الثقافية. كما حصل على جائزة السلام الدولية وغيرها من الجوائز المرموقة لينال تكريماً من العديد من شيوخ الإمارات بسبب تفوقه الأكاديمي ونشاطاته المتعددة. فاز نصه المسرحي بجائزة أبوظبي للثقافة والفنون كما حصل نص فيلمه القصير \"مر..ذوقه\"على جائزة الفيلم العربي القصير و كتابه \"بصمة إبداع\" على جائزة سرد. وحصلت كليباته الوطنية على ملايين المشاهدات. <br></p><p><br></p>', NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(191, '3939440000089660004', 'يزن عيسى', 'yazan-issa', '<p>شاعر وناشط ثقافي سوري مقيم في الإمارات العربية المتحدة، درس هندسة الأتمتة الصناعية وأكمل تعليمه في ماجستير إدارة الأعمال، حائز على عدة جوائز شعرية محلية ودولية، من أهمّها جائزة الشارقة للإبداع العربي في دورتها السابعة والعشرين. حقق حضوراً في المشهد الشعري السوري والعربي، كما عرف كناشط ثقافي ومقدم ومحاور في العديد من المحافل الثقافية العربية. صدر له ديوان (أجنحة تحاول فهم الريح) عن دائرة الثقافة في الشارقة، وله مشاركات في عدة صحف ومنصات إعلامية عربية. <br></p><p><br></p>', NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(192, '3939440000089694001', 'زينه شمس', 'zeina-chams', '<p>زينة توفيق شمس سورية الجنسيَّة، وُلِدَت في مدينة دمشق 1986، وتعيش في دولة الإمارات العربيَّة المتحدة منذ عام 1996. درست في الجامعة الأمريكيَّة في الشارقة – قسم الإعلام – وحصلَت بعد ذلك على شهادة الماجستير في الترجمة والترجمة الفوريَّة بمرتبة الشَّرف عام 2015 من الجامعة الأمريكيَّة في الشارقة. للكاتبة اهتمامات ثقافيَّة وأدبية وفنيَّة منها: العزف على الكَمان، ورقص الباليه، إلى جانب القراءة والكتابة. <br></p><p><br></p>', NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(193, '3939440000089650002', 'حلا ماهر', 'hala-maher', '<p>كاتبة قصص قصيرة ومدونة في مراجعات الكتب. صدر لها مجموعة قصصية بعنوان \"في الانتظار\"، وقصة قصيرة بعنوان \"وردة في مهب الريح\"، التي حازت على المركز الرابع في برنامج \"أصوات على الهواء\" الذي تنظمه إذاعة مونت كارلو الدولية بالتعاون مع مجلة العربي الكويتية. <br></p><p><br></p><p>بدأت مسيرتها الأدبية من شغفها بمراجعة الكتب كهواية، لتتحول هذه الهواية إلى إصدار مطبوع من خلال برنامج دبي الدولي للكتابة.<br></p><p><br></p><p>تعمل حالياً على إصدار روايتين جديدتين: “الياسمينة السوداء”، و\"امرأة في المنفى\".<br></p><p><br></p>', NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(194, '3939440000089433038', 'حصه عبدالله', 'hessa-abdulla', '<p>كاتبة إماراتية تكتب قصصاً قصيرة في مجال الخيال، والجريمة، والرعب؛ بالإضافة إلى الشعر الحر، والخواطر النثرية بثلاث لغات، وهي: العربية، والإنجليزية، والأردية. <br></p><p>صدر لها حديثاً مجموعة قصص قصيرة بعنوان \"المرأى من المرآة\" من منشورات غاف. وصدر لها مجموعة نصوص نثرية بعنوان \"٧ أعوام من الخريف\" من دار أوستين مكاولي العالمية، بالإضافة إلى مجموعة قصص قصيرة من دار قنديل كجزء من مشاركتها في دورة القصة القصيرة مع مؤسسة محمد بن راشد للمعرفة.<br></p><p>نُشر لها كذلك عدة قصص في مطبوعات مختلفة مثل مجلة \"سكة\" الالكترونية، أنثولوجية \"كلنا السدرة، كلنا نحب البحر\" من اتحاد كتاب وأدباء الإمارات، و أنثولوجية \"السبورة\" من غاف للنشر.<br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(195, '3939440000086491005', 'رازميج بدريان', 'razmig-bedirian', '<p>رازميج بيديريان هو كاتب سوري أرمني نشأ في الإمارات العربية المتحدة، عمل كصحفي في العديد من المنشورات المحلية ودرّس الكتابة الإبداعية في جامعة نيويورك، فضلاً عن جهوده في أدب الخيال، يعمل رازميج في مجال الفنون والثقافة في صحيفة \"ذا ناشونال <br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(196, '3939440000010806257', 'سلطان سعود القاسمي', 'sultan-sooud-alqassemi', '<p>سلطان سعود القاسمي هو كاتب وباحث إماراتي في الشؤون الاجتماعية والسياسية والثقافية في دول الخليج العربي. أسس \"مؤسسة بارجيل للفنون\" في عام 2010 وهي مبادرة مستقلة تهدف إلى تعزيز التنمية الفكرية في المشهد الفني العربي، عمل سلطان في تدريس سياسة الفن الحديث في الشرق الأوسط في جامعات مختلفة في جميع أنحاء أوروبا والولايات المتحدة. أكمل الزمالة في \"معهد برلين للدراسات المتقدمة\" في عام 2023 وهو حالياً باحث مشارك في \"كلية الدراسات الشرقية والإفريقية\" في لندن.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(197, '3939440000086057001', 'نسيم أختار خان', 'naseem-akhtar-khan', '<p>خدم العميد (المتقاعد) نسيم أختر خان في الجيش الباكستاني وجهاز الاستخبارات الداخلية لأكثر من أربعة عقود (1969-2010)، وهي الفترة التي اتسمت بتطورات أمنية إقليمية مهمة ذات آثار دائمة على باكستان. امتدت حياته المهنية إلى أدوار عسكرية واستخباراتية، مما وفر خبرة مباشرة في عمليات السلام والقتال. يُعرف بأنه محارب خفي وقد أجرى عمليات سرية وجمع معلومات استخباراتية من معاقل العدو، كما أثرت مهمة دبلوماسية في الخارج لمدة ثلاث سنوات على فهمه للمناورات الاستراتيجية والسياسية، مما جعله يقدم للقراء منظوراً فريداً حول القضايا الإقليمية والدولية الحرجة. <br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(198, '3939440000083606009', 'ثريا رامكومار', 'surya-ramkumar', '<p>سوريا رامكومار هي كاتبة مقيمة في دبي ومدافعة عن الاستدامة، أصدرت أول رواية خيالية عن المناخ من المنطقة باسم \"ابتعدت السماء\" في عام 2023 وأصبحت من أكثر الكتب مبيعاً على موقع أمازون، لديها أعمال أخرى مثل \"البلاغة الصامتة\" في 2020 و\"استراتيجية الحياة\" في 2024. ظهرت قصصها القصيرة في العديد من المختارات وتستكشف كتاباتها التقاطعات بين الأمومة والأعمال والمناخ. <br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(199, '3939440000084729001', 'ساندي هاني', 'sandy-hani', NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(200, '3939440000084626003', 'عمر الأميري', 'omar-alameeri', NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(201, '3939440000010817026', 'أبراهام فيرجيز', 'abraham-verghese', '<p><b>أبراهام فيرجيز</b> هو طبيب وكاتب وأستاذ كلٍ من ليندا ماير وجوان لين ونائب رئيس قسم الطب في جامعة \"ستانفورد\". ظلت روايته \"قطع الحجر\" في قائمة الكتب الأكثر مبيعاً في صحيفة \"نيويورك تايمز\" لمدة عام، ثم مرة أخرى، ظهرت أحدث رواياته \"عهد الماء\" في قائمة أفضل الكتب مبيعاً في \"نيويورك تايمز\" لعام 2023 وتم اختيارها في نادي \"أوبرا للكتاب\" وستتحول قريباً إلى مسلسل على منصة \"نيتفليكس\". يشغل فيرجيز منصب عضو منتخب في معهد الطب والأكاديمية الأمريكية للفنون والعلوم، منحه الرئيس الأمريكي السابق باراك أوباما الوسام الوطني للعلوم الإنسانية في عام 2016.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58');
INSERT INTO `ar_authors` (`id`, `authorid`, `full_name`, `author_slug`, `author_blurb`, `author_as_year`, `moderator_as_year`, `launchpad_young_author_as_year`, `launchpad_author_as_year`, `performer_as_Year`, `Host_as_Year`, `Website_Status`, `created_at`, `updated_at`) VALUES
(202, '3939440000010818231', 'سمر محفوظ برّاج', 'samar-mahfouz-barraj', '<p><b>سمر محفوظ برّاج</b>، كاتبة ومترجمة لبنانية رائدة في مجال أدب الطفل واليافع. تم ترشيحها لجائزة هانس كريستيان أندرسن المرموقة لعام 2024، وهي أعلى تكريم في مجال أدب الطفل.<br></p><p><br></p><p>بدأت مسيرتها الأدبية بعد تخرجها من الجامعة الأمريكية في بيروت، حيث عملت في مجال التعليم لسنوات. ومنذ ذلك الحين، أصدرت أكثر من 80 كتاباً للأطفال، وترجمت 126 كتاباً من لغات عدة إلى العربية، مما ساهم في إغناء المكتبة العربية للأطفال.<br></p><p><br></p><p>تميزت كتب سمر بأسلوبها السلس ومواضيعها القريبة من عالم الطفل، مما جعلها تحظى بشعبية كبيرة لدى القراء الصغار والكبار على حد سواء. تم تأهل العديد من كتبها إلى القوائم الطويلة والنهائية لعدد من الجوائز، وفاز منها: \"عندما مرضت صديقتي\"، \"جدتي ستتذكرني دائماً\"، \"خط أحمر\"، \"صديقي\"، \"ألف، باء، .. ياء\".<br></p><p><br></p><p>بالإضافة إلى الكتابة، تقدم سمر ورش عمل مكثفة في مجال الكتابة الإبداعية للأطفال، وتدريب المعلمين وأمناء المكتبات على أهمية القراءة وتشجيعها.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(203, '3939440000078832001', 'ميّ شبقلو', 'may-chebaklo', '<p><b>مي شبقلو</b>، مربية تقويمية حاصلة على ماجستير في التربية وحالياً تحضر رسالة الماجستير الثانية في التربية التقويمية. لديها خبرة واسعة في تعليم اللغة العربية للأطفال من جميع الأعمار ومن مختلف الجنسيات. عملت في مدارس ومؤسسات مختلفة في لبنان ودولة الإمارات العربية المتحدة.ألفت مي مجموعة من كتب الأطفال باللغة العربية. كما شاركت في تطوير عدة مناهج دراسية بناءً على خبرتها الطويلة في مجال التعليم إضافة إلى تقديم ورش للمعلمين والأطفال.<br></p><p><br></p><p>عملت الكاتبة كمنسقة، كما أجرت العديد من المقابلات في العديد من وسائل الإعلام اللبنانية والعربية.<br></p><p><br></p><p>تتحدث مي العربية والإنجليزية والفرنسية بطلاقة، ومن هواياتها: الكتابة الإبداعية، رواية القصص، الكتابة المسرحية، التمثيل المسرحي والسفر.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(204, '3939440000086984018', 'زوي محمد', 'zoe-mohammed', '<p>زوي محمد هي شاعرة تنشر أعمالها بنفسها، تتناول مجموعتها الأولى \"أكسر الصمت\" و\"الوصمة\" و\"البنك\" قضايا الصحة العقلية والتحديات الاجتماعية والمهنية والشخصية المتنوعة. بفضل خلفيتها الأكاديمية في اللغويات وشغفها بسرد القصص استطاعت زوي أن تمزج المشاعر الأصيلة لإثارة الحوارات حول مواضيع صعبة، كما تقدم للقراء اتصالاً أعمق بتعقيدات الحياة. <br></p><p>كانت تحلم منذ طفولتها أن تصبح مؤلفة، ثم بعد استكشاف تجارب مهنية متنوعة أصبحت تعمل الآن على تحقيق هذا الحلم من خلال نشر كتاباتها، تركز زوي الآن على توسيع مشاريعها الأدبية آملة ان تكون مصدراً للإلهام.<br></p><p><br></p>', NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(205, '3939440000076617001', 'تشيجوزي أوبيوما', 'chigozie-obioma', '<p>وُلِد تشيجوزي أوبيوما في أكوري بنيجيريا، وصلت روايته \"الصيادون\" التي نشرها في 2015 و\"أوركسترا المغلوبين\" في 2019 إلى نهائيات جائزة \"بوكر\" وتمت ترجمتهما إلى 30 لغة. فاز بجائزة \"لوس أنجلوس تايمز للكتاب\" وجائزة \"الأدب العالمية\" المرموقة، و\"جائزة أوبنهايمر للرواية\" من \"فاينانشال تايمز\" وجائزة \"الجمعية الوطنية للنهوض بالملونين للصور\"، تم ترشيحه لعشرات الجوائز في مجال الرواية واُختير كواحد من \"أفضل 100 مفكر عالمي رائد\" في مجلة \"فورين بوليسي\" في عام 2015. عمل كعضو لجنة تحكيم لجائزة \"بوكر\" في عام 2021 وظهرت أعماله في صحيفة \"نيويورك تايمز\" و\"غارديان\" و\"وفاينانشال تايمز\" و\"باريس ريفيو\" و\"جرانتا\" وغيرهم. حصل أوبيوما على لقب \"أستاذ هيلين إس. لانيير\" للكتابة الإبداعية واللغة الإنجليزية في \"جامعة جورجيا\" وهو مدير برنامج معسكر \"أوكسبيلي\" لكتاب الخيال. نُشرت روايته الثالثة \"الطريق إلى البلاد\" في عام 2024.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(206, '3939440000080959001', 'إيلا فيليبس', 'ella-phillips', '<p><b>إيلا فيليبس</b>، أم وفنانة ومستشارة إبداعية وبستانية، لديها خبرة تزيد عن عقد من الزمان في مجال التعليم في المتاحف والمعارض وتسعى لزيادة الوعي عن التعليم الإبداعي والمساواة في القطاع الثقافي. تكتب إيلا قصصاً للأطفال وتتعاون مع شريكها داريل في كتابة نصوص غير روائية. <br></p><p><br></p><p>تلهم إيلا هي وشريكها العالم لتناول الطعام النباتي من خلال الورش والفعاليات التي يقدماها عبر شركتهما \"الكهرباء - المستقبل - الأطعمة\"، كما أنهما يستمتعان بمشاركة الناس حبهما للطبيعة والأسرة. يتبنى الثنائي نهجاً علمياً في التعامل مع الطعام من خلال زراعة الخضروات في مزرعتهما واستضافة أيام لممارسة البستنة الحضرية. أما عن كتابهما المشترك \"من النبات إلى الطبق\" فهو دليل كامل للزراعة والطهي معاً كعائلة.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(207, '3939440000080956001', 'داريل جادزيكبو', 'darryl-gadzekpo', '<p><b>داريل جادزيكبو</b> هو كاتب وطاهٍ وبستاني شغوف يشارك العالم متعة زراعة الطعام. داريل هو كذلك أحد مؤسسي شركة \"الكهرباء - المستقبل - الأطعمة\" وهي منظمة مُصممة لتخيل أنظمة غذائية أفضل؛ إذ يسعى داريل لإلهام الناس لممارسة الاكتفاء الذاتي. شارك الكاتب في تأليف كتاب \"من النبات إلى الطبق\" بالتعاون مع شريكته إيلا، هذا الكتاب هو دليل للعائلات لزراعة طعامهم وطبخه والاستمتاع به مع التعرف على صحة التربة والأمعاء. يعمل داريل بعيداً عن الحديقة في مجال الموسيقى بصفته مدير تنفيذي لشؤون الفنانين والمبدعين والعلاقات العامة لشركة تسجيلات مستقلة شهيرة لموسيقى \"الجاز\" و\"السول\".<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(208, '3939440000076137014', 'ديس فيتزجيرالد', 'des-fitzgerald', '<p><b>ديس فيتزجيرالد</b> هو كاتب ومدرس علم اجتماع في مختبر العلوم الإنسانية الراديكالية في جامعة \"كوليدج كورك\". يجيب فيتزجيرالد عن الأسئلة التي تدور في أذهاننا مثل نظرتنا عن المدن الحديثة ولماذا نعتقد أن المساحات الحضرية سيئة بالنسبة لعلم النفس البشري. ألّف كتاب \"مدينة اليوم هي شيء يحتضر\" كما شارك في تأليف كتاب \"الدماغ الحضري\". حصل فيتزجيرالد على جائزة \"فيليب ليفرهيوم\" لتميزه في مجال علم الاجتماع، بالإضافة إلى أن إذاعة \"بي بي سي\" أطلقت عليه لقب \"مفكر الجيل الجديد\".<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(209, '3939440000084057001', 'هارشيتا جوبتا', 'harshita-gupta', '<p>هارشيتا جوبتا هي فنانة متعددة المواهب ورائدة أعمال بدأت كشخصية إذاعية وهي الآن تكتسح وسائل التواصل الاجتماعي بمحتواها الكوميدي الذي ظهر في منصات مثل \"هندوستان تايمز\" و\"برات إنديا\"، أطلقت في عام 2024 علامتها التجارية للملابس \"تشيكانكاري هيوز\" التي تُسلّط فيها الضوء على الحرفيين التقليديين وتُبرزهم في المسرح العالمي. احتلت هارشيتا المرتبة التاسعة في قائمة \"فوربس\" لنجوم العالم الرقمي في عام 2023، تعاونت مع أكثر من 200 علامة تجارية بما في ذلك \"سياحة دبي\" و\"نتفليكس\"، وصلت روايتها القصصية \"تسجيل حكاية\" إلى الملايين وظهرت في برنامج \"سيستر\" على قناة \"تي في إف\" وهي الآن مؤلفة مشهورة في دار \"بينغوين الهند\". <br></p><p><br></p><p><br></p><p>.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(210, '3939440000078069001', 'زلفا قطوح', 'zoulfa-katouh', '<p><b>زلفا قطوح</b> كاتبة لأكثر الكتب مبيعاً وحائزة على جوائز لروايتها الأولى التي نالت استحسان النقاد \"طالما تنمو أشجار الليمون\" والتي تُرجمت إلى 24 لغة، ورُشحت الرواية لميدالية \"يوتو كارنيجي\" وكانت إحدى الروايات المرشحة لجائزة \"الحاكم العام\". تعمل زلفا في الصيدلة مما يجعلها تستكشف قصصاً في العلوم وتستلهم الكثير من الطبيعة المحيطة بها والتي تشبه في جمالها أفلام \"استوديو چيبلي للرسوم المتحركة\". تعيش زلفا حالياً في سويسرا بجانب كتبها التي تتزايد باستمرار وحلمها هو أن يقرأ المغني كيم نام جون أحد كتبها.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(211, '3939440000079006001', 'زينب بدوي', 'zeinab-badawi', '<p>زينب بدوي هي مذيعة وأكاديمية من مواليد السودان وحاصلة على درجة البكالوريوس مع مرتبة الشرف من \"جامعة أكسفورد\" ودرجة الماجستير من \"كلية الدراسات الشرقية والافريقية\". تشمل أعمالها سلسلة مكونة من 20 حلقة عن تاريخ أفريقيا تم عرضها على منصة \"بي بي سي\". تشغل الآن منصب رئيسة \"كلية الدراسات الشرقية والإفريقية\" بجانب عملها في مجالس مرموقة مثل \"المؤسسة الملكية\" ومؤسسة \"مايندز\". حصلت زينب على عدة جوائز ودكتوراه فخرية وميدالية \"رئيس الأكاديمية البريطانية\". <br></p>', 'Litfest 2025', 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(212, '3939440000084054001', 'يوسف خندقجي', 'yousef-kandakji', '<p>يوسف خندقجي، وكيل أدبي فلسطيني من مدينة نابلس، ويمثل شقيقه الروائي باسم خندقجي، الحائز على الجائزة العالمية للرواية العربية العام الماضي، حيث يتولى يوسف تمثيله أثناء وجوده في السجن. يمتلك مكتبة لبيع الكتب في فلسطين، ويعمل في المجال الثقافي والأدبي منذ أكثر من خمسة عشر عاماً، مساهماً في تعزيز الأدب الفلسطيني والعربي.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(213, '3939440000010823237', 'وليد طاهر', 'walid-taher', '<p><b>وليد طاهر</b>، كاتب مصري ورسام لكتب الأطفال وخريج كلية الفنون الجميلة بجامعة حلوان. أصدر وليد طاهر أكثر من 70 كتاباً للأطفال حول العالم وأسرّ جمهوره برسوماته المفعمة بالحياة وقصصه الجذابة.<br></p><p><br></p><p>نال وليد العديد من الجوائز عن أعماله، منها جائزة \"اتصالات\" 2010-2016، و تأهل لـ\"قائمة الشرف بولونيا\" في 2004، حاز جائزة \"محمود كحيل\" في 2018 وجائزة \"معرض الشارقة للكتاب\" في 2014، كما نالت مساهماته في أدب الأطفال تقدير نقابة الصحفيين المصريين وحصل على الجوائز للمراتب الأولى في عامي 2004 و2006.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(214, '3939440000076865001', 'وليد هاشم', 'waleed-hashim', '<p>وليد عبدالله هاشم، كاتب بحريني، بدأ محاولاته الأدبية في سن مبكرة وأنجز روايته الأولى: \"لم أكن هناك\" في المرحلة الدراسية الإعدادية عام 1996. أكمل دراسته العليا في المملكة المتحدة، ويحمل بكالوريوس في قانون إنجلترا وويلز من جامعة لندن للاقتصاد والعلوم السياسية (LSE). يواصل حياته المهنية حالياً كمعلم طاقة في مجال التنمية الذاتية وروائي ومحامي مجاز في مملكة البحرين ومستشار قانوني. حازت روايته الثانية \"مروراً بحياةٍ أخرى\" على جائزة الدولة للكتاب المتميز للعام 2007. تعتبر رواية \"ليلى بارونة بوكيت\" خامس أعماله الإبداعية الطويلة المنشورة، والثانية في سلسلة: ليلى دوقة قلالي، والتي أنجزها في العام 2023.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(215, '3939440000080140001', 'فاشتي هاردي', 'vashti-hardy', '<p><b>فاشتي هاردي</b>، مؤلفة كتب أطفال الأكثر مبيعاً. نُشرت رواياتها الشهيرة الموجهة للأطفال في جميع أنحاء العالم بعدة لغات ورُشح أول أعمالها، \"سجلات العاصفة الساطعة\"، لجائزة \"واترستون لكتب الأطفال\"، ثم فاز عملها الثاني، \"شرارة جامحة\"، بجائزة \"بلو بيتر للكتاب\" لأفضل قصة. اكتملت ثلاثيتها،&nbsp; \"سجلات العاصفة الساطعة والتي تضم \"همسات الظلام\" و\"أغنية النار\" و\"ثعبان الرمال\". فيما يتمحور آخر اصداراتها، \"نورث والوحيدة\"، حول الذكاء الاصطناعي وتدور أحداثه في عالم مثير ومفاجئ ويلهم أسئلة عميقة عما يعنيه أن تكون إنساناً.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(216, '3939440000083590012', 'فانيسا وولف', 'vanessa-woolf', '<p>تروي فانيسا وولف قصصاً حقيقية وساحرة وجذابة وغالباً ما تستخدم الوسائل المساعدة والموسيقى، تؤدي عروضاً على المستوى الوطني والدولي سواء على الهواء مباشرة أو افتراضياً. قدمت عروضاً للعديد من الجهات مثل \"الأكاديمية الملكية للفنون\" و\"مهرجان الشارقة القرائي للطفل\" و\"مسرح شكسبير العالمي\" و\"ناشيونال جيوغرافيك\" و\"عين لندن\" و\"الكلية الملكية للموسيقى\" و\"القصور الملكية التاريخية\" و\"الحدائق الملكية\" و\"هارودز\". ألقت وولف محاضرة عن قوة العجب في \"تيد إكس\"، وظهرت على شاشات التلفزيون المحلية والدولية وأدت عروضها في مئات المهرجانات الأدبية. <br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(217, '3939440000076116042', 'تريشيا هيرسي', 'tricia-hersey', '<p>تتمتع <b>تريشيا هيرسي</b> بخبرة تزيد عن 20 عاماً بصفتها فنانة متعددة التخصصات وكاتبة وعالمة لاهوتية ومنظمة مجتمع، كما أنها صاحبة رؤية \"وزارة القيلولة\" ومؤسِسِتها. أسست تريشيا مفهوم كل من \"الراحة هي المقاومة\" و\"الراحة هي التعويض\" وهيئت مساحات مقدسة تساعد على تسليط الضوء على القوة في الراحة ليترسخ المفهوم في المجتمعات في جميع أنحاء العالم. ألفت تريشيا كتاب ضمن قائمة صحيفة \"نيويورك تايمز\" للكتب الأكثر مبيعاً \"الراحة هي المقاومة: البيان\" و\"سوف نرتاح! فن الهروب\".<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(218, '3939440000076117021', 'سوبهادرا داس', 'subhadra-das', '<p><b>سوبهادرا داس</b> هي كاتبة ومؤرخة ومذيعة وممثلة هزلية اشتهرت لكونها تستكشف العلاقة بين العلم والمجتمع. تتخصص داس في تاريخ وفلسفة العلوم وتُركز على تاريخ العنصرية العلمية وعلم تحسين النسل، عملت سابقاً بصفتها أمينة على المجموعات العلمية في جامعة \"كوليدج لندن\" لمدة تسع سنوات، كما عملت في الكتابة والمدونات الصوتية وعروض الكوميديا الارتجالية وتنسيق المعارض المتخصصة في المتاحف ولها ظهور إعلامي في التلفزيون والإذاعة. نشرت إيما كتابها الأول، كتابها الأول \"غير متحضر: عشر أكاذيب صنعت الغرب\"، في عام 2024.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(219, '3939440000076634006', 'ستيفن ميثن', 'steven-mithen', '<p><b>ستيفن ميثن</b> هو أستاذ في قسم عصور ما قبل التاريخ في جامعة \"ريدينج\" بالمملكة المتحدة وعمل سابقاً في التدريس في جامعة \"كامبريدج\". عمل ميثن في مشاريع ميدانية طويلة الأمد في جنوب الأردن وغرب اسكتلندا حيث استكشف مجتمعات الصيادين وجامعي الثمار وأوائل العصر الحجري الحديث، اُنتخب زميلاً في \"الأكاديمية البريطانية\" وعُيّن نائباً لرئيس جامعة \"ريدينج\". من أهم مؤلفاته، كتاب \"ما قبل تاريخ العقل\" وكتاب \"ما بعد الجليد: تاريخ الإنسان العالمي 20000-5000 قبل الميلاد\" وكتاب \"الإنسان البدائي الغنائي\"، وأحدث مؤلفاته، كتاب \"لغز اللغة\".<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(220, '3939440000079074001', 'ستيف موشين', 'steve-mushin', '<p><b>ستيف موشين</b>، مصمم صناعي ومخترع يعمل بين نيوزيلندا وأستراليا ويتعاون مع العلماء في جميع أنحاء العالم لابتكار اختراعات قد تبدو سخيفة ولكنها ممكنة علمياً؛ دور هذه الاختراعات هو إعادة الحياة الطبيعية إلى المدن وتحويلها إلى أنظمة بيئية مناسبة لكافة الكائنات. ستيفن هو مؤلف ورسام كتاب \"\"فائق البرية\": خطة جريئة لإعادة الحياة الطبيعية لكل مدينة على وجه الأرض\". يحتوي كتاب \"فائق البرية\" على أكثر من 100 اختراع مما ساهم بفوزه بجائزة أفضل كتاب غير روائي للأطفال في \"جوائز تصميم الكتب الأسترالية\" لعام 2024، تم ترشيحه لجائزة \"إلسي لوك\" لعام 2024 للكتاب غير الروائي. كما حصل الكاتب على جائزة \"تكريمات التصميم الأسترالي\" في 2015 عن عمله في التفكير في المستقبل المستدام.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(221, '3939440000078824005', 'شيخة الزيارة', 'shaikha-alzeyara', '<p>خريجة جامعة قطر كلية الآداب والفنون سنة 2004، <br></p><p>حاصلة على الاعتماد في تعليم التفكير الفلسفي للأطفال،<br></p><p>مشرف لغوي وتربوي في كرتون سراج التعليمي،<br></p><p>عضو في عدد من لجان تحكيم مسابقات الكتابة للأطفال،<br></p><p>نظمت عدداً من الورش التدريبية حول الكتابة، وصممت برامح خاصة بالقراءة.<br></p><p>حصلت على جائزة الشارقة لكتاب الطفل عن فئة اليافعين للعام ٢٠٢٢.<br></p><p>حصلت على جائزة \"أفضل كتاب السنوية\" عن فئة العقل والجسد والروح للعام ٢٠٢١ وجائزة purple dragonfly الشرفية عن أفضل رسوم للعام.<br></p><p>وصلت رواية 45 ساعة تحت الثلج القائمة القصيرة لجائزة اتصالات للعام ٢٠٢٢.<br></p><p>لديها أكثر من خمسين انتاج في أدب الطفل متنوعة بين القصص والروايات والمسرحيات.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(222, '3939440000083677006', 'ساندرا ميخائيل', 'sandra-mikhail', '<p>ساندرا ميخائيل هي أخصائية تغذية معترف بها دولياً ومؤلفة ومؤسسة \"التغذية من الألف إلى الياء\"، تُعرف بأنها \"أخصائية التغذية في صحة الأمعاء التي تجعل الحديث عن البراز أمراً أنيقاً\". ساندرا متخصصة في صحة الأمعاء والتغذية الرياضية واضطرابات الأكل، وهي حاصلة على مؤهلات من \"جامعة موناش\" و\"المعهد الفيدرالي السويسري للتكنولوجيا \"في زيورخ، و\"اللجنة الأولمبية الدولية\"، عملت كمستشارة لعلامات تجارية مثل \"نادي زيورخ\" و\"هي مرسيديس\" و\"سي إن إن\" و\"أدوبي\"، تدافع ساندرا عن الصحة العقلية ودعتها أريانا هافينغتون للمساهمة في كتابها \"ازدهر\"، لديها كتاب شهير \"سجلات الأمعاء\" وهي أيضاً مضيفة مشاركة في بودكاست \"طبيب الجهاز الهضمي وابنته\". <br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(223, '3939440000083596025', 'روس ويلفورد', 'ross-welford', '<p><b>روس ويلفورد</b>، كاتب بريطاني يختص بكتابة كتب الأطفال. أصدر بعد روايته الأولى \"السفر عبر الزمن مع هامستر\"، ثماني روايات أخرى نالت استحسان النقاد والجمهور، بما في ذلك \"السفر عبر الزمن مع سلحفاة\". بجانب الكتابة، يستمتع ويلفورد بالسفر حول المملكة المتحدة والعالم لتقديم عرضه الفريد \"السحر والعلم\" ودروس عن الكتابة. الجدير بالذكر أن روس كذلك ساحر ماهر وعضو في \"الدائرة السحرية\" المرموقة. <br></p><p><br></p><p>يعيش الكاتب حالياً في لندن مع زوجته وعائلته وحيواناته الأليفة.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(224, '3939440000080455004', 'رشا سمير', 'rasha-samir', '<p>روائية وكاتبة صحفية بجريدة الفجر، حاصلة على ماجيستير جراحة الأسنان من جامعة القاهرة. <br></p><p>عضو إتحاد كتاب مصر، صدر لها ٦ مجموعات قصص قصيرة و٥ روايات هي: جواري العشق، سألقاك هناك، المسحورة، للقلب مرسى أخير، بنات في حكايات.<br></p><p>هي المسؤولة عن إدارة صالون إحسان عبد القدوس الثقافي، وصاحبة مبادرة كاتبان وكتاب الثقافية.<br></p><p>عضو لجنة تحكيم جائزة إحسان عبد القدوس الأدبية، وعضو مؤسسة فاروق حسني الثقافية.<br></p><p>تدير نادي كتاب نادي الجزيرة الرياضي، شاركت بندوات في معارض كتب دولية منها الشارقة، وأبو ظبي، والمغرب، والأردن، وتونس، والقاهرة، والبحرين، وجدة، ومركز الإبراهيم بالبحرين، وندوة في الملحقية الثقافية المصرية بالمملكة المتحدة.<br></p><p>ضيفة نوادي الروتاري بالقاهرة، تناول رواياتها بالنقد: د.صلاح فضل، د.جابر عصفور، جمال الغيطاني، د.زاهي حواس، سعد الحميدين وغيرهما.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(225, '3939440000083929001', 'رنا إدريس', 'rana-idriss', '<p>رنا إدريس، المديرة العامة لـدار الآداب منذ عام 1985، لعبت دوراً محورياً في إثراء الساحة الثقافية والأدبية العربية. درست الأنثروبولوجيا في الجامعة الأمريكية في بيروت، وتابعت دراستها في جامعة نيويورك. <br></p><p><br></p><p>شاركت في لجان تحكيم عدد من الجوائز الأدبية المرموقة، منها جائزة قدموس مع السفارة الفرنسية في بيروت، وجائزة غوته لأفضل قصة قصيرة في بيروت، وورشة الكتابة الإبداعية بإشراف نجوى بركات. حصدت عدة جوائز، منها جائزة أفضل ناشر (مرتبة كومنداتور) من المغرب، وأفضل دار نشر عربية من معرض الشارقة الدولي للكتاب، ووصلت دار الآداب إلى القائمة القصيرة لـجائزة الشيخ زايد. كما حازت جائزة التميز الدولية للنشر من معرض لندن للكتاب في فئة كتب الكبار لعام 2020.<br></p><p><br></p><p>شغلت عضوية مجلس أمناء الجائزة العالمية للرواية العربية من عام 2019 إلى 2022.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(226, '3939440000083513016', 'بيب ويليامز', 'pip-williams', '<p>بيب ويليامز هي مؤلفة أسترالية معروفة بروايتها الأولى \"قاموس الكلمات المفقودة\" التي احتلت المرتبة الأولى في قائمة \"نيويورك تايمز\" لأفضل الكتب مبيعاً، كما اختارتها ريس ويذرسبون كأفضل كتاب وتُرجمت روايتها إلى أكثر من 30 لغة. فازت الرواية بالعديد من الجوائز وتم تكييفها للمسرح والسينما، تواصل رواية ويليامز الثانية \"مجلد كتاب أريحا\" تقاليدها في سرد ​​القصص القوية وتُرجمت أيضاً إلى العديد من اللغات.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(227, '3939440000078852001', 'مهند ساينس', 'mohanad-science', '<p><b>مهند ساينس</b>، رائد في تعليم العلوم والتكنولوجيا والهندسة والرياضيات، هو من علماء مصر المعروفين إذ تمتد خبرته في إلهام العقول اليافعة في جميع أنحاء العالم العربي إلى 13 عاماً <br></p><p><br></p><p>يعد مهند معلماً متفانياً ومصمماً لمجموعات العلوم والتكنولوجيا والهندسة والرياضيات، بالإضافة إلى عروضه وورشه الفعّالة التي تجاوزت 3500 عرض بالإضافة إلى ظهوره في \"تيدكس\".<br></p><p><br></p><p>نجح مهند في تدريب أكثر من 700 معلم ليصبحوا معلمين استثنائيين في مجالات العلوم وتمكينهم من إثارة فضول طلبتهم وتحفيز إبداعهم. يمتد تأثير مهند إلى ما هو أبعد من الفصول الدراسية، فهو صانع محتوى متميز ويحظى بمتابعة كبيرة على وسائل التواصل الاجتماعي بعدد يتجاوز 199 ألفاً من المتحمسين للعلوم والتكنولوجيا والهندسة والرياضيات.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(228, '3939440000083710006', 'محمد المنسي قنديل', 'mohammad-al-mansi-qindeel', '<p>محمد المنسي قنديل هو كاتب وروائي مصري مرموق، وأحد الأسماء البارزة في الأدب العربي المعاصر. تخرج من كلية طب المنصورة في مصر، حيث عمل طبيباً في الريف لعدة سنوات قبل أن يتفرغ للكتابة. له العديد من الروايات التي حظيت بشهرة واسعة، من بينها قمر على سمرقند، يوم غائم في البر الغربي، وأنا عشقت، والتي تحولت بعض منها إلى أعمال تلفزيونية. شغل منصب كبير المحررين في مجلة العربي الكويتية، حيث قام بإجراء استطلاعات ثقافية حول العالم. إلى جانب رواياته، له إسهامات أدبية للأطفال، وكتب نصوصاً للسينما، وألف العديد من الكتب التي تعكس شغفه العميق بتاريخ العالم العربي. حصل على عدة جوائز محلية، تقديراً لإبداعاته التي تجمع بين التاريخ والسرد الأدبي.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(229, '3939440000084051001', 'ماثيو أرليدج (إم جي أرليدج)', 'mj-arlidge', '<p>عمل إم جيه أرليدج في مجال التلفزيون لأكثر من 25 عاماً وتخصص في إنتاج الدراما الراقية، بما في ذلك المسلسلات التي تُعرض في أوقات الذروة مثل \"إيست إندرز\" و\"الشاهد الصامت\" والمسلسل الشهير \"بريء\" الذي يُعرض على قناة \"آي تي في\"، أصبح كتابه الصوتي الحصري \"ست درجات من الاغتيال\" من أكثر الكتب مبيعاً على \"أوديبل\"، كذلك روايته الأولى \" إيني ميني/حادي بادي/حكرة بكرة \" التي كانت من أكثر الكتب مبيعاً في المملكة المتحدة في عام 2014 وتبعها بـ11 رواية أخرى من سلسلة \"هيلين قريس\" وجميعها من أكثر الكتب مبيعاً في صحيفة \"صنداي تايمز\". <br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(230, '3939440000076124029', 'ميجان هيس', 'megan-hess', '<p>كان من المقدر أن تتجه <b>ميجان هيس</b> إلى الرسم طوال حياتها. <br></p><p><br></p><p>بعد عملها في التصميم الجرافيكي والاتجاه الفني، شهدت مسيرتها المهنية في مجال رسوم الموضة التوضيحية إبداعاً مبهراً لعملاء مشهورين في جميع أنحاء العالم&nbsp; بما في ذلك صور شخصية لـ\"فانتي فير\" ورسوم متحركة لـ\"برادا\" في ميلانو ونوافذ \"برجدورف جودمان\" في نيويورك، كما عملت في الرسم المباشر لعروض أزياء \"كريستيان ديور كوتور\"، ألفت ميجان العديد من كتب الموضة الأكثر مبيعاً وكتاب للأطفال شيق \"كلاريس: الفأر الأكثر أناقة في باريس\" إلى جانب سلسلتها الشهيرة \"مجموعة الملكات اليافعات\".<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(231, '3939440000083589006', 'ماتيو أسكاريبور', 'mateo-askaripour', '<p>تتناول رواية المؤلف المقيم في بروكلين ماتيو أسكاريبور بعنوان \"الظبي الأسود\" العنصرية في الشركات الأمريكية بطريقة فكاهية وهي روايته الأولى، احتلت المرتبة الأولى في قائمة \"نيويورك تايمز\" للكتب الأكثر مبيعاً، كما نالت شهرة واسعة في نادي القُراء \"اقرأ مع جينا\". نال أسكاريبور لقب أحد \"النجوم العشرة الصاعدين\" في مجلة \"إنترتينمنت ويكلي\" وحصل على جائزة \"خمسة تحت سن 35\" من \"مؤسسة الكتاب الوطنية\"، تسرد روايته الثانية بعنوان \"هذا النصف العظيم من الكرة الأرضية\" قصصه الجريئة. <br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(232, '3939440000077568006', 'ماجد الأهدل', 'majed-alahdal', '<p>مهندسٌ مدني، باحث في التاريخ الثقافي، مهتمٌّ بالدراسات الحضريَّة، ولديه اهتمام خاص بتاريخ الطعام والشراب وتوثيق العادات. صدر له: ديوان القهوة \"شعر قهوة البنِّ من القرن التاسع الهجري\"، مع مقدمة في تاريخ القهوة، وله تحقيقات لعدة رسائل في أدب القهوة، مثل: \"إثارة النخوة بحكم القهوة\" لأبي بكر المكي، و\"دفع الهفوة\" لابن عبد الغفار المالكي، وعمدة الصفوة لعبد القادر الجزيري، ويصدر له قريباً: \"ديوان الشاي\". <br></p><p><br></p><p>يعمل في مجال إدارة العلامات التجارية، والكتابة الإبداعية والإخراج الفني، وهو مشارك في العديد من المشاريع الإبداعية لعدد من الجهات الحكومية والخاصة، فازت بعض أعماله الدرامية بجوائز رسمية.<br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(233, '3939440000010823127', 'لويجي بونومي', 'luigi-bonomi', '<p>عمل <b>لويجي بونومي</b> في مجال النشر لمدة 40 عاماً بدايةً مع التحرير ثم النشر إلى أن أصبح وكيلاً أدبياً، عمل مع مجموعة من كبار الكتّاب واكتشف مواهبهم بما فيهم بيتر جيمس وجاك هيجنز ونورا روبرتس وسيمون سكارو وأليس روبرتس وفيرن بريتون وبن ميلر وسوزان لويس. <br></p><p><br></p><p>أسس بونومي وكالته \"لويجي بونومي وشركاه\" الأدبية في عام 2005 التي كان لها في العام الماضي وحده 14 كتاباً ضمن قائمة أكثر الكتب مبيعاً وأحدها نالت المركز الأول في القائمة. لدى بونومي شغف في استكشاف الأقلام الجديدة ورعاية مواهب الكتّاب.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(234, '3939440000078804011', 'كيلي كلانسي', 'kelly-clancy', '<p>كيلي كلانسي هي عالمة أعصاب وفيزيائية تتمتع بخبرة بحثية في مجموعة من المنشآت مثل معهد ماساتشوستس للتكنولوجيا وجامعة كاليفورنيا، بيركلي وجامعة لندن وشركة \"ديب مايند\". <br></p><p><br></p><p>تدرس مبادئ الذكاء وابتكرت واجهات دماغ-حاسوب لاستكشاف الأساس البيولوجي للإرادة البشرية ونشرت مقالات عن علم الأعصاب والذكاء الاصطناعي في عدة مجلات، أبرزها: \"وايرد\" وهاربرز\" و\"ذا نيو يوركر\".<br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(235, '3939440000079515001', 'جولي مين', 'juli-min', '<p>جولي مين هي كاتبة أمريكية من أصل كوري تقيم في شنغهاي، حصلت على درجة الماجستير في الفنون الجميلة من \"جامعة وارن ويلسون\" ودرست الأدب الروسي والمقارن في \"جامعة هارفارد\". نُشرت روايتها \"سكان شنغهاي\" في عام 2024 بواسطة \"شبيجل اند جراو\" في الولايات المتحدة و\"ديالوق بوكس\" في المملكة المتحدة، من المقرر ترجمة روايتها إلى اليابانية والألمانية والإسبانية والنرويجية. <br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(236, '3939440000076909002', 'جو رومان', 'joe-roman', '<p><b>جو رومان</b> هو عالم أحياء حفظ البيئة وعالم البيئة البحرية ورئيس تحرير موقع eattheinvaders.org.، يعمل جو زميلاً وكاتباً في معهد \"جوند للبيئة\" في \"جامعة فريمونت\" وكَتَبَ لكبرى الصحف العالمية مثل \"نيويورك تايمز\" و\"ساينس\" و\"سليت\" وغيرها. حصل جو على جائزة \"راشيل كارسون لكتاب البيئة\" عن كتابه \"رسائل من قانون الأنواع المهددة بالانقراض في أمريكا\"، أحدث مؤلفاته هو كتاب \"كل، تغوّط، مت: كيف تصنع الحيوانات عالمنا\".<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(237, '3939440000076136022', 'جيسامي هيبرد', 'jessamy-hibberd', '<p><b>الدكتورة جيسامي هيبرد</b> هي طبيبة نفسية إكلينيكية معتمدة ومتحدثة ومؤلفة لأكثر الكتب مبيعاً على مستوى العالم. ألفت جيسامي تسعة كتب بما فيهم \"علاج للمحتال\" الذي وصفته صحيفة \"صنداي تايمز\" بأنه \"الدليل النهائي لمعالجة وفهم الفخ النفسي لمتلازمة المحتال\"، شعار هيبرد هو: \"ما نفعله كل يوم يحدث الفرق الأكبر\". قالت: \"إنها خطوات صغيرة تؤدي إلى أعظم التغييرات\"،و شاركت هذه الرسالة في حديثها في \"تيد إكس\" بعنوان \"مغامرة العمر\". <br></p><p><br></p><p>نشرت عملها الأخير في مايو 2024 \"كيف تتغلب على الصدمات وتجد نفسك مرة أخرى: 7 خطوات للنمو من الألم\".<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(238, '3939440000077581007', 'جاك ميجيت فيليبس', 'jack-meggitt-phillips', '<p>جاك ميجيت فيليبس هو المؤلف الإنجليزي لسلسلة الأطفال المشهورة عالمياً \"الوحش وبيثاني\"، تروي هذه القصة حياة شاباً يبلغ من العمر 500 عام ووحشاً جائعاً ومخادعاً متمرداً، تُرجمت السلسلة إلى أكثر من 30 لغة ولديها صفقة سينمائية كبرى مع \"هيدي فيلمز\". قدم ميجيت فيليبس عروضًا أمام جماهير غفيرة في عدة مناسبات مثل \"باث فيست\" و\"أدربيلي\" و\"مهرجان النرويج الدولي للأدب\" و\"صالون أدب الأطفال\" في فرنسا و\"كوميك كون\" في إيطاليا. <br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(239, '3939440000080218001', 'هيلين تشيرسكي', 'helen-czerski', '<p>د. هيلين تشيرسكي هي فيزيائية وعالمة محيطات تعمل في \"جامعة لندن\"، حيث تدرس الأمواج المتكسرة والفقاعات. تستكشف أبحاثها كيف تسهم هذه الظواهر في تنفس المحيطات. بالإضافة إلى عملها الأكاديمي، فهي مذيعة علمية في هيئة الإذاعة البريطانية، \"بي بي سي\"، منذ عام 2010. حصلت تشيرسكي على الميدالية الذهبية من \"معهد الفيزياء\" وجائزة \"رواد البحار\"، كما تم منحها درجة دكتوراه فخرية. يتناول أحدث كتبها، \"الماكينة الزرقاء\"، تفاصيل حول المحرك المحيطي للأرض. <br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(240, '3939440000076093030', 'هارييت جريفي', 'harriet-griffey', '<p><b>هارييت جريفي</b> هي مُنظِمة وميسرة لخلوات الكُتّاب وهي ناشرة سابقة مقيمة في لندن، كما أنها مؤلفة وصحفية حاصلة على درجة الماجستير في الأدب الحديث والمعاصر، عملت سابقًا محررة مكلفة في دار \"جورج ألين آند أنوين\" للنشر ومديرة تحرير في \"ماكدونالد\" للنشر وعضو في الجمعية الملكية للأدب ومُدرسة خصوصية في استشارات الكتابة الإبداعية. ألفت جريفي أكثر من 20 كتاباً ومؤخرًا نُشر كتابها الجديد \"اكتب الآن: 100 مطالبة للكتابة لتنطلق بإبداعك\" في أكتوبر ٢٠٢٤.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(241, '3939440000076850004', 'هانو سوير', 'hanno-sauer', '<p><b>هانو سوير</b> هو فيلسوف وكاتب ويعمل حالياً أستاذ في جامعة \"أوتريخت\" في هولندا لتدريس الأخلاق والفلسفة السياسية. كتب هانو العديد من المقالات والدراسات الأكاديمية، أصبح كتابه \"التاريخ العالمي للأخلاق\" من أكثر الكتب مبيعاً في العالم وسيتم ترجمته ليُتاح في أكثر من عشرين دولة. أما عن كتابه الأخير، فهو كتاب فلسفي أيضاً بعنوان \"اختراع الخير والشر\".<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(242, '3939440000087226001', 'فارس بسيسو', 'faris-bseiso', '<p>فارس بسيسو هو رجل أعمال وكاتب فلسطيني سوري يعمل حالياً في منصب المؤسس المشارك والرئيس التنفيذي لشركة \"سيفر ميديا\" التي توفر الموسيقى للعلامات التجارية والفرق الرياضية المحترفة في وسائل التواصل الاجتماعي. عمل بسيسو مؤخراً عضواً ومحرراً في لجنة تحكيم مجلة \"مدن\"، وهي مختارات منشورة بعد مسابقة القصة القصيرة لـ \"مؤسسة برجيل للفنون\"، نشر بسيسو مقالاته في \"سي إن إن\" و\"بلومبيرغ\" ونشر العديد من القصص القصيرة في مجلات إقليمية. يعمل بسيسو الآن في نيويورك سفيراً لشركة \"عفكرة\" ومنسق للفعاليات العربية في نيوريورك. <br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(243, '3939440000086093070', 'فريدة الجريتلي', 'farida-el-gueretly', '<p>فريدة الجريتلي هي خبيرة في الشراكات، والبحث، والسياسات العامة، تتمتع بخبرة واسعة، وتدير حالياً المنح والشراكات لمؤسسة ويكيميديا في منطقة الشرق الأوسط وشمال إفريقيا. حاصلة على درجة الماجستير في السياسات التعليمية الدولية، وقد قادت مشاريع لبناء القدرات وإنتاج الأدلة واستخدامها، مركزة على التنمية الاجتماعية والتعليم. ماهرة في تحليل البيانات، وتقييم البرامج، والتعاون بين القطاعات، وتتقن اللغتين الإنجليزية والعربية، كما أنها شغوفة بتوسيع فرص الوصول إلى المعرفة والتعلم للجميع. <br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(244, '3939440000083611029', 'فايزة خان', 'faiza-s-khan', '<p>فايزة خان هي مديرة دورات الكتابة الرئيسية في \"سيلك رود سليبرز\"، حيث تعمل في تدريس الكتابة الإبداعية مع بعض أشهر المؤلفين في العالم. عملت بصفتها مدربة ومرشدة في الكتابة مع أكثر المؤلفين مبيعاً وكتّاب حائزين على جوائز أدبية متنوعة، خاصة أثناء عملها كمحررة استشارية في\"بلومزبيري للنشر\" ومحررة عامة في \"راندوم هاوس\" في الهند. تتعاون فايزة بصفتها كاتبة مستقلة مع الناشرين والمؤلفين والوكلاء الأدبيين فضلاً عن المؤسسات الثقافية؛ بما في ذلك \"المتحف الوطني السويدي\" و\"متحف ما وراء البحار\" في بريمين. <br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(245, '3939440000076580003', 'إيما دابيري', 'emma-dabiri', '<div class=\"align-left\" style=\"text-align: left;\"><b>إيما دابيري</b> هي أكاديمية ومذيعة وكاتبة أيرلندية نيجيرية، عملت لأكثر من عشر سنوات بصفتها زميلة تدريس في قسم الدراسات الأفريقية في جامعة \"SOAS\"، مدرسة الدراسات الشرقية والأفريقية، في لندن. ألفت إيما الكتاب الأكثر مبيعاً في صحيفة \"صنداي تايمز\"، \"ما الذي يمكن أن يفعله الأشخاص البيض بعد ذلك\" و\"لا تلمس شعري\" و\"الأجساد العصية\"، قدمت دابيري العديد من البرامج التلفزيونية والإذاعية والأفلام الوثائقية التي لاقت استحساناً واسعاً مثل \"رحلات إلى المستقبل الأفريقي\"، و\"روائع بريطانيا المفقودة\"، وفيلمها الوثائقي \"قوة الشعر\" الذي عُرض على \"القناة الرابعة البريطانية\" وحاز على جائزة الأسد الفضي في \"مهرجان كان\". <br></p><div class=\"align-left\" style=\"text-align: left;\"><br></p><div class=\"align-left\" style=\"text-align: left;\">عُينت إيما في عام 2023 زميلة في \"الجمعية الملكية للأدب\".<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(246, '3939440000078360001', 'إيل ماكنيكول', 'elle-mcnicoll', '<p><b>إيل ماكنيكول</b> هي روائية وكاتبة سيناريو حائزة على عدة جوائز مثل جائزة \"بلو بيتر\" للكتاب وجائزة \"واترستون\" الشاملة لكتاب الأطفال في عام 2021 عن كتابها \"نوع من الشرارة\"، كما أنه تم ترشيحها أربع مرات لجائزة \"كارنيجي\" وتحوّل عملها إلى مسلسل تلفزيوني وتم بثه في عام 2023. كما أنه تم ترشيح العمل التلفزيوني لجائزة \"إيمي\" وفاز بأفضل برنامج للأطفال في حفل توزيع \"جوائز البث\" في لندن عام 2024. صُنف كتابها \"نوع من الشرارة\" كواحد من أعظم كتب الأطفال في كل العصور ورُشحت مرتين لجائزة \"أستريد ليندغرين التذكارية\".<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(247, '3939440000083610002', 'دانيال هاندلر المعروف باسم ليموني سنيكيت', 'daniel-handler-aka-lemony-snicket', '<p>دانيال هاندلر هو روائي ومؤلف سلسلة \"ليموني سنيكت\"، من ضمن أعماله أيضاً \"لماذا انفصلنا؟\" و\"كل الأجزاء القذرة\" و\"بستان الزجاجة\" ومذكراته \"بعد ذلك؟ وبعد ذلك؟ وماذا أيضاً؟\" وأما بصفته ليموني سنيكت فقد قدم العديد من كتب الأطفال مثل \"سم الإفطار\" و\"كل الأسئلة الخاطئة\" وسلسة \"أحداث مؤسفة\". يعيش مع زوجته الرسامة ليزا براون في سان فرانسيسكو. <br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(248, '3939440000010821071', 'فيونا ليندسي', 'fiona-lindsay', '<p><b>فيونا ليندسي: </b><b><br></b></p><p>منتجة إبداعية ومحاورة، ومدربة ذات خبرة نوعية. تعتبر واحدة من أبرز مقدمي البرامج الحوارية على خشبة المسرح في المملكة المتحدة،<br></p><p>وتواصل عملها مع الفنانين المبدعين في الإذاعة والسينما وعبر البث المباشر على الإنترنت.<br></p><p>أعدت وقدمت أكثر من عشرة برامج إذاعية يومية لهيئة الإذاعة البريطانية، نالت جميعها استحسانا كبيرا، وقد كان آخرها، برنامجا قدمت من خلاله \"روفوس نوريس\"، المدير الفني للمسرح الوطني في لندن.<br></p><p>في مايو 2023، أطلقت سلسلتها الجديدة، Avril Freck. ملاحظات عن الحب والوحدة، في \"ويست إند\" بلندن، وسوف تطلق الموسم الثاني في ربيع 2024.<br></p><p>بيعت عروضها السابقة في \"ويست إند\" بالكامل، وقد قدمت تلك العروض في مسرح الفنون إضافة للقاءات في \"ليرك\" في شارع \"شافتسبري\" .<br></p><p>تم عرض مقطوعتها الموسيقية SEEN، من تلحين جوانا مارش، لأول مرة في مركز \"باربيكان\" في لندن عام، 2022 وتم اختيارها من قبل هيئة الإذاعة البريطانية لتقديمها في قاعة ألبرت الملكية ضمن موسم حفلات لعام 2023.<br></p><p>ساهمت في تأسيس المنصة الرقمية لتعليم فنون المسرح، المنصة العالمية الرائدة التي تصل لأكثر من 4 ملايين طالب في جميع أنحاء العالم.<br></p><p>فيونا عضوة مؤسِسة لفريق رويال شكسبير التعليمي، وتُعد من أبرز مقدمي البرامج الحوارية على خشبة المسرح في المملكة المتحدة. وتواصل جهودها لتقديم وإنتاج برامج الفعاليات التعليمية على مدار العام.<br></p><p>فيونا شغوفة برواية القصص وتمكين الفنانين من تقديم أعمالهم للجمهور بكل حماس وتفان في مناسبات فريدة وجذابة ومسلية.<br></p><p><br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(249, '3939440000076634001', 'أنيل أنانثاسوامي', 'anil-ananthaswamy', '<p><b>أنيل أنانثاسوامي</b> هو كاتب علمي حائز على عدة جوائز ومؤلف لكتب علمية شهيرة مثل \"الرجل الذي لم يكن هناك\" والذي تم إدراجه في القائمة الطويلة لـ \"جائزة قلم/إي. أو ويلسون للكتابة العلمية الأدبية\". نال أنيل جائزة \"الخريج المتميز\" وهي أعلى جائزة تمنحها \"المعهد الهندي للتكنولوجيا- مدراس\" لخريجيها نظير مساهماته في الكتابة العلمية. عمل سابقاً في مجلة \"نيو ساينتست\" بمنصب كاتب علمي ثم نائب محرر الأخبار، كما كان زميلاً في الصحافة العلمية في \"معهد ماساتشوستس للتكنولوجيا\" في الفترة بين 2019 و2020. أحدث الإنجازات المنشورة لأنيل هو كتابه \"لماذا تتعلم الآلات؟\" الذي نُشر في يوليو 2024.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(250, '3939440000079565001', 'أليسون ستيدمان', 'alison-steadman', '<p>أليسون ستيدمان هي ممثلة بريطانية شهيرة اشتهرت بأعمالها في التلفزيون والسينما والمسرح، ظهرت في عروض شهيرة مثل \"جافين وستيسي\" و\"كبرياء وتحامل\" و\"أصدقاء بدينون\".مثلت في أعمال سينمائية مثل فيلم \"الحياة حلوة\"، كما لعبت دور البطولة في عروض مسرحية مثل \"حفل أبيجيل\" و\"قيام وسقوط الصوت الصغير\". فازت ستيدمان بجائزة \"أوليفييه\" وهي جائزة \"الجمعية الوطنية لنقاد السينما\" ورُشحت إلى جائزتي \"بافتا\". تعيش في لندن مع شريكها وهي من هواة مراقبة الطيور وداعمة لـ \"الجمعية الملكية لحماية الطيور\"، حصلت ستيدمان على \"رتبة الإمبراطورية البريطانية\" في عام 2000. <br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(251, '3939440000078101001', 'ألكسندرا ليفيك', 'alexandra-levick', '<p><b>ألكسندرا ليفيك</b> هي من كبار الوكلاء الأدبيين في \"رايترز هاوس\" وتمثل عملاء حائزين على جوائز ومؤلفي كتب الأكثر مبيعاً من&nbsp; مختلف الفئات العمرية. تدربت ليفيك على يد كبار الوكلاء الأدبيين في الوكالة ذاتها ثم عُيّنت مديرة حقوق الإعلام للسينما والتلفزيون، كما عملت أيضاً في مجال بيع الكتب والنشر في مجال الدعاية. حصلت ليفيك على درجة بكالوريوس الآداب في اللغة الإنجليزية وتخصصت في الكتابة الإبداعية من جامعة \"روتشستر\"، ثم نالت شهادة الماجستير في العلوم في مجال النشر وتحديداً في الوسائط الرقمية والمطبوعة من جامعة \"نيويورك\".<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(252, '3939440000077423001', 'أليكس لاتيمر', 'alex-latimer', '<p><b>أليكس لاتيمر</b> هو كاتب ورسام جنوب أفريقي حائز على عدة جوائز عن كتبه المصورة مثل \"هل أنا ملكك؟\" و\"لولا ووحش البحر\" و\"تل الخلد\" و\"معركة الطعام\". تُرجمت كتبه المصورة إلى عشرات اللغات ونُشرت في جميع أنحاء العالم. أول كتب من تأليف لاتيمر هو \"الإوزة جوردون: أوقح وزة على وجه الأرض\" وهي قصة فريدة ومضحكة؛ حيث تدرك إحدى الإوز أن قول كلمة آسف هو أشجع شيء يمكنك القيام به. يعيش الكاتب في كيب تاون.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(253, '3939440000084698001', 'عبد الرزاق قرنح', 'abdulrazak-gurnah', '<p>عبد الرزاق قرنح هو الفائز بجائزة نوبل في الأدب لعام 2021. وهو مؤلف عشرة روايات: ذاكرة الرحيل، طريق الحجاج، دوتي، الجنة (التي ترشحت لجائزة البوكر وجائزة وايت بريد)، إعجاب الصمت، على البحر (التي وصلت إلى القائمة الطويلة لجائزة اللبوكر وجائزة لوس أنجلوس تايمز للكتاب)، الهجر (التي رشحت لجائزة كتاب الكومنولث)، الهدية الأخيرة، قلب الحصى، والحيوات الآخرة (التي رشحت لجائزة أورويل للرواية لعام 2021 وووصلت للقائمة الطويلة لجائزة والتر سكوت). كان أستاذاً للغة الإنجليزية في جامعة كِنت، وكان عضواً في لجنة تحكيم جائزة البوكر عام 2016. يعيش في كانتربري. <br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(254, '3939440000078800001', 'عبد الإله بنعرفة', 'abdel-illah-benarafa', '<p>عبد الإله بنعرفة، حاصل على الدكتوراه في علم الدلالة من جامعة السوربون، باريس، يشغل حالياً منصب نائب المدير العام لمنظمة العالم الإسلامي للتربية والعلوم والثقافة (الإيسيسكو). <br></p><p>أصدر عبد الإله بنعرفة مجموعة من الكتب والدراسات الثقافية والتاريخية والأدبية والفنية والروايات، آخرها \"لا فتى إلا علي\" عام 2024، وقد وصلت روايته \"ابن الخطيب في روضة طه\" و\"الأختام\" إلى اللائحة الأخيرة لجائزة الشيخ زايد في عامي 2013 و 2023. كما أصدر مجموعة من التحقيقات العلمية لكتب التراث الأندلسي، آخرها تحقبق \"الديوان الكبير لابن العربي\"، الذي حاز على جائزة كتاب العام التراثي في الوطن العربي لعام 2024، من معهد المخطوطات العربية بالقاهرة، ومنظمة الألكسو التابعة لجامعة الدول العربية.<br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(255, '3939440000010820286', 'بيمان برهام العوضي', 'peyman-parham-al-awadhi', '<p>بيمان العوضي هو رائد أعمال ومنتج ورئيس منظمة \"طعام الشارع العالمي\"، شغل سابقاً منصب الرئيس التنفيذي لـ \"أكاديمية الإعلام الجديد\" وهي أول حاضنة لمؤثري وسائل التواصل الاجتماعي في الشرق الأوسط وأسرع شركة ناشئة إعلامية نمواً في الإمارات العربية المتحدة في عامي 2020 و2021، كذلك شغل مناصب عليا في شركات متعددة الجنسيات وكيانات حكومية في الإمارات العربية المتحدة في قطاعات النقل والرياضة والتمويل والإعلام. بيمان شغوف بالتنمية البشرية ويشارك بنشاط في مبادرات التعليم والتعلم ويصنع محتوى جذاب في مجالات الطعام والسفر والثقافة العربية ويشاركه مع جمهور كبير على مواقع التواصل الاجتماعي. <br></p><p><br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, 'Litfest 2025', 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(256, '3939440000084590005', 'حصة حسن', 'hessa-hassan', '<div class=\"align-right\" style=\"text-align: right;\"><b>حص حسن</b> <br></p><div class=\"align-right\" style=\"text-align: right;\">كاتبة وإعلامية في قناة الشارقة<br></p><div class=\"align-right\" style=\"text-align: right;\">فازت على المركز الأول على إمارة عجمان والمركز التاسع على دولة الإمارات العربية المتحدة في الموسم الثامن من تحدي القراءة، كذلك فازت بالمركز الثاني على مستوى إمارة دبي في الموسم الخامس والمركز العاشر على مستوى إمارة عجمان في الموسم السابع من التحدي نفسه، كما فازت بالمركز الثالث في مسابقة <b>عوشة بنت خليفة السويدي</b> عن فئة الشعر في الموسم الأول،<br></p><div class=\"align-right\" style=\"text-align: right;\">شاركت في العديد من الورش والفعاليات في دولة الإمارات العربية المتحدة ومثلت الدولة بالتعاون مع الهلال الأحمر الإماراتي في المملكة الأردنية الهاشمية بصفتها سفيرة أمان لدى شرطة دبي، وهي عضو في فريق العباقرة التطوعي،<br></p><div class=\"align-right\" style=\"text-align: right;\">اما في مجال الكتابة فقد نشرت قصتها مسافر من الدرجة الأولى ووقعت الكتاب في مهرجان الشارقة للطفل القرائي ومعرض أبو ظبي الدولي للكتاب<br></p><div class=\"align-right\" style=\"text-align: right;\">ولها قصة منشورة في كتاب الخمسين<br></p><div class=\"align-right\" style=\"text-align: right;\"><br></p>', NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(257, '3939440000095206004', 'مينا العريبي', 'mina-al-oraibi', '<div class=\"align-right\" style=\"text-align: right;\"><b>مينا العريبي</b>&nbsp;تشغل منصب رئيسة التحرير لجريدة \"ذا ناشيونال\"، المنصة الإخبارية الإقليمية البارزة الصادرة باللغة الإنجليزية ومقرها أبوظبي. تتمتع بخبرة تتجاوز 20 عاماً في تغطية الشؤون الشرق أوسطية والأوروبية والأمريكية، واشتهرت بإجراء مقابلات مع شخصيات بارزة على مستوى&nbsp; العالم <br></p><div class=\"align-right\" style=\"text-align: right;\">عملت مينا كزميلة بارزة في معهد فعالية الدولة (ISE) وزميلة في برنامج قادة العالم بجامعة ييل. تولت منصب نائب رئيس التحرير لجريدة الشرق الأوسط بين عامي 2011 و2015، كما قادت مكتب الصحيفة في واشنطن قبل ذلك. وقد حظيت بتقدير عالمي عندما اختيرت كواحدة من القادة الشباب العالميين من قبل المنتدى الاقتصادي العالمي.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(258, '3939440000084627003', 'بيسان عثمان', 'beesan-osman', '<div class=\"align-right\" style=\"text-align: right;\"><b>بيسان عثمان</b> <br></p><div class=\"align-right\" style=\"text-align: right;\"><br></p><div class=\"align-right\" style=\"text-align: right;\">في سن السادسة عشرة فقط، برزت بيسان عثمان كواحدة من أبرز الشابات المبدعات في مجالات التكنولوجيا والفضاء وعلوم الكمبيوتر، حيث تلهم أقرانها لمتابعة شغفهم بثقة ودون حدود. تتمتع بحضور إعلامي مميز وخبرة واسعة في التأثير على منصات التواصل الاجتماعي.<br></p><div class=\"align-right\" style=\"text-align: right;\">منذ انضمامها إلى مرشدات الشارقة في عام 2019، تطوعت بأكثر من 1000 ساعة وحصدت العديد من الجوائز المرموقة، منها جائزة حمدان بن راشد للأداء التعليمي المتميز وجائزة عون للخدمة المجتمعية التي فازت بها ثلاث مرات متتالية، بالإضافة إلى جائزة الشارقة للعمل التطوعي.<br></p><div class=\"align-right\" style=\"text-align: right;\"><br></p><div class=\"align-right\" style=\"text-align: right;\">بيسان كاتبة موهوبة باللغتين العربية والإنجليزية، وقد فازت بالمركز الأول في مسابقة كاتب صغير في كتاب كبير، كما عملت مترجمة مع وفد رسمي لجمعية المعلمين الإماراتيين. وظهرت في مقابلة تلفزيونية على قناة دبي خلال إكسبو 2020، لتُبرز إنجازاتها وتُجسد رؤيتها في تمكين الشباب وتحفيزهم لتحقيق طموحاتهم.<br></p>', NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(259, '3939440000084605004', 'عمر حسين', 'omar-hussein', '<p>عمر حسين، كاتب أردني-فلسطيني يبلغ من العمر 10 سنوات، وُلد في عام 2012 ويعيش في دبي. وهو طالب في مدرسة ديرة الدولية، حيث فاز بجائزة اللغة الإنجليزية للمرحلة الثانوية لعام 2024. قاده حبه للقراءة والكتابة إلى المشاركة في مسابقات نظمتها مؤسسة الإمارات للآداب. في سن العاشرة فقط، نشر كتابه الأو: \"المهمة التي تعلمت فيها الكثير\" مع دار نشر أوستن ماكولي. يعمل حالياً على الكتاب الثاني في السلسلة ومشروعين آخرين. يهدف عمر من خلال كتاباته إلى معالجة القضايا العالمية ويستمتع بالتمثيل، والتنس، والأساطير اليونانية.<br></p>', NULL, NULL, 'Litfest 2025', NULL, NULL, 'Litfest 2025', 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(260, '3939440000010818136', 'خالد البدور', 'khalid-albudoor', '<p>شاعر إماراتي يُعد من رواد الحركة الشعرية الحديثة في الإمارات. نشر عدة مجموعات شعرية وترجمات في الشعر والفلسفة، وحاز على جائزة يوسف الخال للشعر في لبنان عام 1992. هو أحد الأعضاء المؤسسين لاتحاد كتاب وأدباء الإمارات وشارك في العديد من المهرجانات الأدبية في داخل الإمارات وخارجها. اهتم بدراسة التراث الثقافي الإماراتي، ًوهو منتج أفلام وثائقية. حاصل على الماجستير في فن السيناريو من الولايات المتحدة وحازت أفلامه على جوائز وشهادات التقدير محلياً ودولياً. كرّمته عدة مؤسسات ثقافية لجهوده الأدبية، ولتميز تجربته الشعرية كرمته الأكاديمية الدولية للشعر في إيطاليا بمنحه الدبلوم الفخري للأكاديمية عام 2016.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(261, '3939440000016128014', 'لانا شما', 'lana-shamma', '<p>لانا شما هي ناشطة ثقافية تعمل في مجال السينما والفنون البصرية والأدب، كذلك تعمل على ربط الفنون بالعمل الخيري من خلال التعاون مع الفنانين والمؤسسات والمنظمات المجتمعية. هي حالياً جزء من فريق قيادة \"مؤسسة الإمارات للآداب\"، حيث تركز في عملها على الاستراتيجية والتطوير. قادت لانا سابقاً البرامج العامة والشراكات في \"مركز جميل للفنون\" منذ إنشائه وعملت في الإدارة والتواصل في \"مؤسسة بلومزبري قطر للنشر\"، بالإضافة إلى عملها سابقاً في مجال الاتصالات في \"مهرجان الدوحة ترايبيكا السينمائي\". <br></p><p><br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(262, '3939440000010817086', 'إبتسام البيتي', 'ebtisam-al-beiti', '<p><b>ابتسام البيتي</b> هي مؤلفة إماراتية للأطفال وخبيرة في مرحلة الطفولة المبكرة. نشرت ابتسام ثلاثة كتب للأطفال، جميعها تحمل ثيمة متكررة عن الإيمان بالنفس والإيجابية لدى الأطفال الصغار. تمت دعوتها للمشاركة في عدة مهرجانات أدبية دولية، بما في ذلك مهرجان برادفورد الأدبي المرموق في يوليو 2024، ومهرجان تورونتو الدولي للمؤلفين في سبتمبر 2024. كما كانت ابتسام عضواً في عدة لجان نقاشية في مجال تعليم الطفولة المبكرة، بما في ذلك كونها عضواً في لجنة تحكيم جوائز أفضل مدرسة في دبي لعام 2021 وجوائز ووندرموم لعام 2024. كمدافعة عن التعليم، ساهمت ابتسام بنشاط في تعليم الأطفال الصغار.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(263, '3939440000086981027', 'شهد ثاني', 'shahd-thani', '<p>شهد ثاني هي كاتبة وشاعرة إماراتية في مجال الرومانسية، كانت أمينة ومقدمة حفل وأحد الشعراء المشاركين في أمسية \"الحنين إلى رمضان\" التي أُقيمت في يوم الشعر العالمي بالتعاون مع \"بيت الحكمة\". تعمل بجد على روايتها الرومانسية الإماراتية المعاصرة وهي واحدة من الأعضاء المؤسسين لـ \"فصول بلا عنوان\" وهو عبارة عن مركز للكاتبات. شهد هي شغوفة بالكتابة والأجداد وقد نظمت تدريبية بعنوان \"التواصل مع الأجداد\" والتي بيعت تذاكرها بالكامل.<br></p>', NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(264, '3939440000084787001', 'فرح يونس', 'farah-younes', '<p>فرح يونس هي عازفة قانون سورية، تعيش حالياً في دولة الإمارات العربية المتحدة. قدمت العديد من العروض في أبرز الفعاليات الموسيقية بالإمارات، مثل احتفالات العيد الوطني، مهرجان ليوا، وحفل أم كلثوم بتقنية الهولوغرام في دار الأوبرا بدبي. <br></p><p>كرمت في مؤتمر خماسية تاء التدريب والتنمية المستدامة، وحفل إنجازات جامعة عجمان.<br></p><p><br></p>', NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(265, '3939440000086960029', 'اروما راجيش كومار', 'aroma', '<p>أروما هي كاتبة قد تضيع في الترجمة لولا الشعر وقد برزت أعمالها دولياً في مختارات وفعاليات الشعر الحر، حيث استكشفت موضوعات الهوية والانتماء والموائل العقلية والفروق الدقيقة في الطبيعة. <br></p><p><br></p>', NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58');
INSERT INTO `ar_authors` (`id`, `authorid`, `full_name`, `author_slug`, `author_blurb`, `author_as_year`, `moderator_as_year`, `launchpad_young_author_as_year`, `launchpad_author_as_year`, `performer_as_Year`, `Host_as_Year`, `Website_Status`, `created_at`, `updated_at`) VALUES
(266, '3939440000087003090', 'الكسندر كيزياكوفسكي', 'alex', '<p>أليكس شاعر مقيم في دبي. <br></p><p><br></p>', NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(267, '3939440000084081001', 'مريم الهاشمي', 'maryam-alhashmi', '<p>الدكتورة مريم الهاشمي هي ناقدة وكاتبة إماراتية بارزة، لها إسهامات متميزة في النقد الأدبي والفلسفي، وأعمالها تتنوع بين الدراسات النقدية والتحليلية. من مؤلفاتها المهمة رثاء المدن والممالك بين بغداد والأندلس، دراسة مقارنة بين شِعر شعدي الشيرازي وأبي البقاء الرندي، وتطور الحركة الشعرية في الإمارات، وغُربة المدني التي تتناول فنياً شعر أحمد أمين المدني، ووجوه ماريانا: مقاربات نقدية، والعقل بين الموهبة والعبقرية، والتحولات السردية في الأدب الإماراتي. <br></p><p><br></p><p>حازت الدكتورة مريم على عدة جوائز تقديراً لإسهاماتها الفكرية، منها جائزة راشد بن سعيد للتفوق العلمي، وجائزة العويس للإبداع كأفضل كاتبة إماراتية، وجائزة الشارقة لإبداعات المرأة الخليجية في فئة الدراسات النقدية. وهي عضو في لجان تحكيم متعددة، منها لجنة جائزة العويس للدراسات النقدية، وجائزة معرض الشارقة، وجائزة الشارقة لإبداعات المرأة الخليجية، إضافة إلى عضويتها في اللجنة الاستشارية لجائزة العويس.<br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(268, '3939440000090420002', 'حازم ابراهيم', 'hazem-ibrahim', '<p>حازم ابراهيم مترجم سوري حاصل على بكالوريوس اللغة الإنجليزية وآدابها من جامعة دمشق، ومنحة فولبرايت الأميركية حيث درس التواصل الثقافي في جامعة ولاية كاليفورنيا في ساكرامنتو (CSUS). عمل حازم مترجماً محلفاً وفورياً وتحريرياً في سوريا منذ 2002 وشغل منصب الأمين العام للمجلس المركزي لشؤون أصحاب الهمم في سوريا. يعيش في الإمارات منذ عام 2013، حيث عمل مترجماً فورياً وإعلامياً اقتصادياً في قناة CNBC عربية حتى عام 2021 وهو كبير المترجمين في \"اقتصاد الشرق مع بلومبرغ\" وفي \"الشرق للأخبار\"، وعضو هيئة التحرير والترجمة في هارفارد بزنس ريفيو العربية منذ عام 2014. لحازم كتب مترجمة منها \"آلة الخيال\" و\"التحفيز الاستراتيجي\" و\"ابتكر وانطلق\" الصادرة عن مجرّة.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(269, '3939440000010814227', 'نمل صديقي', 'namal-siddiqui', '<p>نمل صديقي شاعرة باكستانية وُلدت ونشأت في الإمارات العربية المتحدة. تُشرف على تنظيم الفعاليات الثقافية وتعمل كمستشارة للعلامات التجارية، وتقوم حالياً بتحضير مجموعة شعرية للنشر. تتناول أعمالها مواضيع الهوية وإنهاء الاستعمار والطبيعة. بالإضافة إلى ذلك، تعمل نمل كمحاضِرة مساعِدة في الكتابة الإبداعية في معهد روتشستر للتكنولوجيا في دبي. <br></p><p><br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(270, '3939440000010819118', 'حفصة لودي', 'hafsa-lodi', '<p>حفصة لودي صحفية حائزة على جوائز وتعمل في تغطية مواضيع الموضة والثقافة منذ أكثر من عقد. تحمل درجة البكالوريوس في الصحافة ودرجة الماجستير في القانون الإسلامي، وتكتب باستمرار عن تقاطع الدين والموضة والنسوية. نشرت في العديد من الدوريات العالمية مثل \"الإندبندنت\" و\"ذا ناشيونال\" و\"موجيه\" و\"فوغ العربية\" وغيرها. أصدرت كتابها الأول في مجال الكتب غير الروائية بعنوان: \"الاحتشام: معضلة الموضة\" عن دار نشر \"نيم تري\" خلال مهرجان طيران الإمارات للآداب عام 2020، والذي يتناول أسباب وقضايا الموضة المحتشمة. وقد وصفته هاربرز بازار الأمريكية بأنه \"صورة متعمقة وعاطفية عن السياسة والأشخاص وراء هذا الحراك.\"<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(271, '3939440000010825131', 'غيث حسن الحوسني', 'ghaith-alhosani', '<p>غيث الحوسني إعلامي ومثقف من دولة الإمارات العربية المتحدة، شارك في العديد من الأنشطة المهمة الثقافية داخل الدولة وخارجها، ساهم في إدارات لقاءات حوارية كثيرة وشخصيات مهمة، ويقدم الآن عبر منصات التواصل الاجتماعي بودكاست \"احتمال\".<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(272, '3939440000038172011', 'أناميكا تشاترجي', 'anamika-chatterjee', '<p>أناميكا تشاترجي كاتبة ومحررة ومقدمة برامج ومتحدثة في TEDx، تقيم في الإمارات العربية المتحدة. كتبت بشكل واسع عن قضايا النوع الاجتماعي والصحة النفسية والأدب والفنون والثقافة، ووثقت محطات اجتماعية وثقافية بارزة في المنطقة. من بيكو آير إلى الحائز على جائزة نوبل عبد الرزاق قرنح، تسعى مقالاتها إلى فهم الشخص الكامن خلف هذه الشخصيات. في عام 2021، اختير مقالها لصحيفة خليج تايمز حول التعامل مع والد مصاب بمرض الزهايمر لعرضه في فعالية TEDx بمعهد العلوم الطبية المرموق في الهند (AIIMS باتنا). وفي عام 2024، قدمت ثاني حديث TEDx للشباب، حيث تناولت مخاطر الحياة مع القلق.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(273, '3939440000040840040', 'ديمة العلمي', 'deema-al-alami', '<p>بخبرة تزيد عن 16 عاماً في مجال التعليم، ودرجة ماجستير من \"كينجز كوليدج لندن\"، وبكالوريوس من الجامعة الأمريكية في بيروت، تعتبر ديما العلمي معلمة ومناصرة للقراءة ومؤلفة كتب أطفال تسعى إلى تعزيز حب القراءة. شاركت في تأسيس أول قمة عربية للأطفال في مدينة إكسبو دبي، وظهرت في الموسم الأول من برنامج \"شركاء النجاح\"، حيث حصلت على استثمار. أطلقت ديما برنامج \"من أم إلى مؤلفة\" لدعم المؤلفين الطموحين لكتب الأطفال العرب، وشاركت في تأليف كتابين من الأكثر مبيعاً، أحدهما حول الأمان الجسدي للأطفال باللغة العربية. وقد نشرت مؤخراً كتاب \"48 قصة عن المنفى من فلسطين\". عبر حسابها على إنستجرام، تشارك توصيات للكتب ونصائح لتعزيز مهارات القراءة. <br></p><p><br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(274, '3939440000064585001', 'كريستوفر بردلي', 'chris-bradley', '<p>كريس برادلي، بريطاني الأصل، تخرج بشهادات جامعية في الأعمال من جامعات في بريطانيا وفرنسا. بعد بداية مسيرته المهنية في لندن في قطاع النقل والسفر، عمل برادلي في قطاع الطاقة، متنقلاً في العالم مع عائلته. يتقن اللغة الفرنسية، وتشمل اهتماماته التمارين الرياضية، والقراءة، والشؤون العامة، وقضاء الوقت مع زوجته وبناته الثلاث. الآن وهو مقيم في الإمارات العربية المتحدة، يُعتبر برادلي مستشاراً موثوقاً لقيادة المجالس التنفيذية والرؤساء التنفيذيين.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(275, '3939440000087297001', 'روعة طلس', 'rawaa-talass', '<p>كاتبة وصحفية مستقلة، وُلدت في طوكيو وتعيش في دبي. حصلت على درجتي ماجستير في تاريخ الفن من جامعة كِنت في باريس وكلية الدراسات الشرقية والأفريقية في لندن. تنحدر من أصول سورية، وكرست كتاباتها لسرد قصص شخصية وجذابة عن الفن والثقافة والمجتمع من العالم العربي والمنطقة الأوسع. نُشرت مقالاتها في دوريات عالمية مثل \"آرتسي\"، و\"ذا آرت\"، و\"عرب نيوز\"، و\"العربي الجديد\"، و\"إيه دي الشرق الأوسط\"، ومجلة \"كانفاس\"، و\"العربية\"، و\"ذا ناشيونال\". <br></p><p><br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(276, '3939440000089910044', 'ناتاشا هاثيرال', 'natasha-hatherall-shawe', '<p>ناتاشا هاثيرال-شو هي المؤسسة والرئيس التنفيذي لوكالة \"تيش تاش\"، إحدى أكثر وكالات الاتصال طلباً في المنطقة، وقد أمضت أكثر من 20 عاماً في عالم التسويق والإعلام. وُلدت وتعلمت في المملكة المتحدة، وتحمل دكتوراه في علم النفس والتسويق. تمتعت بمسيرة مهنية متنوعة شملت العديد من القطاعات، بما في ذلك قيادة الوكالات العالمية مثل \"ماكان إريكسون\" و\"يورور س إس جي\" و\"هافاس جلوبال\"، والشركات العالمية مثل \"لوريال\" و\"دياغيو\". انتقلت ناتاشا إلى المنطقة في عام 2010، وأسست وكالتها الخاصة في عام 2012. ناتاشا هي مدافعة شغوفة عن حقوق المرأة في الأعمال وصحة المرأة.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(277, '3939440000089921057', 'ريا شديد', 'rhea-chedid', '<p>بالخبرة التي امتلكتها في مجال البودكاست لمدة خمس سنوات، تشغل <b>ريا شديد</b> حالياً منصب مديرة البودكاست الأول لدى سبوتيفاي في منطقة الشرق الأوسط وشمال أفريقيا. بالإضافة إلى هذا الدور، وتقديمها لبودكاستاتها الخاصة، أسست ريا شركة ريزين ميديا، وهي شركة إنتاج بودكاست تهدف إلى إنتاج موجة جديدة من المحتوى للعالم الناطق بالعربية.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(278, '3939440000090159019', 'ﻣﺎﻳﺎ أبوظهر', 'maya-abou-zahr', '<p>بالإضافة إلى عملها الأكاديمي في جامعة الإمارات والجامعة الأميركية في دبي، تعد مايا أبو ظهر باحثة، كاتبة، مراجعة كتب، محررة، محكمة علمية، وميسرة جلسات. لها كتاب منشور، كما كتبت العديد من المقالات حول الاستدامة، السياحة الطبية، الصراع الروسي-الأوكراني، النسوية، ومواضيع تتعلق بمنطقة الخليج العربي. نُشرت مقالاتها في دوريات مرموقة كالشؤون العربية المعاصرة، مركز الخليج للأبحاث، مجلة شؤون اجتماعية، والمستقبل العربي. <br></p><p>مايا عضو في مجموعة دبي للجودة، وعضو في مجموعات ثقافية وريادية، وشاركت في عدة نوادي كتب كملتقى الراويات، حيث أسست أحدها. شاركت في أكثر من 70 ندوة ومؤتمر، وأدارت العديد من الجلسات النقاشية. تهوى القراءة والموسيقى.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(279, '3939440000084554001', 'عفراء راشد الظاهري', 'afra-rashed-al-dhaheri', '<p>عفراء راشد الظاهري هي طالبة متميزة في مدرسة ليوة القطارة في العين. تجيد اللغتين العربية والإنجليزية، وتتفوق في دراستها ولديها شغف بالرسم والتلوين. حصلت عفراء على العديد من الجوائز، بما في ذلك شهادة التميز والمركز الأول في مسابقة المعلومات في مسابقة المكتبة. كما أنها كاتبة طموحة، حيث ساهمت في كتاب \"شجرة التفاح\" باللغة العربية ونشرت كتاب \"كن صديقاً، لا متنمراً\" باللغة الإنجليزية في معرض أبوظبي للكتاب. تحلم عفراء بأن تصبح كاتبة للأطفال ومعلمة، بينما تستكشف التكنولوجيا والبرمجة. <br></p><p><br></p>', NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(280, '3939440000080163001', 'أمل إسماعيل', 'amal-ismail', '<p>شاعرة ومترجمة فلسطينية لها 17 إصداراً أدبياً منشوراً في الشعر والقصة القصيرة والسرد وإدارة المعرفة والابتكار والأم والطفل. <br></p><p>فائزة بجائزة توليولا الإيطالية للشعر غير الإيطالي عام 2020.<br></p><p>فائزة بجائزة أوائل الإمارات في عام القراءة 2016 عن مبادرة \"رأس الخيمة تقرأ\".<br></p><p>محررة أدبية ومدرّبة كتابة، ومقيّمة في الجوائز الأدبية وجوائز التميّز.<br></p><p>عضو اتحاد كتاب وأدباء الإمارات، والاتحاد الدولي للغة العربية، والجمعية الدولية للمترجمين واللغويين العرب.<br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(281, '3939440000089912035', 'ونديرلا ماجومدار', 'oindrila-majumdar', '<p>أويندريلا ماجومدار، طالبة في الصف التاسع في أكاديمية دبي الدولية، مدفوعة بشغفها لعلم الفلك واستكشاف أسرار الكون. بدأت رحلتها برسالة مفتوحة عن مسبار الأمل الإماراتي، مما أدى إلى لقاء مع سعادة سارة الأميري وألهمها لكتابة كتاب علم الفلك للعقول الشابة. تتعاون أيندريلا مع علماء من جامعة برينستون، والمعهد الوطني للبحوث العلمية (CNRS)، ووكالة ناسا في إعداد فيديوهات تهدف إلى إثارة اهتمام الجمهور الشاب بالعلوم والفلك. كمتحدثة رئيسية في إكسبانس، ستشارك أويندريلا رؤاها حول الثقوب السوداء ومستقبل علم الفلك، مما يميزها كصوت واعد في هذا المجال.<br></p>', NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(282, '3939440000084560001', 'كريم صدّيقي', 'karim-siddiqi', '<p>كريم صديقي، طفل يبلغ من العمر 10 سنوات من دبي، الإمارات العربية المتحدة، لديه حب استثنائي للقراءة، خصوصاً قصص الغموض. مستلهماً من حكايات الإثارة والتشويق، قرر كريم أن يكتب كتابه الخاص وهو في التاسعة من عمره، ليصدر أول أعماله: \"قصر الألغاز\". يظهر كتابه الأول شغفه الكبير بجنس الغموض وموهبة السرد التي تأسر القراء. خارج مساعيه الأدبية، يعد كريم من عشاق كرة القدم الذين يكرسون وقتاً كبيراً للعبة. سواء في القراءة أو الكتابة أو على أرض الملعب، يتألق كريم في كل ما يفعله من خلال إبداعه وحماسه. <br></p><p><br></p>', NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(283, '3939440000076908001', 'ممدوح حمادة', 'mamdouh-hamada', '<p>ممدوح حمادة: خريج كلية الصحافة في جامعة بيلاروسيا الحكومية بدرجة دكتوراه، واكاديمية بيلاروسيا الحكومية للفنون بدرجة دبلوم في الإخراج السينمائي، مؤلف 18 كتاباً بين أبحاث وروايات ومجموعات قصصية ومسرحيات مثل \"فن الكاريكاتير من جدران الكهوف على أعمدة الصحافة\"، ورواية \"المحطة الأخيرة\"، وسلسلة مجموعات قصصية تحت عنوان \"دفاتر ممدوح حمادة\"، ومسرحية \"الجلاد المتقاعد\". <br></p><p>كاتب سيناريو لأكثر من 30 عملاً تلفزيونياً وسينمائياً منها \"ضيعة ضايعة\"، و\"الخربة\"، و\"بقعة ضوء\"، و\"مدينة المعلومات\" و\"بيتي العربي\" للأطفال وغيرها.<br></p><p>مقيم حالياً في الإمارات العربية المتحدة.<br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(284, '3939440000083577010', 'صالحة غابش', 'saleha-ghabish', '<p>حاصلة على ليسانس آداب الدراسات الإسلامية واللغة العربية، وتمهيدي ماجستير في كلية دار العلوم. <br></p><p>تعمل رئيساً للمكتب الثقافي، ومستشاراً ثقافياً للمجلس الأعلى لشؤون الأسرة بالشارقة، وكذلك مديرة تحرير مجلة \"مرامي\" الاجتماعية الأسرية، الصادرة عن المجلس.<br></p><p>لها دواوين شعرية وروايات، ومؤلفة لكتب الأطفال واليافعين، وتترأس دار النشر، كما ألفت المسرحيات والتمثيليات التلفزيونية، وشاركت بعرضها في دول عربية وعالمية، وترجمت لها أعمال بلغات عديدة، حصلت على جوائز كشاعرة، وكمساهمة في البناء الثقافي الإماراتي، وعليه تم اختيارها ضمن أفضل 24 سيدة إماراتية، من قبل الهيئة الاتحادية للتنافسية والإحصاء.<br></p><p>وهي عضو اتحاد وكتاب وأدباء الإمارات، ورابطة أديبات الإمارات، وعضو مجلس استشاري في أكثر من جامعة.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(285, '3939440000087940001', 'أسماء الرميثي', 'asmaa-al-remeithi', '<p>أسمة سعيد الرميثي، والمعروفة بـ ”Asami ART”، هي فنانة إماراتية متخصصة في رسم المانجا والتصميم الجرافيكي، بخبرة تتجاوز 13 عاماً. ابتكرت شخصية “أسامي” التي تعكس تفاصيل حياتها اليومية، مما قاد إلى إطلاق خط منتجات ناجح مستوحى من الشخصية. حصلت على جائزة ADMAF عام 2016 عن كتابها المصوّر ثنائي اللغة “Turning Point”. أصدرت سبعة كتب تتنوع بين قصص مصورة وكتب تلوين وكتب فنية. تشارك أسمة بفعالية في تنظيم ورش العمل والمعارض محلياً وعالمياً، وتُعد مديرة مجتمعية للفن الإماراتي، حيث تدعم الفنانين وتوفر لهم منصات لعرض إبداعاتهم وتبادل المعرفة.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(286, '3939440000089667001', 'حمدة البلوشي', 'hamda-alblooshi', '<p>كاتبة في مجال أدب الطفل، شغوفة بنقل المعرفة وتنمية المهارات الأساسية للأطفال. <br></p><p>حاصلة على بكالوريوس في الطفولة المبكرة، ومعلمة رياض أطفال بخبرة تمتد لأكثر من 20 عاماً.<br></p><p>حاصلة على دبلوم مدرب محترف معتمد، ودبلوم في فلسفة منتسوري في التعليم الأمريكي، تتبنى نهجاً تعليمياً يلهم الأطفال ويشجعهم على الاستقلال والإبداع.<br></p><p>مؤسسة مشروع \"صغارية\" لنشر حب القراءة بين الأطفال.<br></p><p>مؤسسة دار \"عالمكم للنشر والتوزيع\"، المتخصصة في بيع كتب الأطفال والوسائل التعليمية المبتكرة.<br></p><p>رؤيتها هي ترك بصمة في عالم الطفولة وإلهام الأطفال والمربين من خلال تقديم محتوى تعليمي مبتكر، يدمج بين اللعب والتعليم بأسلوب تفاعلي.<br></p>', NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(287, '3939440000010812296', 'صالحة عبيد', 'salha-obaid', '<p>كاتبة إماراتية، تخصص هندسة إلكترونية، لها مجموعة قصصية أولى بعنوان \"زهايمر\" عام 2010، تلاها مجموعتان قصصيتان: \"ساعي السعادة\" و\"خصلة بيضاء بشكل ضمني\"، وقد فازت الأخيرة بجائزة العويس للإبداع عام 2016. كما فازت عن مجمل أعمالها بجائزة الإمارات للشباب عن فئة الكتابة الإبداعية في العام 2017. <br></p><p>وفي العام 2018 نشرت رواية&nbsp; \"لعلها مزحة\" التي وصلت للقائمة الطويلة لجائزة الشيخ زايد للكتاب في 2021.<br></p><p>صالحة حائزة على شهادة الكتابة الإبداعية من برنامج جامعة بلاتسكي في التشيك عام 2017، كما أنها كانت ضمن برنامج زمالة الكتابة الإبداعية العالمي بجامعة آيوا بالولايات المتحدة الأمريكية دفعة عام 2021، وفي العام 2022 أصدرت روايتها الثانية&nbsp; \"دائرة التوابل\" التي وصلت للقائمة الطويلة للجائزة العالمية للرواية العربية عام 2023.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(288, '3939440000057659008', 'جرايمي ويلسون', 'graeme-wilson', '<p>اشتهر جرايم ويلسون بكتابته للسير الذاتية السردية والدقيقة والغنية بالتفاصيل عن مختلف قادة العالم، تشمل أعماله السير الذاتية المعتمدة للمؤسس الشيخ زايد بن سلطان آل نهيان والشيخ خليفة بن زايد آل نهيان والشيخ راشد بن سعيد آل مكتوم، بالإضافة إلى رؤساء دول أذربيجان وكازاخستان وعمان وسريلانكا وجزر المالديف. تعاون ويلسون على نطاق واسع مع الحائز على جائزة الأوسكار مورغان فريمان كونه منتجاً سينمائياً، أُلقيت خطاباته في \"الجمعية العامة للأمم المتحدة\" و\"مجلس العموم البريطاني\" وهو زميل في \"الجمعية الجغرافية الملكية\" في لندن. <br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(289, '3939440000083705004', 'لالين سوخيرا', 'laaleen-sukhera', '<p>تعمل لالين سوخيرا في مجال الاتصالات المؤسسية وتدير جمعية \"جين أوستن للشرق الأوسط وشمال أفريقيا وباكستان\"، أول عمل روائي لها هو \"أوستنستان\" ولها إسهاماتها في المجلات الأكاديمية عبر الأطلسي، تعمل لالين على رواية خيالية تدور أحداثها في دبي التي اختارتها موطناً لها، كما أسست \"رابطة دبي الاجتماعية\" التي تستمتع فيها بتكوين العلاقات مثل إيما وودهاوس في العصر الحديث. لالين هي أم لثلاث فتيات صغيرات من عائلة بينيت وتمثلها \"وكالة ويليام موريس\" في هوليوود.<br></p>', 'Litfest 2025', 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(290, '3939440000010809051', 'أليسون ويليامز', 'allison-k-williams', '<p>عملت أليسون ك. ويليامز في تحرير مجموعة من المؤلفات وتدريب المؤلفين على صفقات النشر مع دور نشر مثل \"بنجوين راندوم هاوس\" و\"كنوبف\" و\"مانتل\" و\"سانت مارتن\" والعديد من دور النشر الصغيرة. لديها خبرة واسعة في تسويق المؤلفين وبناء المجتمع ولديها مدونة \"بريفيتي\" التي يتابعها فيها أكثر من 80 ألف متابع، كذلك لديها أكثر من 10 آلاف متابع على إنستقرام وأكثر من 12 ألف مشارك في قائمتها البريدية و أكثر من 5 آلاف على صفحتها في فيسبوك. لديها منشورات متنوعة في صحيفة \"نيويورك تايمز\" وظهرت على شاشات \"الإذاعة الوطنية العامة\" و\"سي بي سي\"، نال كتابها \"سبع مسودات: تحرير ذاتي مثل المحترفين من صفحة فارغة إلى كتاب\" شهرة واسعة، وتقود معسكرات كتابة \"أعد ولادة كتابك\" وتشارك في استضافة \"منصة دردشة جسر الكتاب\".<br></p>', 'Litfest 2025', 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(291, '3939440000080935007', 'إيميلي دنلاي', 'emily-dunlay', '<p>ولدت إيميلي دانلاي ونشأت في دالاس بولاية تكساس ودرست الأدب الإنجليزي والكتابة الإبداعية في \"جامعة برينستون\"، أتمت تدريبها كأمينة مكتبة متخصصة في الكتب القديمة وتقيم حالياً في أبو ظبي، الإمارات العربية المتحدة. <br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(292, '3939440000084570007', 'فاطمة علي الزرعوني', 'fatima-ali-alzarooni', NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(293, '3939440000084570002', 'علي حميد اللوغاني', 'ali-humaid-alloghani', NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(294, '3939440000010812166', 'ماجيك فيل', 'magic-phil', '<b>ماجيك فيل</b>، مذيع التلفزة، والإذاعة، والساحر وكاتب الأطفال، هو أصلا من شمال شرق إنجلترا، ويقيم في الإمارات العربية المتحدة منذ عشر سنوات.<br><br>\n\nفيل كاتب عامود  المشاهير في مجلة \"تايم أوت\" للأطفال،حيث يقدم قصصه المضحكة، والطرائف والألغاز،ولديه برنامجه الإذاعي اليومي للأطفال، \"ذا لافترنون درايف\"، على محطة الأطفال الشهيرة بيرل 102 أف إم.<br><br>\n\nويمكن  للجمهور حضور عروض ماجيك فيل العائلية الفكاهية الحية  في جميع أنحاء الإمارات العربية المتحدة. <br><br>\n\nففي شهر ديسمبر 2020، قدّم ستة عروض على متن سفينة الملكة إليزابيث الثانية، نفدت تذاكرها جميعها.<br><br>\n\nويمكن متابعة ماجيك فيل على قناة الأطفال التلفزيونية \"نكلوديون\"، وقد قدم العديد من البرامج التلفزيونية المباشرة الأخرى.<br><br>\n\nفي عام 2019، نشر كتابه الأول\"الكلب الذي يحب اللون الأزرق\"، تلاه، في عام 2020 كتاب\" الجمل الذي يحب اللون الأحمر\".<br><br>\n\nبرنامج \"ماجيك فيل\"، وقت القصص، برنامج ماتع مسلي يحفل بالحكايات والطرائف والشخصيات المميزة والأغاني، وتفاعل الجمهور الذي لا يتوقف!', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', '2025-02-01 12:38:58', '2025-02-01 12:38:58');
INSERT INTO `ar_sessions` (`id`, `session_id`, `session_name`, `session_slug`, `session_number`, `session_website_status`, `session_year`, `no_normal_tickets`, `session_authors`, `session_category`, `session_venue`, `age`, `session_room`, `session_language`, `session_translation`, `session_blurb`, `session_short_blurb`, `session_location`, `det_code`, `pricetype`, `created_at`, `updated_at`) VALUES
(1, '3939440000085341498', 'الحدث الغنائي الكبير', 'the-big-sing', '75', 'Published to Website', 'Litfest 2025', 350, NULL, 'الفعاليات الخاصة', 'انتركونتيننتال', NULL, 'واحة القصص', 'متعددة اللغات', NULL, '<p>يعود \"الحدث الغنائي الكبير\" للسنة الثالثة على التوالي، حيث تجتمع جوقات المدارس من مختلف أنحاء دولة الإمارات لتقديم أمسية ساحرة من العروض الغنائية الآسرة باللغتين العربية والإنجليزية. احتفاءً بالمواهب الموسيقية المتنوعة لشباب المنطقة، يستعرضون أصواتهم البلورية وأسلوبهم الشجاع والجذاب في الأداء الجماعي<br></p>', '<p>لا تفوّتوا هذه الأمسية الساحرة التي ستأخذكم في رحلة من العروض الغنائية الآسرة باللغة العربية والإنجليزية، احتفاءً بالمواهب المحلية الموسيقية المتنوعة للأطفال <br></p>', 'دبي فيستفال سيتي', 'SSPECIALEVENTS100', 'J', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(2, '3939440000087012110', 'طريق الكتابة: فايزة إس. خان', 'the-write-path-faiza-s-khan', '414', 'Published to Website', 'Litfest 2025', 3, 'فايزة خان', 'الورش', 'انتركونتيننتال', NULL, 'الواحة', 'الإنجليزية', NULL, '<p>هل تبحثون عن ملاحظات من خبير حول فكرة روايتكم؟ سجلوا الآن للحصول على تقييم مدته 10 دقائق تقدم فيه خبيرة النشر <b>فايزة خان</b> نصائح حول ملخص الكتاب المكون من صفحة واحدة ووصف الغلاف الخلفي الذي لا يتجاوز 50 كلمة.بفضل سنوات من الخبرة، سيقدم بونومي رؤى حول إمكانيات فكرتكم ويوجهكم لما يجب التفكير فيه أثناء رحلتكم في الكتابة والنشر. <br></p><p>فايزة خان مهتمه بكل أنواع الأدب الروائي التجاري، بالإضافة إلى غير الروائي الذكي الموجه لجمهور تجاري.<br></p><p>سيتواصل معكم المهرجان بحلول منتصف يناير لتأكيد موعد فترتكم المخصصة التي ستكون ضمن مدة الجلسة.<br></p><p><br></p>', '<p>هل تبحثون عن ملاحظات من خبير حول فكرة روايتكم؟ سجلوا الآن للحصول على تقييم مدته 10 دقائق تقدم فيه خبيرة النشر <b>فايزة خان</b> نصائح حول ملخص كتابكم المكون من صفحة واحدة ووصف الغلاف الخلفي الذي لا يتجاوز 50 كلمة. <br></p><p><br></p>', 'دبي فيستفال سيتي', 'SWORKSHOPS240', 'O', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(3, '3939440000085077981', 'ورشة بناء العوالم في الأدب التاريخي', 'workshop-worldbuilding-in-historical-fiction', '409', 'Published to Website', 'Litfest 2025', 18, 'ريحان خان;', 'الورش', 'انتركونتيننتال', NULL, 'الواحة', 'الإنجليزية', NULL, '<p>يعد البحث عنصراً أساسياً في تطوير الخيال التاريخي المدروس، لكن ما هو مقدار البحث الذي يجب على الكتّاب القيام به؟ كيف من الممكن تحديد الصراعات التي ستنعش البيئة التاريخية؟ ما هي الأسئلة التي يجب طرحها أثناء بناء عالم الرواية لضمان أن تنبض الشخصيات والأماكن بالحياة بطريقة لا تُنسى؟ <br></p><p>يشارك الكاتب <b>ريحان خان</b>، مؤلف رواية \"قبر الإمبراطوريات\"، في هذه الورشة تقنيات البحث الفعّالة والمجربة لصياغة رواية تاريخة مميزة، بغض النظر عن الحقبة التي تدور فيها القصة. هذه الورشة موجهة لكافة&nbsp; الكتّاب من الواعدين إلى المحترفين.<br></p>', '<p>يشاركنا الكاتب <b>ريحان خان</b>، مؤلف رواية \"قبر الإمبراطوريات\"، في هذه الورشة أساليب مجربة وحقيقية لصياغة الأدب التاريخي، بغض النظر عن العصر الذي تدور فيه القصة. <br></p><p><br></p>', 'دبي فيستفال سيتي', 'SWORKSHOPS300', 'P', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(4, '3939440000085077936', 'ورشة عمل للمراهقين: كيف تكون فائق البرية', 'teen-workshop-how-to-ultrawild', '404', 'Published to Website', 'Litfest 2025', 20, 'ستيف موشين;', 'الورش', 'انتركونتيننتال', NULL, 'الواحة', 'الإنجليزية', NULL, '<p>هل تساءلتم يوماً كيف قد تبدو مدن المستقبل؟ أو ما هي الاختراعات المجنونة التي قد تساعد في جعل هذه المدن حقيقة؟ في جلسة التفكير الإبداعي الديناميكية هذه، بقيادة الفنان والمصمم الصناعي <b>ستيف موشين</b> \"فائق البرية\"، ستتعلمون كل شيء عن تحويل المدن إلى أنظمة بيئية مستقبلية. تبدأ الورشة بمناقشة ملهمة تستكشف الاختراعات في العالم الحقيقي، تليها جلسة تصميم سريعة حيث يمكنكم ابتكار إبداعاتكم المستقبلية الخاصة. تعالوا وارسموا بتقنية ثلاثية الأبعاد وابتكروا أفكاركم الخاصة لإعادة إحياء المدن.<br></p>', '<p>مع الفنان <b>ستيف موشين</b>، نستكشف الابتكارات في العالم الحقيقي وتصميم الأنظمة البيئية المستقبلية من خلال الرسم الإبداعي والرسم ثلاثي الأبعاد والمزيد في هذه الورشة الديناميكية للمراهقين.<br></p>', 'دبي فيستفال سيتي', 'SWORKSHOPS150', 'N', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(5, '3939440000092226438', 'سماوات شعرية', 'skies-of-poetry', '252', 'Published to Website', 'Litfest 2025', 150, 'عائشه الشامسي', 'الحوارات', 'انتركونتيننتال', NULL, 'المجلس', 'العربية', NULL, '<p>أمسية شعرية خاصة من أمسيات المهرجان تجمع بين الجمال والإلهام مع الدكتورة <b>عائشة الشامسي</b>، حيث تأخذنا قصائدها في رحلة فريدة عبر عوالم الكلمة والوجدان بأبياتها العذبة التي تنبض بالحياة والتأمل تستحضر الشاعرة ملامح الذات، الوطن والإنسانية في لوحات شعرية آسرة.<br></p><p>لا تفوتوا فرصة الاستماع إلى صوت شعري متفرّد يجمع بين العمق والبساطة ويضيء أمسياتنا بروح الكلمة.<br></p>', '<p>أمسية شعرية خاصة من أمسيات المهرجان تجمع بين الجمال والإلهام مع الدكتورة <b>عائشة الشامسي</b>، حيث تأخذنا قصائدها في رحلة فريدة عبر عوالم الكلمة والوجدان.<br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(6, '3939440000085341942', 'طريق الكتابة: لويجي بونومي', 'the-write-path-luigi-bonomi', '412', 'Published to Website', 'Litfest 2025', 8, 'لويجي بونومي', 'الورش', 'انتركونتيننتال', NULL, 'الرمال', 'الإنجليزية', NULL, '<p>هل تبحثون عن ملاحظات من خبير حول فكرة روايتكم؟ سجلوا الآن للحصول على تقييم مدته 10 دقائق يقدم فيه الوكيل الأدبي <b>لويجي بونومي</b> نصائح حول ملخص الكتاب المكون من صفحة واحدة ووصف الغلاف الخلفي الذي لا يتجاوز 50 كلمة. بفضل سنوات من الخبرة، سيقدم بونومي رؤى حول إمكانيات فكرتكم ويوجهكم لما يجب التفكير فيه أثناء رحلتكم في الكتابة والنشر. <br>لويجي بونومي مهتم بكل أنواع الأدب الروائي التجاري، بالإضافة إلى غير الروائي الذكي الموجه لجمهور تجاري</p><p>سيتواصل معكم المهرجان بحلول منتصف يناير لتأكيد موعد فترتكم المخصصة التي ستكون ضمن مدة الجلسة.<br></p><p><br></p>', '<p>هل تبحثون عن ملاحظات من خبير حول فكرة روايتكم؟ سجلوا الآن للحصول على تقييم مدته 10 دقائق يقدم فيه الوكيل الأدبي <b>لويجي بونومي</b> نصائح حول ملخص كتابكم المكون من صفحة واحدة ووصف الغلاف الخلفي الذي لا يتجاوز 50 كلمة. <br></p>', 'دبي فيستفال سيتي', 'SWORKSHOPS240', 'O', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(7, '3939440000085341933', 'طريق الكتابة: أليكساندرا ليفيك', 'the-write-path-alexandra-levick', '413', 'Published to Website', 'Litfest 2025', 8, 'ألكسندرا ليفيك', 'الورش', 'انتركونتيننتال', NULL, 'الرمال', 'الإنجليزية', NULL, '<p>هل تبحثون عن ملاحظات من خبير حول فكرة روايتكم؟ سجلوا الآن للحصول على تقييم مدته 10 دقائق حيث تقدم الوكيلة الأدبية <b>ألكسندرا ليفيك</b> نصائح حول ملخص كتابكم المكون من صفحة واحدة ووصف الغلاف الخلفي الذي لا يتجاوز 50 كلمة. مع سنوات من الخبرة، ستقدم ليفيك رؤى حول إمكانيات فكرتك وتوجيهات مفيدة حول ما يجب التفكير فيه أثناء رحلتك في الكتابة والنشر. <br></p><p><b>ألكسندرا ليفيك</b> مهتمة بكتب الصور، ومجموعة واسعة من أدب الأطفال والشباب، بالإضافة إلى الأعمال الأدبية للبالغين ذات الطابع الخيالي أو الميل نحو الأنواع الأدبية.<br></p><p>هل تبحث عن ملاحظات من خبير حول فكرة روايتك؟سجّل الآن للحصول على تقييم مدته 10 دقائق حيث تقدم وكيلة الأدب ألكسندرا ليفيك نصائح حول ملخص كتابك المكون من صفحة واحدة ووصف الغلاف الخلفي الذي لا يتجاوز 50 كلمة.مع سنوات من الخبرة، ستقدم ليفيك رؤى حول إمكانيات فكرتك وتوجيهات مفيدة حول ما يجب التفكير فيه أثناء رحلتك في الكتابة والنشر.<br></p><p>ألكسندرا ليفيك مهتمة بكتب الصور، ومجموعة واسعة من أدب الأطفال والشباب، بالإضافة إلى الأعمال الأدبية للبالغين ذات الطابع الخيالي أو الميل نحو الأنواع الأدبية.<br></p><p><br></p>', '<p>هل تبحثون عن ملاحظات من خبير حول فكرة روايتكم؟ سجلوا الآن للحصول على تقييم مدته 10 دقائق تقدم فيه الوكيلة الأدبية <b>ألكسندرا ليفيك</b> نصائح حول ملخص كتابكم المكون من صفحة واحدة ووصف الغلاف الخلفي الذي لا يتجاوز 50 كلمة.&nbsp;<br></p>', 'دبي فيستفال سيتي', 'SWORKSHOPS240', 'O', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(8, '3939440000085341299', 'أصوات مابعد الحداثة: حوار الشعر والذات', 'postmodern-prose', '53', 'Published to Website', 'Litfest 2025', 220, 'خالد البدور, أسماء عزايزة', 'الحوارات', 'انتركونتيننتال', NULL, 'البراحة 1', 'العربية', 'اللغة الإنجليزية إلى اللغة العربية; اللغة العربية إلى اللغة الإنجليزية', '<p>تستعد هذه الجلسة الحوارية لاستكشاف عوالم شعر ما بعد الحداثة مع الشاعر <b>خالد البدور</b> والشاعرة <b>أسماء عزايزة</b>، حيث نغوص في نقاشات ثرية ومثيرة. <br></p><p>نكتشف كيف تتمكن هذه الحركة الشعرية من إنتاج أشعار مبتكرة تمزج بين العمق والجمال، كما سنستعرض الطرق التي يعبر بها الشعراء عن تجاربهم ورؤاهم من خلال حوار دائم بين الذات والعالم. يفتح النقاش أمامنا أبواب التأمل في معاني الكلمات وأبعادها العميقة.<br></p><p>كما نسلط الضوء على التحديات التي تواجه شعراء قصيدة النثر في تحدي المعايير التقليدية، مما يجعل هذه الجلسة فرصة مميزة للاحتفاء بجوهر الشعر العربي المعاصر الثري.<br></p>', '<p>انضموا إلى الشاعر <b>خالد البدور</b> والشاعرة <b>أسماء عزايزة</b> في جلسة حوارية مثيرة حول شعر ما بعد الحداثة، حيث نستكشف كيف تدمج هذه الحركة بين العمق والجمال، ونتناول التحديات العديدة التي يواجهها الشعراء. <br></p><p><br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(9, '3939440000092978012', 'الرئيس التنفيذي الجديد: دورة متقدمة مع الدكتور تاي ويجينز', 'the-new-ceo-a-masterclass-with-dr-ty-wiggins', '92', 'Published to Website', 'Litfest 2025', 0, 'تاي ويجينز', 'الورش', 'انتركونتيننتال', NULL, 'الواحة', NULL, NULL, '<p>الأشهر الـ 12-18 الأولى في منصب الرئيس التنفيذي تعتبر الفترة الأكثر حسمًا في مسيرته المهنية. حيث يُحدد فيها الأساس للخطوات الجريئة التي ستعرفه بها الأجيال القادمة. </p><p>انضم إلى <b>كريستوفر بردلي</b> و<b>الدكتور تاي ويجينز</b> من شركة<i> راسل رينولدز أسوسييتس</i> في دورة تدريبية حصرية، لتعلم استراتيجيات التمكن في هذه الفترة الحرجة.</p><p></p><p>مواضيع الدورة:</p><p>1. مخاطر وعوائد انتقالات الرؤساء التنفيذيين: تحليل العوامل الحاسمة.</p><p>2. التحديات غير المتوقعة: كيفية التعامل مع المفاجآت.</p><p>3. أولويات الرؤساء التنفيذيين الجدد: السرعة والتعقل.</p><p>4. دروس عملية من رؤساء تنفيذيين عالميين.</p><p></p><p>يستند هذا البرنامج التدريبي إلى كتاب \"الرئيس التنفيذي الجديد: كيفية البدء بشكل جيد والأداء بسرعة\" لكريس برادلي والدكتور تاي ويجينز، والذي يقدم المسار الداخلي في كيفية تعامل الرؤساء التنفيذيين الرائدين عالميًا مع أول 18 شهرًا من مناصبهم.</p>', '<p>إن الأشهر الـ12 إلى 18 الأولى من حياة الرئيس التنفيذي هي الفترة الأكثر حسمًا خلال فترة وجوده في مسيرته المهنية. انضم إلى الدكتور <b>تاي ويجينز</b>، الرئيس التنفيذي ورئيس قسم التحولات العالمي في شركة راسل رينولدز أسوشيتس لحضور دورة تدريبية حصرية حول كيفية تمكن الرؤساء التنفيذيين من التعامل مع هذه اللحظة المهنية عالية المخاطر.<br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(10, '3939440000092226372', 'مانسيرة: ملحمة شعرية', 'manseera-a-poetic-epic', '251', 'Published to Website', 'Litfest 2025', 80, 'عادل خزام, null, جورج والاس', 'الحوارات', 'انتركونتيننتال', NULL, 'الأمواج', 'العربية والإنجليزية', NULL, 'انضموا إلى\nجلسة استثنائية تجمع الشاعر الإماراتي عادل خزام مع الشاعرة البريطانية فيونا\nسامبسون والشاعر الأمريكي جورج والاس (عبر زووم)، للحديث  حول \"مانسيرة\"، العمل الشعري\nالأحدث الذي يعيد إحياء فن الملحمة بأسلوب معاصر. خلال الجلسة، نستكشف معاني\nالنصوص الشعرية، رحلة الإبداع وراء العمل، وكيف يمكن للشعر أن يربط الثقافات ويعبر\nعن التجربة الإنسانية بعمقها وأبعادها المختلفة.', 'انضموا إلى\nجلسة استثنائية تجمع الشاعر الإماراتي عادل خزام مع الشاعرة البريطانية فيونا\nسامبسون والشاعر الأمريكي جورج والاس (عبر زووم)، للحديث عن \"مانسيرة\"، العمل الشعري\nالأحدث الذي يعيد إحياء فن الملحمة بأسلوب معاصر.', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(11, '3939440000085077945', 'ورشة كشف غموض الخيال التأملي', 'workshop-demystifying-speculative-fiction', '405', 'Published to Website', 'Litfest 2025', 18, 'ماتيو أسكاريبور', 'الورش', 'انتركونتيننتال', NULL, 'الواحة', 'الإنجليزية', NULL, '<p>ما هو الخيال التأملي؟ هل هو ديستوبيا مستقبلية أم أبعاد متوازية أو ربما تاريخ بديل؟ <br></p><p><br></p><p>في هذه الورشة، استعدوا للغوص في العوالم الشاسعة لكتابة الخيال التأملي والتطرق إلى وجهة النظر والبنية وبناء العالم والحوارات وغيرها من التفاصيل.<br></p><p><br></p><p>ورشة مثرية يديرها مؤلف الكتب الأكثر مبيعاً وفقاً لجريدة \"نيويورك تايمز\"، <b>ماتيو أسكاريبور</b>، الحائز على جائزة \"5 تحت 35\" من \"مؤسسة الكتاب الوطنية\".<br></p><p><br></p><p>يُطلعكم أسكاريبور على تفاصيل صياغة روايته الأخيرة، \"هذا النصف العظيم من الكرة الأرضية\"، بطريقة عملية يتخللها تمارين كتابة ومناقشة فعّالة تهدف إلى صقل عملكم الأدبي واستحضار أفكاركم الخاصة.<br></p><p><br></p><p>نرحب بكافة الكُتّاب بمختلف مستويات الخبرة.. اطلقوا العنان لرحلة الإبداع!<br></p>', '<p>يدير مؤلف الكتب الأكثر مبيعاً وفقاً لقائمة جريدة \"نيويورك تايمز\"، <b>ماتيو أسكاريبور</b>، ورشة إبداعية حول الخيال التأملي ويتناول فيها الكاتب وجهة النظر والبنية وبناء العالم والحوارات وغيرها. فرصة مميزة للتعلم ومعرفة تفاصيل حصرية حول رحلة كتابة كتاب \"هذا النصف العظيم من الكرة الأرضية\".<br></p>', 'دبي فيستفال سيتي', 'SWORKSHOPS300', 'P', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(12, '3939440000085077900', 'البدء بالكتابة: معسكر تدريبي للكُتّاب', 'start-writing-boot-camp', '400', 'Published to Website', 'Litfest 2025', 18, 'هارييت جريفي', 'الورش', 'انتركونتيننتال', NULL, 'الأمواج', 'الإنجليزية', NULL, '<p>هل تراودكم فكرة الكتابة ولكنك لا تعرفون من أين أو كيف تبدأون؟ <br></p><p><br></p><p>استعدوا بالمهارات والمعرفة التي تحتاجونها لبدء رحلتكم الإبداعية في ورشة مثرية على مدى يومين مع الناشرة والكاتبة والصحفية <b>هارييت جريفي</b>. في الورشة، تتعلمون طرائق تحويل الإلهام إلى مخطوطة سردية وكيفية استكشاف أسلوبكم الأدبي الخاص. كذلك تتعرفون على عناصر البنية السردية والحبكة وكيفية التواصل مع قصصكم بانسجام تام في كل مرة تكتبون فيها.<br></p><p><br></p><p>هذه الورشة مناسبة للكتّاب المبتدئين الذين يتطلعون إلى تطوير مهارات الكتابة والحفاظ عليها.<br></p>', '<p>هل تراودكم فكرة الكتابة ولكنكم لا تعرفون من أين أو كيف تبدأون؟ <br></p><p><br></p><p>انضموا إلى <b>هارييت جريفي</b> في معسكر تدريبي للكُتّاب على مدى يومين؛ ورشة مصممة خصيصاً للكتّاب المبتدئين في الكتابة والذين يتطلعون إلى بدء رحلتهم الأدبية.<br></p>', 'دبي فيستفال سيتي', 'SWORKSHOPS2000', 'Q', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(13, '3939440000085341854', 'ورشة: فن رسوم المانجا', 'workshop-drawing-manga', '450', 'Published to Website', 'Litfest 2025', 20, 'أسماء الرميثي;', 'الورش', 'انتركونتيننتال', NULL, 'الواحة', 'العربية', NULL, '<p>تأخذنا الفنانة <b>أسماء الرميثي</b>&nbsp;في رحلة مشوّقة إلى عالم فن الكوميك الياباني، حيث تلتقي الإبداع والتقنية في تناغم فريد. </p><p>تُعتبر هذه الجلسة التطبيقية مثالية للفنانيين من مختلف المستويات ومحبي هذا الفن، إذ تقدم نظرة معمقة إلى أساسيات المانجا، بدءاً من تصميم الشخصيات وتعابير الوجه، وصولاً إلى الحركات الديناميكية وسرد القصص البصرية.</p><p>ترافق أسماء المشاركين في كل خطوة، مقدمةً تقنيات مبتكرة لابتكار شخصيات جذابة وإضفاء الحياة على قصصهم. انضموا إلينا لاكتشاف أسرار هذا الفن الرائع، وابدؤوا رحلتكم الإبداعية مع أسماء والاستمتاع بتجربة فريدة من نوعها!!</p><p></p>', '<p>تأخذنا الفنانة <b>أسماء الرميثي</b> في رحلة مشوقة إلى عالم فن الكوميك الياباني، حيث نستكشف تصميم الشخصيات والتعابير، بالإضافة إلى الحركات الديناميكية وسرد القصص البصرية. <br></p><p><br></p>', 'دبي فيستفال سيتي', 'SWORKSHOPS50', 'M', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(14, '3939440000085077972', 'ورشة عمل: فن التحرير', 'workshop-the-art-of-editing', '408', 'Published to Website', 'Litfest 2025', 18, 'فايزة خان', 'الورش', 'انتركونتيننتال', NULL, 'الواحة', 'الإنجليزية', NULL, '<p>لاحظ إرنست همنغواي أن \"الكتابة هي إعادة كتابة\"، إذا كانت مسودتك الأولى هي جمع المواد فإن التحرير وإعادة الصياغة هي الوقت الذي ستحولها فيه إلى قصة. تُقدم <b>فايزة خان</b> في هذه الورشة تمارين عملية تليها ملاحظات مصممة خصيصاً للمشاركين الأفراد. تجمع فايزة خبرتها كمحررة ومرشدة تعمل مع مؤلفين مشهورين والنقاد الأدبيين ومجموعة من دور النشر الدولية، سيتعلم المشاركون في الورشة حيل المهنة التي ستسمح لهم بصياغة قصص أفضل من خلال العمل على أعمالهم الخاصة كمحررين محترفين. <br></p><p><br></p>', '<p>ستساعدكم هذه الورشة مع رئيسة تحرير بلومزبري في الهند السابقة <b>فايزة خان </b>على صقل المسودات وتحويلها إلى قصص لا تشوبها شائبة من خلال التمارين العملية والرؤى الخبيرة المستمدة من مسيرتها المهنية التي استمرت لعقود من الزمن. <br></p><p><br></p>', 'دبي فيستفال سيتي', 'SWORKSHOPS300', 'P', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(15, '3939440000085341800', 'هارشيتا جوبتا: غير محبوب', 'harshita-gupta-unloved', '77', 'Published to Website', 'Litfest 2025', 220, 'هارشيتا جوبتا;', 'بعد النهار في ليل', 'انتركونتيننتال', NULL, 'الراس 3', 'الإنجليزية', NULL, '<p>من منا لم تحطمه الحسرة؟ إنها تجربة مدمرة لكنها عالمية تجعلنا نشعر بالضياع والوحدة. تقدم المذيعة والمؤثرة <b>هارشيتا جوبتا </b>في هذه الجلسة نصائح عملية ورؤى ثاقبة من كتابها الجديد \"غير محبوب\". تناقش جوبتا استراتيجيات لاستعادة قوتكم وإعادة بناء ذاتكم المحطمة واحتضان مستقبل مليء بالوعود، تعلموا كيفية حب الذات من خلال الحسرة ذاتها. لن تحضر جوبتا بمفردها بل ستُحضر كتابها المفعم بالإلهام والإيجابية.وتحاورها <b>أناميكا تشاترجي </b><b><br></b></p><p><br></p>', '<p>تشاركنا <b>هارشيتا جوبتا</b> في هذه الجلسة بعض الأفكار من مذكراتها \"غير محبوب\"، حيث تناقش فيها كيفية استعادة قوتك، إعادة بناء نفسك، واحتضان حب الذات.تحاورها <b>أناميكا تشاترجي</b> في هذا اللقاء العميق والمُلهم.<br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(16, '3939440000085341372', 'قسم الخيال التأملي', 'the-department-of-speculation', '61', 'Published to Website', 'Litfest 2025', 150, 'ماتيو أسكاريبور, ثريا رامكومار', 'الحوارات', 'انتركونتيننتال', NULL, 'الراس 1', 'الإنجليزية', NULL, '<p>تفتح لنا الروايات الخيالية آفاقاً جديدة لمستقبلنا المحتمل، ويمكنها أيضاً أن تدفعنا إلى التفكير في عواقب ما يحدث في العالم الآن. <br></p><p>ينضم كل من <b>ماتيو أسكاريبور</b>، مؤلف كتاب \"هذا النصف العظيم من الكرة الأرضية\"، و<b>ثريا رامكومار</b>، مؤلفة كتاب \"ابتعدت السماء\"،و<b>فادي زغموت</b> (contributor to Arabilioso) إلى فيونا ليندسي لمناقشة أحدث روائعهما الأدبية وكيف أن الأعمال الروائية لها القدرة على معالجة القضايا العرقية والطبقية والهوية والصراع الدائم على السلطة في السياسة بطرق مبتكرة لا نهاية لها. كما يتعمق المتحدثون في متعة الكتابة وإمكانياتها التي تفصح عن المجهول العظيم.<br></p><p><br></p>', '<p>يناقش كل من <b>ماتيو أسكاريبور</b>، مؤلف كتاب \"هذا النصف العظيم من الكرة الأرضية\"، و<b>ثريا رامكومار</b>، مؤلفة كتاب \"ابتعدت السماء\"،و<b>فادي زغموت</b>&nbsp;(contributor to <i>Arabilioso</i>) كيف يمكن استخدام الخيال لمعالجة قضايا اليوم بطرائق مبتكرة لا نهاية لها تحاورهم&nbsp;<b>فيونا ليندسي</b><br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(17, '3939440000085077990', 'ورشة عمل: بناء منصة المؤلف', 'workshop-build-your-author-platform', '410', 'Published to Website', 'Litfest 2025', 18, 'أليسون ويليامز;', 'الورش', 'انتركونتيننتال', NULL, 'الواحة', 'الإنجليزية', NULL, '<p>ربما سمعتم أن امتلاك منصة قوية للمؤلف أمر مهم، ولكن كيف تبنون منصتكم دون قضاء كل وقتكم في الكتابة على وسائل التواصل الاجتماعي؟ تشرح المحررة<b> أليسون ويليامز</b> في هذه الورشة عن أهمية بناء منصة للمؤلف وكيفية تنفيذها: من تحديد الأسلوب الأدبي أو التجاري الخاص وتحديد الجمهور المستهدف إلى ترسيخ صوتكم وتحديد قنوات التسويق المناسبة لعملكم. ستغادرون ومعكم خطة لبناء منصة مستدامة في حياتكم اليومية للكتابة لمساعدتكم على التواصل مع مجتمع القراء والحصول على النشر وزيادة مبيعات الكتب. <br></p><p><br></p>', '<p>انضموا إلى المحررة <b>أليسون ويليامز</b> لحضور ورشة تدريبية عن بناء منصة للمؤلف وتغطية الجمهور المستهدف وتحديد صوتكم الأدبي واختيار قنوات التسويق للتواصل مع القراء ودفع المبيعات. <br></p>', 'دبي فيستفال سيتي', 'SWORKSHOPS300', 'P', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(18, '3939440000085341236', 'إيل ماكنيكول: رومانسية المدينة الصغيرة', 'elle-mcnicoll-love-joy-big-hearted-stories', '46', 'Published to Website', 'Litfest 2025', 80, 'إيل ماكنيكول', 'الفعاليات العائلية', 'انتركونتيننتال', NULL, 'الأمواج', 'الإنجليزية', NULL, '<p>تتحدث <b>إيل ماكنيكول&nbsp; </b>​مع <b>لالين سوخيرا&nbsp;</b> عن روايتها الجديدة \"البعض يفضلها باردة\"، وهي قصة مرحة وكبيرة القلب عن بلوغ سن الرشد. تدور أحداث الرواية حول بطلة تعاني من اضطراب عصبي، وتكون عازمة على العودة إلى بلدتها الصغيرة لآخر مرة قبل أن تغادرها إلى الأبد. <br></p><p><br></p><p>لا تراهن شخصية جاسبر مونتغمري على إفساد خطوبة شقيقته عن طريق الخطأ أو الاصطدام بخصمها القديم، صانع الأفلام الناشئ آرثر لانكستر. ولكن مع ظهور العلاقات القديمة وتصاعد التوترات في البلدة الصغيرة، تبدأ شخصية معينة من عشاق السينما في الظهور كسبب كبير للبقاء.<br></p><p><br></p><p>انضموا إلى الكاتبة وهي تتحدث عن الأدب الرومانسي والكتابة عن التوحد وأهمية تمثيل الجميع بشكل شامل.<br></p><p><br></p>', '<p>انضموا إلى الكاتبة الاسكتلندية <b>إيل ماكنيكول</b>، مؤلفة الكتب الأكثر مبيعاً والحائزة على العديد من الجوائز، في مناقشة روايتها \"البعض يفضلها باردة\"، التي تتناول قصة رومانسية مليئة بالعواطف، مع بطلة عصبية غير تقليدية.&nbsp;<br></p><p><br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(19, '3939440000085077918', 'ورشة بناء شخصيات قابلة للتصديق', 'workshop-creating-believable-characters', '402', 'Published to Website', 'Litfest 2025', 18, 'كلير ماكنتوش', 'الورش', 'انتركونتيننتال', NULL, 'الواحة', 'الإنجليزية', NULL, '<p>ما الذي يجعل الشخصية لا تُنسى؟ <br></p><p>تعرّفوا على طرائق صياغة شخصيات ثلاثية الأبعاد مع مؤلفة روايات الجريمة الأكثر مبيعاً، وفقاً لصحيفة \"نيويورك تايمز\" ولصحيفة \"صنداي تايمز\"، كلير ماكنتوش. ألفت كلير عدة كتب من أهمها: \"تركتك ترحلين\" و\"أراك\" و\"دعني أكذب\"<br></p><p>تكشف الكاتبة في هذه الورشة العملية كيفية بناء شخصيات بطولية وشريرة معقدة وذات أبعاد حقيقية! نتعلم أيضاً كيفية إضفاء الحيوية على الشخصيات التي نختارها وأهم العيوب والمميزات والصراع الذاتي ودوافعه.كما نتعرّف على ضرورة ألا يكون الأبطال محبوبين دائماً ولماذا يمكن أن يكون للأشرار مواقف مبهمة.<br></p><p>هذه الورشة مخصصة لكافة الكُتّاب من المبتدئين إلى الخبراء.<br></p><p><br></p>', '<p>تعلموا طرائق بناء شخصيات ثلاثية الأبعاد ومكتملة في هذه الورشة العملية مع مؤلفة الكتب الأكثر مبيعاً،<b> كلير ماكنتوش</b>. هذه الورشة مثالية للكتّاب في جميع مراحل حياتهم المهنية.<br></p>', 'دبي فيستفال سيتي', 'SWORKSHOPS300', 'P', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(20, '3939440000085341827', 'كيلي كلانسي: اللعب بالواقع', 'kelly-clancy-playing-with-reality', '81', 'Published to Website', 'Litfest 2025', 150, 'كيلي كلانسي', 'بعد النهار في ليل', 'انتركونتيننتال', NULL, 'الراس 1', 'الإنجليزية', NULL, '<p>تقول عالمة الأعصاب والفيزياء <b>كيلي كلانسي</b>: \"كانت الألعاب دائماً تدور حول اكتشاف ذواتنا\".<br></p><p><br></p><p>تكشف كلانسي في كتابها الجديد \"اللعب بالواقع: كيف تُشكل الألعاب عالمنا\" عن أهمية الألعاب ومدى قوتها في التأثير على كيفية تنقلنا في العالم ومكاننا فيه أيضاً.<br></p><p><br></p><p>في حوار مع <b>جوليا ويلر</b> تخبرنا كلانسي عن التأثير الخفي للألعاب عبر التاريخ البشري وتسلط الضوء على كيف يمكن لألعاب الحياة الحديثة أن تشوه تفضيلاتنا وتصنع رغباتنا وتدفعنا إلى مزيد من الاستقطاب.<br></p><p><br></p><p>انضموا إلى كلانسي واستمعوا لإجابتها عن السؤال المثير: هل نلعب الألعاب أم أن الألعاب تلعب بنا؟<br></p>', '<p>تناقش عالمة الأعصاب <b>كيلي</b> <b>كلانسي</b> التأثير الخفي الذي خلفته الألعاب على التاريخ البشري، بدءاً من الأوقات الماضية الممتعة إلى شن الحروب وظهور الذكاء الاصطناعي.<br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(21, '3939440000085341489', 'كلمات بدائية', 'primal-words', '74', 'Published to Website', 'Litfest 2025', 80, 'صفية سنكلير, خيراني باروكا, دانابيل جوتيريز', 'الحوارات', 'انتركونتيننتال', NULL, 'الأمواج', 'الإنجليزية', NULL, '<p>تكتب الشاعرة الإندونيسية <b>خيراني باروكا</b>، مؤلفة كتاب \"أموك\"، قصائد جذرية عن الغضب والصلاة تشير إلى المقاومة غير المنحازة للغات القائمة والشعوب الصامدة. <br></p><p>تكتب الشاعرة المقيمة في دبي، <b>دانابيل جوتيريز</b>، مؤلفة كتاب \"الكلمة إف\"، عن المهجورين والآباء والمغفرة من خلال عدسة الأنثى.<br></p><p>وتكتب الشاعرة الجامايكية الأمريكية <b>صفية سنكلير</b>، مؤلفة كتاب \"آكل لحوم البشر\"، قصائد كاملة تستكشف التاريخ والعلاقات العرقية والأنوثة والاختلاف والمنفى.<br></p><p>يجتمع هؤلاء الشعراء المعاصرون الثلاثة مع&nbsp;<b>ناتالي حنظل</b> لمناقشة الموضوعات التي توحد أعمالهم الاستثنائية: التاريخ والاستعمار والنزوح والانتماء والأنوثة والذات.<br></p><p><br></p>', '<p>يجتمع ثلاثة شعراء معاصرون بارزون، <b>دانابيل جوتيريز </b>و<b>خيراني باروكا</b> و<b>صفية سنكلير</b>، في محادثة واسعة النطاق حول القوة الاستثنائية للشعر تحاورهم&nbsp;<b>ناتالي حنظل</b><br></p><p><br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(22, '3939440000085077963', 'اعثروا على أصواتكم في الكتابة', 'workshop-finding-your-writers-voice', '407', 'Published to Website', 'Litfest 2025', 18, 'هارييت جريفي', 'الورش', 'انتركونتيننتال', NULL, 'الواحة', 'الإنجليزية', NULL, '<p>كيف من الممكن إيجاد أصواتنا في الكتابة؟ كل كاتب لديه صوت خاص به وهذه الورشة الشاملة تعلمكم كيفية اكتشفاه ورعايته وتطويره. <br></p><p>انضموا إلى الناشرة والكاتبة والصحفية <b>هارييت جريفي</b> وهي تكشف عن هذا الجانب الأساسي من مجموعة أدوات الكاتب؛ حيث ترشدكم لتحديد أصواتكم في الكتابة وفهمها وصقلها جيداً وذلك من خلال مناقشات وتحليل نصوص وتمارين على الكتابة.<br></p><p>هذه الورشة مناسبة لكافة الكُتّاب في أي مرحلة من مشروعهم الكتابي أو حياتهم المهنية.<br></p>', '<p>تعلمكم الناشرة والكاتبة والصحفية <b>هارييت جريفى</b> طرائق تحديد أصواتكم ككتّاب وفهمها وصقلها وهو جانب أساسي من أدوات الكاتب.<br></p>', 'دبي فيستفال سيتي', 'SWORKSHOPS300', 'P', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(23, '3939440000085077954', 'ورشة عمل للمراهقين: خلق عوالم جديدة غريبة', 'teen-workshop-creating-strange-new-worlds', '406', 'Published to Website', 'Litfest 2025', 20, 'فاشتي هاردي', 'الورش', 'انتركونتيننتال', NULL, 'الواحة', 'الإنجليزية', NULL, '<p>انضموا إلى مؤلفة الكتب الأكثر مبيعاً، <b>فاشتي هارفي</b>، مؤلفة \"نورث والوحيدة\" لحضور ورشة ممتعة وتفاعلية للكتابة الإبداعية. <br></p><p>اطلقوا العنان لخيالكم واكتشف إمكانياتكم في بناء عوالم جديدة،واستكشفوا العلاقة بين العوالم البديلة والتجارب الواقعية.استعدوا بتحدي بقواعد الخيال التأملي في بيئة ملهمة وحاضنة للإبداع.تساعدكم هذه الورشة على ابتكار افكار ورؤى جديدة أو التوسع في مفاهيم قصصكم.<br></p><p>لا حاجة لأي خبرة سابقة،فقط احضروا بذهنٍ منفتح وخيال بلا حدود.<br></p><p><br></p>', '<p>ستكشف مؤلفة الكتب الأكثر مبيعاً، <b>فاشتي هاردي</b>، مؤلفة كتاب \"نورث والوحيدة\"، الستار عن إمكانيات بناء عوالم والخيال التأملي في ورشة عن الكتابة الإبداعية لليافعين. <br></p><p><br></p>', 'دبي فيستفال سيتي', 'SWORKSHOPS150', 'N', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(24, '3939440000085341899', 'إيما دابيري: أجساد عاصية', 'emma-dabiri-disobedient-bodies', '89', 'Published to Website', 'Litfest 2025', 150, 'إيما دابيري;', 'بعد النهار في ليل', 'انتركونتيننتال', NULL, 'الراس 2', 'الإنجليزية', 'اللغة الإنجليزية إلى اللغة العربية; اللغة العربية إلى اللغة الإنجليزية', '<p>من صور انستاجرام إلى محاولات تحسين المظهر قد يبدو الضغط الذي نتعرض له لنكون بمظهر معين أشبه بقاعة مملوءة بالمرايات لا يمكن الهروب منها، لكن ماذا سيحدث لو قررنا ببساطة ألا نخضع لمعايير الجمال التقليدية؟ <br></p><p>انضموا إلى الكاتبة والمذيعة والناقدة الثقافية، <b>إيما دابيري</b> مع <b>كلوي بيري </b>لتستمعوا إلى منظور جذري وتمكيني وشخصي عميق نتعلم من خلاله كيف نحب أجسادنا الرائعة والعنيدة والعصية أيضاً!<br></p><p>هذه الجلسة مخصصة لأي شخص يرغب في التحرر من دائرة المنافسة والنزعة الاستهلاكية التي لا نهاية لها، اكتشفوا معنى أن تستعيدوا الجمال بشروطكم الخاصة.<br></p><p><br></p>', '<p>انضموا إلى الكاتبة والمذيعة والناقدة الثقافية <b>إيما دابيري</b> لتتعرفوا على منظور جذري وتمكيني وشخصي عميق حول تصورنا عن أجسادنا واكتشفوا معنى أن تستعيدوا الجمال بشروطكم الخاصة.<br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(25, '3939440000085341435', 'إم جيه أرليدج: فن التشويق', 'mj-arlidge-the-art-of-suspense', '68', 'Published to Website', 'Litfest 2025', 150, 'ماثيو أرليدج (إم جي أرليدج)', 'الحوارات', 'انتركونتيننتال', NULL, 'الراس 3', 'الإنجليزية', NULL, '<p>أمضى <b>إم جيه أرليدج </b>أكثر من عقدين من الزمان ككاتب سيناريو ومنتج تلفزيوني قبل أن يتجه إلى أدب الجريمة، كانت روايته الأولى \"إيني ميني، حادي بادي، حكرة بكرة\" من الروايات الأكثر مبيعاً في المملكة المتحدة في عام 2014 عرّف من خلالها قُرّاءه ببطلة الرواية المفتشة هيلين جريس. أصبحت روايات الجريمة التي ألفها أرليدج معروفة في جميع أنحاء العالم، ولأنه لا يخجل من المناقشات الصريحة فهو يناقش مؤثراته وإلهاماته وأعماله الرائعة عبر الصفحات والشاشات. لا تفوت الفرصة لاكتساب رؤى رائعة عن أسرار كتابته المروعة مع أنابيل كانتاريا.<br></p>', '<p>انضموا إلى مؤلف روايات الجريمة الأكثر مبيعاً <b>إم جيه أرليدج</b> وهو يناقش رحلته من كاتب سيناريو إلى روائي، تعرّفوا على مصادر إلهامه التي جعلته يطلق رواياته المثيرة المظلمة والمحبوبة في جميع أنحاء العالم. <br></p><p><br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(26, '3939440000085250115', 'تريشيا هيرسي: سوف نرتاح!', 'tricia-hersey-we-will-rest', '7', 'Published to Website', 'Litfest 2025', 150, 'تريشيا هيرسي', 'الحوارات', 'انتركونتيننتال', NULL, 'الواحة', 'الإنجليزية', NULL, '<p>ثقافة العمل الشاق حاضرة هنا وهي مروعة! إنها خليط من التوتر والإنهاك وضغط العمل واستخدام الإنترنت طوال اليوم. تستضيف<b>&nbsp;مريم برتوي</b> مؤلفة كتاب \"سوف نرتاح!\" ومؤسسة \"وزارة القيلولة\"، <b>تريشيا</b> <b>هيرسي</b>، والتي تدافع عن قوة الراحة كشكل من أشكال المقاومة ووسيلة للهروب من الصخب. ترفض تريشيا الأنظمة التي تجرد الإنسان من إنسانيته وتسعى لتغيير السيناريو المعهود عن الإنتاجية المستمرة.تدعوكم هذه الأمسية إلى الاسترخاء لاستعادة راحتكم بشروطكم الخاصة،لذا انضموا إلى هيرسي التي ترشدكم خلال تجربة قيلولة تأملية وملهمة لتشارك متعة الراحة الجماعية واستعادة القدرة على \"عدم القيام بشيء\"!<br></p>', '<p>ثقافة العمل الشاق حاضرة هنا وهي مروعة! انضموا إلى مؤسِسة \"وزارة القيلولة\"، <b>تريشيا</b> <b>هيرسي</b>، لتشاركوا في متعة الراحة الجماعية واستعادة القدرة على \"عدم القيام بشيء\"!<br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(27, '3939440000085077891', 'تجربة احتراق الجسد', 'amal-ismail-on-writing-through-trauma', '306', 'Published to Website', 'Litfest 2025', 150, 'أمل إسماعيل;', 'ملتقى الأفكار', 'انتركونتيننتال', NULL, 'خور الأفكار', 'العربية', NULL, '<p>أمل إسماعيل تتحدث ضمن برنامج \"ملتقى الأفكار\" عن تجربتها التي كتبت عنها في كتابها الصادر قريباً جداً بعنوان \"تجربة احتراق الجسد\". <br></p><p><br></p><p>تدور القصة حول حادثة انفجار قدر الضغط أثناء طهيها لزوجها وبناتها الثلاثة في عام 2022، مما تسبب لها بحروق من الدرجة الثانية والثالثة في الجزء العلوي من جسدها. وبعد خطأ طبي، تعرضت أمل، الشاعرة والمترجمة الفلسطينية المقيمة في دولة الإمارات العربية المتحدة، لتجربة قاسية استمرت عاماً من العلاج المكثف. اليوم، تشاركنا أمل هذه التجربة في إطار قصصي ساخر، كما هو معتاد منها – فهي حكاءة من الطراز الرفيع.<br></p>', '<p>تحدثنا الكاتبة أمل إسماعيل عن موضوع كتابها الأخير، الذي يمثل تجربة شخصية حساسة تتناول تفاصيل حادثة تعرضت لها، حيث انفجر قدر الضغط أثناء طهيها، مما أدى إلى إصابتها بحروق بليغة. <br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(28, '3939440000085341471', 'ريهان خان: صعود الإمبراطوريات وسقوطها', 'rehan-khan-the-rise-and-fall-of-empires', '72', 'Published to Website', 'Litfest 2025', 80, 'ريحان خان;', 'الحوارات', 'انتركونتيننتال', NULL, 'الأمواج', 'الإنجليزية', NULL, '<p>\"مقبرة الإمبراطوريات\" هي رواية تاريخية مثيرة تدور أحداثها في عام 90 قبل الميلاد في عالم قديم تشكله الطموحات القاسية والعنف ونزوات القدر المتقلبة. </p><p>تتشابك هذه القصة الملحمية مع قصص الزعيم وأمير العرب الأنباط الذي يحكم طريق التوابل من عدن إلى غزة، وأبولونيا، ابنة إمبراطور قوي، والجنرال تشاو، الذي لا يُقهر في جيش الهان الصيني، في مهمة محفوفة بالمخاطر لرسم الطريق غرباً إلى البحر المتوسط</p><p>يناقش الكاتب<b> ريحان خان</b>&nbsp; مع&nbsp;<b>كريستوفر بردلي</b> هذه القصة عن الأعمال البطولية والمعارك الشرسة.</p><p></p>', '<p>يناقش الكاتب الشهير <b>ريحان خان</b>&nbsp;مع <b>كريستوفر بردلي</b> ملحمته الخيالية التاريخية، \"قبر الإمبراطوريات\"، التي تدور أحداثها في عالم قديم تشكله الثقافات المتضاربة والطموح القاسي وتقلبات الأقدار. <br></p><p><br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(29, '3939440000085341426', 'النقطة الزرقاء: البيئات والنظم البيئية', 'the-blue-dot-environments-and-ecosystems', '67', 'Published to Website', 'Litfest 2025', 150, 'هيلين تشيرسكي, جو رومان', 'الحوارات', 'انتركونتيننتال', NULL, 'الراس 3', 'الإنجليزية', NULL, '<p>إن فهم تشكيل الأنظمة البيئية لعالمنا المادي يمكن أن يسلط الضوء على مكاننا فيه ويساعدنا في تجنب الكوارث البيئية. <br></p><p>انضموا إلى حوار يوسّع مدارك العقل يجمع بين عالمة الفيزياء <b>هيلين تشيرسكي</b>، مؤلفة كتاب \"الآلة الزرقاء: كيف تُشكل المحيطات العالم\"،&nbsp; وعالم الأحياء <b>جو رومان</b>، مؤلف كتاب \"كل، تغوّط، مت: كيف تصنع الحيوانات العالم\" مع <b>أمانديب بهانجو</b> ،لننغمس في أعماق المحركات التي تحرك العالم الطبيعي،من قوة المحيطات المذهلة إلى الديناميكيات المعقدة للحياة الحيوانية.<br></p><p>تُقدّم هذه الجلسة رؤى عميقة حول قصة الحياة على الأرض وتكشف كيف تشكل هذه الأنظمة غير العادية كوكبنا وحياتنا.<br></p><p><br></p>', '<p>تخوض عالمة الفيزياء <b>هيلين تشيرسكي</b>، مؤلفة كتاب \"الآلة الزرقاء: كيف تُشكل المحيطات العالم\"،&nbsp; وعالم الأحياء <b>جو رومان</b>، مؤلف كتاب \"كل، تغوّط، مت: كيف تصنع الحيوانات العالم\" تجربة عميقة في المحركات التي تحرك العالم الطبيعي.<br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(30, '3939440000084859002', 'تشيجوزي أوبيوما: الطريق إلى البلاد', 'chigozie-obioma-the-road-to-the-country', '42', 'Published to Website', 'Litfest 2025', 150, 'تشيجوزي أوبيوما;', 'الحوارات', 'انتركونتيننتال', NULL, 'الراس 3', 'الإنجليزية', NULL, '<p><span class=\"highlight\" style=\"background-color:transparent\"><b>تشيجوزي أوبيوما </b>هو روائي حائز على جائزة \"البوكر\" العالمية مرتين عن كتابيه \"الصيادون\" و\"أوركسترا المغلوبين\". يتحدث أوبيوما في كتابه الثالث، \"الطريق إلى البلاد\"، عن قصة شاب يبحث عن أخيه على خلفية الحرب الأهلية النيجيرية في الستينيات. ينضم أوبيوما إلى <b>فايزه خان</b> للحديث عن تحفته الفنية الحديثة التي وصفتها مجلة \"ذا نيويورك تايمز\" بأنها: \"رواية روحانية ومؤثرة تشعل القلب بالحماسة\"، أما مجلة \"مراجعة شيكاغو للكتب\" وصفتها بأنها: \"شهادة قوية على أهمية القصص: القصص التي حدثت في الماضي والقصص التي نصنعها لأنفسنا والقصص التي تركناها خلفنا\".</span><br></p>', '<p><span class=\"highlight\" style=\"background-color:transparent\"><span class=\"colour\" style=\"color:rgb(0, 0, 0)\">يناقش الروائي <b>تشيجوزي أوبيوما</b>، الحائز على جائزة \"البوكر\" العالمية مرتين، أحدث روائعه \"الطريق إلى البلاد\" وهي قصة عميقة لرجل يبحث عن شقيقه خلال الحرب الأهلية النيجيرية في الستينيات.</span></span><br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(31, '3939440000085341381', 'جولي مين: سكان شنغهاي', 'juli-min-shanghailanders', '62', 'Published to Website', 'Litfest 2025', 150, 'جولي مين', 'الحوارات', 'انتركونتيننتال', NULL, 'الراس 1', 'الإنجليزية', NULL, '<p>حوار شيق يجمع الصوت الجديد في عالم الأدب الكاتبة الكورية الأمريكية، <b>جولي مين</b>، مع <b>جوليا ويلر </b> لمناقشة روايتها سريعة الوتيرة \"سكان شنغهاي\"؛ تدور أحداث الرواية حول التغيرات التي طرأت على ثروات عائلة من شنغهاي نتيجة الاضطرابات العالمية. تروي مين قصتها من خلال تسلسل زمني عكسي، حيث تبدأ أحداث الرواية في عام 2040 ثم تمر بحاضرنا وتنتهي بأخذنا إلى الماضي القريب. تتناول رواية \"سكان شنغهاي\" وقائع قاسية عن الصين المعاصرة وتمثل صورة مبهرة عن عائلة تصنع نفسها ثم تنهض بعد سقوطها، تحمل هذه الرواية في طياتها قصة مؤثرة عن الحب والأسرار وما يدور في المنزل والشعور بالانتماء.</p>', '<p>استمعوا إلى قصة الرواية الأولى للكاتبة <b>جولي</b> <b>مين</b>، \"سكان شنغهاي\"، وهي رواية سريعة الوتيرة تحمل في طياتها وقائع قاسية عن الصين المعاصرة وصورة مبهرة لعائلة تصنع نفسها وتنهض بعد سقوطها عبر السنين.<br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(32, '3939440000085341335', 'دانيال هاندلر: وبعد ذلك؟ وبعد ذلك؟ ماذا أيضاً؟', 'daniel-handler-and-then-and-then-what-else', '57', 'Published to Website', 'Litfest 2025', 200, 'دانيال هاندلر المعروف باسم ليموني سنيكيت;', 'الحوارات', 'انتركونتيننتال', NULL, 'البراحة 3', 'الإنجليزية', NULL, '<p>انضموا إلى مؤلف الكتب الأكثر مبيعاً <b>دانيال هاندلر، المعروف باسم ليموني سنيكيت</b> في حوار مع<b> (اسم مدير الجلسة)</b>، إذ يروي التقلبات والمنعطفات في حياته المهنية في الكتابة ويناقش مذكراته الجديدة \"وبعد ذلك؟ وبعد ذلك؟ ماذا أيضاً؟\"، تمثل هذه المذكرات رسالة حب إلى القوة المواسية والمرعبة للكتب. <br></p><p><br></p><p>تتبع أحدث أعمال هانلدر حياته من خلال مجموعة شعرية وفرق تمثيل غريبة ورحلات سيارات الأجرة في منتصف الليل ومحلات بيع الكتب المستعملة ووحدات الطب النفسي، ويُقدم هاندلر استكشافاً غريباً ومؤثراً للقراءة والكتابة وعن سبب روايتنا للقصص.<br></p><p><br></p><p>لا تفوتوا فرصة الاستمتاع بأسلوبه الذكي والبارع وقضاء أمسية مسلية وغريبة مع واحد من أكثر الشخصيات المحبوبة اليوم في عالم الأدب.<br></p>', '<p>في واحدة من أبرز فعاليات مهرجان طيران الإمارات للآداب يظهر<b> دانيال هاندلر، المعروف باسم ليموني سنيكيت</b>، في لقاء حصري لمناقشة مذكراته المسلية والمؤثرة بشكل غريب، \"وبعد ذلك؟ وبعد ذلك؟ ماذا أيضاً؟\".<br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(33, '3939440000085250179', 'ركن الكتّاب: الكتابة للشاشة', 'writers-corner-screenwriting-101', '14', 'Published to Website', 'Litfest 2025', 80, 'ماثيو أرليدج (إم جي أرليدج);', 'الحوارات', 'انتركونتيننتال', NULL, 'الأمواج', 'الإنجليزية', NULL, '<p>ما الفرق بين كتابة رواية وكتابة سيناريو؟ وكيف تختلف الكتابة لمسلسل تلفزيوني قائم عن إنشاء حلقة تجريبية أصلية؟ ما هي العناصر التي تجعل السيناريو مميزاً عن غيره؟ وما الذي ينبغي أن تعرفوه حول بدء مسيرتكم في كتابة السيناريو وسط بيئة تلفزيونية مليئة بالتحديات؟ الكاتب المحترف في مجال السيناريو <b>إم جيه أرليدج</b> يكشف أسرار هذا المجال، ويقدم نصائح عملية وتوجيهات لكل من لديه شغف بالكتابة للشاشة. انضموا إليه في جلسة عرض توضيحية شاملة تليها جلسة أسئلة وأجوبة موسّعة مع الجمهور.<br></p>', '<p>الخبير في كتابة السيناريو <b>إم جيه أرليدج </b>يستعرض الفرق بين كتابة الرواية والسيناريو، وكيفية ابتكار حلقات تجريبية أصلية، وأسرار التميز في مشهد التلفزيون الحالي. جلسة مليئة بالرؤى والنصائح العملية، تليها جلسة أسئلة وأجوبة موسّعة مع الجمهور. <br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(34, '3939440000094213065', 'بريق نجم', 'a-star-sparkle', '288', 'Published to Website', 'Litfest 2025', 35, 'شيخة الزيارة', 'الفعاليات العائلية', 'انتركونتيننتال', NULL, 'الواحة', 'العربية', NULL, '<p>انضموا إلى الكاتبة <b>شيخة الزيارة</b> في جلسة قرائية مليئة بالخيال والإبداع من خلال قصتها الجميلة <i>\"بريق نجم\"</i>. في هذه الجلسة، سيأخذ الأطفال وعائلاتهم رحلة ساحرة مع بطل القصة الذي يكتشف عالماً يعتمد على التكنولوجيا والأجهزة التي تسهل الحياة، لكن هذه الراحة الزائفة قد تجعلهم ينسون قيمة العمل والجهد الحقيقي.</p><p>القصة تطرح موضوعات هامة حول أهمية العلاقات الإنسانية، نعمة الحواس، وكيف يمكن للتكنولوجيا أن تشغلنا عن تقدير ما هو مهم في حياتنا. ستكون الجلسة فرصة للأطفال للتفاعل مع القصة من خلال نشاطات وألعاب ممتعة، حيث سيتعلمون عبر اللعب قيم التعاون والاهتمام بالعلاقات البشرية.</p><p>لا تفوتوا هذه الفرصة لقضاء وقت ممتع وتعليمي مع العائلة، واستمتعوا بمغامرة شيقة</p><p></p>', '<p>انضموا إلى الكاتبة <b>شيخة الزيارة</b> في جلسة قرائية مليئة بالخيال والإبداع من خلال قصتها الجميلة <i>\"بريق نجم\"</i>. في هذه الجلسة، سيأخذ الأطفال وعائلاتهم رحلة ساحرة مع بطل القصة الذي يكتشف عالماً يعتمد على التكنولوجيا والأجهزة التي تسهل الحياة، لكن هذه الراحة الزائفة قد تجعلهم ينسون قيمة العمل والجهد الحقيقي.<br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(35, '3939440000085341890', 'هانو سوير: اختراع الخير والشر', 'hanno-sauer-the-invention-of-good-and-evil', '88', 'Published to Website', 'Litfest 2025', 220, 'هانو سوير', 'بعد النهار في ليل', 'انتركونتيننتال', NULL, 'الأمواج', 'الإنجليزية', NULL, '<p>من أين تأتي قيمنا؟ ما هو أصل الصواب والخطأ والخير والشر؟ وكيف تتطور الأخلاق في العالم الحديث؟ <br></p><p><br></p><p>انضموا إلى الفيلسوف <b>هانو</b> <b>سوير</b> مع<b> ريحان خان&nbsp;</b>لإلقاء نظرة ثاقبة على بعض أهم التغيرات الأخلاقية التي شكلت التاريخ البشري.<br></p><p><br></p><p>يسلط سوير الضوء على القيم الأساسية التي تشكل مجتمعاتنا وكيف ابتكرت البشرية مفاهيم الخير والشر ثم تعيد ابتكارها بمرور الوقت والسبب لتحول الفلسفة من كونها مجردة إلى الأمور التي تُشكل مدننا وقوانيننا وحياتنا.<br></p>', '<p>كيف تطور مفهوم الأخلاق بمرور الوقت؟ <br></p><p><br></p><p>انضموا إلى الفيلسوف <b>هانو</b> <b>سوير</b> لإلقاء نظرة ثاقبة على اللحظات التاريخية التي غيرت فهمنا الحديث لـ\"الخير\" و \"الشر\".<br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(36, '3939440000085341480', 'ركن الكتّاب: كيف تحصل على وكيل أدبي؟', 'writers-corner-how-to-get-a-literary-agent', '73', 'Published to Website', 'Litfest 2025', 80, 'لويجي بونومي', 'الحوارات', 'انتركونتيننتال', NULL, 'الأمواج', 'الإنجليزية', NULL, '<p>ما الخطوة التي تلي كتابة المخطوطة؟ يُجيبكم في هذه الجلسة المليئة بالمعلومات الوكيل الأدبي <b>لويجي بونومي </b>على بعض الأسئلة الأكثر شيوعاً من المؤلفين الذين يتطلعون إلى تمثيل أعمالهم الأدبية، مثل: كيف تتعاملون مع وكيل؟ ما الذي يجعل المخطوطة تجذب انتباه الوكيل بين العديد من الوكلاء الآخرين؟ ما الذي يمكن للوكيل الجيد فعله ولا يمكنكم أنتم القيام به؟ ستعملون على كتابة خطاب تقديم وتتعلمون كيفية صياغة ملخص مقنع وتكتشفون بالضبط ما يجب أن ترفقه في الرسالة الموجهة للوكيل الأدبي. سيكون هناك متسع من الوقت للتمارين المصممة خصيصاً بالإضافة إلى فرصة لطرح أسئلتكم الأكثر إلحاحاً على بونومي. <br></p><p><br></p>', '<p>انضموا إلى الوكيل الأدبي <b>لويجي بونومي</b> في جلسة مليئة بالمعلومات عن تأمين التمثيل الأدبي، بما في ذلك النصائح حول كيفية التعامل مع الوكلاء وصياغة رسائل مقنعة وتحسين خطاب التقديم والملخص. <br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(37, '3939440000093978552', 'الشاهد - كيف للأمة أن تصنع مستقبلها', 'witness-how-a-nation-creates-its-own-future', '98', 'Published to Website', 'Litfest 2025', 200, 'نجيب محمد العلي', 'الحوارات', 'انتركونتيننتال', NULL, 'البراحة 2', NULL, NULL, '<p>انضم إلينا في حدث استثنائي للاحتفال بنشر كتاب \"شاهدكيف تبني الأمة مستقبلها\" الذي يروي رحلة الإمارات العربية المتحدة الاستثنائية. </p><p>تعرف على القيادة الحكيمة للشيخ <b>زايد</b>، الأب المؤسس، الذ ي شكلت قيمه الدائمة ماضي الأمة وحاضرها ومستقبلها واكتشف تحول الإمارات العربية المتحدة من خلال عدسة إكسبو 2020 دبي، وكيف يربط هذا الحدث التاريخي التاريخ بالمستقبل، ويعكس ابتكار الأمة وتأثيرها العالمي، تحت رعاية معالي الشيخ نهيان مبارك آل نهيان.</p><p></p><p>انضم إلى المحادثة حيث يناقش المشاركون إرث الإمارات العربية المتحدة في التعليم والثقافة والتسامح، وقصتها الرائعة للتقدم على مدى السنوات الخمسين الماضية.</p>', '<p>انضم إلينا للاحتفال بنشر كتاب \"شاهد: كيف تبني الأمة مستقبلها\"، والذي يستكشف رحلة دولة الإمارات العربية المتحدة نحو الرؤية والابتكار، وتراثها الغني ومستقبلها الحيوي.<br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(38, '3939440000087321155', 'ألف ليلة وليلة من الحكايا', 'a-thousand-and-one-nights-of-stories', '198', 'Published to Website', 'Litfest 2025', 200, 'واسيني الأعرج', 'الحوارات', 'انتركونتيننتال', NULL, 'البراحة 1', 'العربية', 'اللغة الإنجليزية إلى اللغة العربية; اللغة العربية إلى اللغة الإنجليزية', '<p>يشاركنا البروفيسور <b>واسيني الأعرج</b> رحلته الفريدة في عالم الرواية والأدب. سنستمع إلى حكاياته عن مسيرته كروائي، وكيف تأثرت أعماله بمزيج من التراث العربي والحداثة الأدبية. <br></p><p>من خلال هذه الجلسة، يكشف واسيني الأعرج عن كواليس إبداعه، وتطور أسلوبه السردي الذي يمزج بين الحكايات القديمة ورؤى معاصرة تعكس واقع الإنسان وتحدياته.<br></p><p>ستكون هذه فرصة لاكتشاف العوالم التي بناها الكاتب في رواياته، وكيف استطاع نسج قصص تأخذ القراء في رحلة عميقة إلى عوالم مليئة بالخيال والتأمل<br></p>', '<p>يشاركنا البروفيسور<b> واسيني الأعرج</b> رحلته الفريدة في عالم الرواية والأدب. سنستمع إلى حكاياته عن مسيرته كروائي، وكيف تأثرت أعماله بمزيج من التراث العربي والحداثة الأدبية. <br></p><p><br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(39, '3939440000085341363', 'من الألم إلى الهدف', 'from-pain-to-purpose', '60', 'Published to Website', 'Litfest 2025', 150, 'كلير ماكنتوش, جيسامي هيبرد', 'الحوارات', 'انتركونتيننتال', NULL, 'الراس 1', 'الإنجليزية', NULL, '<p>الحياة مليئة بالتجارب المروعة وهذا أمر لا يمكننا إنكاره. </p><p></p><p>في لقاء يجمع <b>كلير ماكنتوش</b>، مؤلفة كتاب \"أعدك لن يؤلمك دائماً كهذه المرة\"، <b>وجيسامي هيبرد</b>، مؤلفة \"كيف تتغلب على الصدمة النفسية وتجد نفسك مرة أخرى\"، وتحاورهم <b>أمنديب بهانجو</b>&nbsp;للحديث عن الأوقات الصعبة والعيش من بعدها.</p><p></p><p>يقدم ضيوفنا الثلاثة نصائح رحيمة وحكيمة وصادقة عن كيفية تجاوز أصعب أوقاتنا عن طريق علم النفس وعلم الأعصاب وتجاربهم الخاصة في الحزن والتشافي.كما سنعرف كيف يمكن للصدمة أن تكون حافزاً لإعادة تقييم قيم الحياة واكتشاف منظور جديد للمعنى.</p><p></p>', '<p>يستعين كل من&nbsp;<b>كلير ماكنتوش</b> و<b>جيسامي هيبرد</b> بالتحليل المتخصص وتجاربهم الشخصية في الصدمات والصعوبات لتقديم نصائح رحيمة وحكيمة وصادقة عن كيفية تجاوز أحلك الأوقات التي نعيشها.<br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(40, '3939440000085341146', 'مستقبل المدن: قصص من المدينة', 'urban-reality-stories-from-the-city', '35', 'Published to Website', 'Litfest 2025', 150, 'رنا المطوع, ستيف موشين, ديس فيتزجيرالد', 'الحوارات', 'انتركونتيننتال', NULL, 'الراس 1', 'الإنجليزية', NULL, '<p>كيف ينبغي أن تبدو مدينة المستقبل؟ وما الذي يمكننا فعله لتحويل أحلامنا الطموحة في التصميم الحضري إلى حقيقة؟ في حوار حيوي ومثير للتفكير، يجيب<b> ديس فيتزجيرالد</b>، مؤلف كتاب \"مدينة اليوم هي شيء يحتضر\"، و<b>رنا المطوع</b>، مؤلفة كتاب \"الحياة اليومية في المدينة المذهلة\"، و<b>ستيف موشين،</b> مؤلف كتاب \"فائق البرية\"، مع&nbsp;<b>غيث عبدالله</b>&nbsp;عن أسئلة تتعلق بالمنزل والانتماء والتكيف والمرونة من خلال المنظور الحضري. <br></p><p>ينظر هؤلاء المفكرون الحالمون إلى ماضي الحياة الحضرية وحاضرها ومستقبلها ويقدمون ثلاثة وجهات نظر مختلفة للغاية عن معنى العيش في مدينة.<br></p>', '<p>يجتمع <b>ديس فيتزجيرالد</b>، مؤلف كتاب \"مدينة اليوم هي شيء يحتضر\"، و<b>رنا المطوع</b>، مؤلفة كتاب \"الحياة اليومية في المدينة المذهلة\"، و<b>ستيف موشين</b>، مؤلف كتاب \"فائق البرية\"، للنظر في ماضي الحياة الحضرية وحاضرها ومستقبلها.<br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(41, '3939440000085341453', 'سُلطة الذكاء الاصطناعي', 'the-authority-of-artificial-intelligence', '70', 'Published to Website', 'Litfest 2025', 150, 'كيلي كلانسي, أنيل أنانثاسوامي', 'الحوارات', 'انتركونتيننتال', NULL, 'الراس 3', 'الإنجليزية', NULL, '<p>نحن نعيش في ثورة؛ حيث يشارك الذكاء الاصطناعي بشكل متزايد في اتخاذ القرارات التي تغير الحياة مثل الموافقة على القروض المصرفية أو حتى تحديد نوع الورم إذا كان سرطانياً أم لا! ولكن هل يمكننا الوثوق بسُلطة الآلات؟ تماماً كما نثق بالمديرين الماليين أو الأطباء؟ <br></p><p>في حوار يجمع الصحفي العلمي <b>أنيل أنانثاسوامي</b>، مؤلف كتاب \"لماذا تتعلم الآلات؟\"، وعالمة الأعصاب <b>كيلي كلانسي</b>، مؤلفة كتاب \"اللعب بالواقع\"، <b>&nbsp;</b>مع <b>أمانديب بهانجو </b>، لمناقشة التبعات العملية والأخلاقية لتعلم الآلات والأسئلة الوجودية التي قد تنشأ نتيجة الإجابات المقدمة من الذكاء الاصطناعي.<br></p><p>تنتظركم مناقشة مفعمة بالحيوية والإثارة حول موضوع له آثار بعيدة المدى على مستقبلنا جميعاً.<br></p>', '<p>هل يمكننا الوثوق بالذكاء الاصطناعي؟ يناقش كل من الصحفي العلمي <b>أنيل أنانثاسوامي</b>، مؤلف كتاب \"لماذا تتعلم الآلات؟\"، وعالمة الأعصاب <b>كيلي كلانسي</b>، مؤلفة كتاب \"اللعب بالواقع\"،&nbsp; يحاورهم&nbsp;<b>أمانديب بهانجو </b>&nbsp;علي العواقب المترتبة نتيجة ثقتنا بالآلات.<br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(42, '3939440000085341218', 'نجوى ذبيان: الثابت الوحيد', 'najwa-zebian-the-only-constant', '44', 'Published to Website', 'Litfest 2025', 150, 'نجوى ذبيان', 'الحوارات', 'انتركونتيننتال', NULL, 'الراس 2', 'الإنجليزية', 'اللغة الإنجليزية إلى اللغة العربية; اللغة العربية إلى اللغة الإنجليزية', '<p>كيف نتعامل مع التغيرات الصغيرة والكبيرة في حياتنا بشكل أفضل؟ <br></p><p><br></p><p>ترشدنا الكاتبة والمعلمة<b> نجوى ذيبان</b> في كتابها \"الثابت الوحيد\" نحو التغييرات التي يجب أن نتخذها، أو تلك التي نحتاج إلى تحمُّلها، في رحلة لحياة أكثر أصالة.<br></p><p><br></p><p>يمثل كتاب \"الثابت الوحيد\" رسالة مؤثرة لتقبل ذواتنا كما هي؛ حيث يجمع الكتاب بين السرد الشخصي والنصائح العلمية لمساعدتنا في العثور على طريقنا من خلال فوضى الحياة. انضموا إلى نجوى ذيبان مع <b>أناميكا تشاترجي </b> في نقاش حول كيفية العثور على الجمال في ظل الريبة وكيف لاحتضان التغيير القدرة على وضعنا في طريق لبناء الحياة التي نحلم بها.<br></p>', '<p>تصعد الكاتبة والمعلمة الشهيرة<b> نجوى ذبيان</b> إلى المسرح لتقدم نصائح قيّمة حول كيفية التعامل مع التغيرات التي يجب أن نتخذها أو تلك التي نحتاج إلى تحمُّلها في رحلة لحياة أكثر أصالة.<br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(43, '3939440000085341191', 'صفية سنكلير: مذكرات جامايكية', 'safiya-sinclair-a-jamaican-memoir', '40', 'Published to Website', 'Litfest 2025', 150, 'صفية سنكلير', 'الحوارات', 'انتركونتيننتال', NULL, 'الراس 2', 'الإنجليزية', 'اللغة الإنجليزية إلى اللغة العربية; اللغة العربية إلى اللغة الإنجليزية', '<p>انضموا إلى الكاتبة <b>صفية سنكلير</b> في حوار مع<b> حفصة لودي&nbsp;</b> للاحتفال بنشر كتابها الجديد \"كيف تقول بابل: مذكرات جامايكية\". تم ادراج كتابها المبهر في القائمة المختصرة لـ\"جائزة المرأة للكتب غير الخيالية\" لعام 2024؛ ويستكشف الكتاب طفولة سنكلير في عائلة راستافارية منعزلة وأبوية صارمة حيث كان من المتوقع أن تكون سنكلير فتاة مطيعة وصامتة وخاضعة للأوامر وراضية بالعيش في عزلة شبه كاملة عن العالم الخارجي. <br></p><p>تتناول هذه المذكرات الرائعة مواضيع مثل الحرية والهوية والقوة التحويلية للأدب والشعر، بالإضافة إلى أنها تروي ببراعة كفاح سنكلير للتحرر من نشأتها الصارمة والتنقل في العالم بشروطها الخاصة.<br></p>', '<p>تنتظركم على المسرح الكاتبة المرشحة لـ\"جائزة المرأة للكتب غير الخيالية\"، <b>صفية سنكلير</b>، لمناقشة كتابها \"كيف تقول بابل\" إذ نستكشف من خلال مذكراتها المبهرة مواضيع مثل الحرية والهوية والقوة التحويلية للأدب تحاورها&nbsp;<b>حفصة لودي&nbsp;</b><br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:29', '2025-02-02 09:54:29');
INSERT INTO `ar_sessions` (`id`, `session_id`, `session_name`, `session_slug`, `session_number`, `session_website_status`, `session_year`, `no_normal_tickets`, `session_authors`, `session_category`, `session_venue`, `age`, `session_room`, `session_language`, `session_translation`, `session_blurb`, `session_short_blurb`, `session_location`, `det_code`, `pricetype`, `created_at`, `updated_at`) VALUES
(44, '3939440000085341182', 'إميلي دنلاي: فضيحة في روما', 'emily-dunlay-a-scandal-in-rome', '39', 'Published to Website', 'Litfest 2025', 150, 'إيميلي دنلاي', 'الحوارات', 'انتركونتيننتال', NULL, 'الراس 2', 'الإنجليزية', 'اللغة الإنجليزية إلى اللغة العربية; اللغة العربية إلى اللغة الإنجليزية', '<p>تصل تيدي هانتلي كارلايل إلى روما في 1969 من دالاس، تكساس مع زوجها الدبلوماسي. تتوق تيدي لبدء حياتها الجديدة وتكون في أبهى صورها، ترتدي الملابس الأنيقة وتأسر زملاء زوجها. لسببٍ ما تنقلب حفلة السفارة رأساً على عقب وينهار عالم تيدي الذي بنته بعناية لتبدأ حبكة معقدة مليئة بالتشويق والإثارة والمكائد. <br></p><p><br></p><p>انضموا إلى الروائية <b>إميلي دنلاي</b> في أول ظهور لها في حوار مع<b> أنابيل كانتاريا&nbsp;</b>، حيث تتعمق في شخصية تيدي والحياة في ايطاليا في منتصف القرن العشرين.<br></p>', '<p>ترفع الروائية <b>إيميلي دنلاي</b> الستار عن قصة تيدي، رواية مثيرة مليئة بالمكائد تدور أحداثها في إيطاليا في منتصف القرن العشرين. وصف النقاد الرواية بأنها تجمع بين مسلسل \"دروس في الكيمياء\" ومسلسل \"رجال ماد\" في آنٍ واحد!<br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(45, '3939440000085341155', 'كلير ماكنتوش: أعدك لن يؤلمك دائماً كهذه المرة', 'clare-mackintosh-it-wont-always-hurt-like-this', '36', 'Published to Website', 'Litfest 2025', 150, 'كلير ماكنتوش', 'الحوارات', 'انتركونتيننتال', NULL, 'الراس 1', 'الإنجليزية', NULL, '<p>بحثت مؤلفة الكتب الأكثر مبيعاً <b>كلير ماكنتوش</b> عن الدعم والمؤازرة بين طيات الكتب بعد أن فقدت ابنها البالغ من العمر خمسة أسابيع؛ كل الكتب أخبرتها بما يجب أن تشعر به ومتى تشعر به، ولكن اكتشفت مؤخراً أنه لا يوجد مراحل محددة للحزن أو طرق سهلة لتخفيف آلامنا. تناقش الكاتبة مع <b>ناتاشا هاثيرال</b> تفاصيل كتابها الذي ألّفته للتعبير والتعامل مع حزنها. <br></p><p>يعكس الكتاب تأمل شخصي عميق عن تعلم كيفية التعايش مع أسوأ لحظات الحياة وإيجاد طريق العودة إلى فهم الذات والشفاء والأمل.<br></p>', '<p>مؤلفة الكتب الأكثر مبيعاً <b>كلير ماكنتوش</b> عن التجربة المريرة التي عاشتها بسبب فقدان ابنها البالغ من العمر خمسة أسابيع، كما تشاركنا استكشافها لرحلة الشفاء والأمل من خلال الكتابة عن حزنها تحاورها&nbsp;<b>ناتاشا هاثيرال</b><br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(46, '3939440000085250143', 'أنتوني ساتين: الرُحّل الذين شكلوا عالمنا', 'anthony-sattin-the-wanderers-who-shaped-our-world', '10', 'Published to Website', 'Litfest 2025', 150, 'أنتوني ساتين;', 'الحوارات', 'انتركونتيننتال', NULL, 'الراس 3', 'الإنجليزية', NULL, '<p>انطلقوا في رحلة عبر تاريخ الحركة والهجرة مع الصحفي والكاتب <b>أنتوني ساتين</b> في مناقشة واسعة النطاق مع <b>فيونا ليندسي&nbsp;</b>حول كتابه الشهير \"البدو: الرحّل الذين شكلوا عالمنا\". يدلي ساتين دفاعاً قوياً وأدلة دامغة عن كيفية رعاية البدو للحضارة وتجديدها عبر التاريخ، حيث تتبع الرواية المسارات الملحمية للرُحّل عبر عدة قارات لأكثر من 12,000 عاماً. <br></p><p>تذكرنا هذه الرواية الشاملة بحاجتنا الإنسانية العميقة للبحث والاستكشاف، هذه الجلسة هي أفضل رحلة سينطلق فيها محبي المغامرات<br></p>', '<p>انضموا إلى <b>أنتوني</b> <b>ساتين</b> في رحلة لاستكشاف السفر والهجرة كما دونهما في كتابه الشهير \"البدو\". يقدم أنتوني دفاعاً قوياً عن كيفية تعزيز الرُحّل للحضارة وتطويرها عبر التاريخ.<br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(47, '3939440000093457061', 'كحل إثمد', 'kohl-ithmid', '280', 'Published to Website', 'Litfest 2025', 75, 'فاطمة المزروعي', 'الحوارات', 'انتركونتيننتال', NULL, 'المجلس', NULL, NULL, '<p>انضموا إلى جلسة استثنائية حول كتاب \"كحل إثمد\" للكاتبة د. <b>فاطمة المزروعي</b>، الذي يقدم مجموعة من القصص التاريخية التقليدية بأسلوب سردي مستوحى من حكايات الجدات والشخصيات التي عاشت في الإمارات في الخمسينيات والستينيات والسبعينيات. يعكس الكتاب أحداثاً هامة من تاريخ الدولة، ويستعرض أبرز الشخصيات الإماراتية، خاصة النساء، من خلال قصص تعكس العواطف البشرية والعادات والتقاليد والمهن التي شكلت الحياة في تلك الحقبة. <br></p><p>\"كحل إثمد\" يربط بين الماضي والحاضر عبر القصص التي تنبض بالحب والحنين، مستعرضاً تفاعل الشخصيات مع الأرض والمجتمع، ويُعيد إحياء التقاليد التي كانت جزءاً من الحياة اليومية في الإمارات<br></p>', '<p>انضموا إلى جلسة حول كتاب \"كحل إثمد\" للكاتبة د. <b>فاطمة المزروعي&nbsp;</b>الذي يقدم قصصاً تاريخية تجسد الحياة الإماراتية في الخمسينيات والستينيات، مستعرضاً العادات والتقاليد والشخصيات النسائية البارزة<br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(48, '3939440000085341619', 'رجل ثلج بلا أنف', 'the-snowman-without-a-nose', '208', 'Published to Website', 'Litfest 2025', 100, 'ماجيك فيل', 'الفعاليات العائلية', 'انتركونتيننتال', NULL, 'خور الأفكار', 'الإنجليزية', NULL, '<p>انضموا إلى بطل الفكاهة <b>ماجيك فيل</b> في عرضه الساحر والمؤثر المستوحى من كتابه الجديد \"رجل الثلج بلا أنف\" هذه الحكاية المشوقة مثالية للأطفال الصغار وتحكي قصة رجل ثلج محبوب يفقد أنفه، وعلى ماجيك فيل (وأنت أيضاً!) مساعدته في العثور عليه! سيرسم هذا العرض ابتسامة عريضة على وجوهكم! مع الأجواء الكوميدية ​​والخدع السحرية والكثير من المرح التفاعلي، إنه مزيج رائع من سحر الشتاء وبهجة الاحتفالات، هذه الجلسة مثالية لجميع أفراد الأسرة، لا تفوتوا المغامرة الثلجية المليئة بالضحك والمفاجآت! <br></p><p><br></p>', '<p>انضموا إلى <b>ماجيك فيل</b> لمساعدة رجل ثلج في العثور على أنفه في هذه المغامرة الممتعة والسحرية المليئة بالكوميديا ​​والمفاجآت، إنه عرض شتوي مليء بالضحك والعجائب ومثالي لجميع أفراد الأسرة. <br></p>', 'دبي فيستفال سيتي', 'SFAMILYACTIVITIES50', 'E', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(49, '3939440000085341592', 'من النبات إلى الطبق', 'from-plant-to-plate', '204', 'Published to Website', 'Litfest 2025', 220, 'داريل جادزيكبو, إيلا فيليبس', 'الفعاليات العائلية', 'انتركونتيننتال', NULL, 'البراحة 2', 'الإنجليزية', NULL, '<p>استعدوا للاستمتاع مع أبطال الاستدامة ومؤلفي كتاب \"من النبات إلى الطبق\"، <b>داريل جادزيكبو</b> و<b>إيلا فيليبس</b>. <br></p><p>\"من النبات إلى الطبق\" هو كتاب طبخ مميز للأطفال، يوضح كيفية زراعة مكونات الطعام حتى بدون حديقة، وتحويلها إلى وجبات لذيذة.<br></p><p>يقدمان داريل وإيلا نصائح حول اختيار البذور والتربة المناسبة ورعاية النباتات حتى تصبح جاهزة للحصاد.&nbsp; كما يشاركان شغفهما في الاهتمام بالصحة والعناية بالكوكب من خلال طهي وجبات لذيذة وصحية باستخدام مكونات مزروعة في المنزل.<br></p><p><br></p>', '<p>انضموا إلى <b>داريل جادزيكبو</b> و<b>إيلا فيليبس</b> حيث يشرحان كيفية زراعة المكونات دون الحاجة إلى حديقة وتحويلها إلى وجبات لذيذة. ابدأوا رحلتكم في زراعة مكوناتكم بأنفسكم! <br></p><p><br></p>', 'دبي فيستفال سيتي', 'SFAMILYACTIVITIES50', 'E', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(50, '3939440000085341764', 'كنز الشبهانه', 'the-treasure-of-shabhana', '225', 'Published to Website', 'Litfest 2025', 75, 'نورة الخوري', 'الفعاليات العائلية', 'انتركونتيننتال', NULL, 'المجلس', 'العربية', NULL, '<p>جلسة تفاعلية ممتعة ومثيرة مع الكاتبة <b>نورة الخوري</b>! في هذه الجلسة،تنطلقون في عالم المغامرات من خلال قراءة مقتطفات من كتاب \"كنز الشبهانة\"، الذي يمزج بين الخيال والإبداع، ليأخذكم في رحلة لا تُنسى بين أسرار وكنوز مخبأة. <br></p><p>وليس هذا كل شيء! تشاركون في مغامرات تفاعلية عبر ألعاب مصممة خصيصاً للجلسة، مع تحديات مشوقة للبحث عن الكنز وتنمية التفكير الإبداعي.<br></p><p>كما تتعرفون على حقائق مفيدة عن شجرة الغاف، الشجرة الوطنية لدولة الإمارات، ودورها في الحفاظ على البيئة والاستدامة.<br></p><p>فرصة فريدة تجمع بين القراءة والتعلم والإبداع، مع لعبة تعزز التعاون والتفكير الاستراتيجي. انضموا إلينا لقضاء وقت مليء بالمرح والمعرفة!<br></p>', '<p>ننطلق في عالم المغامرات مع الكاتبة <b>نورة الخوري</b> حيث تقرأ لنا من كتابها \"كنز الشبهانة\"، الذي يمزج بين الخيال والإبداع، ونكتشف الكنوز المخبأة في مجموعة من الألعاب والتحديات.<br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(51, '3939440000085250106', 'المبتدئات', 'the-debutants', '6', 'Published to Website', 'Litfest 2025', 150, 'جولي مين, إيميلي دنلاي, سارة حمدان', 'الحوارات', 'انتركونتيننتال', NULL, 'البراحة 1', 'الإنجليزية', 'اللغة الإنجليزية إلى اللغة العربية; اللغة العربية إلى اللغة الإنجليزية', '<p><b>إيميلي دنلاي</b> تستحضر في روايتها \"تيدي \"عالم إيطاليا في ستينيات القرن العشرين، مقدمة قصة مفعمة بالسحر والسياسة والمكائد.أما<b> جولي مين</b> في روايتها \"سكان شنغهاي\" فتروي قصة عائلة يانغ عبر عقود من الزمن،بدءاً من عام 2040 وصولاً إلى عام 2014 في أسلوب سردي عكسي.من جهة أخرى تقدم ساره حمدان في \"ماذا يقول الناس\" رحلة شابة عربية تطمح أن تصبح فنانة كوميدية في مدينة نيويورك وهي تواجه التحديات المهنية وتوازن بين العادات والتقاليد.تتميز هذه الروايات بمخططات مدروسة بعناية وإعدادات مرسومة بوضوح حيث تتناول موضوعات الهوية والانتماء والعلاقات والمرونة.تقدم كل منها تصويراً دقيقاً لشخصيات تخوض تحديات شخصية وخارجية في سعيها لإيجاد المعنى والاتصال.وفي هذا الحوار تنضم إليهم <b>فيرونيكا سوليفان</b> لمناقشة هذه الأعمال الأدبية المتنوعة.<br></p><p><br></p>', '<p>في هذا الحوار تجتمع الروائيات المبتدئات اللاتي حظين بإشادة كبيرة: <b>إيميلي دانلاي</b>&nbsp;\"تيدي\"&nbsp;<b>جولي مين&nbsp;</b>\"سكان شنغهاي\"، و<b>سارة حمدان</b>&nbsp;\"ماذا سيقول الناس\" لمناقشة تصويرهن الدقيق للشخصيات في سعيهن للبحث عن المعنى والاتصال.تحاورهن <b>فيرونيكا سوليفان</b>&nbsp;لاستكشاف أبعاد هذه الروايات وتأثيرها في عالم الأدب</p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(52, '3939440000085341719', 'لقاء الرسامين الضخم', 'the-illustrators-showdown', '220', 'Published to Website', 'Litfest 2025', 220, 'ميثاء الخياط, أليكس لاتيمر', 'الفعاليات العائلية', 'انتركونتيننتال', NULL, 'البراحة 2', 'الإنجليزية', NULL, '<p>استعدوا لمواجهة فنية ملحمية بين رسامي كتب الأطفال الشهيرين، <b>أليكس لاتيمر</b> و<b>ميثاء الخياط</b>! شاهدوا كيف يتنافسان وجهاً لوجه ويجسدان شخصيات وقصصاً على الفور استجابة لاقتراحات الجمهور. <br></p><p>استمتعوا بتجربة إثارة بعروض الرسم الحيّ، وتعلموا نصائح وحيل الرسم التوضيحي من نخبة من المبدعين.<br></p><p>ترى من سيفوز في هذه المواجهة الفنية النهائية؟ أنتم ستقررون! هذا الحدث التفاعلي المثير سيشعل الإبداع ويلهم الفنانين الشباب الواعدين.<br></p>', '<p>استعدوا لمواجهة ملحمية بين رسامي كتب الأطفال المشهورين، أ<b>ليكس لاتيمر</b> و<b>ستيفن لينتون</b>. تُرى من سيفوز؟ القرار لكم! <br></p>', 'دبي فيستفال سيتي', 'SFAMILYACTIVITIES50', 'E', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(53, '3939440000085341001', 'مناظرة في الحب: أمسية الشعر والقانون', 'arabic-poetry-and-qanoon-night', '22', 'Published to Website', 'Litfest 2025', 100, 'أسماء عزايزة, أمل السهلاوي, عبداللطيف يوسف, عفراء عتيق, لمياء الصيقل, فرح يونس', 'الفعاليات الخاصة', 'مسرح الفن الرقمي (تودا)', NULL, 'مسرح تودا', 'العربية', NULL, '<p>جرى القول إنه لأجل الحب وُجدّ الشعر، ليقول ما لا يقوله الكلام العادي. </p><p>&nbsp;يجتمع كل من <b>أسماء عزايزة</b>، و<b>أمل السهلاوي</b>، و<b>حنين الصايغ</b>، و<b>عبد اللطيف يوسف</b>، ود. <b>عفراء عتيق</b>، و<b>لمياء الصيقل،</b> في مناظرة شعرية محورها الحب وحُكامها قصائد العشق والهوى.</p><p>بين رؤاهم المختلفة عن الحب وكلماته، نمضي أمسية خاصة في مسرح الفن الرقمي (ToDA) مع روعة الموسيقى وبلاغة الكلمة.بصحبة موسيقى القانون العربية الأصيلة والعزف الآسر للفنانة <b>فرح يونس</b>،</p><p></p>', '<p>&nbsp;يجتمع كل من <b>أسماء عزايزة</b>، و<b>أمل السهلاوي</b>، وحنين الصايغ، و<b>عبد اللطيف يوسف</b>، ود. <b>عفراء عتيق</b>، و<b>لمياء الصيقل</b>، في مناظرة شعرية.بصحبة موسيقى القانون العربية الأصيلة والعزف الآسر للفنانة <b>فرح يونس</b>،<br></p>', 'سوق مدينة جميرا', 'SSPECIALEVENTS120', 'K', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(54, '3939440000085250215', 'ركن الأقلام الصاعدة', 'litfest-launch-pad', '18', 'Published to Website', 'Litfest 2025', 100, 'حمدان بن ﺷﻔّﻴﺎن العامري, حمدة البلوشي, حلا ماهر, يزن عيسى, زينه شمس', 'فعاليات مجانية', 'انتركونتيننتال', NULL, 'خور الأفكار', 'العربية', NULL, '<p>كما في كل عام، يحتفي المهرجان بالأصوات الأدبية الجديدة، موفراً لها منصة فريدة للاحتفال بأحدث الإصدارات وأول ثمار الإبداع. </p><p>هذا العام، نلتقي مع مجموعة من الكتاب الموهوبين: <b>حمدان بن شفيان العامري</b>، و<b>حمدة البلوشي</b>، و<b>حلا&nbsp;ماهر</b>، و<b>يزن عيسى</b> و<b>زينة شمس.</b> استعدوا لنغوص في قصصهم ونستكشف رحلتهم المثيرة نحو إنجاز كتبهم الأخيرة.</p><p>انضموا إلينا لاكتشاف المزيد من القصص الجديدة الملهمة عن قرب!</p><p></p>', '<p>نلتقي هذا العام مع <b>حمدان بن شفيان العامري</b>، و<b>حمدة البلوشي</b>، و<b>حلا&nbsp;ماهر</b>، و<b>يزن عيسى</b>، و<b>زينة شمس</b>، لنستمع إلى قصصهم ورحلتهم المميزة في إنجاز كتبهم التي صدرت مؤخراً.<br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(55, '3939440000085341710', 'وليمة الوحش الأخيرة', 'the-beasts-final-feast', '219', 'Published to Website', 'Litfest 2025', 220, 'جاك ميجيت فيليبس', 'الفعاليات العائلية', 'انتركونتيننتال', NULL, 'البراحة 2', 'الإنجليزية', NULL, '<p>ظل إيبينيزر تويزر شاباً لمدة 512 عاماً لأنه كان يُطعم وحشاً سحرياً يعيش أعلى منزله، لقد قدّم له جميع أنواع الأشياء ليأكلها مثل القردة والتماثيل وحتى الصبار! بالرغم من أن الوحش يريد التهام طفلاً ويعرف إيبينيزر الطفلة المثالية لإشباع شهية الوحش تُدعى بيثاني؛ وهي طفلة مخادعة وفظة ومغرورة، إلا أنه قد حدث شيئاً غير متوقع تماماً! <br></p><p>انضموا إلى الكاتب المضحك <b>جاك ميجيت-فيليبس</b> الحائز على العديد من الجوائز عن سلسلته \"الوحش وبيثاني\" الشهيرة لتلقوا نظرة مرحة على عالمه الساحر المليء بالصداقات غير المتوقعة والفوضى والشغب، استعدوا لإطلاق ضحكاتكم الشريرة لنرى إذا باستطاعتكم إخافة الوحش!<br></p>', '<p>انضموا إلى الكاتب المضحك <b>جاك ميجيت-فيليبس</b> الحائز على العديد من الجوائز عن سلسلته \"الوحش وبيثاني\" الشهيرة وألقوا نظرة مرحة على عالمه الساحر المليء بالصداقات غير المتوقعة والفوضى والشغب<br></p>', 'دبي فيستفال سيتي', 'SFAMILYACTIVITIES50', 'E', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(56, '3939440000085250170', 'نسيم خان: وراء كواليس جهاز الخدمة السرية الباكستاني', 'naseem-khan-the-inside-story-of-pakistans-secret-services', '13', 'Published to Website', 'Litfest 2025', 80, 'نسيم أختار خان;', 'الحوارات', 'انتركونتيننتال', NULL, 'الأمواج', 'الإنجليزية', NULL, '<p>ارتبط العميد <b>نسيم اختار خان </b>بالجيش الباكستاني لمدة أربعة عقود تقريباً؛ قضى أكثر من نصفها في التعامل مع إدارة الأمن ومكافحة التجسس على المستويين العملياتي والاستراتيجي، يقدم كتابه \"محاصر في مرمى النيران\" رواية من الداخل عن الديناميكيات المعقدة للحرب والجيوسياسية في منطقة خالية من التهديدات الأجنبية أو نقاط الضعف الداخلية. يشارك خان في هذه الجلسة الرائعة رؤى ثاقبة حول عالم الأمن القومي والحياة الاستخباراتية عالية المخاطر، جلسة أساسية لأي شخص مهتم بالدفاع والدراسات الاستراتيجية والشؤون الجيوسياسية. يحاوره <b>مصطفي الراوي</b> في هذا اللقاء المثير&nbsp;<br></p>', '<p>يشارك العميد <b>نسيم اختار خان</b> أفكاره من كتابه \"محاصر في مرمى النيران\"، حيث يقدم وجهة نظر من الداخل عن الخدمة السرية الباكستانية وديناميكيات الحرب والجغرافيا السياسية التي شكلت الأمة يحاوره <b>مصطفي الراوي</b> في هذا اللقاء المميز&nbsp;<br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(57, '3939440000096835278', 'أهلاً بك في القطار الليلي للأفكار التي لا تنام.. الرحلة الأولى', 'welcome-aboard-the-night-train-of-sleepless-thoughts-the-first-journey', '103', 'Published to Website', 'Litfest 2025', 150, 'أمل السهلاوي;', 'الحوارات', 'انتركونتيننتال', NULL, 'الراس 2', 'العربية', 'اللغة الإنجليزية إلى اللغة العربية; اللغة العربية إلى اللغة الإنجليزية', '<p>هل يمكن للحظات قصيرة أن تتحول إلى أدب خالد؟ في هذه الجلسة الحوارية، نستكشف مع الشاعرة<b> أمل السهلاوي</b> مفهوم \'أدب الكتابات العابرة\' الذي ابتكرته في كتابها الجديد، حيث تكشف الكلمات عما تخفيه التفاصيل اليومية من فلسفات صامتة ومعانٍ عميقة. كيف ينجح هذا النوع الأدبي في مزج السرد بالتأمل، والواقع بالفكر؟ وكيف يفتح نافذة للتأمل في لحظات خاطفة تكاد تُنسى لكنها تحمل دلالات واسعة؟ جلسة غنية بالأفكار والتجارب، تسلط الضوء على قدرة الأدب على إعادة تشكيل إدراكنا للحياة، وتحويل البسيط إلى استثنائي. انضموا إلى الحوار لتتعرفوا على أسرار هذا النوع الأدبي الفريد وأبعاده الفلسفية.</p>', '<p>هل يمكن للحظات قصيرة أن تتحول إلى أدب خالد؟ في هذه الجلسة الحوارية، نستكشف مع الشاعرة<b> أمل السهلاوي</b> مفهوم \'أدب الكتابات العابرة\' الذي ابتكرته في كتابها الجديد، حيث تكشف الكلمات عما تخفيه التفاصيل اليومية من فلسفات صامتة ومعانٍ عميقة. كيف ينجح هذا النوع الأدبي في مزج السرد بالتأمل، والواقع بالفكر؟<br></p><p><br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(58, '3939440000085341128', 'أنيل أنانثاسوامي: لماذا تتعلم الآلات؟', 'anil-ananthaswamy-why-machines-learn', '33', 'Published to Website', 'Litfest 2025', 150, 'أنيل أنانثاسوامي', 'الحوارات', 'انتركونتيننتال', NULL, 'الراس 1', 'الإنجليزية', NULL, '<p>يقدم الكاتب العلمي الشهير <b>أنيل أنانثاسوامي</b> في كتابه الجديد \"لماذا تتعلم الآلات؟\" تحليلًا عميقًا للرياضيات الأساسية وراء الذكاء الاصطناعي، موضحًا كيف سيستمر التعلم الآلي في تغيير مجرى حياتنا اليومية ويحدث ثورة في مجالاتنا الاجتماعية والاقتصادية. يناقش الكتاب كيف يمكننا الاستفادة القصوى من هذه التكنولوجيا المتطورة، بالإضافة إلى استعراض القيود التي يجب أن نكون واعين لها، والرياضيات والإبداع اللذين يشكلان الأساس لمستقبل آخذ في التشكل، حيث تصبح الآلات قادرة على التعلم والتطور&nbsp;ويحاوره <b>كريستوفر بردلي&nbsp;</b>لاستكشاف تأثير هذه التكنولوجيا على المستقبل.<br></p><p><br></p>', '<p>يناقش الكاتب العلمي<b> أنيل أنانثاسوامي</b>، مؤلف كتاب \"لماذا تتعلم الآلات\"، الرياضيات وراء الذكاء الاصطناعي ويوضح كيف سيستمر التعلم الآلي في تحويل حياتنا الاجتماعية والاقتصادية.ويحاوره <b>كريستوفر بردلي&nbsp;</b>لاستكشاف تأثير هذه التكنولوجيا على المستقبل.<br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(59, '3939440000085250224', 'دليل المتخصصين للنشر', 'writers-corner-an-insiders-guide-to-publishing', '19', 'Published to Website', 'Litfest 2025', 100, 'ألكسندرا ليفيك, لويجي بونومي, فايزة خان', 'الحوارات', 'انتركونتيننتال', NULL, 'خور الأفكار', 'الإنجليزية', NULL, '<p>إن عملية نشر كتاب ليست بالأمر السهل ولا يكتمل العمل بمجرد كتابة الكلمة الأخيرة، ما ينتظركم بعد ذلك هو شبكة معقدة من الترويج لكتبكم والتعاقد عليه والعلامة التجارية والتسويق والبيع، حيث تتنافس كتبكم مع آلاف الكتب الأخرى التي يتم نشرها. إذاً كيف يمكنك التنقل عبر الإجراءات الروتينية والتغلب عليها؟ انضموا إلى الوكلاء الأدبيين، <b>ألكسندرا ليفيك</b>، الذي تعمل في وكالة \"بيت الكاتب\" الأدبية، و<b>لويجي بونومي</b>، من وكالة \"لويجي بونومي وشركاه\" الأدبية، والناشرين، <b>نورا ناصرين أبو بكار</b> من دار \"بينجوين راندوم هاوس\" في جنوب شرق أسيا، و<b>ساديا أنور</b>، من دار \"يوهيبوكس\" للخوض في حوار متعمق عما يحتاجه الكاتب لمعرفة طريق النجاح في مشوار النشر الصعب.<br></p>', '<p>استمعوا إلى أربعة متخصصين في مجال النشر وهما الوكيلين الأدبيين <b>ألكسندرا ليفي</b>ك و<b>لويجي بونومي</b> والناشرين<b> نورا الناصري أبو بكار</b> و<b>ساديا أنور</b> للتعرف على أسهل الطرق لنشر كتبكم.<br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(60, '3939440000085250152', 'ميجان هيس: الموضة بالألوان', 'megan-hess-fashion-in-colour', '11', 'Published to Website', 'Litfest 2025', 150, 'ميجان هيس', 'الحوارات', 'انتركونتيننتال', NULL, 'الراس 3', 'الإنجليزية', NULL, '<p>لقد أثبتت الموضة أنها واحدة من أكثر الظواهر البصرية تاثيراً عبر التاريخ، كما لعبت الألوان دوراً رئيسياً في إثارة المشاعر وتحقيق الانسجام وإيجاد التناقضات لمساعدة الناس على تحديد أنماطهم ومكانهم في العالم من خلال ما يرتدونه. انضموا إلى الرسامة الشهيرة والكاتبة صاحبة الكتب الأكثر مبيعاً وعاشقة الموضة، <b>ميجان هيس</b>، و تحاورها&nbsp;<b>حفصة لودي </b> للتعمق في عالم الموضة وألوانها واستكشاف تجربة ميجان للتأثير المذهل الذي أحدثته الألوان في تشكيل قصة الموضة؛ كما تستعرض ميجان مجموعتها المميزة بتوقيعها الخاص وتصاميم مختارة من كتابها.<br></p><p><br></p>', '<p>تتحدث الرسامة الشهيرة والكاتبة صاحبة الكتب الأكثر مبيعاً، <b>ميجان هيس</b>، عن الموضة والألوان وتستعرض تجربتها المميزة حول التأثير المذهل الذي أحدثته الألوان في تشكيل تاريخ الموضة وتحاورها&nbsp;<b>حفصه لودي</b><br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(61, '3939440000085341462', 'عمار شمس: خذني إلى دبي', 'ammar-shams-take-me-to-dubai', '71', 'Published to Website', 'Litfest 2025', 80, 'عمار شمس;', 'الحوارات', 'انتركونتيننتال', NULL, 'الأمواج', 'الإنجليزية', NULL, '<p>متى كانت آخر مرة فعلتم شيئاً للمرة الأولى؟ هذا السؤال هو ما دفع <b>عمار شمس</b> طوال العشرين عاماً الماضية، ملهماً إياه للمخاطرة، والتعلم المستمر، والتعامل مع الحياة بفضول لا محدود. مؤخراً، دفعه هذا السؤال ليصبح سائق تاكسي في دبي، حيث يتواصل مع الركاب من جميع الطبقات الاجتماعية، مشتركاً معهم في قصصهم وآمالهم وأحلامهم. ينضم شمس إلى<b> فيونا ليندسي</b> ليتأملا معاً قوة الفضول التحويلية ورحلته الفريدة، موضحين كيف يمكن للعيش بعقل متفتح أن يؤدي إلى اكتشافات غير متوقعة ويغني فهمنا للعالم.<br></p>', '<p><b>عمار شمس</b> يناقش تجربته كسائق تاكسي في دبي ويكشف عن الرؤى التي اكتسبها من خلال تواصله مع حيوات وقصص متنوعة. <br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(62, '3939440000085341082', 'بيب ويليامز: عن النساء والكلمات', 'pip-williams-of-women-and-words', '30', 'Published to Website', 'Litfest 2025', 200, 'بيب ويليامز;', 'الحوارات', 'انتركونتيننتال', NULL, 'البراحة 3', 'الإنجليزية', NULL, '<p>تكتب مؤلفة الكتب الأكثر مبيعاً، <b>بيب ويليامز</b>، نوعاً من الروايات التاريخية الذي تبث الحياة في الماضي بأسلوب حيوي وغامر. تدعونا روايتها الأولى، \"قاموس الكلمات المفقودة\"، وأحدث إصداراتها، \"مجلد كتب أريحا\"، إلى اكتشاف الحياة الداخلية الغنية بالخيال للنساء اللواتي يسعين إلى شق طريقهن الخاص في عالم يتسم باللامبالاة. <br></p><p><br></p><p>تتحدث الكاتبة&nbsp; مع&nbsp;<b>نمل صديقي&nbsp;</b>عن تجربتها في العمل مع الأرشيف ودور الأدب الروائي في إلقاء الضوء على كل ما هو ممكن. وتشير أنها تستمد إلهامها من القصص الرائعة التي ترويها في كتبها المحفزة للتفكير، حيث تستكشف اتساع تجارب النساء اللواتي تم استبعادهن من كتب التاريخ لفترة طويلة.<br></p><p><br></p>', '<p>تصعد الكاتبة المشهورة <b>بيب ويليامز</b>، مؤلفة كتب \"قاموس الكلمات المفقودة\" و\"مجلد كتاب أريحا\"،&nbsp; إلى المسرح لمناقشة مصادر الإلهام وراء كتبها المحفزة للتفكير. <br></p><p><br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(63, '3939440000085341836', 'جريمة كتبناها', 'murder-we-wrote', '82', 'Published to Website', 'Litfest 2025', 150, 'ماثيو أرليدج (إم جي أرليدج), فيونا ليندسي, كلير ماكنتوش', 'بعد النهار في ليل', 'انتركونتيننتال', NULL, 'الراس 3', 'الإنجليزية', NULL, '<p>استعدوا لليلة مليئة بالتشويق والإثارة مع كاتب السيناريو الشهير <b>إم جيه أرليدج </b>وضيوفه المميزين <b>كلير ماكنتوش</b> ,<b>فيونا ليندسي</b>، حيث سيخلقون رواية جريمة جديدة أمام أعينكم مباشرة على المسرح. لكن هناك مفاجأة كبيرة – الجمهور هو من سيتحكم في تفاصيل القصة! من خلال اقتراحاتكم، ستساهمون في بناء حبكة مشوّقة مليئة بالتشويق والتوتر، مع بداية ووسط ونهاية، بالإضافة إلى منعطفات غير متوقعة. هل ستنجحون في رسم مصير القصة؟ هناك طريقة واحدة لمعرفة ذلك…<br></p>', '<p>انضموا إلى <b>إم جيه أرليدج</b> وضيوفه في ليلة مثيرة من كتابة الروايات البوليسية المباشرة، حيث يتحكم الجمهور في التحولات الدرامية لقصة&nbsp; مليئة بالتشويق والإثارة. <br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(64, '3939440000085341354', 'الإعلام والشرق الأوسط', 'media-and-the-middle-east', '59', 'Published to Website', 'Litfest 2025', 150, 'هالة جوراني, مينا العريبي', 'الحوارات', 'انتركونتيننتال', NULL, 'الراس 1', 'الإنجليزية', NULL, '<p>هؤلاء الصحفيون الشجعان كانوا في بعض أخطر الأماكن في العالم، حيث قاموا بتغطية الاضطرابات، والانتفاضات، والانهيارات المالية، والكوارث الطبيعية، والأوبئة الفيروسية، والأحداث التي غيّرت مسار التاريخ. <br></p><p><br></p><p>في هذه الجلسة، يجتمع رئيس تحرير \"عرب نيوز\"، <b>فيصل عباس</b>، مؤلف كتاب \"حكايا عربي أنجلوفوني\"، والصحفية الحائزة على جائزة \"إيمي\"، <b>هالة جوراني</b>، مؤلفة كتاب \"لكنك لا تبدين عربية\"، مع <b>مصطفى الراوي</b> للحديث عن مسيرتيهما المهنية في التغطية الإعلامية المتعلقة بالشرق الأوسط أو في المنطقة نفسها. كما يناقشون الدور المتغير لوسائل الإعلام في صياغة السردية عبر المنطقة، والقصص وراء العناوين الرئيسية.<br></p>', '<p>حلقة نقاشية مع رئيس تحرير صحيفة \"عرب نيوز\"، <b>فيصل عباس</b>، والصحفية الحائزة على جائزة \"إيمي\"، <b>هالة جوراني</b>، حول حياتهما المهنية في التغطية الإعلامية في منطقة الشرق الأوسط وحولها. <br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(65, '3939440000085077864', 'القتل بألف لهجة: سر روايات الجريمة', 'walid-hashim-on-the-secrets-behind-crime-novels', '303', 'Published to Website', 'Litfest 2025', 100, 'وليد هاشم;', 'ملتقى الأفكار', 'انتركونتيننتال', NULL, 'خور الأفكار', 'العربية', NULL, '<p>هل تعرفون ليلى وذياب؟ <br></p><p>إنهما بطلا سلسلة الكاتب البحريني وليد هاشم في سلسلة الجريمة الكوميدية والتي تعد الأولى من نوعها في العالم العربي.<br></p><p>هل تعرفون تيسير إذاً؟<br></p><p>ربما لا، لكنكم على موعد لمعرفة شخصيات مثيرة للقلق والاهتمام في آن واحد. شخصيات بعشرات اللهجات في سلسلة روائية زاخرة بالمشاهد المضحكة والمفارقات الكوميدية الساخرة في إطار جريمة يتحداكم الكاتب أن تعرفوا القاتل فيها.<br></p><p>يحدثكم <b>وليد هاشم</b> عن السر الذي يجمع بين النقيضين: الكوميديا والرعب، والذي جعل حوارات هذه السلسلة الروائية الأمتع والأشهر وذلك في حديث ضمن إحدى جلسات برنامج \"ملتقى الأفكار\".<br></p>', '<p>شخصيات بعشرات اللهجات في سلسلة روائية زاخرة بالمشاهد المضحكة والمفارقات الكوميدية الساخرة في إطار جريمة يتحداكم الكاتب <b>وليد هاشم</b> أن تكشفوا فيها القاتل. <br></p><p><br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(66, '3939440000085341782', 'سوبهادرا داس: عشر أكاذيب صنعت الغرب', 'subhadra-das-ten-lies-that-made-the-west', '76', 'Published to Website', 'Litfest 2025', 220, 'سوبهادرا داس;', 'بعد النهار في ليل', 'انتركونتيننتال', NULL, 'البراحة 2', 'الإنجليزية', NULL, '<p>هل الغرب متحضر بالفعل كما يحب أن نتصوره؟ <br></p><p>انضموا إلى المؤلفة <b>سوبهادرا داس</b>، مؤلفة كتاب \"غير متحضر: عشر أكاذيب صنعت الغرب\"، في جلسة ذكية ولاذعة ومستنيرة مع <b>ميكالار سميث</b> تأخذنا الكاتبة في جولة غير تقليدية حول فكرة الحضارة الغربية وما يدعمها من أكاذيب ومبالغات وتضليلات، وتضيء داس عقولنا بخبرتها المتنوعة كونها كاتبة ومؤرخة وكوميدية تستهدف نفاق الغرب وتدافع عن تاريخ الشعوب وعلومهم وإبداعاتهم وثقافاتهم التي طالما تم رفضها باعتبارها \"غير متحضرة\".<br></p><p>تعدكم الجلسة بأنكم لن تنظروا إلى التاريخ بنفس الطريقة مرة أخرى.<br></p><p><br></p>', '<p>انضموا إلى الكاتبة والمؤرخة والكوميدية <b>سوبهادرا داس</b> في جولة غير تقليدية حول فكرة الحضارة الغربية وما يدعمها من أكاذيب ومبالغات وتضليلات.<br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(67, '3939440000085341444', 'دروس التاريخ', 'history-lessons', '69', 'Published to Website', 'Litfest 2025', 150, 'أبراهام فيرجيز, بيب ويليامز', 'الحوارات', 'انتركونتيننتال', NULL, 'الراس 3', 'الإنجليزية', NULL, '<p>يكتب كل من <b>أبراهام فيرجيز</b> ، مؤلف كتاب \"عهد الماء\"، <b>وبيب ويليامز</b>، مؤلفة كتاب \"قاموس الكلمات المفقودة\" و\"مجلد كتاب أريحا\"، أعمالاً معقدة ومتعددة الطبقات من الأدب التاريخي تركز على سرد قصص الأصوات المهمشة عبر تاريخنا الملحمي. <br></p><p>يجتمع هذان الكاتبان المشهوران مع&nbsp;<b>جوليا ويلر</b> لمناقشة إحياء العصور الغابرة&nbsp; ومنح أولئك الذين تم تجاهلهم ونسيانهم صوتًا يعبر عنهم، وكيف يمكن للكتابة عن فصول منسية من الماضي أن تسلط الضوء على هموم الحاضر.<br></p>', '<p>يجتمع <b>أبراهام فيرجيز </b>، مؤلف كتاب \"عهد الماء\"، و<b>بيب ويليامز</b>، مؤلفة كتاب \"قاموس الكلمات المفقودة\"مع <b>جوليا ويلر</b> لمناقشة المهمة المعقدة المتمثلة في سرد قصص الأصوات المهمشة عبر تاريخنا الملحمي <br></p><p><br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(68, '3939440000098409063', NULL, 'shaikha-al-marri-book-launch-of-journey-to-the-skies', '739', 'Published to Website', 'Litfest 2025', 200, NULL, 'الحوارات', 'انتركونتيننتال', NULL, 'الراس 1', NULL, NULL, NULL, NULL, 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(69, '3939440000085341701', 'في عالم هاردي', 'into-the-hardy-verse', '218', 'Published to Website', 'Litfest 2025', 220, 'فاشتي هاردي', 'الفعاليات العائلية', 'انتركونتيننتال', NULL, 'البراحة 2', 'الإنجليزية', NULL, '<p>انضموا إلى <b>فاشتي هاردي</b> في رحلة استكشافية عبر عوالمها الخيالية المدهشة للأطفال واليافعين، والتي يسكنها المستكشفون والحيوانات العاقلة في سلسلة \"سجلات العاصفة الساطعة\"، والأشباح في \"آلات شرارة جامحة\"، والأشجار الواعية في \"كراوفول\"، والبشر الآليين في \"نورث والوحيدة\"، بالإضافة إلى الاختراعات القديمة في سلسلة \"صائدو الآثار\" الجديدة، وأكثر من ذلك! <br></p><p>ستحصلون على لمحة عن مصدر إلهام أفكارها وطريقة بناء عوالم تأخذ القُراء في مغامرات لا تُنسى، مع العديد من نصائح الكتابة، مثل كيفية إنشاء خرائط للعوالم الروائية. يخرج القُراء من هذه التجربة مُلهَمين وجاهزين لكتابة قصصهم الفريدة والمليئة بالمغامرات.<br></p>', '<p>انضموا إلى <b>فاشتي هاردي</b> في رحلة عبر عوالمها الخيالية مثل \"سجلات العاصفة الساطعة\" و\"شرارة جامحة\" وتعلموا كيفية بناء قصص مشوقة وإنساء خرائط خيالية! <br></p><p><br></p>', 'دبي فيستفال سيتي', 'SFAMILYACTIVITIES50', 'E', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(70, '3939440000085341200', 'ستيفن ميثن: لغز اللغة', 'steven-mithen-the-language-puzzle', '41', 'Published to Website', 'Litfest 2025', 150, 'ستيفن ميثن', 'الحوارات', 'انتركونتيننتال', NULL, 'الراس 3', 'الإنجليزية', NULL, '<p>كيف تحولت نداءات أسلافنا في عصور ما قبل التاريخ إلى مفردات معقدة لآلاف اللغات الموجودة اليوم؟ انضموا معنا في حوار مع عالم الآثار الحائز على عدة جوائز <b>ستيفن ميثن</b> لمناقشة كتابه \"لغز اللغة\" ولمعرفة كيف تطورت اللغة ولماذا تطورت. كما سنناقش ما يمكن تعلمه في وقتنا الحالي من خلال فحص الطرق التي استطاعت من خلالها اللغة إيصال الفكر البشري والثقافة على مدى آلاف السنين. يجمع هذا الحوار العميق يجمع الكاتب ميثن بـ <b>MODERATOR NAME</b> ويستند فيه ميثن على أحدث الاكتشافات في علم اللغويات وعلم الآثار وعلم الوراثة وعلم النفس لحل لغز هويتنا وما قد نصبح عليه من خلال اللغة.<br></p>', '<p>يناقش عالم الآثار الحائز على جوائز <b>ستيفن ميثن</b> كتابه الأخير، \"لغز اللغة\"، وهو تحقيق مثير للاهتمام عن كيفية تطور اللغة ولماذا تطورت وكيف تطورت البشرية عن طريق اللغة. <br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(71, '3939440000085250206', 'ناشرون إماراتيون على طاولة الحوار', 'emirati-publishers-showcase', '17', 'Published to Website', 'Litfest 2025', 70, 'محمد قنديل, محمد بن دخين المطروشي, عبد العزيز محمد علي, فاطمة الخطيب', 'الحوارات', 'انتركونتيننتال', NULL, 'البراحة 1', 'العربية', NULL, '<p>يجتمع نخبة من رواد النشر في الإمارات لمناقشة أبرز التحديات والفرص التي تمّيز صناعتهم الفريدة. </p><p>خلال هذه الجلسة التفاعلية، سيقدم المتحدثون رؤى قيمة حول مواضيع متعددة، مثل الجدوى الاقتصادية لنشر الكتب، ومسارات النشر الرقمي، وسبل إيصال إصداراتهم للعالمية.</p><p>كما سيتناول النقاش اتجاهات السوق، وكيفية استجابة الناشرين والجهات المؤثرة لمتطلبات الساحة وتحوّلاتها السريعة.</p>', '<p>يجتمع نخبة من رواد النشر في الإمارات لمناقشة أبرز التحديات والفرص التي تمّيز صناعتهم الفريدة. يقدم المتحدثون رؤى قيمة حول مواضيع متعددة، مثل الجدوى الاقتصادية لنشر الكتب، ومسارات النشر الرقمي، وسبل إيصال إصداراتهم للعالمية.<br></p><p><br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(72, '3939440000087321020', 'ناظم زهاوي: الفتى القادم من بغداد', 'nadhim-zahawi-the-boy-from-baghdad', '199', 'Published to Website', 'Litfest 2025', 150, 'ناظم الزهاوي', 'الحوارات', 'انتركونتيننتال', NULL, 'البراحة 2', 'الإنجليزية', NULL, '<p>وُلد <b>ناظم زهاوي</b> ونشأ في بغداد، لكنه وصل إلى المملكة المتحدة في سن الثانية عشرة بعد أن اضطرت عائلته للفرار من وطنها تحت تهديد نظام صدام حسين. في هذه الجلسة، يستعرض زهاوي رحلته من العراق إلى بريطانيا في طفولته، ومسيرته البارزة في عالم الأعمال الدولية والسياسة، والسياسات والشخصيات التي أثرت في وطنه الجديد وصاغت ملامحه. بصدق ووضوح، يقدم تأملات شخصية حول فترة مضطربة في السياسة البريطانية، ويتناول أسئلة حول الهوية والانتماء وتطور الأمة. <br></p><p><br></p>', '<p>يشارك <b>ناظم زهاوي</b> رحلته من بغداد إلى بريطانيا، ومسيرته في السياسة والأعمال، وتأملاته حول الهوية والانتماء في بريطانيا المتغيرة. <br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(73, '3939440000085341755', 'قصص ولغات', 'stories-and-languages', '224', 'Published to Website', 'Litfest 2025', 75, 'إبتسام البيتي, سمر محفوظ برّاج', 'الفعاليات العائلية', 'انتركونتيننتال', NULL, 'المجلس', 'متعددة اللغات', NULL, '<p>في هذه الجلسة المليئة بالدفء والبهجة، تصحبنا الكاتبتان<b> سمر محفوظ برّاج&nbsp;</b>وابتسام البيتي في رحلة شيقة عبر قصتيهما: \"ليلة غريبة جداً\" و\"ليمون وسر الليموثي\".&nbsp; بمزيج من اللغتين العربية والإنجليزية، يغوص الأطفال في عالمين رائعين، يتنقلون بين أحداث مشوقة ويستمتعون بجمال كل لغة. هذه الجلسة تقدم لحظات ثرية تجعل القراءة تجربة فريدة تعمها الفرحة. <br></p><p><br></p>', '<p>تأخذنا الكاتبتان <b>سمر محفوظ برّاج </b>وابتسام البيتي في مغامرة عبر قصتين ساحرتين: \"ليلة غريبة جداً\" و\"ليمون وسر الليموثي\". مع تقديم القصص باللغتين العربية والإنجليزية، <br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(74, '3939440000085341390', 'قصص خيالية كاشفة', 'revelatory-fictions', '63', 'Published to Website', 'Litfest 2025', 200, 'عبد الرزاق قرنح, تشيجوزي أوبيوما', 'الحوارات', 'انتركونتيننتال', NULL, 'البراحة 3', 'الإنجليزية', NULL, '<p>يبدو أن التعاطف أصبح في عداد المفقودين في ظل تزايد انقسام العالم، فهل يمكن لقراءة القصص الخيالية أن تحيي فينا التعاطف؟ يجتمع الروائيان الحائزان على جوائز <b>عبد الرزاق قرنح </b>و<b>تشيجوزي أوبيوما</b> في هذه الجلسة لمناقشة الكتابة المقصودة والدور الذي يلعبه الخيال في إلقاء الضوء على الحالة الإنسانية ويحاورهم <b>سعيد سعيد</b>&nbsp;يشتهر هذان المؤلفان الاستثنائيان بتقديم مجموعة متنوعة من وجهات النظر والاستفزازات على صفحات كتبهم ويعتبران الخيال أداة للمقاومة والنقد ووسيلة للكشف والحقيقة. هذه فرصة لسماع شهادة قوية وشخصية حول أهمية سرد القصص بكل صدق وشفافية.<br></p>', '<p>انضموا إلى الروائيين الحائزين على جوائز <b>عبد الرزاق قرنح</b> و<b>تشيجوزي أوبيوما</b> ليرفعا الستار عن تعزيز الخيال في التعاطف ومقاومة الانقسام وإلقاء الضوء على الحالة الإنسانية في حوار صريح وصادق. <br></p><p><br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(75, '3939440000085341746', 'اكتشف قصتك', 'discover-your-story', '223', 'Published to Website', 'Litfest 2025', 75, 'سارة لورا نيستي ويلارد, شيرين مالهيربي', 'الفعاليات العائلية', 'انتركونتيننتال', NULL, 'المجلس', 'الإنجليزية', NULL, '<p>يبتكر الثنائي المبدع <b>شيرين مالهيربي</b> و<b>سارةلورا نيستي ويلارد</b> قصصاً مصورة مؤثرة عن الهوية والانتماء، مثل \"الفتاة التي نامت تحت القمر\" و\"الفتاة التي خيطت النجوم\" و\"الفتاة التي تعيش بين عالمين\". ستستمتعون بقراءة شيرين للقصص وبمقدمة عن فن الرسم التوضيحي لسارة في ورشة عمل ممتعة وشاملة لكتابة قصة وإنشاء رسوم توضيحية فريدة من نوعها. في نهاية هذه الجلسة ستتمكنون من اصطحاب كتابكم الذي يحمل قصصاً صغيرة إلى المنزل! <br></p><p><br></p>', '<p>اسردوا حكايتكم وأبدعوا في رسمها في هذه الجلسة التفاعلية مع الراوية <b>شيرين مالهيربي </b>والرسامة <b>سارة لورا نيستي ويلارد</b>. <br></p><p><br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(76, '3939440000085341565', 'هذا ليس كلبي!', 'thats-not-my-dog', '202', 'Published to Website', 'Litfest 2025', 75, 'فانيسا وولف', 'الفعاليات العائلية', 'انتركونتيننتال', NULL, 'المجلس', 'الإنجليزية', NULL, '<p>انضموا إلينا لاكتشاف ممتع في عالم السلسلة العالمية الناجحة \"هذه ليست...\"، المثالية للأيدي الصغيرة الفضولية! <br></p><p>تقدم هذه الكتب التفاعلية التي يمكن لمسها واستشعارها تجربة مليئة بالدهشة والألوان الزاهية، بالإضافة إلى قصص بسيطة وجذابة. تأخذنا راوية القصص البريطانية المحبوبة <b>فانيسا وولف</b> في هذه الجلسة الشيقة، حيث ينطلق الأطفال في مغامرة حسية رائعة، حيث يستمتعون باكتشاف ما سيظهر في القصة التالية، سواء كان كلباً أشعثاً أو ديناصوراً متعرجاً.<br></p><p><br></p><p>هذه الجلسة مثالية للأطفال من 0 إلى 4 سنوات، وستكون خطوة رائعة في رحلة أطفالكم في القراءة.<br></p><p><br></p>', '<p>تدعوكم الكاتبة <b>فانيسا وولف</b> لاستكشاف القوام والألوان من خلال سلسلة الكتب التفاعلية الأكثر مبيعاً على مستوى العالم،&nbsp; \"هذا ليس ...\"، والتي تعتمد على ملامسة العالم من خلال حواسنا الخمس. <br></p><p><br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(77, '3939440000085341209', 'فيصل عباس: حكايا عربي عاشق للثقافة الإنجليزية', 'anecdotes-of-arab-anglophiles', '43', 'Published to Website', 'Litfest 2025', 150, 'فيصل عباس, محمد احمد المر', 'الحوارات', 'انتركونتيننتال', NULL, 'الراس 3', 'الإنجليزية', NULL, '<p>انضموا إلى الصحفي الشهير <b>فيصل عباس</b> الذي يشاركنا رؤاه المرحة واللطيفة عن حياته كونه عربي يعيش في لندن كما وثقها في كتابه \"حكايا عربي أنجلوفوني\" إذ يغطي الكتاب المليء بالحكايات المسلية موضوعات الجنس والسياسة وحتى الدين. <br></p><p>في حوار يجمع رئيس تحرير \"عرب نيوز\"، <b>فيصل عباس</b>، مع معالي <b>محمد احمد المر </b>و <b>فيونا ليندسي</b>&nbsp;نتعمق في رحلة فيصل الشخصية التي انتقل فيها من الأنجلوفوبيا، كره الثقافة الإنجليزية، إلى الأنجلوفيليا، عشق الثقافة الإنجليزية.<br></p><p>تقدم هذه الجلسة دراسة صريحة وعميقة وممتعة عن التناقضات الثقافية والاجتماعية بين الثقافتين البريطانية والعربية، كذلك تطرح تقييم فضولي وعاطفي للخصائص الفريدة ونقاط الضعف في بريطانيا التي يرويها فيصل بأسلوبه المميز وموهبته الرائعة في سرد القصص<br></p>', '<p>في حوار يجمع رئيس تحرير \"عرب نيوز\"، <b>فيصل عباس</b>، مع معالي <b>محمد احمد المر</b> و <b>فيونا ليندسي</b>&nbsp;نتعمق في رحلة فيصل الشخصية التي انتقل فيها من الأنجلوفوبيا، كره الثقافة الإنجليزية، إلى الأنجلوفيليا، عشق الثقافة الإنجليزية.<br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(78, '3939440000092234068', 'كولم ماكلوجلين: تكريم لحياة تستحق العيش', 'colm-mclouglin-a-tribute-to-a-life-well-spent', '90', 'Published to Website', 'Litfest 2025', 80, 'جرايمي ويلسون, null, null, null', 'الحوارات', 'انتركونتيننتال', NULL, 'الأمواج', NULL, NULL, NULL, NULL, 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(79, '3939440000085341737', 'جودفري هو ضفدع', 'godfrey-is-a-frog', '222', 'Published to Website', 'Litfest 2025', 75, 'أليكس لاتيمر', 'الفعاليات العائلية', 'انتركونتيننتال', NULL, 'المجلس', 'الإنجليزية', NULL, '<p>مر جودفري ببعض التغيرات الكبيرة خلال نشأته؛ لقد كان بيضة ثم شرغوف والآن اكتمل وأصبح ضفدعاً، لكن لا يشعر جودفري بأنه مميز عندما يقارن نفسه بالدببة ومخالبها العملاقة والغزلان بقرونها الرائعة والبلشون بأجنحته المهيبة، لذا ما المثير في كونه ضفدع؟ <br></p><p>يعتلي المسرح <b>أليكس لاتيمر</b> الكاتب والمصور الحائز على عدة جوائز عن كتبه المصورة، \"تل الخلد\"، ولا تتبع ديناصوراً أبداً\".<br></p><p>يقدم الكاتب نشاط رسم تفاعلي يشارك فيه قصة جودفري الرائعة للغاية بطريقته البرمائية الخاصة.<br></p>', '<p>في هذه الجلسة التفاعلية، يقدم <b>أليكس لاتيمر</b> قصة الضفدع جودفري الذي لا يشعر بأنه مميز للغاية، لكنه يكتشف فيما بعد مدى قدرته على أن يكون استثنائياً إذا تعلم فقط تقبل ذاته.<br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(80, '3939440000085341647', 'هيلين فارمر: القوى الخارقة السرية لعائلتي', 'my-familys-secret-superpowers', '211', 'Published to Website', 'Litfest 2025', 75, 'هيلين فارمر', 'الفعاليات العائلية', 'انتركونتيننتال', NULL, 'المجلس', 'الإنجليزية', NULL, '<p>تتناول روبي وعائلتها وجبة العشاء وهم يعملون على \"حل العُقد\"، فيتحدثون عن مخاوفهم ويتبادلون الأفكار التي تساعدهم على حل أمورهم، ينتاب روبي التردد أحياناً عندما تفعل أشياء جديدة وتشعر بفراشات في معدتها وتصبح نبضات قلبها أشبه بقرع الطبول، ليست روبي وحدها من تشعر بذلك! بل أن والدها ووالدتها وأختها الكبرى أوليف لا يشعرون بالرضا في بعض الأحيان. <br></p><p><br></p><p>انضموا إلى <b>هيلين فارمر</b> لتكتشفوا القوة الخارقة السرية التي تساعد روبي على الشعور بتحسن وثقة أكبر حيث تتعلمون أيضاً بعض النصائح والحيل التي يمكن إتخاذها لتساعدكم على \"حل العُقد\"!<br></p>', '<p>انضموا إلى المذيعة المحلية الشهيرة ومؤلفة كتب الأطفال <b>هيلين فارمر</b> لإطلاق كتابها الجديد واكتشفوا قواكم الخارقة السرية التي ستساعدكم على تجاوز الأوقات التي لا تشعرون فيها بالسعادة.<br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(81, '3939440000085341872', 'هواء نقي، كلمات منعشة', 'fresh-air-fresh-lyrics', '86', 'Published to Website', 'Litfest 2025', 200, 'نجوى ذبيان, الكسندر كيزياكوفسكي, زوي محمد, أدريان كالفوبولو, اروما راجيش كومار, نعمه النور, ساره النعيمي, محمد أمير', 'بعد النهار في ليل', 'انتركونتيننتال', NULL, 'المجلس', 'متعددة اللغات', NULL, '<p>انضموا إلينا في أمسية هادئة للاحتفال بالتقاليد الشعرية الغنية في المنطقة وقراءة الشعر الحر. استمتعوا بمزيج انتقائي من المواهب المحلية وأداء خاص من ضيف دولي. <br></p><p><br></p>', '<p>انضموا إلينا في أمسية هادئة للاحتفال بالتقاليد الشعرية الغنية في المنطقة وقراءة الشعر الحر. استمتعوا بمزيج انتقائي من المواهب المحلية وأداء خاص من ضيف دولي. <br></p><p><br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(82, '3939440000085341665', 'ابنة غواص اللؤلؤ وعقد البعو', 'the-pearl-divers-daughter-and-the-cowrie-necklace', '213', 'Published to Website', 'Litfest 2025', 75, 'ميثاء الخياط, حصة المهيري', 'الفعاليات العائلية', 'انتركونتيننتال', NULL, 'المجلس', 'العربية', NULL, '<p>انضموا إلى المبدعتين الإماراتيتين الحائزتين على جوائز، <b>ميثاء الخياط</b> و<b>حصة المهيري</b>، لاكتشاف روايتهما الخيالية المبتكرة لفئة اليافعين: \"ابنة غواص اللؤلؤ وعقد البعو\"، الفائزة بجائزة اتصالات لأدب اليافعين. تروي هذه القصة الآسرة حكاية تمزج بين التراث الإماراتي وعوالم الخيال والمغامرة. </p><p>استمتعوا بجلسة ملهمة تتضمن فقرات شيّقة من أسئلة تفاعلية، ورسومات حية، وقراءات مختارة، وحوار غني، في احتفاء إبداعي يضيء على جمال السرد القصصي الإماراتي.</p>', '<p>انضموا إلى المبدعتين الإماراتيتين الحائزتين على جوائز، <b>ميثاء الخياط</b> و<b>حصة المهيري</b>، لاكتشاف روايتهما الخيالية المبتكرة لفئة اليافعين: \"ابنة غواص اللؤلؤ وعقد البعو\"، الفائزة بجائزة اتصالات لأدب اليافعين. تروي هذه القصة الآسرة حكاية تمزج بين التراث الإماراتي وعوالم الخيال والمغامرة. <br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(83, '3939440000085250197', 'إفطار رواد الأعمال: المرأة في القيادة', 'business-breakfast-women-in-leadership', '16', 'Published to Website', 'Litfest 2025', 100, 'مها أبو العينين, جيسامي هيبرد, سو بريدجمان', 'الفعاليات الخاصة', 'انتركونتيننتال', NULL, 'خور الأفكار', 'الإنجليزية', NULL, '<p>ابدأوا يومكم مع ألمع العقول في عالم الأعمال وخاصةً النساء الملهمات في الأدوار القيادية! لا تفوتوا فرصة الاستماع إلى <b>جيسامي هيبرد</b>، مؤلفة كتبا \"علاج للمحتال\"، و<b>مها أبو العينين</b>، مؤلفة كتاب \"7 قواعد للاعتماد على الذات\"، و<b>سو بريدجمان</b>، مؤلفة كتاب \"فائدة ذكاء الاتصالات\"، لمناقشة التحديات والفرص التي يواجهها القطاع حيث يقدمن وجهات نظر من عمق المجال وأفكار أساسية ورؤى مستقبلية من خلال الحديث عن موضوعات مثل الاعتماد على الذات والتغلب على متلازمة المحتال واستراتيجيات التواصل الفعّال. يدير هذه الجلسة <b>لوسي تشاو </b> لمدة ساعة يتم فيها تسليط الضوء على مسارات الإدارة جديدة في عالم سريع التغير؛ ثم تليها وجبة إفطار خفيفة لتبادل أطراف الحديث.<br></p>', '<p>جلسة مع <b>جيسامي</b> <b>هيبرد</b>، مؤلفة كتبا \"علاج للمحتال\"، <b>ومها</b> <b>أبو</b> <b>العينين</b>، مؤلفة كتاب \"7 قواعد للاعتماد على الذات\"، <b>وسو</b> <b>بريدجمان</b>، مؤلفة كتاب \"فائدة ذكاء الاتصالات\"، لمناقشة التحديات والفرص التي تواجه المرأة في عالم الأعمال.<br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS150', NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(84, '3939440000085341692', 'السفر عبر الزمن مع السلحفاة', 'time-travelling-with-a-tortoise', '217', 'Published to Website', 'Litfest 2025', 220, 'روس ويلفورد', 'الفعاليات العائلية', 'انتركونتيننتال', NULL, 'البراحة 2', 'الإنجليزية', NULL, '<p>يسافر البطل الجريء آل شودري عبر الزمن لإنقاذ حياة والده في كتاب الأطفال الأكثر مبيعاً، \"السفر عبر الزمن مع الهامستر\"، للكاتب <b>روس ويلفورد</b>. والآن، عاد كل شيء إلى طبيعته... أم أن ذلك ليس صحيحاً؟ حينها يكتشف آل أن التدخل في الزمن لا يسير دائماً كما يتوقع. <br></p><p>انضموا إلى الكاتب روس في الفصل التالي المثير والمرح السفر عبر الزمن مع السلحفاة، حيث يستمر آل شودري في مغامراته في التنقل بين العصور. ساعدوه في الإجابة عن السؤال: إذا كان بإمكانكم تغيير الماضي مع العلم أن ذلك سيؤثر على الحاضر، هل ستفعلون ذلك؟<br></p>', '<p>انضموا إلى <b>روس ويلفورد</b> وهو يقدم لكم كتاب \"السفر عبر الزمن مع السلحفاة\"، الجزء الثاني المثير من كتاب \"السفر عبر الزمن مع الهامستر\". تستمر مغامرة السفر عبر الزمن التي يخوضها آل شودري مع أسئلة عميقة وتقلبات مضحكة! <br></p><p><br></p>', 'دبي فيستفال سيتي', 'SFAMILYACTIVITIES50', 'E', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(85, '3939440000085341638', 'مغامرات أنيقة', 'fashionable-adventures', '210', 'Published to Website', 'Litfest 2025', 75, 'ميجان هيس', 'الفعاليات العائلية', 'انتركونتيننتال', NULL, 'المجلس', 'الإنجليزية', NULL, '<p>تبتكر <b>ميغان هيس</b> قصصاً للصغار ذوي الأحلام الكبيرة، سواء كان ذلك لاكتشاف قوتهم الداخلية أو الانطلاق في مغامرة أنيقة في مدينة بعيدة! <br></p><p><br></p><p>تنضم الكاتبة والرسامة المعروفة بسلسلتها الشهيرة \"مجموعة الملكات اليافعات\" وسلسلة \"كلاريس: الفأر الأكثر أناقة في باريس\" إلى <b>(اسم مدير الجلسة)</b> للتحدث عن حكاياتها المصورة الجميلة التي تنبض بالأناقة واللباقة.<br></p><p><br></p><p>استعدوا للانطلاق إلى أماكن تتجاوز خيالكم مع هذه القصص المميزة عن البطلات الشجاعات والمغامرات الأنيقة والملكات العصريات.<br></p>', '<p>هل أنتم مستعدون لمغامرة أنيقة؟ <br></p><p><br></p><p>انضموا إلى مؤلفة كتب الأطفال الشهيرة <b>ميجان هيس</b> لتشارككم قصصها المصورة الجميلة التي تجتمع فيها البطلات الشجاعات والملكات العصريات.<br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(86, '3939440000085341137', 'تشاران رانجاناث: لماذا نتذكر؟', 'charan-ranganath-why-we-remember', '34', 'Published to Website', 'Litfest 2025', 150, 'تشاران رانجاناث', 'الحوارات', 'انتركونتيننتال', NULL, 'الراس 1', 'الإنجليزية', NULL, '<p>الذاكرة هي أكثر من مجرد سجل للماضي بل إنها تلعب دوراً هاماً في كل جانب من جوانب حياتنا تقريباً، بدءاً من التعلم وصنع القرار وصولاً إلى الاستجابة للصدمات والشفاء منها. في طليعة الأبحاث حول أسباب تذكرنا للأشياء، يعمل عالم الأعصاب وعالم النفس الرائد <b>تشاران رانجاناث</b> على إعادة صياغة الطريقة التي نفكر بها بشأن الذكريات بشكل جذري؛ وفي جلسة خاصة، ينضم العالم إلى <b>جوليا ويلر </b> ليكشف عن الطرق المدهشة التي تستخدم بها أدمغتنا المعلومات من ماضينا لتحديد حاضرنا وتخيل مستقبلنا. كما يُعرّفنا رانجاناث على ما يمكن أن نتعلمه عن أنفسنا وعن الأشخاص من حولنا إذا فهمنا قوة الذاكرة والقدرة على استخدامها بشكل أفضل.<br></p>', '<p>استمعوا إلى عالم الأعصاب وعالم النفس <b>شاران رانجاناث</b>، مؤلف كتاب \"لماذا نتذكر\"، وتعرفوا على ما يمكن أن نتعلمه عن أنفسنا وعن الأشخاص من حولنا إذا فهمنا قوة الذاكرة والقدرة على استخدامها بشكل أفضل.<br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(87, '3939440000085077672', 'المهرجان بنكهة طفولية!', 'children-take-over-litfest-arabic-edition', '200', 'Published to Website', 'Litfest 2025', 220, 'علي حميد اللوغاني, بيسان عثمان, فاطمة علي الزرعوني, حصة حسن, عمر الأميري, ساندي هاني', 'الفعاليات العائلية', 'انتركونتيننتال', NULL, 'البراحة 1', 'العربية', 'اللغة الإنجليزية إلى اللغة العربية; اللغة العربية إلى اللغة الإنجليزية', '<p>انضموا إلينا للاحتفاء ببعض من أصغر وألمع المؤلفين في دبي. سيتحدث هؤلاء الكتاب الناشئون عن تجاربهم الإبداعية، ويقرؤون مقتطفات من كتبهم، ويشاركوننا مصادر إلهامهم.<br></p><p>يجب أن يكون الأطفال دون سن 12 برفقة شخص بالغ يحمل تذكرة.<br></p><p><br></p>', '<p>انضموا إلينا للاحتفاء ببعض من أصغر وألمع المؤلفين في دبي. سيتحدث هؤلاء الكتاب الناشئون عن تجاربهم الإبداعية، ويقرؤون مقتطفات من كتبهم، ويشاركوننا مصادر إلهامهم.<br></p><p><br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30');
INSERT INTO `ar_sessions` (`id`, `session_id`, `session_name`, `session_slug`, `session_number`, `session_website_status`, `session_year`, `no_normal_tickets`, `session_authors`, `session_category`, `session_venue`, `age`, `session_room`, `session_language`, `session_translation`, `session_blurb`, `session_short_blurb`, `session_location`, `det_code`, `pricetype`, `created_at`, `updated_at`) VALUES
(88, '3939440000085341628', 'هذا ليس نمري!', 'thats-not-my-tiger', '209', 'Published to Website', 'Litfest 2025', 100, 'فانيسا وولف;', 'الفعاليات العائلية', 'انتركونتيننتال', NULL, 'المجلس', 'الإنجليزية', NULL, '<p><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; box-sizing: border-box; pointer-events: all; color: rgb(0, 0, 0); font-family: inherit; font-size: 13.3333px; font-style: normal; font-variant-ligatures: none; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: right; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: pre-wrap; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">انضموا إلينا لاكتشاف ممتع في عالم السلسلة العالمية الناجحة \"هذه ليست...\"، المثالية للأيدي الصغيرة الفضولية! <br style=\"box-sizing: border-box; pointer-events: all;\">تقدم هذه الكتب التفاعلية التي يمكن لمسها واستشعارها تجربة مليئة بالدهشة والألوان الزاهية، بالإضافة إلى قصص بسيطة وجذابة. تأخذنا راوية القصص البريطانية المحبوبة </span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; box-sizing: border-box; pointer-events: all; color: rgb(0, 0, 0); font-family: inherit; font-size: 13.3333px; font-style: normal; font-variant-ligatures: none; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: right; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: pre-wrap; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; font-weight: bold;\">فانيسا وولف</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; box-sizing: border-box; pointer-events: all; color: rgb(0, 0, 0); font-family: inherit; font-size: 13.3333px; font-style: normal; font-variant-ligatures: none; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: right; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: pre-wrap; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"> في هذه الجلسة الشيقة، حيث ينطلق الأطفال في مغامرة حسية رائعة، حيث يستمتعون باكتشاف ما سيظهر في القصة التالية، سواء كان كلباً أشعثاً أو ديناصوراً متعرجاً. <br style=\"box-sizing: border-box; pointer-events: all;\">هذه الجلسة مثالية للأطفال من 0 إلى 4 سنوات، وستكون خطوة رائعة في رحلة أطفالكم في القراءة.</span> <br></p>', '<p><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; box-sizing: border-box; pointer-events: all; color: rgb(0, 0, 0); font-family: inherit; font-size: 13.3333px; font-style: normal; font-variant-ligatures: none; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: right; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: pre-wrap; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">تدعوكم الكاتبة </span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; box-sizing: border-box; pointer-events: all; color: rgb(0, 0, 0); font-family: inherit; font-size: 13.3333px; font-style: normal; font-variant-ligatures: none; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: right; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: pre-wrap; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; font-weight: bold;\">فانيسا وولف</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; box-sizing: border-box; pointer-events: all; color: rgb(0, 0, 0); font-family: inherit; font-size: 13.3333px; font-style: normal; font-variant-ligatures: none; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: right; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: pre-wrap; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"> لاستكشاف القوام والألوان من خلال سلسلة الكتب التفاعلية الأكثر مبيعاً على مستوى العالم،  \"هذا ليس ...\"، والتي تعتمد على ملامسة العالم من خلال حواسنا الخمس.</span>&nbsp;<br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(89, '3939440000085341019', 'صورة جماعية للخليج', 'collective-portrait-of-the-gulf', '23', 'Published to Website', 'Litfest 2025', 198, 'عبداللطيف يوسف, صالحة عبيد, وليد هاشم', 'الحوارات', 'انتركونتيننتال', NULL, 'البراحة 1', 'العربية', 'اللغة الإنجليزية إلى اللغة العربية; اللغة العربية إلى اللغة الإنجليزية', '<p>نفتح أبواب الحوار بين أصوات متنوعة من دول الخليج العربي لاستكشاف الفروق الفريدة والتشابهات العميقة التي تشكل هوية المنطقة. يجتمع كل من الكتاب <b>صالحة عبيد</b>، و<b>عبد اللطيف يوسف</b> و<b>محمد اليحيائي</b> ليقدموا لنا رؤى ثاقبة حول التعبيرات الثقافية والفنية المتنوعة في بلدانهم، وكيف تساهم هذه العناصر في بناء هوية خليجية جماعية أوسع. <br></p><p>سنسلط الضوء على الجوانب المتعددة التي تُثري المشهد الثقافي في الخليج، ونستكشف كيفية تفاعل هذه الخصوصيات معاً لتشكيل نسيجاً غنياً ومتوازناً. إنها فرصة لفهم أعمق للإرث الثقافي والإبداعي الذي يميز هذا الجزء من العالم.<br></p>', '<p>يجتمع كل من الكتاب <b>صالحة عبيد</b>، و<b>عبد اللطيف يوسف</b> و<b>محمد اليحيائي</b> ليقدموا لنا رؤى ثاقبة حول التعبيرات الثقافية والفنية المتنوعة في بلدانهم، وكيف تساهم هذه العناصر في بناء هوية خليجية جماعية أوسع.&nbsp;<br></p><p><br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(90, '3939440000085250079', 'أسوار العقل العربي: هل ما زال دور الأديب حياً؟', 'pens-punchlines-possibilities', '3', 'Published to Website', 'Litfest 2025', 198, 'مريم الهاشمي, نبيل سليمان, عبد الإله بنعرفة', 'الحوارات', 'انتركونتيننتال', NULL, 'البراحة 1', 'العربية', 'اللغة الإنجليزية إلى اللغة العربية; اللغة العربية إلى اللغة الإنجليزية', '<p>في هذه الجلسة الحوارية بنمط الطاولة المستديرة، ينضم إلينا نخبة من الأدباء والمفكرين العرب: الكاتب <b>محمد اليحيائي</b>، الكاتبة والناقدة <b>مريم الهاشمي</b>، والكاتب <b>نبيل سليمان</b> والدكتور <b>عبد الإله بنعرفة</b>، لاستكشاف دور الأديب والمثقف العربي في المشهد الراهن. <br></p><p>نغوص في تجاربهم الشخصية وتصوراتهم حول تطور دور الأديب عبر التاريخ، وطرائق تفاعل الأدب، اليوم، مع التحولات الكبيرة التي يمر بها العالم العربي.<br></p><p>هل تغير دور المثقف في زمن العولمة والثورات الرقمية؟<br></p><p>كيف يمكن للأدب أن يكون أداة للتغيير أو مرآة تعكس ما يحدث؟<br></p><p>استعدوا لحوار مفتوح يتناول تحديات وفرص المثقف العربي في رسم ملامح المستقبل الثقافي والسياسي في منطقتنا، في ظل اختلاف السياقات من الخليج إلى المحيط.<br></p><p><br></p>', '<p>على طاولة مستديرة، يناقش كل من&nbsp; الكاتب <b>محمد اليحيائي</b>، الكاتبة والناقدة <b>مريم الهاشمي</b>، والكاتب <b>نبيل سليمان</b> والدكتور <b>عبد الإله بنعرفة</b>، دور الأديب والمثقف العربي في المشهد الراهن وكيف يمكن للأدب أن يكون أداة للتغيير أو مرآة التي تعكس حقيقة ما يحدث. <br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(91, '3939440000085250047', 'أبيات من أعماق الصحراء', 'desert-stanzas', '1', 'Published to Website', 'Litfest 2025', 100, 'خيراني باروكا, صفية سنكلير, شمه البستكي, عبداللطيف يوسف, أسماء عزايزة, خالد البدور, رومينيشن', 'الفعاليات الخاصة', 'كارافانسيراي', NULL, 'المخيم الصحراوي', 'متعددة اللغات', NULL, '<p>استمتعوا بليلة لا تُنسى من الشعر والسرد الحر وسط الكثبان الرملية الغامضة والسماء المرصعة بالنجوم، يُجسد هذا الحدث الخاص قلب المهرجان حيث ينضم الجميع للاحتفال بالقصص والتعبير عن الفرح والاندهاش بالقوة العميقة للكلمات في ربط الزمان والمكان والتجربة الإنسانية. انضموا إلى مجموعة استثنائية من الأصوات المحلية والعالمية؛ حيث نجتمع معاً لقضاء ليلة من التواصل والاحتفال والسحر وعشاء شهي نختتم به الجلسة. <br></p><p><br></p>', '<p>انضموا إلينا في ليلة آسرة من الشعر تحت سماء مرصعة بالنجوم، حيث نحتفي بقوة السرد وقدرته على ربط الأزمنة والأماكن. استمتعوا بموهبة وأصوات محلية وعالمية يتردد صداها في أفق الصحراء الواسع. <br></p><p><br></p>', 'مخرج 29، شارع جبل علي لهباب، دبي', 'SSPECIALEVENTS425', 'L', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(92, '3939440000085341574', 'هذا ليس ديناصوري!', 'thats-not-my-t-rex', '203', 'Published to Website', 'Litfest 2025', 100, 'فانيسا وولف', 'الفعاليات العائلية', 'انتركونتيننتال', NULL, 'المجلس', 'الإنجليزية', NULL, '<p>انضموا إلينا لاكتشاف ممتع في عالم السلسلة العالمية الناجحة \"هذه ليست...\"، المثالية للأيدي الصغيرة الفضولية! <br></p><p>تقدم هذه الكتب التفاعلية التي يمكن لمسها واستشعارها تجربة مليئة بالدهشة والألوان الزاهية، بالإضافة إلى قصص بسيطة وجذابة. تأخذنا راوية القصص البريطانية المحبوبة <b>فانيسا وولف</b> في هذه الجلسة الشيقة، حيث ينطلق الأطفال في مغامرة حسية رائعة، حيث يستمتعون باكتشاف ما سيظهر في القصة التالية، سواء كان كلباً أشعثاً أو ديناصوراً متعرجاً.<br></p><p>هذه الجلسة مثالية للأطفال من 0 إلى 4 سنوات، وستكون خطوة رائعة في رحلة أطفالكم في القراءة.<br></p>', '<p>تدعوكم الكاتبة<b> فانيسا وولف</b> لاستكشاف القوام والألوان من خلال سلسلة الكتب التفاعلية الأكثر مبيعاً على مستوى العالم،&nbsp; \"هذا ليس ...\"، والتي تعتمد على ملامسة العالم من خلال حواسنا الخمس. <br></p><p><br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(93, '3939440000085341254', 'شيرين ماليربي: الأرض المقدسة ونحن', 'shereen-malherbe-the-holy-land-and-me', '48', 'Published to Website', 'Litfest 2025', 80, 'شيرين مالهيربي', 'الحوارات', 'انتركونتيننتال', NULL, 'الأمواج', 'الإنجليزية', NULL, '<p>ظهرت الكاتبة البريطانية الفلسطينية <b>شيرين مالهيربي</b> في الفيلم الوثائقي الذي أنتجته هيئة الإذاعة البريطانية بعنوان \"الأرض المقدسة ونحن\" في عام 2023. هذه هي التجربة التي قادتها إلى اكتشاف تفاصيل عن تاريخ عائلتها في فلسطين لم تكن تعرفها من قبل. <br></p><p>إن الدافع للحفاظ على هذا التاريخ هو جوهر كتابها الجديد المؤثر، \"بنات ياسيني\"، وهي رواية على مدى أجيال متعددة تستكشف الصدمات والانتماء والأهمية الحيوية للحفاظ على التقاليد وتكريم الماضي لتأمين حاضرنا تحاورها&nbsp;<b>ديمة العلمي</b> وتناقش الكاتبة المقاومة والمرونة وتفاصيل روايتها الأكثر شخصية حتى الآن.<br></p><p><br></p>', '<p><b>​</b>تتحدث الكاتبة البريطانية الفلسطينية <b>شيرين مالهيربي</b> عن كتابها الجديد \"بنات ياسيني\"، روايتها المؤثرة والتي تستكشف الصدمات والانتماء على مدى عدة أجيال إضافة إلى أهمية الحفاظ على التقاليد وتكريم الماضي.<br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(94, '3939440000085341791', 'فانتازيا أم تاريخ؟', 'fantasy-or-history', '78', 'Published to Website', 'Litfest 2025', 81, 'رشا سمير, أحمد الصادق, حصه عبدالله', 'بعد النهار في ليل', 'انتركونتيننتال', NULL, 'الأمواج', 'العربية', NULL, '<p>يلتقي ثلاثة من أبرز الكُتّاب ليكشفوا عن رؤاهم الأدبية في المزج بين الخيال والواقع، ويسلطون الضوء على قوة السرد في استحضار التاريخ والأساطير. <br></p><p>تقدم <b>رشا سمير </b>روايتها \"المسحورة\"، التي تستعرض عمق حضارة الأمازيغ، بدءاً من المغرب إلى واحة سيوة، وتناقش قدرة أدب الفانتازيا على عكس تاريخ مثير وذا أبعاد عديدة.<br></p><p>أما <b>أحمد الصادق</b>، فيستعرض تجربته مع أدب النوع المزدوج في روايته \"دوار العالم\"، حيث تتداخل الفلسفة والفانتازيا، ليطرح رؤية جديدة تكسر الحدود التقليدية للأجناس الأدبية.<br></p><p>وتشارك <b>حصة عبد الله</b> رؤيتها حول الأساطير والخرافات في دولة الإمارات، لتغوص في عمق التقاليد المحلية وتأثيرها على الهوية الثقافية.<br></p><p>انضموا إلينا في رحلة أدبية تأخذكم إلى عوالم جديدة!<br></p>', '<p>يلتقي الكتّاب، <b>رشا سمير</b>، <b>أحمد الصادق</b>، و<b>حصة عبد الله</b>، لاستكشاف الأبعاد المثيرة بين الخيال والواقع. يقدمون رؤى فريدة حول الفانتازيا والتاريخ والأساطير، ويكشفون كيف تتداخل هذه العناصر لتشكيل هويات ثقافية غنية. <br></p><p><br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(95, '3939440000085341728', 'هذا ليس فلامنغو', 'thats-not-my-flamingo', '221', 'Published to Website', 'Litfest 2025', 100, 'فانيسا وولف', 'الفعاليات العائلية', 'انتركونتيننتال', NULL, 'المجلس', 'الإنجليزية', NULL, '<p>انضموا إلينا لاكتشاف ممتع في عالم السلسلة العالمية الناجحة \"هذه ليست...\"، المثالية للأيدي الصغيرة الفضولية! <br></p><p>تقدم هذه الكتب التفاعلية التي يمكن لمسها واستشعارها تجربة مليئة بالدهشة والألوان الزاهية، بالإضافة إلى قصص بسيطة وجذابة. تأخذنا راوية القصص البريطانية المحبوبة <b>فانيسا وولف</b> في هذه الجلسة الشيقة، حيث ينطلق الأطفال في مغامرة حسية رائعة، حيث يستمتعون باكتشاف ما سيظهر في القصة التالية، سواء كان كلباً أشعثاً أو ديناصوراً متعرجاً.<br></p><p>هذه الجلسة مثالية للأطفال من 0 إلى 4 سنوات، وستكون خطوة رائعة في رحلة أطفالكم في القراءة.<br></p>', '<p>تدعوكم الكاتبة <b>فانيسا وولف</b> لاستكشاف القوام والألوان من خلال سلسلة الكتب التفاعلية الأكثر مبيعاً على مستوى العالم،&nbsp; \"هذا ليس ...\"، والتي تعتمد على ملامسة العالم من خلال حواسنا الخمس. <br></p><p><br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(96, '3939440000085341272', 'عبد الرزاق قرنح: القاص المحترف', 'an-evening-with-abdulrazak-gurnah', '50', 'Published to Website', 'Litfest 2025', 200, 'عبد الرزاق قرنح', 'الحوارات', 'انتركونتيننتال', NULL, 'البراحة 2', 'الإنجليزية', NULL, '<p>أمسية مستنيرة مع القاص الكبير <b>عبد الرزاق قرنح</b> احتفالاً بإطلاق كتابه القادم \"السرقة\". حصل قرنح على \"جائزة نوبل\" في الأدب عام 2021 وهو معروف على نطاق واسع بأنه أحد أبرز كتّاب ما بعد الاستعمار في العالم، تستكشف رواياته التي لا تعرف المساومة والشفقة مثل \"الجنة\" و\"الحياة بعد الموت\" و\"التحويل\" و\"عن طريق البحر\" موضوعات المنفى والهوية والانتماء. يشارك قرنح مع <b>زينب بدوي</b> النطاق الكامل لإبداعه وإنسانيته ويتأمل حياته المهنية الرائعة والموضوعات التي يكررها باستمرار. <br></p><p><br></p>', '<p>يصعد الكاتب الحائز على جائزة نوبل <b>عبد الرزاق قرنح </b>مسرح مهرجان طيران الإمارات للآداب في حدث خاص للاحتفاء بحياته ومسيرته المهنية الرائعة، يُعرف قرنح على نطاق واسع بأنه أحد أبرز الكُتّاب في العالم&nbsp;وتحاوره&nbsp;&nbsp;<b>زينب البدوي</b> في هذا اللقاء المميز<br></p><p><br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS100', 'D', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(97, '3939440000085077873', 'مستقبل التعاون مع هانو سوير', 'hanno-sauer-on-global-morality', '304', 'Published to Website', 'Litfest 2025', 150, 'هانو سوير;', 'ملتقى الأفكار', 'انتركونتيننتال', NULL, 'خور الأفكار', 'الإنجليزية', NULL, '<p>يستعرض الفيلسوف <b>هانو سوير </b>في كتابه الأخير \"اختراع الخير والشر\" تاريخ الأخلاق وتطورها عبر الزمن ويوجه انتباهه إلى المستقبل في هذا العرض الرائع متأملاً في كيفية مواجهة عالمنا للتحديات العالمية المتزايدة وما المتوقع علينا فعله للاستجابة إليها بحلول منسقة عالمياً. <br></p><p>العالم بحاجة إلى أن يعمل يد بيد لإيجاد حلول مشتركة للسيطرة على الأوبئة والحروب النووية وأزمة تغير المناخ والصراعات الجيوسياسية عبر الدول والحدود ويشمل ذلك توسيع نطاق التعاون ليضم مجموعات أكبر حجماً.<br></p><p>نرى كل هذا وأكثر من خلال نظرة سوير الثاقبة وخبرته في تاريخ الأخلاق وكيف من المفترض أن يكون هذا التعاون تعاون عالمي.<br></p>', '<p>ينظر الفيلسوف <b>هانو سوير</b> إلى المستقبل ويطرح موضوع التعاون العالمي للتغلب على التحديات العالمية والدور الذي تلعبه الأخلاق في إيجاد حلول مشتركة للقضايا الأكثر إلحاحاً.<br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(98, '3939440000085077882', 'ساندرا ميخائيل تتحدث عن حب أمعائك', 'sandra-mikhail-on-loving-your-gut', '305', 'Published to Website', 'Litfest 2025', 150, 'ساندرا ميخائيل', 'ملتقى الأفكار', 'انتركونتيننتال', NULL, 'خور الأفكار', 'الإنجليزية', NULL, '<p>ما الذي تعرفه حقاً عن أمعائك؟ تتعمق أخصائية التغذية ومؤلفة كتاب \"سجلات الأمعاء\" <b>ساندرا ميخائيل</b> في هذه المحاضرة الاستكشافية الصريحة والمستنيرة عن أهمية التغذية الشخصية وصحة الأمعاء، مع التركيز على ميكروبيوم الأمعاء الذي يشير إلى النظام البيئي المتنوع من الميكروبات التي تؤثر على كل شيء من الهضم إلى الصحة العقلية. لا تفوّتوا هذه الجلسة المجانية لتتعلموا كيفية تغذية ميكروبيومك من خلال اختيارات الطعام ونمط الحياة وتحديد المعلومات الصحية المضللة المنتشرة على وسائل التواصل الاجتماعي، اطلقوا العنان للإمكانات الحقيقية لأمعاء سعيدة وصحية.<br></p>', '<p>انضموا إلى أخصائية التغذية <b>ساندرا ميخائيل</b> وهي تستكشف تأثير ميكروبيوم الأمعاء على الصحة وتقدم رؤى حول التغذية وتنفي الأساطير الصحية وتشارك نصائح لتغذية أمعائك من أجل الصحة العامة. <br></p><p><br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(99, '3939440000085077849', 'لالين سوخيرا عن: 250 عاماً من جين أوستن', 'laaleen-sukhera-on-250-years-of-jane-austen', '302', 'Published to Website', 'Litfest 2025', 100, 'لالين سوخيرا', 'ملتقى الأفكار', 'انتركونتيننتال', NULL, 'خور الأفكار', 'الإنجليزية', NULL, '<p>ما الذي يجعل مؤلفة ست روايات فقط رمزاً عالمياً بعد 250 عاماً من ولادتها في قرية هامبشاير الهادئة؟ كيف أصبح اقتباس لجين أوستن أحد أكثر اللحظات تأثيراً في تاريخ التلفزيون؟ ولماذا يُزَين وجه أوستن ورقة نقدية بريطانية من فئة 10 جنيهات إسترلينية؟ تقدم <b>لالين سوخيرا</b>، مُؤسِسِة \"جمعية جين أوستن\" في الشرق الأوسط وشمال إفريقيا وباكستان ومحررة كتاب \"أوستنستان\"، نظرة شخصية وخيالية على حياة الكاتبة جين وإرثها من عام 1775 وحتى 2025. <br></p><p><br></p><p>هذه الجلسة مناسبة للجميع&nbsp; مخصصة لعشاق جين أوستن أو الراغبين في اكتشاف أعمال الكاتبة لأول مرة، من جميع الأعمار.لا تنسوا ارتداء قبعاتكم الأنيقة إن رغبتم!<br></p>', '<p>تقدم <b>لالين سوخيرا</b>، واحدة من عشاق الكاتبة جين أوستن، جلسة استكشافية رائعة عن حياة الكاتبة وإرثها وتأثيرها الدائم على الفن والمجتمع. <br></p><p><br></p><p>لا تنسوا ارتداء قبعاتكم الأنيقة إن رغبتم!<br></p><p><br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(100, '3939440000085077825', 'التفكير العميق مع جيسامي هيبرد', 'jessamy-hibberd-on-the-problems-of-overthinking', '300', 'Published to Website', 'Litfest 2025', 100, 'جيسامي هيبرد', 'ملتقى الأفكار', 'انتركونتيننتال', NULL, 'خور الأفكار', 'الإنجليزية', NULL, '<p>يعتقد معظمنا أن الاجترار هو أسلوب إيجابي للتكيف يساعدنا في التغلب على مشاكلنا، ولكن يوجد خط رفيع بين التفكير العميق والانحدار إلى التفكير المفرط. <br></p><p><br></p><p>يجهل الكثيرون عند وقوعهم في دوامة الهلاك بسبب التفكير المفرط الذي يمكن أن يكون عادة مغرية وخطيرة يصعب إيجاد طريق للخروج منها.<br></p><p><br></p><p>في لقاء عميق مع مؤلفة الكتب الأكثر مبيعاً والطبيبة النفسية السريرية، <b>جيسامي هيبرد</b>، نستكشف مشكلات التفكير المفرط ونحدد خطوات عملية مصممة للمساعدة في التخلص من عادة التفكير المفرط إلى الأبد.<br></p>', '<p>لقاء مثري في انتظاركم تقدمه لكم الطبيبة النفسية السريرية والكاتبة <b>جيسامي هيبرد</b> عن التفكير العميق والخط الفاصل بين التفكير العميق والانحدار إلى العادة الخطيرة المغرية المتمثلة في الإفراط في التفكير.<br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(101, '3939440000096030061', 'رؤى واستراتيجيات شاملة من عالم الأعمال الخيرية', 'unlocking-insights-from-the-business-of-philanthropy', '100', 'Published to Website', 'Litfest 2025', 200, 'سلطان سعود القاسمي, فادي غندور, إيزابيل أبو الهول', 'الحوارات', 'انتركونتيننتال', NULL, 'البراحة 2', NULL, NULL, '<p>&nbsp;في الوقت الذي يكافح فيه العالم لتوفير ما يتراوح بين 5 إلى 7 تريليون دولار سنويًا لتحقيق أهداف التنمية المستدامة للأمم المتحدة لعام 2030، ينشأ نطاق غير مسبوق من رأس المال الخيري، مع نشر ما يقدر بنحو 2 تريليون دولار على مستوى العالم كل عام، بما في ذلك 250 مليار دولار إلى تريليون دولار في الزكاة والصدقة من البلدان ذات الأغلبية المسلمة. وفي حين أن الوصول إلى رأس المال ليس الحاجز الأساسي، يجب أن يتحول التركيز إلى نشره الاستراتيجي والمنسق لتعظيم التأثير. ومن المقرر أن تصبح الأسواق ذات النمو المرتفع، التي تساهم بأكثر من 60٪ من الناتج المحلي الإجمالي العالمي وموطن أسرع الاقتصادات نموًا، محركات رئيسية للابتكار الاجتماعي، مدعومة بأكبر عملية نقل للثروة بين الأجيال في التاريخ. ومع انتقال 83 تريليون دولار عالميًا في العقدين المقبلين، بما في ذلك تريليون دولار في الشرق الأوسط وحده في غضون ست سنوات، فإن الجيل القادم لديه فرصة فريدة للاستفادة من هذه الثروة والأدوات المبتكرة لمعالجة التحديات النظامية. </p><p>تتمتع الأعمال الخيرية الاستراتيجية بإمكانات هائلة لدفع التغيير الاجتماعي على نطاق واسع، إلا أن تأثيرها غالبًا ما يكون مقيدًا بنقص البيانات والبحوث والقيادة. تتطلب معالجة أكثر مشاكل العالم تعقيدًا التعاون بين الأعمال الخيرية والحكومة والشركات. يتعمق هذا الحدث في الرؤى الرئيسية لكتاب \"العمل الخيري\" - وهي سلسلة من المحادثات العالمية التي بدأها <b>بدر جعفر</b> في عام 2021 وبلغت ذروتها بنشر الكتاب - والذي يستكشف المشهد المتطور للأعمال الخيرية مع التركيز على أسواق النمو. وبالاعتماد على رؤى أكثر من 50 قائدًا في قطاعات الأعمال والعمل الخيري والاجتماعي، سيجري سعادة بدر جعفر محادثة مع <b>إيزابيل أبو الهول وفادي غندور وسلطان سعود القاسمي </b>لمناقشة التقاطع بين مبادئ الأعمال والممارسات الخيرية.</p>', '<p>يتطلب تحقيق أهداف التنمية المستدامة للأمم المتحدة لعام 2030 ما بين 5 إلى 7 تريليون دولار سنويًا، مع وجود 2 تريليون دولار من رأس المال الخيري العالمي الذي يوفر إمكانات هائلة. تستكشف هذه الجلسة الأفكار المستمدة من كتاب \"العمل الخيري\" للكاتب <b>بدر جعفر</b>، مع التركيز على الأسواق ذات النمو المرتفع ودور العمل الخيري في قيادة التغيير المنهجي. <br></p><p><br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(102, '3939440000085341863', 'مستعدون حتى بدون خبرة', 'unqualified-but-here-for-it', '85', 'Published to Website', 'Litfest 2025', 100, 'ماتيو أسكاريبور, أليسون ستيدمان, هارشيتا جوبتا', 'بعد النهار في ليل', 'انتركونتيننتال', NULL, 'خور الأفكار', 'الإنجليزية', NULL, '<p>ساعدوني! هل يوجد كاتب هنا؟ انضم إلى بعض من ألمع العقول في \"مهرجان طيران الإمارات للآداب\" في هذه الجلسة الصاخبة بعد المساء واستمع لنصائح عن العلاقات وتأملات في أزمات حياتهم المهنية، مجموعة من نجوم المهرجان يحاولون الإجابة على مجموعة من الأسئلة الملحة التي تدور في ذهنك أنت مع المضيفة دانابل جوتيريز، سيقدمون نصائح غير مشروطة وأصعب الألغاز التي تواجهك في الحب والحياة والأخلاق الحديثة. أرسل أسئلتك بشكل مجهول وشاهد الفوضى وهي تدلي أستارها... <br></p><p><br></p><p>انضموا إلينا في واحدة من أكثر جلسات مهرجان طيران الإمارات للآداب حيوية وإثارة، حيث تجتمع بعض ألمع العقول لتبادل نصائح عن العلاقات والتأملات في أزمات حياتهم المهنية. مجموعة من نجوم المهرجان تسعى للإجابة على الأسئلة الملحة التي تدور في أذهانكم، بمرافقة المضيفة <b>دانابيل جوتيريز</b>.<br></p><p><br></p><p>أرسلوا اسئلتكم واستعدوا لنصائح صريحة وجرعة من التأملات في الحب، والحياة والمزيد.<br></p>', '<p>ينضم نخبة من نجوم الأدب إلى المضيفة <b>دانابيل جوتيريز</b> لتقديم نصائح مختلفة تماماً حول أصعب الألغاز عن الحب والحياة والمزيد. <br></p><p><br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(103, '3939440000085341656', 'حكايات للحروف', 'stories-of-letters', '212', 'Published to Website', 'Litfest 2025', 75, 'ميّ شبقلو', 'الفعاليات العائلية', 'انتركونتيننتال', NULL, 'المجلس', 'العربية', NULL, '<p>هل كنتم تعلمون أن لكل حرف في أبجديتنا الجميلة حكاية خاصة ومثيرة؟ <br></p><p>ننطلق مع الكاتبة <b>ميّ شبقلو&nbsp;</b>في مغامرة حيث نتعرف معاً على قصص ممتعة ونكشف عن أسرار الأحرف بطريقة لم نختبرها من قبل!<br></p><p>ولن يقتصر الأمر على القصص فقط، بل نشارك في تحديات وألعاب تفاعلية تُثري معرفتنا وتضفي على مغامرتنا الكثير من المرح. استعدوا&nbsp; لاستكشاف عالم الحروف والاحتفال بلغتنا الرائعة في أجواء من الفرح والمتعة.<br></p><p><br></p>', '<p>لكل حرف في أبجديتنا الرائعة قصة وحكاية. في سلسلة “حكايات الحروف”، تأخذنا الكاتبة <b>ميّ شبقلو​</b> في مغامرات نكتشف من خلالها جوانب جديدة ومثيرة عن الأحرف العربية، مع تحديات وألعاب ممتعة تختبر معرفتنا.<br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(104, '3939440000085341107', 'ليلة نزار قباني: حب بلا حدود', 'nizar-qabbani-endless-love', '32', 'Published to Website', 'Litfest 2025', 200, NULL, 'الفعاليات الخاصة', 'انتركونتيننتال', NULL, 'البراحة 3', NULL, NULL, '<p>انضموا إلينا في هذه الأمسية الاستثنائية التي تحتفي بحياة وشعر نزار قباني، شاعر الحب والوطن. في هذا الحدث الخاص، سنغوص في أعماق عالمه الشعري من خلال مشاهد درامية حية تُؤدى بعاطفة وعمق، حيث تُجسد قصائده الشهيرة لحظات الحب، الفقد، والحرية على خشبة المسرح. <br></p><p>الموسيقى والغناء سيكونان جزءاً لا يتجزأ من العرض، حيث نستمتع بأداءات لبعض من أجمل الأغاني التي أبدع كلماتها، تغمرنا بأجواء من الرومانسية والشجن.<br></p><p>هذه الأمسية ليست مجرد احتفال بشعر نزار قباني، بل هي رحلة عبر كلماته التي ما زالت حية في ذاكرة كل من يستمع إليها.<br></p>', '<p>أمسية خاصة تحتفي بذكرى شاعر حب والوطن نزار قباني، نستمتع بأداءات مسرحية وغنائية وشعرية تستعيد أجمل أعماله التي عاشت في ذاكرتنا.</p>', 'دبي فيستفال سيتي', 'SSPECIALEVENTS75', 'H', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(105, '3939440000085341952', 'تأثير الاستقرار على الإبداع والمبدع', 'dubai-home-of-creativity', '714', 'Published to Website', 'Litfest 2025', 300, 'نبيل سليمان, ممدوح حمادة, أمل إسماعيل, حوراء النداوي', 'الحوارات', 'انتركونتيننتال', NULL, 'واحة القصص', 'العربية', NULL, '<p>في ظل عالم تسوده الاضطرابات والنزاعات الجيوسياسية، يواجه المبدعون، في مختلف المجالات، تحديات كبرى في العثور على بيئة آمنة ومستقرة تتيح لهم التركيز على إبداعهم بعيداً عن ضغوط الحياة. </p><p>ولتوفير هذه البيئة الآمنة، خصصت دولة الإمارات العربية المتحدة فئة خاصة للمثقفين ضمن منظومة الإقامات الذهبية طويلة الأمد، مما يتيح لهم الفرصة للتركيز على إنتاجهم الإبداعي.</p><p>يناقش هذا الموضوع تجربة أربعة من الكتّاب الحاصلين على الإقامة الذهبية في الدولة، وهم: <b>ممدوح حمادة،</b> ن<b>بيل سليمان</b>، <b>حوراء النداوي</b>،<b> وأمل إسماعيل.</b></p><p>​تقام هذه الجلسة برعاية الإدارة العامة للإقامة وشؤون الأجانب في دبي.</p>', '<p>في ظل النزاعات الجغرافية والسياسية، يناقش كل من <b>ممدوح حمادة</b>، <b>نبيل سليمان</b>، <b>حوراء النداوي</b>، و<b>أمل إسماعيل</b> أهمية الإقامة الذهبية في دولة الإمارات العربية المتحدة ومزايا توفير بيئة آمنة للمبدعين تمكنّهم من العمل والإنتاج.<br></p><p>تقام هذه الجلسة برعاية الإدارة العامة للإقامة وشؤون الأجانب في دبي.</p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(106, '3939440000085341345', 'أليسون ستيدمان: خارج الشخصية', 'alison-steadman-out-of-character', '58', 'Published to Website', 'Litfest 2025', 200, 'أليسون ستيدمان', 'الحوارات', 'انتركونتيننتال', NULL, 'البراحة 3', 'الإنجليزية', NULL, '<p><b>أليسون ستيدمان</b> هي واحدة من أكثر الممثلات المحبوبات في بريطانيا ومن أعمالها: \"المكسرات في مايو\"، و\"حفل ابيجيل\"، و\"كبرياء وتحامل\" و\"جافين وستاسي\". <br></p><p><br></p><p>انضموا إليها في حديث مع <b>فيونا ليندسي</b> تشارك فيه قصصاً وحكايات من حياتها الشخصية ومسيرتها المهنية التي تزيد عن 60 عاماً، بدءاً من نشأتها في الطبقة العاملة في ليفربول بعد الحرب إلى وصولها للقبول والتقدير لمسيرتها التلفزيونية والمسرحية والتحديات للتوفيق بين العمل والحياة الأسرية.<br></p><p><br></p><p>هذه المناقشة المليئة بالصراحة والدفء هي بمثابة قصيدة عن حياة ستيدمان المذهلة داخل شخصياتها وخارجها.<br></p><p><br></p><p>لا تفوتوا فرصة الاستماع إلى هذه الراوية الموهوبة والفكاهية بكلماتها الخاصة بها.<br></p>', '<p>في حدثٍ لا يُفوّت، تشاركنا الكنز الوطني البريطاني <b>أليسون ستيدمان</b> قصة حياتها بكل صراحة ودفء. ستيدمان هي واحدة من أكثر رواة القصص المفعمين بالموهبة وروح الدعابة في العالم.<br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(107, '3939440000085341173', 'كسر القاعدة', 'breaking-the-mould', '38', 'Published to Website', 'Litfest 2025', 150, 'تريشيا هيرسي, إيما دابيري, سوبهادرا داس', 'الحوارات', 'انتركونتيننتال', NULL, 'الراس 2', 'الإنجليزية', 'اللغة الإنجليزية إلى اللغة العربية; اللغة العربية إلى اللغة الإنجليزية', '<p>يبدو أن العالم يحكمه أنظمة خارجة عن سيطرتنا! إنها أفكار عفا عليها الزمن حول التاريخ والإنتاجية والجمال والوجود، تُشكل هذه الأفكار السائدة حياتنا اليومية بطرق عميقة وغالباً ما تقودنا إلى مسارات مألوفة؛ التي بدورها تحد من إحساسنا بالثقة وقيمتنا لذواتنا، هل يمكننا مقاومة الأعراف والسير في طريق غير معهود؟ <br></p><p>في نقاش شيق يجمع<b> إيما دابيري</b>، مؤلفة كتاب \"الأجساد العصية\"، و<b>سوبهادرا داس</b>، مؤلفة كتاب \"غير متحضر: عشر أكاذيب صنعت الغرب\"، و<b>تريشيا هيرسي</b>، مؤلفة كتاب \"سوف نرتاح!\" مع <b>حفصة لودي</b> يجبن من خلال أعمالهن عن القصص التي نعيشها وكيف نوفر مساحة لأفكار وطرق جديدة للوجود.<br></p>', '<p>في نقاش شيق يجمع <b>إيما دابيري</b>، مؤلفة كتاب \"الأجساد العصية\"، و<b>سوبهادرا داس</b>، مؤلفة كتاب \"غير متحضر: عشر أكاذيب صنعت الغرب\"، و<b>تريشيا هيرسي</b>، مؤلفة كتاب \"سوف نرتاح!\"، يجبن من خلال أعمالهن عن القصص التي نعيشها وكيف نوفر مساحة لأفكار وطرق جديدة للوجود.<br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(108, '3939440000085341091', 'زينب بدوي: التاريخ الأفريقي لأفريقيا', 'zeinab-badawi-an-african-history-of-africa', '31', 'Published to Website', 'Litfest 2025', 200, 'زينب بدوي', 'الحوارات', 'انتركونتيننتال', NULL, 'البراحة 3', 'الإنجليزية', NULL, '<p>تتمتع أفريقيا بتاريخٍ حافل بدايةً من حضاراتها القديمة إلى إمبراطورياتها في العصور الوسطى ووصولاً إلى فترات التغيرات العالمية التي شهدتها في القرون الأخيرة، لكن لفترة طويلة جداً كان تاريخ القارة خاضعاً للهيمنة أو التجاهل ببساطة من قبل الروايات الغربية. رفعت المذيعة والصحفية والمخرجة السينمائية البارزة<b> زينب بدوي</b> الستار عن ماضي أفريقيا الحافل من خلال سفرها إلى أكثر من 30 دولة والتحدث مع عدد لا يحصى من المؤرخين وعلماء الأنثروبولوجيا وعلماء الآثار ورواة القصص لوضع الأمور في نصابها الصحيح. في هذه الجلسة، تنضم زينب بدوي إلى <b>حارث البستاني </b> لسرد ما تعلمته وأرخته في كتابها \"التاريخ الأفريقي لأفريقيا\".<br></p>', '<p>تناقش المذيعة والصحفية والمخرجة السينمائية الحائزة على عدة جوائز،<b> زينب بدوي</b>، تاريخ إفريقيا في كتابها المثير للاهتمام والمدروس بعناية حول القارة التي مهدت للبشرية.<br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(109, '3939440000085341809', 'كل ما يلمع!', 'all-that-glitters', '79', 'Published to Website', 'Litfest 2025', 150, 'أليكس برون, موكسي أندرسون, باسل اليافي, جون شينتون, كيثيلن جميلي, ماثيو كوربيت, نادين بسيوني, نسيمة فرنسيس, باولو سلوبودا, ريا صموئيل, رومينا ساتفاتمانيش', 'الفعاليات الخاصة', 'انتركونتيننتال', NULL, 'البراحة 3', 'الإنجليزية', NULL, '<p>ماذا يحدث عندما تجمع بين مجموعة من الممثلين البارعين في الدراما والمقتنعين بعظمتهم مع مخرج طموح ومسيطر ومساعد صبور وموقع تصوير مغلق؟ أوه، وهل ذكرنا الجثة؟ لدى الجميع دافع ولا أحد في مأمن في لغز القتل المتألق هذا، يوجد شيء واحد مؤكد مع استمرار تراكم الجثث: شخص ما يستعد للتصوير عن قرب. هل ستحلون اللغز؟ أم ستُتهمون ظلماً؟ ربما سنكتشف أنكم أنتم خلف هذا طوال الوقت. على أي حال.. أنتم مدعوون إلى عشاء مع النجوم. <br></p><p>أضواء.. كاميرا... أكشن.<br></p>', '<p>انضموا إلى عشاء مليء بالنجوم على شرف جريمة قتل، حيث يخلق طاقم درامي ومخرج مسيطر وجثة حالة من الفوضى، هل يمكنكم حل القضية قبل أن تسقط الجثة التالية مع وجود كل المشتبه بهم؟ أضواء.. كاميرا... أكشن! <br></p>', 'دبي فيستفال سيتي', 'SSPECIALEVENTS425', 'L', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(110, '3939440000085341164', 'مها أبو العينين: 7 قواعد للاعتماد على الذات', 'maha-aboueleneins-7-rules-of-self-reliance', '37', 'Published to Website', 'Litfest 2025', 150, 'مها أبو العينين', 'الحوارات', 'انتركونتيننتال', NULL, 'الراس 2', 'الإنجليزية', 'اللغة الإنجليزية إلى اللغة العربية; اللغة العربية إلى اللغة الإنجليزية', '<p>تلخص خبيرة الاتصالات الاستراتيجية والعلامات التجارية الشخصية المشهورة عالمياً، <b>مها أبو العينين</b>، عقوداً من الخبرة لتعلمكم كيفية استخدام أعظم أصولكم، ذواتكم، لتحقيق أحلامكم. استوحت مها أبو العنين كتابها \"7 قواعد للاعتماد على الذات\" من تعاليم والدها وبالاعتماد على الحكايات الشخصية واللقاءات المهنية وابتكرت الخبيرة إطاراً قوياً للتعامل مع متطلبات العالم الذي يتسم بالتغير السريع وكيفية تحديد الوقت المناسب للعثور على الفرص واغتنامها، سواء في حياتكم الشخصية أو المهنية أو الإبداعية، تستعرض مها أبو العنين أدواتها العملية مع (اسم مدير الجلسة) لتحقيق النجاح بغض النظر عن الظروف.<br></p>', '<p>انضموا إلى خبيرة الاتصالات الاستراتيجية والعلامات التجارية الشخصية المشهورة عالمياً، <b>مها أبو العينين</b>، ومؤلفة \"7 قواعد للاعتماد على الذات\"، لمعرفة كيفية استخدام أعظم أصولكم لتحقيق أحلامكم وهي \"ذواتكم\".<br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(111, '3939440000085341845', 'مأدبة عشاء فلسطينية', 'the-bethlehem-banquet', '83', 'Published to Website', 'Litfest 2025', 160, 'فادي قطان', 'الفعاليات الخاصة', 'انتركونتيننتال', NULL, 'مطعم زيتون', 'الإنجليزية', NULL, '<p>كتاب \"بيت لحم\" هو أحدث إصدارات الشيف الفرنسي الفلسطيني <b>فادي قطان</b>، هذا الكتاب هو أكثر من مجرد مجموعة بسيطة من الوصفات، بل هو تكريم للناس والأماكن والمنتجات التي تنتجها أرض بيت لحم، يأخذ الكاتب القُراء في جولة عبر المدينة والتلال والصحراء وبساتين الزيتون والبرتقال والمزارع التي يطلق عليها الفلسطينيون اسم الوطن. ينضم قطان إلى <b>بيمان برهام العوضي</b>&nbsp;لمناقشة رحلته الشخصية كمؤلف وطاهٍ في حدث خاص يجمع بين الحوار العميق والطعام الشهي لنحتفل بتربة المنطقة العريقة ومكوناتها البارزة وتقاليدها وقدرتها على الصمود، لا تفوُتوا هذه القصيدة المؤثرة التي تتغنى بالثقافة الفلسطينية ومطبخها التراثي. <br></p><p><br></p>', '<p>احتفلوا مع الشيف<b> فادي قطان</b> بكتابه \"بيت لحم\" الذي يجمع بين روعة المطبخ الفلسطيني وجمال الأرض المباركة. استمتعوا بعشاء فاخر يحمل نكهات ممتزجة بالشغف والتقاليد والحنين. <br></p>', 'دبي فيستفال سيتي', 'SSPECIALEVENTS425', 'L', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(112, '3939440000085341245', 'زلفا قطوح: الحب والخسارة في سوريا', 'zoulfa-katouh-love-and-loss-in-syria', '47', 'Published to Website', 'Litfest 2025', 85, 'زلفا قطوح', 'الحوارات', 'انتركونتيننتال', NULL, 'الأمواج', 'الإنجليزية', NULL, '<p>أشادت صحيفة \"ذا تايمز\" على رواية \"طالما تنمو أشجار الليمون\" للكاتبة صاحبة الكتب الأكثر مبيعاً والحائزة على عدة جوائز،<b> زلفا قطوح</b>، بقول: \"استحضار للمكان والزمان وخشونته وتطوره\"، ألّفت زلفا قطوح قصة تحبس الأنفاس عن الحب والخسارة في سوريا، إذ تدور أحداث القصة خلال الحرب الأهلية في سوريا حيث تعيش الكاتبة سلامة كساب البالغة من العمر 18 عاماّ حياة مليئة بالألم والمشقة ويعتليها الخوف والهلوسة بسبب قسوة ما رأته. تتحدث <b>ريا شديد</b>&nbsp;مع الكاتبة عن هذه الرواية الرقيقة التي تؤلم القلب ويستعرضون من خلال النقاش المرونة والإيمان والمخاطر التي يجب أن نتحملها أحياناً سعياً وراء الأمل.<br></p>', '<p>تناقش المؤلفة الأكثر مبيعاً والحائزة على عدة جوائز، <b>زلفا قطوح</b>، روايتها \"طالما تنمو أشجار الليمون\"، وهي رواية مؤلمة عن سن الرشد خلال&nbsp; الحرب الأهلية في سوريا.<br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(113, '3939440000085341399', 'العرب في عيون العالم: الأدب والترجمة كنافذة على الهوية العربية', 'arabs-through-global-eyes', '64', 'Published to Website', 'Litfest 2025', 315, 'سوسن بنعرفة, صالحة غابش, عيسى ناصري', 'الحوارات', 'انتركونتيننتال', NULL, 'الراس 2', 'العربية', 'اللغة الإنجليزية إلى اللغة العربية; اللغة العربية إلى اللغة الإنجليزية', '<p>كيف يسهم الأدب العربي في صياغة صورة العرب أمام العالم؟ وما الدور الذي تلعبه الترجمة في تعزيز الحوار الثقافي بين الشعوب؟ <br></p><p>في هذه الجلسة المميزة، يجتمع كل من <b>عيسى ناصري</b>، <b>سوسن بنعرفة،</b> و<b>صالحة غابش،</b>&nbsp; لاستكشاف الأثر العميق للأدب العربي على الساحة الدولية.<br></p><p>نتناول ما يقدمه الأدب من صور جديدة وحقيقية للعرب، بعيداً عن القوالب النمطية، ودور الترجمة الحيوي في إيصال جوهر الأعمال العربية إلى الجمهور من حول العالم.<br></p><p>استعدوا لنقاشات ثرية حول دور الأدب والترجمة في بناء جسور من التفاهم والتواصل بين الثقافات المختلفة. ماهي فعلاً قوة الأدب كأداة لتشكيل الوعي وتوسيع الآفاق؟<br></p>', '<p>مع <b>عيسى ناصري</b>، <b>سوسن بنعرفة</b>، و<b>صالحة غابش</b>، نفهم دور الأدب العربي في صياغة صورة العرب أمام العالم ومدى مساهمة الترجمة في نقل روح وأصالة الأعمال الأدبية العربية إلى الجمهور من حول العالم. <br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(114, '3939440000085341281', 'عالم من جسور: الطرق المتعددة إلى السلام الإنساني والتسامح', 'a-world-of-bridges', '51', 'Published to Website', 'Litfest 2025', 198, 'نورة الكربي, عبد الإله بنعرفة', 'الحوارات', 'انتركونتيننتال', NULL, 'البراحة 1', 'العربية', 'اللغة الإنجليزية إلى اللغة العربية; اللغة العربية إلى اللغة الإنجليزية', '<p>حين كتب الدكتور <b>عبد الإله بنعرفه</b> روايته الأحدث \"لا فتى إلا علي\"، هل كان يسعى إلى بناء مساحة من التفاهم حول إحدى أكثر الشخصيات جدلاً في التاريخ الإسلامي؟ ثم كيف استطاعت الدكتورة <b>نورة الكربي</b> من العمل على قضية التسامح والتقريب الإنساني في بيئة متغيرة مثل بيئة شباب الجامعة؟ <br></p><p>يناقش المتحدثون رؤية معاصرة حقيقية وملموسة تهدف إلى تحقيق عالم يسوده التسامح والتفاهم الإنساني والسلام.<br></p>', '<p>يناقش كل من الدكتور <b>عبد الإله بنعرفة</b>&nbsp;والدكتورة <b>نورة الكربي</b> رؤية معاصرة حقيقية وملموسة تهدف إلى تحقيق عالم يسوده التسامح والتفاهم الإنساني والسلام. <br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(115, '3939440000085250188', 'رشفة عبر الزمن', 'a-sip-through-time', '15', 'Published to Website', 'Litfest 2025', 140, 'ماجد الأهدل', 'بعد النهار في ليل', 'انتركونتيننتال', NULL, 'خور الأفكار', 'العربية', NULL, '<p>تجربة غامرة في تذوّق القهوة واستكشاف أسرار إنتاجها وتحضيرها، حيث سنغوص في عالم القهوة من خلال مقارنة شيقة بين طقوس القهوة العربية التقليدية وأصناف القهوة المعاصرة المفضلة. <br></p><p>يقدم <b>ماجد الأهدل</b>، مؤلف كتاب \"ديوان القهوة\"، رؤى عميقة حول رحلة القهوة وهويتها، مستعرضاً التحديات التاريخية التي واجهتها، بما في ذلك التحريم والقيود الثقافية. كيف يمكن للقهوة أن تجمع بين التاريخ والتراث والابتكار في كل فنجان؟<br></p>', '<p>يقدم <b>ماجد الأهدل</b>، مؤلف كتاب \"ديوان القهوة\"، رؤى حول رحلة القهوة وهويتها، بما في ذلك التحديات عبر التاريخ <br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(116, '3939440000085341601', 'لنجعل العلوم ممتعة!', 'making-science-fun', '206', 'Published to Website', 'Litfest 2025', 220, 'مهند ساينس', 'الفعاليات العائلية', 'انتركونتيننتال', NULL, 'البراحة 2', 'الإنجليزية', NULL, '<p>انضموا إلى<b> مهند سينس</b> وتعلّموا كيف يحول العلوم اليومية إلى مغامرات تفاعلية مثيرة في جلسة مصممة خصيصاً للأطفال، تدعوكم كل لحظة إلى رؤية العالم من حولكم بفضول جديد بدءاً من التجارب المدهشة وصولاً إلى الأنشطة العملية، هل تساءلت يوماً كيف يمكن لبالون بسيط أن يحرك جسماً؟ أو كيف يمكن للماء أن يتغير شكله؟ يقدم مهند إجابات علمية بطريقة ممتعة وحيوية ويحول دروس العلوم إلى تجارب لا تُنسى. سواء كانت لديكم قائمة من الأسئلة أو كنتم راغبين ببعض المفاجآت المذهلة؛ فإن هذه الجلسة الخاصة تعدكم بالإثارة والاكتشاف! <br></p><p><br></p>', '<p>انضموا إلى <b>مهند سينس</b> لمغامرة عملية وحيوية يتحول فيها العلم اليومي إلى شيء غير عادي لتكشف التجارب المدهشة عن منظور جديد للعالم من حولك! <br></p><p><br></p>', 'دبي فيستفال سيتي', 'SFAMILYACTIVITIES50', 'E', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(117, '3939440000085341408', 'شخصيات حية', 'living-legends', '65', 'Published to Website', 'Litfest 2025', 315, 'ممدوح حمادة, نادية النجار', 'الحوارات', 'انتركونتيننتال', NULL, 'الراس 2', 'العربية', 'اللغة الإنجليزية إلى اللغة العربية; اللغة العربية إلى اللغة الإنجليزية', '<p>انضموا إلى جلسة مميزة تجمع بين السيناريست <b>ممدوح حمادة</b>، الكاتبة <b>حنين الصايغ</b>، والروائية <b>نادية النجار</b>، إذ يتحدثون عن فن ابتكار الشخصيات التي تنبض بالحياة على الورق وتُحاكي الواقع على الشاشة. كيف يستمر الكتّاب في صياغة شخصيات تتجاوز حدود القصص لتصبح جزءاً من وجداننا، سواء في الأدب أو التلفزيون؟ <br></p><p>استعدوا لاكتشاف الأسرار التي تجعل هذه الشخصيات ترافقنا طويلاً حتى بعد طي صفحات الكتاب أو انتهاء الحلقة الأخيرة من المسلسل.<br></p><p><br></p>', '<p>انضموا إلى جلسة مميزة تجمع بين السيناريست <b>ممدوح حمادة</b>، الكاتبة <b>حنين الصايغ</b>، والروائية <b>نادية النجار</b>، حيث يتحدثون عن فن ابتكار الشخصيات التي تنبض بالحياة على الورق وتُحاكي الواقع على الشاشة. <br></p><p><br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(118, '3939440000085341317', 'آفاق الإبداع: مبادرات دولة الإمارات لدعم الكتّاب والمثقفين', 'cultural-initiatives-of-the-uae', '55', 'Published to Website', 'Litfest 2025', 198, 'إيزابيل أبو الهول, سعادة الدكتور علي بن تميم, سعادة مروة العقروبي', 'الحوارات', 'انتركونتيننتال', NULL, 'البراحة 1', 'العربية', 'اللغة الإنجليزية إلى اللغة العربية; اللغة العربية إلى اللغة الإنجليزية', '<p>تستعرض هذه الجلسة الحوارية المبادرات الثقافية الرائدة التي أطلقتها دولة الإمارات العربية المتحدة لدعم المثقفين، بدءاً من برامج الزمالة الأدبية التي تفتح آفاقاً جديدة للكتّاب، وصولاً إلى الجوائز التي تحتفي بالتميّز والابتكار، وكذلك المنح التي تتيح فرصاً ثمينة لإبراز المواهب.</p><p>يشارك سعادة الدكتور <b>علي بن تميم</b>، رئيس مركز أبوظبي للغة العربية، وسعادة <b>مروة العقروبي</b>، مديرة مشروع بيت الحكمة، وسعادة <b>ابراهيم الهاشمي</b>، المدير التنفيذي لمؤسسة سلطان بن علي العويس الثقافية، و<b>إيزابيل أبو الهول</b>، المؤسِّسة والمستشارة، وعضو مجلس أمناء مؤسسة الإمارات للآداب، لمناقشة أثر هذه البرامج في إثراء المشهد الثقافي وتعزيز الإنتاج الأدبي محلياً وعالمياً.</p>', '<p>في جلسة ثرية، يشارك سعادة الدكتور <b>علي بن تميم</b>، وسعادة <b>مروة العقروبي</b>، وسعادة<b> ابراهيم الهاشمي</b>، و<b>إيزابيل أبو الهول</b>، للحديث عن أبرز المبادرات الثقافية التي تطلقها دولة الإمارات العربية المتحدة لدعم الكتّاب والمثقفين، بدءاً من برامج الزمالة الأدبية، مروراً بالجوائز المتنوعة، ووصولاً إلى المنح الثقافية الداعمة للمبدعين؛ ويتطرقون إلى مدى أهمية هذه البرامج في تعزيز الإنتاج الإبداعي على المستويين المحلي والعالمي.<br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(119, '3939440000085341326', 'ألكسندر ماكناب: أطفال الرمال السبعة', 'alexander-mcnabb-the-children-of-the-seven-sands', '56', 'Published to Website', 'Litfest 2025', 200, 'الكساندر مكناب', 'الحوارات', 'انتركونتيننتال', NULL, 'الراس 3', 'الإنجليزية', NULL, '<p><p style=\"text-align: right; margin-top: 0px\" align=\"right\">انضموا إلى المؤلف <b>ألكسندر مكناب</b> في نقاش استثنائي حول كتابه الجديد \"أبناء الرمال السبعة\". يأخذنا مكناب في رحلة عميقة عبر تاريخ دولة الإمارات الغني والمعقد، بدءاً من دورها القديم كمركز للتجارة في شبكات حضارة مجان، وصولاً إلى تطورها لتصبح دولة حديثة. من خلال استكشاف 130,000 سنة من الصمود في واحدة من أصعب البيئات على وجه الأرض، يعرض مكناب كيف كانت هذه المنطقة شاهدة على صعود الحضارة، وتطور المدن قبل الإسلام، والإرث البحري الذي أسهم في تشكيل التجارة العالمية. ومن خلال خبرته التي تمتد لأكثر من 35 عاماً في الشرق الأوسط، يقدم مكناب رؤى فريدة حول كيفية انتقال هذه المنطقة من تجارة النحاس القديمة إلى قيام دولة الإمارات في عام 1971. <br></p></p>', '<p><p style=\"text-align: right; margin-top: 0px\" align=\"right\">&nbsp;انضموا إلى المؤلف<b> ألكسندر مكناب</b> في حوار شيق حول كتابه \"أبناء الرمال السبعة\"، حيث يأخذنا في رحلة عبر تاريخ دولة الإمارات، من طرق التجارة القديمة وصولاً إلى التحول الحديث الذي جعلها في طليعة الأمم. <br></p></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(120, '3939440000085341308', 'عالم جديد شجاع', 'a-brave-new-world', '54', 'Published to Website', 'Litfest 2025', 198, 'أحمد الصادق, عيسى ناصري, حوراء النداوي, نهلة الفهد', 'الحوارات', 'انتركونتيننتال', NULL, 'البراحة 1', 'العربية', 'اللغة الإنجليزية إلى اللغة العربية; اللغة العربية إلى اللغة الإنجليزية', '<p>مع تسارع وتيرة التكنولوجيا وتغير شكل العالم كما نعرفه، يبرز سؤال جوهري: كيف ستتفاعل الفنون مع هذا التحول السريع؟ في هذه الجلسة الملهمة، يجتمع نخبة من الفنانين الشباب، الكاتب <b>أحمد الصادق</b>، الكاتب والشاعر&nbsp;<b>عيسى ناصري</b>، والكاتبة <b>حوراء النداوي</b>، والمخرجة السينمائية <b>نهلة الفهد،</b> لاستكشاف تأثير هذه التطورات على المشهد الإبداعي. هل ستتغير أدوار الكتّاب والفنانين وصناع الأفلام لتصبح أكثر عمقاً وتعقيداً؟ <br></p><p>نغوص في كيفية استعداد الجيل الجديد من المبدعين لمواجهة التحديات التي تلوح في الأفق، مع تسليط الضوء على الفرص التي يتيحها العصر الرقمي. إنها جلسة تُحفز التفكير وتفتح آفاقاً جديدة للإبداع الفني والثقافي، حيث نعيد صياغة ملامح الفنون في عالم متغير.<br></p>', '<p>في ظل تسارع وتيرة التكنولوجيا وتغير ملامح العالم كما نعرفه، يبرز سؤال مهم: كيف ستتفاعل الفنون مع هذه التحولات؟ يلتقي الفنانون الشباب <b>أحمد الصادق</b>، و<b>عيسى ناصري</b>، و<b>حوراء النداوي</b>، و<b>نهلة الفهد</b>، لاستكشاف تأثير هذه التطورات على إبداعاتهم والمشهد الفني بشكل عام. <br></p><p><br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(121, '3939440000085250242', 'أبراهام فيرجيز: عهد الماء', 'abraham-verghese-the-covenant-of-water', '21', 'Published to Website', 'Litfest 2025', 680, 'أبراهام فيرجيز', 'الحوارات', 'انتركونتيننتال', NULL, 'واحة القصص', 'الإنجليزية', NULL, '<p>أظهرت رواية الطبيب والمؤلف <b>أبراهام فيرجيز</b> \"قطع الحجر\" التي أُصدرت في عام 2009 براعته في اللغة والسرد واستحق بجدارة أن يكون \"ظاهرة أدبية\"، يسلط فيرجيز الضوء على ولاية كيرلا الهندية في روايته الجديدة \"عهد الماء\" التي من خلالها يمد يد العون إلى بيج أماتشي، وهي أم حاكمة تحاول حل لغز مستمر في عائلتها وهو وفاة شخص واحد على الأقل في كل جيل بسبب الغرق. ينضم فيرجيز إلى&nbsp;<b>(MODERATOR NAME)</b> لمناقشة ملحمة عائلته المؤثرة للغاية، تروي هذه القصة خسارة مفجعة وتحولات لا يمكن تصورها ولكن تتخلل هذه الفواجع لحظات رائعة من الفكاهة والنِعم.<br></p>', '<p>يتحدث الظاهرة الأدبية <b>أبراهام فيرجيز</b> عن ملحمته العائلية المؤثرة والأكثر مبيعًا، \"عهد الماء\"، والتي تدور أحداثها في ولاية كيرلا بالهند. أشادت أوبرا وينفري على هذه الرواية ووصفتها بأنها \"لا يمكن التوقف عن قراءتها\".<br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS100', 'D', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(122, '3939440000085250161', 'على خطى الراوي', 'in-the-footsteps-of-a-storyteller', '12', 'Published to Website', 'Litfest 2025', 198, 'محمد المنسي قنديل', 'الحوارات', 'انتركونتيننتال', NULL, 'البراحة 1', 'العربية', 'اللغة الإنجليزية إلى اللغة العربية; اللغة العربية إلى اللغة الإنجليزية', '<p>اكتشفوا سحر الأدب من خلال عيون واحد من أبرز كتّاب الوطن العربي، د. <b>محمد المنسي قنديل</b>. <br></p><p>في هذه الجلسة الملهمة، نرافق قنديل في رحلة ممتدة عبر الزمن، حيث تتشابك خيوط الواقع بالخيال، وتعيش الشخصيات الملحمية حياتها اليومية. كيف شكلت تجاربه الشخصية وعشقه للتاريخ والموروث الثقافي أعماله التي تأسر العقول وتثري القلوب؟<br></p><p>انضموا إلينا لاكتشاف أسرار الحكايات التي صاغت مسيرته الأدبية، واستمتعوا بحديث عن الشغف والإبداع والبحث الدائم عن الجمال بين صفحات الكتب<br></p>', '<p>اكتشفوا روعة الأدب من خلال عيون أحد أبرز كتّاب الوطن العربي، <b>د. محمد المنسي قنديل</b>. نرفع الستار عن تجاربه الشخصية وعشقه للتاريخ والموروث الثقافي والسر وراء أعماله التي تأسر العقول وتثري القلوب. <br></p><p><br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(123, '3939440000085341674', 'تعرفوا على ليموني سنيكت!', 'meet-lemony-snicket', '214', 'Published to Website', 'Litfest 2025', 680, 'دانيال هاندلر المعروف باسم ليموني سنيكيت', 'الفعاليات العائلية', 'انتركونتيننتال', NULL, 'واحة القصص', 'الإنجليزية', NULL, '<p>أرجوكم انظروا بعيداً، ستكون حياتكم أكثر متعة إذا توقفتم عن قراءة هذا على الفور. هل ما زلتم هنا؟ حسناً، لقد حذرناكم. استعدوا لصباح من البؤس والويلات حيث يصعد ليموني سنيكيت أو ربما شخصيته البديلة <b>دانيال هاندلر </b>إلى مسرح المهرجان في هذه الجلسة الخاصة للأطفال والكبار الفضوليين على حد سواء. يجلس راوي سلسلة \"أحداث مؤسفة\" التي تم تحويلها إلى فيلم في عام 2004، ومؤخراً مسلسل على منصة \"نيتفلكس\"، مع <b>جاك ميجيت فيليبس</b> في حدث شخصي نادر. سيكون عشاق ليموني سنيكيت في غاية سعادتهم.<br></p>', '<p>استعدوا لصباح مليء بالبؤس والويلات مع ليموني سنيكيت راوي سلسلة \"أحداث \"مؤسفة\" في مسرح مهرجان طيران الإمارات للآداب.<br></p>', 'دبي فيستفال سيتي', 'SFAMILYACTIVITIES75', 'F', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(124, '3939440000085341046', 'أنا لا أكذب.. لكنني أكتب: هل للأدب وجه قبيح؟', 'i-dont-lie-i-write', '26', 'Published to Website', 'Litfest 2025', 198, 'رشا سمير, علي الشعالي, نبيل سليمان', 'الحوارات', 'انتركونتيننتال', NULL, 'البراحة 1', 'العربية', 'اللغة الإنجليزية إلى اللغة العربية; اللغة العربية إلى اللغة الإنجليزية', '<p>هل الألم فعلاً هو محرك الإبداع؟ <br></p><p>في هذه الجلسة، نستكشف الجوانب غير المريحة والمظلمة للكتابة، والتي غالباً ما تبقى مخفية خلف جماليات النصوص. نناقش ما يُعرف بالوجه القبيح للأدب مثل الصراعات الداخلية التي يعاني منها الكتّاب، والقلق، والشعور بالعزلة، والألم النفسي الذي قد يرافق عملية الإبداع.<br></p><p>هل يعكس الأدب أحياناً الحقائق القاسية للحياة، مثل الفقد، والإخفاقات، أو الأزمات الاجتماعية؟ وكيف تؤثر هذه العناصر على رؤية الكتّاب وما يختارون تقديمه للقارئ؟ هل تُستنزف هذه المشاعر خلال عملية الكتابة؟<br></p><p>تنضم إلينا الكاتبة<b> رشا سمير</b>، والكاتب والشاعر <b>علي الشعالي</b>، والدكتور<b> نبيل سليمان</b> في حوار عميق وصريح، حيث نفهم كيف يمكن لهذه الجوانب أن تُشكّل الأعمال الأدبية وتجعلها أكثر قرباً من الواقع، بينما نتساءل: هل يمكن للأدب أن يكون أداة لتحويل الألم إلى أمل؟<br></p>', '<p>في جلسة عميقة وصريحة مع كل من <b>رشا سمير </b>و<b>علي الشعالي</b> و<b>نبيل سليمان</b>، نفهم الصراعات الداخلية التي يعاني منها الكتّاب مثل القلق، والشعور بالعزلة، والألم النفسي الذي قد يرافق عملية الإبداع ونبحث عن إجابة لأهم سؤال: هل يمكن للأدب أن يكون أداة لتحويل الألم إلى أمل؟ <br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(125, '3939440000085077699', 'المهرجان بنكهة طفولية! النسخة الانجليزية', 'children-take-over-litfest-english-edition', '201', 'Published to Website', 'Litfest 2025', 220, 'اشي اديتيا, عفراء راشد الظاهري, كريم صدّيقي, ونديرلا ماجومدار, أوليفيا بالك, عمر حسين, رالف طوق, شانتي ألارد, عمير كيداوي', 'الفعاليات العائلية', 'انتركونتيننتال', NULL, 'البراحة 2', 'الإنجليزية', NULL, '<p>انضموا إلينا للاحتفاء ببعض من أصغر وألمع المؤلفين في دبي. سيتحدث هؤلاء الكتاب الناشئون عن تجاربهم الإبداعية، ويقرؤون مقتطفات من كتبهم، ويشاركوننا مصادر إلهامهم. <br></p><p>يجب أن يكون الأطفال دون سن 12 برفقة شخص بالغ يحمل تذكرة.<br></p>', '<p>انضموا إلينا للاحتفاء ببعض من أصغر وألمع المؤلفين في دبي. سيتحدث هؤلاء الكتاب الناشئون عن تجاربهم الإبداعية، ويقرؤون مقتطفات من كتبهم، ويشاركوننا مصادر إلهامهم.<br></p><p><br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30');
INSERT INTO `ar_sessions` (`id`, `session_id`, `session_name`, `session_slug`, `session_number`, `session_website_status`, `session_year`, `no_normal_tickets`, `session_authors`, `session_category`, `session_venue`, `age`, `session_room`, `session_language`, `session_translation`, `session_blurb`, `session_short_blurb`, `session_location`, `det_code`, `pricetype`, `created_at`, `updated_at`) VALUES
(126, '3939440000085341055', 'الضحك في الظلام، حين تلتقي الكوميديا بالواقع', 'tickling-the-dark-side', '27', 'Published to Website', 'Litfest 2025', 198, 'أحمد الصادق; ممدوح حمادة;', 'بعد النهار في ليل', 'انتركونتيننتال', NULL, 'البراحة 1', 'العربية', 'اللغة الإنجليزية إلى اللغة العربية; اللغة العربية إلى اللغة الإنجليزية', '<p>للضحك تلك القدرة على التخفيف من تأثير كل ما لا نحبه في هذا العالم، ولهذا وُجدت الكوميديا! <br></p><p>الفنان الذي يستطيع أن يجعل غيره يضحك على مصاعب الحياة، ويحول السخرية إلى سلاح في وجه القبح، هو بلا شك فنان حقيقي يمتلك سراً من أعمق أسرار الإبداع العبقري.<br></p><p>يخبرنا كل من السيناريست <b>ممدوح حمادة</b>، المبدع وراء عدد من المسلسلات الشهيرة مثل \"ضيعة ضايعة\" و\"بقعة ضوء\"، والكاتب <b>أحمد الصادق</b>، مؤلف كتاب \"عشر محاولات فاشلة للانتحار\"، عما يحدث عندما تلتقي الكوميديا بعالم الواقع، وكيف يخرج إلى النور ما نسميه \"الكوميديا السوداء\".<br></p><p><br></p>', '<p>يخبرنا السيناريست <b>ممدوح حمادة</b> والكاتب<b> أحمد الصادق</b>، عما يحدث عندما تلتقي الكوميديا بعالم الواقع، وكيف يخرج إلى النور ما يُعرف بـ\"الكوميديا السوداء\". <br></p><p><br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(127, '3939440000085341037', 'الجسد حقيبة سفر', 'the-everlasting-walk', '25', 'Published to Website', 'Litfest 2025', 198, 'واسيني الأعرج, محمد المنسي قنديل', 'الحوارات', 'انتركونتيننتال', NULL, 'البراحة 1', 'العربية', 'اللغة الإنجليزية إلى اللغة العربية; اللغة العربية إلى اللغة الإنجليزية', '<p>ينضم إلينا البروفيسور <b>واسيني الأعرج</b> والدكتور <b>محمد المنسي قنديل</b> لاستكشاف كيف تتداخل المدن والأماكن مع النسيج الأدبي، لتصبح جزءاً لا يتجزأ من روح النص. <br></p><p>يأخذنا الكاتبان في رحلة عميقة، يكشفان فيها عن تأثير السفر والتنقل على السرد الروائي، وكيف تشكل التجارب والأماكن عالماً يتجاوز الواقع ليعكس روح الشخصيات وأحداث القصص.<br></p><p>نتعرف على دور المدن كحاضنة للذاكرة الأدبية وكيف تصبح شوارعها وأزقتها شخصيات تتحدث بين السطور، مما يجعل هذه الجلسة تجربة فريدة لاستكشاف الأدب من منظور الأماكن والرحلات التي تلهمه.<br></p>', '<p>ينضم إلينا البروفيسور <b>واسيني الأعرج</b> والدكتور <b>محمد المنسي قنديل</b>، لنستكشف سوياً كيف تتداخل المدن والأماكن مع النسيج الأدبي، لتصبح جزءاً لا يتجزأ من روح النص. <br></p><p><br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(128, '3939440000085341290', 'ويكيميديا: أنسنة المعرفة', 'humanising-knowledge', '52', 'Published to Website', 'Litfest 2025', 140, 'فريدة الجريتلي, روتانا الحسنات', 'الحوارات', 'انتركونتيننتال', NULL, 'خور الأفكار', 'العربية', NULL, '<p>انضموا إلى المتحدثتين <b>فريدة الجريتلي</b> و<b>روتانا الحسنات</b> لاستكشاف ملهم لرؤية مؤسسة ويكيميديا في بناء عالمٍ يستطيع فيه الجميع مشاركة المعرفة والوصول إليها بحرية. اكتشفوا كيف تمكّن هذا المنصة التعاونية الأفراد والمجتمعات حول العالم من مشاركة المعلومات بحرية والمساهمة في بناء مجتمع أكثر إنصافاً ووعياً. </p><p>ستنقلكم هذه الجلسة إلى فرص وتحديات حركة ويكيميديا، وستلهم الحضور للمشاركة والمساهمة في بناء عالم أكثر انفتاحاً وشمولية في مجال المعرفة</p>', '<p>انضموا إلى المتحدثتين <b>فريدة الجريتلي</b> و<b>روتانا الحسنات</b> لاستكشاف ملهم لرؤية مؤسسة ويكيميديا في بناء عالمٍ يستطيع فيه الجميع مشاركة المعرفة والوصول إليها بحرية.<br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(129, '3939440000085250125', 'مع الفائز الغائب، نكمل الحكاية', 'the-absent-winner', '8', 'Published to Website', 'Litfest 2025', 315, 'يوسف خندقجي, رنا إدريس', 'الحوارات', 'انتركونتيننتال', NULL, 'الراس 2', 'العربية', 'اللغة الإنجليزية إلى اللغة العربية; اللغة العربية إلى اللغة الإنجليزية', '<p>في جلسة مثيرة تأخذنا إلى أعماق التجربة الإنسانية، نكشف النقاب عن قصة الكاتب الأسير، باسم خندقجي، وروايته الحائزة على الجائزة العالمية للرواية العربية، \"قناع بلون السماء\"؛ لكن ماذا يعني فوز باسم وهو خلف القضبان، وما هي التفاصيل التي لم تُروَ بعد عن هذا الإنجاز المذهل؟ <br></p><p>انضموا إلى <b>يوسف خندقجي</b>، شقيق الكاتب، و<b>رنا إدريس</b>، الناشرة لكتاب باسم إذ يستعرض كلاهما المشاعر المعقدة والتحديات التي واجهها الكاتب خلال كتابة روايته. كيف استقبل خبر الفوز الذي بلغه بعد فترة طويلة من الإعلان؟ وما القصة الخفية وراء كواليس هذا النجاح؟<br></p><p>جلسة حافلة بالأمل والمثابرة والحنين نكتشف فيها كيف تتداخل الآمال والأحلام مع الألم والمعاناة<br></p><p><br></p>', '<p>بالنيابة عن شقيقه الكاتب الأسير باسم خندقجي، يشاركنا كل من <b>يوسف خندقجي</b> والناشرة <b>رنا إدريس</b> الحديث عن الكاتب الغائب وروايته التي تخطت قضبان السجن، فيما نترقب صدور الجزء الثاني من هذه الحكاية.<b>​</b> <br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(130, '3939440000085250088', 'أن تكون الأول: قصة سمو الشيخ محمد بن راشد آل مكتوم', 'to-be-the-first-the-story-of-his-highness-sheikh-mohammed-bin-rashid-al-maktoum', '4', 'Published to Website', 'Litfest 2025', 315, 'جرايمي ويلسون', 'الحوارات', 'انتركونتيننتال', NULL, 'الراس 1', 'الإنجليزية', NULL, '<p>انطلقوا في رحلة استثنائية عبر حياة صاحب السمو الشيخ محمد بن راشد آل مكتوم، القائد الذي حول دبي من مدينة صغيرة إلى واحدة من أبرز العواصم العالمية. \"الأول\"، سيرته الذاتية المعتمدة التي كتبها <b><b>جرايمي ويلسون</b>​</b>، تروي مسيرة الشيخ محمد المُلهمة منذ نشأته في منزل بسيط من الطين وحتى وصوله إلى منصب نائب رئيس دولة الإمارات، رئيس وزرائها، وحاكم دبي الذي أطلق رؤى مبتكرة. يناقش ويلسون في كتابه تأثير الشيخ محمد الكبير، من إتمام وثيقة الاتحاد وقيادة دبي لتصبح مركزاً للسلام والتسامح والفرص، إلى قصته التي تعكس الإصرار، والمرونة، وتجسيد القوة التحويلية للقيادة الهادفة التي غيرت وجه المنطقة والعالم.<br></p>', '<p>يستعرض <b>جرايمي ويلسون ​</b>في حديثه عن كتاب “الأول”، السيرة الذاتية المعتمدة لصاحب السمو الشيخ محمد بن راشد آل مكتوم، تفاصيل رحلة سموه الفريدة وكيف تحولت دبي من مدينة بسيطة إلى مركز عالمي نابض بالحياة<br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(131, '3939440000085341073', 'هالة جوراني: لكنك لا تبدين عربية', 'hala-gorani-but-you-dont-look-arab', '29', 'Published to Website', 'Litfest 2025', 432, 'هالة جوراني', 'الحوارات', 'انتركونتيننتال', NULL, 'البراحة 3', 'الإنجليزية', NULL, '<p>عاشت وتنقلت الصحفية السورية الأمريكية الحائزة على جائزة \"إيمي\"، <b>هالة جوراني</b>، في معظم أنحاء العالم وهي تتحدث ثلاث لغات بطلاقة، كما استمتعت بمسيرتها المهنية لكونها واحدة من أكثر المراسلين الدوليين احتراماً في العالم، غيّر عملها الذي امتد لعقود من حياتها الخاصة وحياة الأشخاص والمجتمعات التي كتبت عنها وخاصةً في الشرق الأوسط. تعتلي هالة المسرح مع <b>روعة طلس </b> لمناقشة كتاب \"لكنك لا تبدين عربية\" وهي مذكراتها التي تكشف حياتها ومسيرتها المهنية وتتعمق في تاريخ عائلتها وتنظر في الأسئلة التي لا تزال عالقة في ذهنها: من هي؟ وأين تنتمي؟<br></p>', '<p>تعتلي الصحفية السورية الأمريكية الحائزة على جائزة إيمي <b>هالة جوراني</b>&nbsp;المسرح لتناقش مؤلفها: \"لكنك لا تبدين عربية\"، وهو كتاب سردي عن حياتها الرائعة ومسيرتها المهنية وبحثها عن الانتماء.<br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(132, '3939440000085077780', 'حفل إطلاق كتاب أصوات شابة من شبه الجزيرة العربية', 'book-launch-voices-of-future-generations-for-the-middle-east-region', '828', 'Published to Website', 'Litfest 2025', 400, NULL, 'الفعاليات العائلية', 'انتركونتيننتال', NULL, 'البراحة 3', 'متعددة اللغات', NULL, '<p>بعد عام من الإعداد، ستتوفر القصص الفائزة في الدورة الخامسة من مسابقة أصوات أجيال المستقبل لمنطقة الشرق الأوسط لقرائتها. يمكن للجميع قراءتها في مجموعة أصوات شابة من شبه الجزيرة العربية 2024. مجموعة من القصص الملهمة والرائعة كتبها طلاب متميزون ورسمها فنانون من دولة الإمارات العربية المتحدة. تمت ترجمة جميع القصص الفائزة الاثنتان والعشرون -&nbsp;إحدى عشرة قصة مكتوبة باللغة العربية وإحدى عشرة قصة باللغة الإنجليزية&nbsp;- والمجموعة متاحة باللغتين. </p><p>ندعوكم للانضمام إلينا في حفل إطلاق هذا الكتاب المميز للغاية.&nbsp;بحضور <b>لجين وسام الحلبي</b> و<b>محمد حمدان صديقي</b>، الفائزين بالمركز الأول في المسابقة باللغتين العربية والإنجليزية. هذه هي فرصتكم لإظهار الدعم لجميع الشباب الموهوبين الذين كتبوا قصصاً مستوحاة من أهداف التنمية المستدامة للأمم المتحدة وحقوق الطفل.</p><p></p><p>نتطلع لرؤيتكم واكتشاف المغامرات الشيقة التي تخيلها الفائزون!</p>', '<p>بعد عام من الإعداد، ستتوفر القصص الفائزة في الجولة الخامسة من مسابقة أصوات أجيال المستقبل لمنطقة الشرق الأوسط للجميع لقراءتها في مجموعة: \"أصوات شابة من شبه الجزيرة العربية 2024\". مجموعة من القصص الملهمة والرائعة كتبها طلاب متميزون ورسمها فنانون من الإمارات العربية المتحدة.<br></p><p>بحضور&nbsp;<b>لجين وسام الحلبى</b> وم<b>حمد حمدان صديقي</b>،&nbsp;نتطلع لرؤيتكم واكتشاف المغامرات الشيقة التي تخيلها الفائزون!<br></p><p><br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(133, '3939440000085341227', 'مدن: قصص قصيرة من العالم العربي', 'mudun-short-stories-from-the-arab-world', '45', 'Published to Website', 'Litfest 2025', 432, 'سلطان سعود القاسمي, ريم خورشيد, فارس بسيسو, رازميج بدريان', 'الحوارات', 'انتركونتيننتال', NULL, 'البراحة 3', 'الإنجليزية', NULL, '<p>\"مدن: قصص قصيرة من العالم العربي\" هي مجموعة قصصية قصيرة بارزة تجمع بين بعض من أكثر الكُتّاب المعاصرين إثارة من مختلف أنحاء المنطقة.تنضم<b> لانا شما</b> إلى محرري المجموعة القصصية&nbsp; <b>سلطان سعود القاسمي</b> ,<b>ريم خورشيد </b>,<b>فارس بسيسو ,رازميج بدريان&nbsp;</b> للاحتفال بالأعمال الرائعة المنشورة في صفحاتها، بالإضافة إلى العمل المستمر لـ \"مؤسسة بارجيل للفنون\" في دعم المواهب الناشئة من خلال \"جائزة مدن للقصة القصيرة\" لا تفوتوا هذه المناسبة للاحتفال والاكتشاف الأدبي. <br></p>', '<p>انضموا إلى محرري \"مدن: قصص قصيرة من العالم العربي\" لحضور حدث يحتفل بالكُتّاب المعاصرين والقصص الرائعة الواردة في المجموعة و\"جائزة مدن للقصة القصيرة\" التي تقدمها \"مؤسسة بارجيل للفنون\". <br></p><p><br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(134, '3939440000085077798', 'مسرح الفنون الحية', 'fringe-stage-spotlighting-young-performers', '226', 'Published to Website', 'Litfest 2025', 680, NULL, 'الفعاليات العائلية', 'انتركونتيننتال', NULL, 'واحة القصص', 'متعددة اللغات', NULL, '<p>يعود مسرح الفنون الحية في عام 2025 ليعرض ويحتفي بالمواهب الرائعة للشباب من مؤدين، وراقصين، وموسيقيين، وشعراء، ورواة القصص من جميع أنحاء دولة الإمارات! <br></p><p><br></p><p>يجب أن يكون الأطفال دون سن 12 برفقة شخص بالغ يحمل تذكرة.<br></p>', '<p>يعود مسرح الفنون الحية في عام 2025 ليعرض ويحتفي بالمواهب الرائعة للشباب من مؤدين، وراقصين، وموسيقيين، وشعراء، ورواة القصص من جميع أنحاء دولة الإمارات! <br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(135, '3939440000085341683', 'جيف كيني: فوضى ساخنة', 'diary-of-a-wimpy-kid-hot-mess', '216', 'Published to Website', 'Litfest 2025', 600, 'جيف كيني;', 'الفعاليات العائلية', 'انتركونتيننتال', NULL, 'واحة القصص', 'الإنجليزية', NULL, '<p>تعرفوا عن قرب على الكاتب والرسام <b>جيف كيني </b>صاحب كتاب \"مذكرات طالب\"، يقدم الكتاب التاسع عشر في سلسلته الناجحة \"فوضى ساخنة\" التي ستغمركم بالضحك والتعاطف! يعود جريج هيفلي لمغامرة أخرى تجمع بين العائلة ومنزل صغير على الشاطئ والحرارة الشديدة، جميع العوامل تشير إلى وصفة لكارثة جديدة، وبالحديث عن الوصفات فإن المكونات السرية وراء كرات اللحم الشهيرة التي تصنعها جدته كانت محفوظة بعناية لسنوات. هل يستطيع جريج أن يكشف عن كل أسرار عائلته قبل انتهاء إجازتهم؟ أم أنه سيثير المشاكل فقط؟ سيقدم كيني الضحكات ويحتفل بأحدث كتاب \"مذكرات طالب\" بينما يرضي شغفكم بالمتعة العائلية، ستتاح الفرصة للجمهور للانضمام إلى جيف على المسرح للاستمتاع بمنافسة ودية في جو أسري. <br></p>', '<p>انضموا إلى مؤلف سلسلة \"مذكرات طالب\"، الكاتب<b> جيف كيني</b> وهو يقدم الكتاب التاسع عشر في سلسلته \"فوضى ساخنة\"! توقعوا كثيراً من الضحك والمرح العائلي وفرصة للاستمتاع بالمرح والفوضى على المسرح. <br></p><p><br></p><p><br></p>', 'دبي فيستفال سيتي', 'SFAMILYACTIVITIES100', 'G', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(136, '3939440000085341583', 'مذكرات طالب: فوضى ساخنة', 'diary-of-a-wimpy-kid-hot-mess-1', '205', 'Published to Website', 'Litfest 2025', 600, 'جيف كيني', 'الفعاليات العائلية', 'انتركونتيننتال', NULL, 'واحة القصص', 'الإنجليزية', NULL, '<p>تعرفوا عن قرب على الكاتب والرسام<b> جيف كيني</b> صاحب كتاب \"مذكرات طالب\"، يقدم الكتاب التاسع عشر في سلسلته الناجحة \"فوضى ساخنة\" التي ستغمركم بالضحك والتعاطف! يعود جريج هيفلي لمغامرة أخرى تجمع بين العائلة ومنزل صغير على الشاطئ والحرارة الشديدة، جميع العوامل تشير إلى وصفة لكارثة جديدة، وبالحديث عن الوصفات فإن المكونات السرية وراء كرات اللحم الشهيرة التي تصنعها جدته كانت محفوظة بعناية لسنوات. هل يستطيع جريج أن يكشف عن كل أسرار عائلته قبل انتهاء إجازتهم؟ أم أنه سيثير المشاكل فقط؟ سيقدم كيني الضحكات ويحتفل بأحدث كتاب \"مذكرات طالب\" بينما يرضي شغفكم بالمتعة العائلية، ستتاح الفرصة للجمهور للانضمام إلى جيف على المسرح للاستمتاع بمنافسة ودية في جو أسري. <br></p>', '<p>انضموا إلى مؤلف سلسلة \"مذكرات طالب\"، الكاتب<b> جيف كيني</b> وهو يقدم الكتاب التاسع عشر في سلسلته \"فوضى ساخنة\"! توقعوا كثيراً من الضحك والمرح العائلي وفرصة للاستمتاع بالمرح والفوضى على المسرح. <br></p><p><br></p>', 'دبي فيستفال سيتي', 'SFAMILYACTIVITIES100', 'G', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(137, '3939440000085077753', 'مسرح الفنون الحية', 'fringe-stage-spotlighting-young-performers-1', '215', 'Published to Website', 'Litfest 2025', 680, NULL, 'الفعاليات العائلية', 'انتركونتيننتال', NULL, 'واحة القصص', 'متعددة اللغات', NULL, '<p>يعود مسرح الفنون الحية في عام 2025 ليعرض ويحتفي بالمواهب الرائعة للشباب من مؤدين، وراقصين، وموسيقيين، وشعراء، ورواة القصص من جميع أنحاء دولة الإمارات! <br></p><p><br></p><p>يجب أن يكون الأطفال دون سن 12 برفقة شخص بالغ يحمل تذكرة.<br></p>', '<p>يعود مسرح الفنون الحية في عام 2025 ليعرض ويحتفي بالمواهب الرائعة للشباب من مؤدين، وراقصين، وموسيقيين، وشعراء، ورواة القصص من جميع أنحاء دولة الإمارات! <br></p><p><br></p><p><br></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(138, '3939440000098101920', NULL, 'litfest-after-hours-wet-grass-music-collective', '115', 'On Hold', 'Litfest 2025', NULL, NULL, 'بعد النهار في ليل', 'انتركونتيننتال', NULL, 'المجلس', NULL, NULL, NULL, NULL, 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(139, '3939440000098101980', NULL, 'litfest-after-hours-comedy-by-the-creek', '116', 'On Hold', 'Litfest 2025', NULL, 'null, null, null, ليز جونزاليس', 'بعد النهار في ليل', 'انتركونتيننتال', NULL, 'خور الأفكار', NULL, NULL, NULL, NULL, 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(140, '3939440000085341610', 'كيف تزرع تنيناً', 'how-to-grow-a-dragon', '207', 'On Hold', 'Litfest 2025', 220, 'ستيفن لينتون', 'مُلغاة', 'انتركونتيننتال', NULL, 'البراحة 2', 'الإنجليزية', NULL, '<p>انضموا إلينا في رحلة سحرية مع الرسام الشهير <b>ستيفن لينتون</b>، الذي سيأخذكم عبر سلسلة كتبه الساحرة \"كيف تزرع\". في كتابه \"كيف تزرع تنيناً\", ستخوضون تجربة فريدة في عالم متجر النباتات \"سارة والسيد بوتيفر\". حيث تنمو التنانين من الأشجار، وبالطبع، مع لمسة من الفوضى. <br></p><p>يقوم ستيفن بإرشاد الجمهور لإبداع رسوماتهم التوضيحية وفقاً لرؤيتهم الشخصية، مستوحاة من موضوعات القصة التي تجمع بين حل المشكلات، اللطف، والحيلة.<br></p><p>هذا الحدث مصمم لإلهام الإبداع، فلا تنسوا إطلاق العنان لمخيلتكم!<br></p>', '<p>انضم إلى رسام الأطفال الشهير <b>ستيفن لينتون</b> في هذه الفعالية للرسم. تعرّفوا على نصائح الرسم وازرعوا تنانيكم أو أي وحش غامض تريده! <br></p><p><br></p>', 'دبي فيستفال سيتي', 'SFAMILYACTIVITIES50', 'E', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(141, '3939440000085341028', 'أنتِ السبب ياماما', 'blame-it-on-mum', '24', 'On Hold', 'Litfest 2025', 198, 'رشا سمير, حنين الصايغ', 'مُلغاة', 'انتركونتيننتال', NULL, 'البراحة 1', 'العربية', 'اللغة الإنجليزية إلى اللغة العربية; اللغة العربية إلى اللغة الإنجليزية', '<p>هل تصبح الهالة العظيمة التي نحيط الأمهات بها، عبئاً كبيراً في بعض الأحيان؟ وعند أي حد تصبح المسؤولية المجتمعية مبالغاً فيها؟ <br></p><p>الكثير من عقد الطفولة وتبعاتها تُرجع إلى الأمهات، فهل أثقلت التوقعات المجتمعية الدور الأمومي الذي تمارسه أمهاتنا بفطرتهن، وبما لديهن من معرفة وأدوات متاحة؟<br></p><p>تناقش الكاتبة <b>د.رشا سمير</b>، مؤلفة كتاب \"بنات في حكايات\"، والكاتبة <b>حنين الصايغ</b>، مؤلفة رواية \"ميثاق النساء\"، صورة الأمومة وتأثيرها على الهوية والعلاقات الإنسانية. انضموا إليهن لطرح أسئلتكم وأفكاركم حول موضوع بهذه الحساسية والواقعية.<br></p><p><br></p>', '<p>تناقش الكاتبة <b>د. رشا سمير</b>، والكاتبة <b>حنين الصايغ</b>، صورة الأمومة وتأثيرها على الهوية والعلاقات الإنسانية، ويسألن عن حجم الأعباء المُلقاة على أعتاق الأمهات. <br></p><p><br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
