(150, '3939440000098135289', NULL, 'from-plant-to-plate-planting-activity', '227', 'On Hold', 'Litfest 2025', NULL, 'داريل جادزيكبو, إيلا فيليبس', 'الفعاليات العائلية', 'انتركونتيننتال', NULL, 'قافلة \"القراءة\" التابعة لمؤسسة الإمارات للآداب', NULL, NULL, NULL, NULL, 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(151, '3939440000098135037', NULL, 'litfest-after-hours-phat-g', '117', 'On Hold', 'Litfest 2025', NULL, NULL, 'بعد النهار في ليل', 'انتركونتيننتال', NULL, 'المجلس', NULL, NULL, NULL, NULL, 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(152, '3939440000092226306', 'مشكلات معاصرة', 'modern-issues', '250', 'On Hold', 'Litfest 2025', 80, 'فاطمه بنت علي', 'مُلغاة', 'انتركونتيننتال', NULL, 'الواحة', 'العربية', NULL, '<p><p style=\"text-align: right; direction: rtl; unicode-bidi: embed; margin-top: 0px\" dir=\"RTL\">تحتفي هذه الجلسة بصدور كتاب الكاتبة فاطمه بنت علي الجديد \"مشكلات معاصرة\"، الذي يسلط الضوء على أبرز تحديات العصر الحديث مثل أزمة الحداثة وما بعد الحداثة، هيمنة مجتمع السوق، الاغتراب الإنساني، وتراجع القيم في ظل سطوة التكنولوجيا. بأسلوب شيق وتحليل عميق، تفتح الكاتبة نافذة على الحلول الفلسفية المقترحة لاستعادة التوازن والارتقاء بالإنسانية. انضموا إلى الحوار لاكتشاف كيف يمكن للفكر أن يكون بوابة للخروج من أزماتنا المعاصرة نحو أفق أرحب وأكثر إنسانية.<br></p></p><p><br></p>', '<p><p style=\"text-align: right; direction: rtl; unicode-bidi: embed; margin-top: 0px\" dir=\"RTL\"><span class=\"font\" style=\"font-family:Calibri, sans-serif\">تحتفي هذه\nالجلسة بصدور كتاب الكاتبة <b>فاطمه بنت علي</b> الجديد <i>\"</i>مشكلات معاصرة\"، الذي يسلط\nالضوء على أبرز تحديات العصر الحديث، بأسلوب شيق\nوتحليل عميق، تفتح الكاتبة نافذة على الحلول الفلسفية المقترحة لاستعادة التوازن\nوالارتقاء بالإنسانية.</span><br></p></p>', 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
