(156, '3939440000098101743', NULL, 'litfest-after-hours-riri', '112', 'On Hold', 'Litfest 2025', NULL, NULL, 'بعد النهار في ليل', 'انتركونتيننتال', NULL, 'المجلس', NULL, NULL, NULL, NULL, 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(157, '3939440000085341417', 'Shamma Albastaki: House to House بيت لبيت', 'shamma-albastaki-house-to-house-byt-lbyt', '66', 'Cancelled', 'Litfest 2025', 150, 'شمه البستكي;', 'مُلغاة', 'انتركونتيننتال', NULL, 'الراس 2', 'العربية', 'اللغة الإنجليزية إلى اللغة العربية; اللغة العربية إلى اللغة الإنجليزية', NULL, NULL, 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(158, '3939440000085341064', NULL, 'cancelled-of-the-land-stories-from-palestine', '28', 'Cancelled', 'Litfest 2025', 200, NULL, 'مُلغاة', 'انتركونتيننتال', NULL, 'البراحة 3', 'الإنجليزية', NULL, NULL, NULL, 'دبي فيستفال سيتي', NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(159, '3939440000085250070', 'رسم ملامح المستقبل: كيف نعد أبناءنا لعالم الغد؟', 'cancelled-beyond-the-classroom', '2', 'Cancelled', 'Litfest 2025', 220, 'سمو الشيخة الدكتورة شما بنت محمد بن خالد آل نهيان', 'مُلغاة', 'انتركونتيننتال', NULL, 'البراحة 3', 'العربية', NULL, '<p>في عالم سريع التطور والتغير، تزداد مسؤولية تربية الأطفال وتهيئتهم للمستقبل جدية وتعقيداً، فما هي أهم الأسئلة التي ينبغي علينا مناقشتها عند التفكير في شكل العالم الذي يخطو إليه أطفالنا؟ <br></p><p><br></p><p>تناقش سمو الشيخة د. شما بنت محمد بن خالد آل نهيان رؤيتها حول العلم والثقافة في تشكيل تجارب التعليم وتربية مستقبل الأجيال الناشئة.<br></p><p><br></p><p>كيف يمكن لقطاع التعليم أن يواجه التحديات الصعبة التي تعترض طريقه؟ وكيف يمكن لمناهجه وتقنياته أن تواكب التطور السريع، مع الحفاظ في الوقت ذاته على الهوية والتراث الثقافي للمنطقة؟<br></p><p><br></p><p>انضموا إلى جلسة نادرة ولقاء ثمين مع قامة ثقافية وواحدة من أهم قيادات الفكر والتعليم في دولة الإمارات.<br></p>', '<p>تناقش سمو الشيخة د. شما بنت محمد بن خالد آل نهيان، وهي من قادة الفكر والتعليم في دولة الإمارات العربية المتحدة، رؤاها حول العلم والثقافة وتأثير تجارب التعليم والتربية الحالية في تشكيل مستقبل الأجيال القادمة. <br></p><p><br></p>', 'دبي فيستفال سيتي', 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(160, '3939440000085250097', NULL, 'cancelled-taking-the-temperature', '5', 'Cancelled', 'Litfest 2025', 150, NULL, 'مُلغاة', 'انتركونتيننتال', NULL, 'الراس 1', 'الإنجليزية', NULL, NULL, NULL, 'دبي فيستفال سيتي', 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:30', '2025-02-02 09:54:30');
