INSERT INTO `authors` (`id`, `authorid`, `full_name`, `author_slug`, `author_blurb`, `author_as_year`, `moderator_as_year`, `launchpad_young_author_as_year`, `launchpad_author_as_year`, `performer_as_Year`, `Host_as_Year`, `Website_Status`, `image`, `created_at`, `updated_at`) VALUES
(1, '3939440000087590003', 'Sarah AlNuaimi', 'sarah-alnuaimi', '<p><b>Sarah AlNuaimi</b> is an Emirati poet, artist, and photographer. She was one of the performing <br></p><p>poets for the Ramadan Nostalgia night held on World Poetry Day in collaboration with<br></p><p>House of Wisdom and the Rumi Poetry Night held in December in 2024 and a featured poet<br></p><p>on one of Emirates Literature Festival community nights. Her poetry collection showcasing<br></p><p>her deep love of ancestors and nostalgia has been published with Sail publishing’s<br></p><p>Anthology in 2022 titled <i>Baring My Heart</i>. In collaboration with Sharjah Art Foundation In<br></p><p>2022, she hosted Nostalgia; A consequence of living-Poetry and Prose: a two-day<br></p><p>workshop at Bait Al Shamsi and a workshop about Sharing Cultures through art at The<br></p><p>Flying Saucer. In 2020, she was one of the participating artists in Akaas Visual Arts -<br></p><p>“Promising artist exhibition”. She performed her first debut in spoken word poetry at MKS<br></p><p>Jewelry and Untitled Chapter collaboration at Abu Dhabi Art Fair in Manarat Al Saadiyat in<br></p><p>2019. In a collaboration with Dubai Public Library in 2019, she hosted workshops to<br></p><p>kickstart National Novel Writing Month, including Paint with Words. She has been<br></p><p>published in Sekka Magazine and a US based anthology titled <i>Starcrossed Anthology</i>. She<br></p><p>also holds a bachelor’s degree in industrial engineering and management engineering from<br></p><p>the University of Sharjah and strives to showcase how creativity transcends all boundaries<br></p>', NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(2, '3939440000010821146', 'Jeff Kinney', 'jeff-kinney', '<p><b>Jeff Kinney</b> is a #1 <i>New York Times </i>bestselling author of the Diary of a Wimpy Kid series and the Awesome Friendly Kid series. He is a six-time Nickelodeon Kids\' Choice Award winner for Favorite Book and has been named one of <i>TIME</i>\'s 100 Most Influential People in the World. He spent his childhood in the Washington DC area and moved to New England, where he and his wife own a bookstore named An Unlikely Story.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(3, '3939440000100031001', 'Ayman Chaudhary', 'ayman-chaudhary', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
