(25, '3939440000076841006', 'Ahmed AlSadek', 'ahmed-alsadek', '<p><b>Ahmed AlSadek</b> is a short story writer and novelist, born in Cairo. He studied philosophy at university and works as a literary editor and freelance writer for several online platforms in the fields of culture and arts. He has published five literary works, the latest being the novel <i>Duwar Al-Aalam </i>(<i>The World’s Spiral</i>) by Dar Al-Ain Publishing in 2023. He has won numerous prestigious literary awards, including the State Encouragement Award for Literature in 2021 for his novel <i>Hydra: The Odyssey of Destruction and Immortality</i>. He has also received several literary grants from the Afak Foundation and the Ministry of Culture and has participated in numerous literary workshops and cultural events in Beirut, Beshari, Marrakesh, Rabat, and Doha.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(26, '3939440000010822056', 'Clare Mackintosh', 'clare-mackintosh', '<p>With over two million copies of her books sold worldwide, number one bestseller <b>Clare Mackintosh</b> is the multi-award-winning author of seven Sunday Times bestselling novels, including <i>I Let You Go</i>, which won the Theakston Old Peculier Crime Novel of the Year in 2016. Her new crime series, featuring Welsh detective DC Ffion Morgan, has been critically acclaimed, with both <i>The Last Party</i> and <i>A Game of Lies</i> hitting the Sunday Times top ten. In 2024 she published a memoir, <i>I Promise it Won\'t Always Hurt Like This</i>.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(27, '3939440000099565004', 'Yaghoub Jahanbakhsh Ghaderi', 'yaghoub-jahanbakhsh-ghaderi', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
