(30, '3939440000099551001', 'Abdul Karim Wahid Bakhsh', 'abdul-karim-wahid-bakhsh', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(31, '3939440000096806004', 'Adam Mezi', 'adam-mezi', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(32, '3939440000098406002', 'Waleed Eltayeb Gubara', 'waleed-eltayeb-gubara', '<p><b>Waleed Eltayeb Gubara</b> is the CEO and Managing Partner at Touchline, one of the region’s foremost storytelling agencies. He is the publisher and co-founder of Philanthropy Age, a key source of philanthropic news, insights, and interviews in the Arab world. He is also the publisher of<i> How To Do Good</i>, a collection of inspiring essays from philanthropists, celebrities, and thought leaders striving to improve the world through charitable giving and impact programming. <br></p><p>With over 25 years of experience in brand strategy, content, and communications, Waleed has steered transformative projects for governments, public offices, and global brands alike. A passionate filmmaker, writer, and poet, he co-directed, produced, and wrote <i>The President and the Dragon,</i> which chronicles 40 years of Guinea Worm Disease eradication, led by the late US President <b>Jimmy Carte</b><b>r</b>. He also wrote, produced, and co-directed <i>Diamonds, Backpacks and a Matchbox</i>, a documentary backed by UNHCR that offers a powerful insight into the experiences and lives of refugees in camps across Jordan and Lebanon.<br></p><p><br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(33, '3939440000090149040', 'William Zimmerle', 'william-zimmerle', '<p>is a Senior Lecturer in the <i>Ancient World &amp; Heritage Programs</i> at NYU Abu Dhabi. He is the Founder of <i>Ra\'eha</i> <i>رائحة</i>:The Digital Heritage Library of Arabian Incense, Ancient Aromatics, and Fine Fragrances. He directs ethnography projects that document the heritage of incense burners in Arabia. He has directed archaeological fieldwork and produced a cultural exhibition on rock art from 2016-2019:<i>The Dhofar Rock Art &amp; Arabian Inscriptions Project</i>: A Digital Humanities Initiative. This heritage project is currently funded by NYU and the UAE, and encompasses a study of petroglyphs in Arabia including both in the UAE and Oman.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(34, '3939440000099544001', 'Abdullah Jalal Ostadi', 'abdullah-jalal-ostadi', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(35, '3939440000099005010', 'Dabke Group', 'dabke-group', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(36, '3939440000076100051', 'Najwa Zebian', 'najwa-zebian', '<p><b>Najwa Zebian</b>, EdD, is a Lebanese Canadian author, speaker, and educator. Known for her work in guiding readers through hard emotions, she has published four books, most recently <i>The Only Constant</i>. Her TEDx talk, \'Finding Home Through Poetry\', and podcast <i>In the Clear</i>​, highlight her healing-centered approach. Her work has appeared in <i>The New York Times</i>, <i>Glamour</i>, <i>HuffPost</i>, and more.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(37, '3939440000010824098', 'Faisal J. Abbas', 'faisal-j-abbas', '<p><b>Faisal J Abbas</b> is the Editor-in-Chief of the Riyadh-based daily <i>Arab News</i> and Deputy Chairman of the Saudi Journalists Association (SJA). A renowned columnist on Arab affairs, he regularly appears on CNN, BBC World, and other platforms. In June 2024, Abbas published <i>Anecdotes of an Arab Anglophile</i>, praised for promoting cross-cultural understanding by Chris Doyle, Director of the Council for Arab-British Understanding (CAABU). The book received endorsements from Saudi Ambassador to the UK HRH Prince Khalid Bin Bandar, Sir Ben Elliot, and former Middle East Minister Alistair Burt.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(38, '3939440000010823122', 'Maitha Al Khayat', 'maitha-al-khayat', '<p><b>Maitha Al Khayat</b> is an Emirati mother and a world-renowned author, children\'s book illustrator, and trainer in children\'s literature. She has published around 200 books for children and young adults, some of which have been translated into English, Turkish, and Italian. Her books have been adopted as curricula in both public and private schools. She has won prestigious awards, including the 2024 Etisalat Award for her novel The Pearl Diver\'s Necklace and the Cowrie Necklace, as well as two awards at the 2024 Sharjah Children\'s Reading Festival: Best Arabic Book for I Will Catch My Breakfast and Best English Book for Ayesha\'s Pearl. Meytha also writes television programs and is an advisor in the field of literature and languages at the Quarter Century Foundation. <br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(39, '3939440000099296001', 'Keval Chandran', 'keval-chandran', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
