(53, '3939440000062046001', 'Sarah Laura Nesti Willard', 'sarah-laura-nesti-willard', '<p><b>Sarah Laura Nesti Willard </b> coordinates the Bachelor of Arts in Visual Studies and Creative Industries at United Arab Emirates University, where she teaches art criticism, digital design, drawing, and other studio courses. A PhD candidate at Plymouth University, her research focuses on Middle Eastern animation, illustration, and comics. Sarah has illustrated children\'s books for publishers including Beacon Books and Random House, and she founded Artworksis, a mural company, in 2006. She continues to work as an illustrator.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(54, '3939440000083611002', 'Shereen Malherbe', 'shereen-malherbe', '<p><b>Shereen Malherbe</b> is a British-Palestinian author and advocate for authentic voices. She writes novels, a children’s book series, and is currently working on a middle-grade mystery series. Her books are translated into multiple languages, and she regularly speaks at literary festivals. Malherbe also coaches aspiring writers to achieve their publishing goals.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(55, '3939440000086955072', 'Nadhim Zahawi', 'nadhim-zahawi', '<p>Born in Baghdad, <b>Nadhim Zahawi </b>and his family fled Saddam Hussein to the UK when he was 11. After earning a degree in chemical engineering from UCL, Nadhim transitioned into business, establishing one of the largest, most successful polling and market research firms globally, YouGov, in 2000. He was CEO of YouGov until 2010, when he stood down to become Member of Parliament for Stratford-on-Avon, where he served until standing down in 2024. Nadhim went on to serve as Chancellor of the Exchequer, one of the highest roles in British Government. Since leaving politics, Nadhim has become Non-Executive Chairman of the Very Group.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(56, '3939440000076108026', 'Anthony Sattin', 'anthony-sattin', '<p><b>Anthony Sattin</b> is a British journalist and travel writer whose work has focused on the Middle East and North Africa, including several highly acclaimed books on history and travel and two biographies, <i>A Winter on the Nile</i> and <i>Young Lawrence</i>. His broadcast work includes documentaries on subjects as diverse as the Coptic liturgy and Layla Majnun. His latest book, <i>Nomads: The Wanderers Who Shaped Our World</i>, has been described as ‘important, generous and beautifully written’, and was a Book of the Year in <i>The Times</i>, <i>The Sunday Times</i> and <i>The Spectator</i>.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(57, '3939440000010823207', 'Rehan Khan', 'rehan-khan', '<p><b>Rehan Khan</b>, intrigued by how ideas move across cultures, is the author of the Tudor Turk trilogy, set in the Ottoman Empire and Tudor England. The series, nominated for the Carnegie Medal, blends adventure with reflections on virtue. His latest book, <i>A Tomb of Empi</i><i>res</i>, is set 2,000 years ago in Damascus, Jerusalem, and Petra, during a time of conflict over Middle Eastern resources.<br></p>', 'Litfest 2025', 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(58, '3939440000033858531', 'Helen Farmer', 'helen-farmer', '<p><b>Helen Farmer </b>is the author of <i>My Mummy\'s Secret Adventures</i>, a children’s book that aims to help working mothers with the question of \"Where does mummy go all day?”. She is also a broadcaster on Dubai Eye 103.8fm, where she entertains and informs the city with discussions on everything from finance to food. When she\'s not on the air or writing, Helen shares snippets of her life on social media, offering a peek into her world, with a relatable mix of Dubai life, travel, style, and those real-life parenting moments.<br></p>', 'Litfest 2025', 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(59, '3939440000010808096', 'Danabelle Gutierrez', 'danabelle-gutierrez', '<p><b>Danabelle Gutierrez</b> is an award-winning writer, actress, photographer, and artist. Her work has appeared in <i>The Common</i>, <i>Cordite Poetry Review</i>, <i>Vogue Arabia</i>, and more. She is the author of <i>Tears Across The Earth</i>, <i>Until The Dreams Come</i>, and <i>I Long to Be The River</i>, as well as chapbooks <i>Eventually The River Surrenders </i>and <i>Softer</i>. Her latest collection, <i>The F Word</i>, was published in 2024. Born in Las Piñas and raised in Cairo, Vienna, and Muscat, she currently resides in Dubai.<br></p>', 'Litfest 2025', 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(60, '3939440000033691575', 'Yvette Judge', 'yvette-judge', '<div><b>Yvette Judge</b> is a children’s librarian by profession whose career then took her to Emirates Literature Foundation, where she worked in several different roles, her favourite of which was planning the Children’s Programme. She made regular appearances on Dubai Eye 103.8FM looking at the world of books and ran two book groups for younger readers. She is delighted to maintain her links with ELF, working on several competitions and returning in 2023 as a moderator. <br></div><div><br></div><div>Currently in semi-retirement in France, Yvette has continued to enjoy the literary world, running an English-language book group and organising literary lunches with locally based writers, thus combining two of her favourite things – food and reading! Yvette is often to be found in the garden coaxing her vegetables to survive the summer heat, with a podcast or audio book for company.<br></div>', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(61, '3939440000098773016', 'Ramesh Cidambi', 'ramesh-cidambi', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(62, '3939440000098726049', 'Niall McLoughlin', 'niall-mcloughlin', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(63, '3939440000010813176', 'Marwa Al Aqroubi', 'marwa-al-aqroubi', '<p>UAEBBY President, Executive Director of Sharjah’s House of Wisdom, and a prominent figure in the UAE’s cultural landscape. A champion of children\'s literature, she has made significant strides in publishing and writing, earning her a spot on the Bologna Children\'s Book Fair Award panel in 2017. As a Board Member of the Sharjah Book Authority and BoT member of IBBY, she tirelessly promotes reading as a daily habit for children, bringing innovative cultural initiatives into everyday life<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(64, '3939440000010791057', 'Ali Bin Tamim', 'ali-bin-tamim', '<p>Chairman of the Abu Dhabi Arabic Language Centre (ALC) <br></p><p>H.E. Dr. <b>Ali bin Tamim</b> holds the position of Chairman of the Abu Dhabi Arabic Language Centre at the Department of Culture and Tourism – Abu Dhabi. In parallel to his current role, he serves as Secretary-General of the Sheikh Zayed Book Award, and Editor-in-Chief of Al-Markaz: Majallat al-Dirāsāt al-ʿArabiyya (The Centre: Journal of Arabic Studies), the first peer-reviewed journal that is completely published in Arabic by Brill publishing house.<br></p><p>Before his current role, H.E. bin Tamim held various positions related to the cultural and heritage sectors in the UAE. He served as a Chairperson of the Sheikh Zayed Grand Mosque Centre, a Member of the Jury for the ‘Prince of Poets’ television programme, in addition to serving as a jury member in several prominent cultural awards in the UAE, most notably the Dubai Culture Award and the Khalifa Award for Education.&nbsp;<br></p><p>H.E. bin Tamim also managed the Kalima Project for Translation; he was the General Manager of Abu Dhabi Media Company from 2016 to 2019, as well as Chairman of the Executive Committee and a Member of the Board of Directors of the National Library and Archives from 2015-2018.<br></p><p>Dr. Ali bin Tamim received his Doctorate Degree in Literary Critique from Yarmouk University in Jordan in 2005, as well as a Master’s Degree in Arabic Language and Literature from the University of Jordan in 2001. H.E. contributed to a range of media and cultural initiatives in the United Arab Emirates.<br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(65, '3939440000098739035', 'Alison Milton', 'alison-milton', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
