(81, '3939440000097688008', 'Eyas Khadour', 'eyas-khadour', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(82, '3939440000097136009', 'Fiona Sampson', 'fiona-sampson', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(83, '3939440000098073009', 'George Wallace', 'george-wallace', '<p><b>George Wallace</b> is a New York City-based poet with 42 chapbooks and five albums of spoken word poetry streamed worldwide. He is editor of several literary publications, including <i>Poetry bay</i>, <i>Long Island Quarterly</i>,&nbsp;<i>Walt’s Corner</i> and <i>Great Weather for Media Lifetime</i>; lifetime National Beat Laureate (NBPF); and writer in residence at the Walt <b>Whitman Birthplace</b>. A significant contributor to poetry&nbsp; communities across the US in recent years George has received major festival laureateships worldwide and is recipient of major honors; in 2024 he received an honorary doctorate. From the Chamber of International Artists and Writers and the Royal Academy of Spain. <br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(84, '3939440000010818116', 'Hessa Almehairi', 'hessa-almehairi', '<p><b>Hessa Almehairi</b> is a writer and illustrator of children’s and young adult literature. She holds a Bachelor’s degree in Early Childhood Education and a Master’s degree in Educational Administration and Policy. Her most notable achievements include the story “<i>The Dinoraf</i>,” which won the Sheikh Zayed Book Award in 2018, and a translated version was released in three languages the following year. Almehairi&nbsp;recently joined the Arts Academy to pursue her dream of producing the finest Emirati children’s books. She now works as an author and illustrator of children’s and young adult books. Her first work as an illustrator was published in the book “<i>The Pearl Diver’s Daughter and the Necklace of the Ship</i>” by <b>Maitha Al Khayat</b>. Al Almehairi&nbsp;continues to participate as a writer and illustrator in various book fairs and to give workshops for children and adults.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(85, '3939440000097041001', 'Fadi Ghandour', 'fadi-ghandour', '<p>is the Executive Chairman of Wamda Group, a platform that invests, nurtures and builds entrepreneurship eco-systems across the Middle East and North Africa. Fadi was also the co-founder of Ar​a​mex, one of the leading global logistics companies based in Dubai. Fadi spent the first 30 years of his work life as CEO of Aramex, building the company, to become one of the leading emerging market logistics companies, and making it the first company from the Arab world to be listed on Nasdaq.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(86, '3939440000098432001', 'Shaikha Al Marri', 'shaikha-al-marri', '<p><b>Shaikha Al Marri</b> is a 24-year-old licensed commercial first officer pilot with Emirates Airlines and a debut self-published author. Her memoir,<i> Journey to the Skies</i>, charts her path from childhood fascination with aviation to realizing her dream of taking to the skies. Through her story, Shaikha shares a message of determination and hope, encouraging others to reach for their own aspirations, no matter how distant they may seem. <br></p><p>As a young Emirati woman, Shaikha is passionate about empowering future generations to embrace their dreams wholeheartedly. She hopes her journey will encourage readers—particularly young girls—never to abandon their ambitions.<br></p><p><br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(87, '3939440000096676011', 'Najeeb Al Ali', 'najeeb-al-ali', '<p><b>Najeeb Mohammed AlAli</b> is the Executive Director of Expo City Dubai Authority, previously the Executive Director of Expo 2020 serving as Deputy to the Commissioner General, H.E. Sheikh <b>Nahayan Mabarak AlNahayan</b>. He also held positions with the Emirates Competitiveness Council, the UAE Prime Minister’s Office, The Executive Council of Dubai, TECOM Group and the Emirates Integrated Telecommunications Company (DU) and others. He played key roles in UAE government initiatives, including UAE Vision 2021 and Dubai’s green policies. <br></p><p>Najeeb holds a Master’s in Technology Innovation Management from the University of Sussex and a Bachelor’s in Telecommunication Engineering from the University of Hertfordshire.<br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(88, '3939440000076128024', 'Charan Ranganath', 'charan-ranganath', '<p><b>Charan Ranganath</b> is the author of the New York Times bestselling book, <i>Why We Remember</i>. He is a Professor at the Center for Neuroscience and Department of Psychology and director of the Dynamic Memory Lab at the University of California at Davis. For over 25 years, Dr. Ranganath has studied the mechanisms in the brain that allow us to remember past events, using brain imaging techniques, computational modelling and studies of patients with memory disorders. He has been recognized with several awards, including a Guggenheim Fellowship and a Vannevar Bush Faculty Fellowship. He lives in Davis, California.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(89, '3939440000013339004', 'Sara Hamdan', 'sara-hamdan', '<p><b>Sara Hamdan</b>, a Berkeley and Columbia graduate, is a former Merrill Lynch banker, New York Times journalist, and editor at Google. After winning a Netflix short story award, she received the First Chapter: Emirates Literature Foundation Seddiqi First Chapter Writers’ Fellowship for her debut novel, What Will People Think? Sara is Palestinian American, raised in Greece, and has called Dubai home for twenty years. When she’s not typing away at her laptop, she loves to spend time at the beach with her husband and two kids.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(90, '3939440000086685074', 'Rotana Al Hasanat', 'rotana-al-hasanat', '<p><b>Rotana Al Hasanat</b> an active volunteer on Wikipedia, contributing in various ways such as content creation, editing, and supporting community-driven projects aimed at enriching the platform. She also serves as a board member of the Wikimedians of Kuwait User Group<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(91, '3939440000086973029', 'Trixie Danielle', 'trixie-danielle', '<p><b>Trixie Danielle</b> is a multidisciplinary artist based in the UAE. Her work delves into migration, identity, and belonging mainly through theatre, poetry, and storytelling while exploring the Filipino diaspora and fostering connection across cultures, reimagining personal and collective memories in her pursuit of community and creative collaboration. A 2024 Numoo cohort member at The Arts Center (NYUAD). As a core member of TRIBE Creatives, she contributed to Sulyap. As a core member of +63Kolektib, she has contributed to projects like Metro Diaries, Lola Basyang in the UAE, and the Museum of Migrating Memories.<br></p>', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(92, '3939440000089659001', 'Aashi Singh', 'aashi-singh', '<p><b>Aashi Singh</b>, a 14-year-old Indian author and ninth-grade student at Dubai\'s Gems Modern Academy, is a multifaceted talent. Her debut poetry collection, <i>Into a Teenage Heart: What Keeps Me Awake at Night</i>, explores the highs and lows of adolescence, touching on self-discovery, love, heartbreak, and identity with raw honesty. Through her writing, Singh reflects her dedication to equality, justice, empathy, and peace — principles that inspire her poetry. A trained ballet dancer since the age of four, she also enjoys singing and boxing. Additionally, she founded Poets and Peace, a digital platform that unites young voices globally, aiming to inspire positive change.<br></p>', NULL, NULL, 'Litfest 2025', NULL, NULL, 'Litfest 2025', 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(93, '3939440000097567007', 'Raffae Hassan', 'raffae-hassan', NULL, NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(94, '3939440000098089017', 'Jennifer Malton', 'jennifer-malton', NULL, NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(95, '3939440000097541004', 'Ayla Hassan', 'ayla-hassan', NULL, NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(96, '3939440000098077034', 'Abdallah Mukhairez', 'abdallah-mukhairez', NULL, NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(97, '3939440000010822231', 'Rafia Ghubash', 'rafia-ghubash', '<p><b>Dr Rafia Ghubash</b> is the first Emirati psychiatrist and the first to hold the title of Professor in Psychiatry. She was the first woman to serve as President of the Arabian Gulf University in Bahrain for eight years and has held prominent roles, including Dean of the Faculty of Medicine at UAE University. Dr Ghubash holds a PhD in psychiatry from the University of London and multiple prestigious diplomas. She is a trailblazer for Arab women, establishing the first women’s museum in the Arab world and the Emirati Art Museum. Her research focuses on mental health, particularly women’s mental health in the UAE.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(98, '3939440000095913002', 'Badr Jafar', 'badr-jafar', '<p>is a business executive and social entrepreneur from the UAE. He is the CEO of<i> </i>Crescent Enterprises and the appointed Special Envoy for B<i>usiness &amp;</i> Philanthropy in the UAE. He serves on the Board of Trustees for<i> </i>Zayed University, International Council of AUB, and the Advisory Council of Development and Outreach for AUS. Badr founded the Pearl Initiative, a non-profit, private sector-led organisation committed to promoting a corporate culture of transparency and accountability across the Gulf Region. He is the Founding Patron of the <i>Centre for </i>Strategic Philanthropy at University of Cambridge<i> </i>and Strategic Philanthropy Initiative at NYU Abu Dhabi.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(99, '3939440000093568037', 'Ty Wiggins', 'ty-wiggins', '<p>is a leadership expert who is passionate about setting up new CEOs for success. As the lead of <i>Russell Reynolds Associates’ CEO &amp; Transitions Practice</i> globally, he helps world-leading CEOs successfully transition into their roles, to unlock business (and personal) success – faster. <br></p><p>Ty is one of a handful of people globally with a PhD in leadership transitions. He harnesses his deep academic and consulting&nbsp; background to provides CEOs, boards, and&nbsp; senior leadership across industries with advice, support and insight needed to start well and perform quickly.<br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(100, '3939440000093647001', 'Eve Wersocki-Morris', 'eve-wersocki-morris', '<p>is an award-nominated and bestselling children’s author. Despite being diagnosed with dyslexia aged 12, she wrote her first full novel aged 13. Her debut T<i>he Bird Singer</i> (2022), inspired by her Polish heritage, was nominated for the B<i>ranford Boase Award</i>. Her second book <i>The Wildstorm Curse</i> was selected for <i>The Reading Agency’s Summer Reading Challenge 2024</i>. Eve has worked with <i>Coram-Beanstalk Literacy Charity</i> and was chair judge for <i>Wimbledon Book Festival’s Junior Young Writers’ Competition</i>. Her third book is <i>Forest of Forbidden Magic</i>. Eve is the director of <i>EWM PR</i>, providing PR and events campaigns for publishers.<br></p>', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(101, '3939440000096039010', 'Tracy Harmoush', 'tracy-harmoush', '<p>Former investment banker turned renowned speaker, entrepreneur, and active investor. After a decade- <br></p><p>long career in finance, Tracy transitioned to entrepreneurship in 2018 and has since become one of the<br></p><p>GCC’s leading wellness entrepreneurs with a growing social media presence.<br></p><p>She founded <i>Untraceable</i>, a wellness and personal growth company, whose latest program attracted 10,000 online subscribers in its first quarter. Her most recent venture is <i>Mama Booza</i>, a UAE-born traditional Arabic ice cream brand, where she serves as an active shareholder, Chief Marketing Officer, and Head of Strategy.<br></p><p>Tracy is also the Managing Partner of <i>The Fifth Kind Productions</i>, where she secures major global deals and retainers for the agency. Additionally, she hosts the <i>What They Don’t Tell Us</i> podcast, where she shares untold insights and life skills through personal experiences and interviews with industry experts.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(102, '3939440000018781001', 'Isobel Abulhoul', 'isobel-abulhoul', '<p><b>Isobel Abulhoul</b> came to Dubai in 1968 and co-founded <i>Magrudy’s</i>, a bookshop chain, in 1975 which is still thriving and now has seventeen bookshops across the UAE. She is a also a co-founder of <i>Al Ittihad Private Schoo</i>l which was set up and built on a land donated by HH late <b>Sheikh Rashid</b>. <br></p><p>In 2008 Isobel founded the international <i>Emirates Airline Festival of Literature</i>, the Middle East’s largest and award-winning celebration of the written and spoken word. In 2013, HH <b>Sheikh Mohammed Bin Rashid Al Maktoum</b>, Vice President and Prime Minister of the UAE and Ruler of Dubai, and also the festival patron, issued a Decree establishing the<i> Emirates Literature Foundatio</i>n, naming Isobel as one of the trustees on the Board. Until March 2023, Isobel was the CEO of the Foundation, and now acts as an advisor and remains as a trustee. Isobel is also a Trustee of the International Prize for Arabic Fiction Board, and a director of the Board for the <i>Mohammed Bin Rashid Library</i>. In addition, Isobel was selected as member of the Police <i>Advisory Council for Community Service</i>. In September 2021, she was appointed as a chairperson for one of the Global Councils focusing on the UN sustainable development goals.<br></p><p>Isobel has received several awards and accolades over the years such as Cultural Personality of the Year by Dr. HH <b>Sheikh Sultan Bin Mohammed Al Qasimi</b>, the Ruler of Sharjah, the prestigious OBE award by HM the late <b>Queen Elizabeth</b> of Great Britain and the Pioneer’s Award in 2016 from HH <b>Sheikh Mohammed Bin Rashid Al Maktoum</b>.<br></p><p>Isobel’s passion and drive for education and literature remains as strong as ever.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(103, '3939440000095619001', 'Emma Quintin', 'emma-quintin', '<p>an internationally recognized actress best known for playing the role of ‘Bella’ in <i>TWEENIES</i>, the award-winning children’s television program produced by the <i>BBC</i>. <br></p><p>With a successful career spanning over 30 years, Emma’s sheer passion and commitment to the industry has ensured that she has established herself not only as a versatile and adaptable performer but as a dedicated and diligent artiste.<br></p><p>She has resided in the UAE since 2013 and is Head of Education for the <i>Proscenium Enrichment Centre</i>. She continues to present and perform across the globe.<br></p><p><br></p>', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(104, '3939440000083527004', 'Fadi Kattan', 'fadi-kattan', '<p><b>Fadi Kattan</b>, chef, hotelier, and author, is recognised as a leading voice of modern Palestinian cuisine. Born in Bethlehem to an established local family, his culinary style reflects a deep passion for the region\'s terroir. Fadi’s Bethlehem-based Fawda restaurant has become a local favorite, and he co-founded Akub, London’s first modern Palestinian restaurant, introducing the city to authentic Palestinian flavours. His first solo cookbook, <i>Bethlehem: A Celebration of Palestinian Food</i>, unveils the city’s hidden culinary gems. This November, Fadi will launch Louf in Toronto, showcasing his unique take on Palestinian flavours and wines.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(105, '3939440000016086029', 'Amandeep Bhangu', 'amandeep-bhangu', '<p><b>Amandeep Bhangu</b> is an award-winning British presenter with over a decade\'s experience with BBC TV News in her home city of London. Moving to the UAE twelve years ago as an international reporter, she\'s filmed in over 30 countries. Pivoting careers post-pandemic, Amandeep is now an established MC-moderator for international events and conferences, featuring heads of state, senior ministers, industry innovators, and global thought leaders. A highly skilled interviewer, moderating panel discussions across diverse topics and providing executive media training through her UAE-based company, Voice Media London. Amandeep holds a Bachelor’s and Master’s in English Literature from the University of Cambridge.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(106, '3939440000092360001', 'Maryam Bartawi', 'maryam-bartawi', '<p><b>Maryam Bartawi </b>spent nine years building her career in the corporate world before making a bold decision at the age of 27 to step away from its security. She embarked on a transformative journey of self-discovery, seeking to align her life with her soul\'s true purpose. Along the way, life became her greatest teacher, offering profound experiences that shaped her vision and aspirations. She is not only pursuing her studies to become a counseling therapist, but simultaneously thriving as a businesswoman, blending her entrepreneurial spirit with a deep passion for empowering individuals, helping them find clarity, healing, and fulfillment in their lives. <br></p><p><br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(107, '3939440000037037012', 'Ibrahim Alhashmi', 'ibrahim-alhashmi', '<p>Member of the Board of Directors of the <i>Mohammed Bin Rashid Library</i> and Executive Director of the <i>Sultan Bin Ali Al Owais Cultural Foundation</i>. A poet and researcher in heritage and identities, he has a number of poetry publications and a book on popular beliefs in the United Arab Emirates, and a number of biographies of some Emirati poets. He has won a number of awards, and his poems have been translated into a number of languages.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(108, '3939440000090137060', 'Veronica Sullivan', 'veronica-sullivan', '<p><b>Veronica Sullivan</b> is a festival director and literary programmer from Melbourne, Australia. She is the current Festival Director of Melbourne Writers Festival. She was previously Head of Programming at the Wheeler Centre for Books, Writing and Ideas.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(109, '3939440000011427057', 'Annabel Kantaria', 'annabel-kantaria', '<p><b>Annabel Kantaria</b> won the inaugural Montegrappa Writing Prize at the Emirates Airline Festival of Literature and has gone on to publish five psychological thrillers with HQ Stories at HarperCollins UK, both under her own name and under the pseudonym Anna Kent. A sixth will be published in July 2025. Annabel is currently the resident writing mentor for the Emirates Literature Foundation Seddiqi Writers’ Fellowship in the UAE and also works as an editorial coach, teaches workshops on writing and editing, and speaks and moderates at various literary festivals around the world.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55');
