(110, '3939440000076893002', 'Hala Gorani', 'hala-gorani', '<p><b>Hala Gorani </b>is an award-winning anchor and correspondent with over 25 years of experience. She has covered history-defining stories and events, currently working as a foreign correspondent for NBC News. Until 2022, she was a primetime anchor for her show <i>Hala Gorani Tonight</i> on CNN, and is one of the most internationally recognised names in journalism. Her memoir <i>But You Don\'t Look Arab</i> was published in 2024. She currently lives in London with her husband where, alongside her journalism work, she is working on her second book.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(111, '3939440000042983056', 'Ahmed & Rashed bin Shabib', 'ahmed-rashed-bin-shabib', '<p>are both urbanists and have tasked themselves over the last 10 years with advancing the urban identity of the contemporary Middle East. They are award winning researchers who tell stories through their deep research on topics, resulting in their books and magazine collectables with<i> Brownbook</i> to reach a circulation of more than a million copies. Ahmed and Rashid have been recognised for their achievements through their nomination for the <i>Aga Khan</i> awards for architecture in 2010 and 2018. They are the winners of the <i>Venice Golden Lion Architecture Award</i> in 2020 for the contribution of their book Anatomy of Sabkhas. They are both graduates of the University of Oxford in the field of Geography.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(112, '3939440000080947002', 'Safiya Sinclair', 'safiya-sinclair', '<p><b>Safiya Sinclair</b>, born in Montego Bay, Jamaica, is the author of the acclaimed memoir <i>How to Say Babylon</i>, which won the National Book Critics Circle Award and the OCM Bocas Prize for Caribbean Literature. The memoir was a finalist for the Women’s Prize for Non-Fiction and featured on multiple \'Best Book\' lists, including <i>The New York Times</i> and <i>TIME</i>. It was also one of President Obama’s Favorite Books of 2023.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(113, '3939440000080377001', 'Khairani Barokka', 'khairani-barokka', '<p><b>Khairani Barokka</b> is a Jakarta-based writer, artist, and consultant. Her work focuses on disability justice, anticolonial praxis, environmental justice, and access. Barokka has been recognized with honors like the UNFPA Indonesian Young Leader award, a Delfina Foundation residency, and an Artforum Must-See. She was the first Poet-in-Residence and Editor at Modern Poetry in Translation. In 2023, she was shortlisted for an Asian Women of Achievement Award. Her latest books are <i>Ultimatum Orangutan</i> and <i>amuk</i>.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(114, '3939440000079554006', 'Abdulatif Yousef', 'abdulatif-yousef', '<p><b>Abdulatif Yousef</b> is a Saudi poet with three poetry publications, and is the winner of the Prince Abdullah Al-Faisal International Prize for Arabic Poetry in the category of poetic experience, in addition to having received other awards and accolades.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(115, '3939440000083548001', 'Asmaa Azaizeh', 'asmaa-azaizeh', '<p><b>Asmaa Azaizeh</b> is a poet, writer, and editor. She has published four poetry collections, the latest being <i>The Body I Once Climbed </i>by Al-Ahliya Publishing, and a prose book titled <i>The Year of Small Museums </i>by Rawayat Publishing, UAE. Her first poetry collection <i>Liwa </i>won the Young Writer Award in the field of poetry from the Abdul Mohsin Al-Qattan Foundation in 2010. Her collection <i>Do Not Believe Me If I Tell You About War </i>was published by Dar Al-Mutawassit in 2019 in both Dutch and Swedish, and will be published this year in French by Zim Publishing in Marseille. She participates in anthologies and poetry festivals worldwide, and some of her poems have been translated into English, German, French, Persian, Swedish, Spanish, Turkish, and others. She worked for years in radio and television and managed cultural projects. She is currently an editor for the Palestine section of the Rasif22 website.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(116, '3939440000080043001', 'Nabil Suleiman', 'nabil-suleiman', '<p><b>Nabil Suleiman</b> graduated from the University of Damascus, Faculty of Arts, Department of Arabic Language in 1967. He is the writer of 57 books, including 23 novels, 28 books on literary criticism, and six books on public affairs. Nabil Suleiman has received numerous awards and honours, the most recent being the Sultan Al-Owais Award in 2021. He has also participated in the judging of several awards and chaired the judging committee for the International Prize for Arabic Fiction in 2024. He has lectured at numerous Arab and international universities and participated in many conferences and seminars. Several books and academic theses have been published about his novels.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(117, '3939440000097100009', 'Wet Grass', 'wet-grass', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(118, '3939440000042588013', 'Kai DeBenedictis', 'kai-debenedictis', NULL, NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(119, '3939440000041956011', 'Isha Nair', 'isha-nair', NULL, NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(120, '3939440000059888011', 'Ayat Minhas', 'ayat-minhas', NULL, NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(121, '3939440000010813126', 'Julia Wheeler', 'julia-wheeler', '<div><b>Julia Wheeler </b>is a writer, journalist and interviewer who worked for the BBC for more than 15 years, including as the BBC’s Gulf Correspondent, based in the UAE, and covering the Arabian Peninsula between 2000 and 2010. <br></div><div><br></div><div>Wheeler has moderated large-scale conferences and chaired inter-governmental forums. She is chair and interviewer at several festivals including Cheltenham (Literature and Science), Hay, Manchester, Stanford’s Travel Writers Festival and the Chiswick, Stratford and Budleigh Salterton Literary Festivals. She has chaired events at The British Library, The Royal Geographical Society and onboard Cunard’s Queen Mary 2, as well as for Warwick University, the <i>Times</i> subscriber events and The Evening Standard Stories Festival.<br></div><div><br></div><div>Wheeler hosts online conversations, webinars and panel discussions for UK and international organisations including the <i>Times</i>, the Singapore Book Council, the Abu Dhabi Book Fair, <i>SAGA</i>, Concierge and the Global Association of Literary Festivals.<br></div><div><br></div><div>Wheeler has been in conversation with Graham Norton, David Walliams, Bob Mortimer and Paul Whitehouse, Jay Blades, Hugh Bonneville, Robert Harris, Jeremy Bowen, Darcey Bussell, Julian Clary, Alexander McCall Smith, Jay Blades, Robert Webb,&nbsp; Richard Osman, Ruth Jones, Mark Billingham, Rory Bremner, Sophie Ellis-Bextor, Colin Thubron, Benedict Allen, David Baddiel, Ben Miller, Mel Giedroyc, Jenny Eclair, Simon Reeve, Alan Titchmarsh, Jeannette Winterson, Julia Quinn, Kate Humble, Rachel Johnson, Mariella Frostrup, Simon Armitage, Elif Shafak, Anthony Horowitz, Jack Dee and Ed Balls. Julia was part of a theatre tour with Amanda Owen, The Yorkshire Shepherdess.<br></div><div><br></div><div>She sits on the board of the Stratford Literary Festival and is a trustee at a Kent secondary school.<br></div>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(122, '3939440000086492004', 'Reem Khorshid', 'reem-khorshid', '<p><b>Reem Khorshid</b> is an architect and urban researcher based in London. Her work focuses on modern and contemporary histories of the Arab cities.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(123, '3939440000076879001', 'Haneen Al Sayegh', 'haneen-al-sayegh', '<p><b>Haneen Al Sayegh</b> is a Lebanese poet and novelist, born in Mount Lebanon. She holds a degree in English language and literature and a Master\'s degree in teaching English as a foreign language from the American University of Beirut. She works in teaching and literary translation. She has published three poetry collections: <i>Let It Be</i> in 2016; <i>An Old Soul</i> in 2018; and <i>Lighthouses to Mislead Time</i>, published by Dar Al-Nahda Al-Arabiya in Beirut. <i>The Covenant of Women</i> is her debut novel, which was published in Lebanon by Dar Al-Adab in September 2023 and translated into German, and was released in March 2024 by dtv.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(124, '3939440000060250003', 'Ammar Shams', 'ammar-shams', '<p>After graduating with a degree in economics, <b>Ammar Shams </b>built a diverse career across industries, including oil and gas, government, banking, and media. With a PhD from SOAS, University of London, he has conducted research on the intersection of gender rights and Sharia law and teaches Family Law at local universities. Ammar is married and has one daughter.&nbsp;<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(125, '3939440000056792046', 'Nizar Habash', 'nizar-habash', '<p><b>Nizar Habash</b> is a Professor of Computer Science at NYU Abu Dhabi and directs the Computational Approaches to Modeling Language (CAMeL) Lab. He specialises in natural language processing and computational linguistics, with extensive research on Arabic NLP, including machine translation, morphological analysis, and dialectal modeling. Before joining NYUAD in 2014, he was a research scientist at Columbia University. He holds a PhD in Computer Science from the University of Maryland and dual bachelor’s degrees in Computer Engineering and Linguistics. Professor Habash has received numerous awards, including the King Salman Academy for Arabic Language Award and the Antonio Zampolli Prize.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(126, '3939440000078809001', 'Maha Abouelenein', 'maha-abouelenein', '<p><b>Maha Abouelenein</b> is an American Egyptian with over 30 years of global communications experience advising global corporate giants, governments, CEOS, and other high-net-worth individuals. She is CEO of Digital &amp; Savvy, a consulting firm with offices in the USA and UAE. A sought-after strategist and speaker, Abouelenein is an expert on personal branding, reputation management, and the transformational power of storytelling. She is the former Head of Global Communications &amp; Public Policy at Google and Managing Director of Weber Shandwick and served General Mills before becoming an entrepreneur. She is on the Global Board of Directors of the Associated Press.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(127, '3939440000090423009', 'Esra AlMulla', 'esra-almulla', '<p>A writer and researcher in Arabic language and cultural heritage, she is a companion of words and books, navigating the pages to unearth the treasures of the Arabic language. Raised in a world overflowing with books from her childhood, the pages were her constant companions, and stories her daily sustenance. Her library is a rich trove, encompassing the vast spectrum of literature. Holding a degree in Arabic Language and Literature and a diploma in electronic archiving, she is currently pursuing her master\'s degree in Arabic. She serves as the Director of the International Storytelling Department at the Sharjah Institute for Heritage, having previously managed the Archiving Department. Her literary contributions span texts, essays, and writings in children\'s literature, alongside her participation in international cultural festivals and gatherings both within the UAE and abroad. Her ambition is to cultivate a deep love for storytelling, forever gazing at the pen and the book, dreaming of a world where stories never cease. <br></p><p><br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(128, '3939440000090187010', 'Aysha Alshamsi', 'aysha-alshamsi', '<p><b>Aysha Alshamsi</b> is a critic, university professor, and poet. She is the Head of the Arabic Language Department at Mohamed Bin Zayed University for Humanities, and has authored several critical and poetic works, including <i>Emirati Poetry from an Ecocritical Perspective </i>and <i>White Ink</i>. Her poetry collections include <i>Embers </i>and <i>What Aisha Didn’t Say</i>.<br></p>', 'Litfest 2025', 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(129, '3939440000097100014', 'Basma Choir', 'basma-choir', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(130, '3939440000092809001', 'Alaa Maasarani', 'alaa-maasarani', '<p><b>Alaa Maasarani</b>&nbsp;has extensive experience spanning over 14 years in the fields of corporate communication, Arabic content creation and editing, storytelling and writing, translation, as well as cultural and geopolitical consulting. His professional career includes working with a variety of organizations, such as the Consulate General of Lebanon in Montreal, MSL Group in the Middle East, and the Anwar Gargash Academy in the UAE. He has a strong track record in social media communication, television appearances, radio interviews, and managing cultural and community dialogues with a wide range of administrative, social, literary, and cultural figures. He holds a Master\'s degree in International Relations from UQAM University in Canada and is currently preparing his doctoral dissertation in the field of diplomatic relations. <br></p><p><br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(131, '3939440000089934031', 'Umair Kidwai', 'umair-kidwai', '<p><b>Umair Kidwai</b> is a 9th-grade student at Gems Modern Academy, Dubai, originally from Lucknow, India. He loves the city’s food and is passionate about reading, coding, basketball, tennis, chess, and storytelling. Umair’s first book was inspired by his history lessons on Greek culture, and his interest in fiction and fantasy was sparked by films like <i>The Hobbit </i>and <i>The Lord of the Rings</i>. Supported by his family, especially his uncle, he navigated the writing and publishing process. Umair aims to explore realistic fiction next, expanding his audience while refining his creative skills and storytelling craft.<br></p>', NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(132, '3939440000089882034', 'Ralf Tawk', 'ralf-tawk', '<p><b>Ralf Tawk</b>, a lively seven-year-old, brings joy and energy to every space he enters. Passionate about basketball, he leads an active lifestyle and expresses his creativity through drawing and reading. Ralf cherishes time with family and friends, enjoying sports, imaginative play, and storytelling. At school, he especially loves math and physical education, fueling his dream of becoming an architect. Environmentally aware, Ralf champions reduced paper usage, showing a mature sense of sustainability. Supported by his family, he’s working on a book inspired by favorites like Big Nate and Dog Man, and embraces each day with joy and curiosity.<br></p>', NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(133, '3939440000089438110', 'RUMInation', 'rumination', '<p><b>RUMInation</b> was founded on October 1, 2021, driven by a shared passion for Eastern culture and art. In a world where connection to culture is essential for every individual, RUMInation seeks to revive the art of storytelling, particularly the untold nomadic stories. By uniting musicians from around the world, the platform aims to inspire a shift from individualism to collective harmony, fostering peace through the curation of diverse nomadic tales. RUMInation envisions a future where people embrace culture and art as a means of survival and unity, echoing Rumi’s belief: “Empathy is better than speaking one language.”<br></p>', NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(134, '3939440000010807016', 'Alexander McNabb', 'alexander-mcnabb', '<p><b>Alexander McNabb</b> has worked as a journalist, editor and magazine publisher in the Middle East for over 38 years. In his spare time, he has been known to be a writer of thriller novels set in the Middle East, UK, and Ireland. His abiding interest in exploring the history of the Emirates has led him terribly astray — but also resulted in the discovery of an amazing story that has remained almost totally untold. When he’s not writing books, he runs a consultancy focused principally on media, publishing, and digital communications.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(135, '3939440000093407085', 'Basel Yafi', 'basel-yafi', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(136, '3939440000090058011', 'Fatima Al Hammadi', 'fatima-al-hammadi', '<p>Specialising in environmental sciences and sustainability, <b>Fatima Al Hammadi</b> works as an Environmental Assessment and Analysis Analyst at the Environment Agency in Abu Dhabi. She is also a writer and author of children\'s short stories, a member of the Youth Council for Arabic Language, and a social media influencer. Her works include a fantasy short story titled \'My Grandmother’s Burqa\', which won first place in the My Story competition across the UAE in 2017, and <i>The Magic Ghaf Tree </i>in 2024.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(137, '3939440000018192011', 'Duaa Khidir', 'duaa-khidir', '<p>With over 2 years of experience in the Wikimedia movement,<b> Duaa Khidir</b> is dedicated to fostering community engagement, digital literacy, and knowledge sharing. As the Communications and Outreach Coordinator for Wikimedia UAE, she leads initiatives to promote Wikipedia and its sister projects, organize workshops, and collaborate with partners to expand the reach of free knowledge. <br></p><p><br></p>', 'WikiArabia2024', 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(138, '3939440000010816171', 'Mohamed Almatrooshi', 'mohamed-almatrooshi', '<p><b>Mohamed Almatrooshi </b>currently holds the position of Treasurer of the Emirates Publishers Association and is a member of the association for the period between 2023 and 2025. From 1989 to 1992, he served as the Editor-in-Chief and later became the Editor-in-Chief of \"The Air Force Magazine.\" Between 1992 and 1997, he served as the Director of the Media Department at the Emirates Center for Strategic Studies and Research, while also being the Editor-in-Chief of the daily newsletter \"Akhbar Al-Sa\'ah.\" From 1999 to 2005, he was the press officer for His Highness the Ruler of Sharjah and the Director of the Emirates News Agency office in Sharjah, as well as the Managing Editor of a news cycle at the news desk in Abu Dhabi. From 2005 to 2010, Mohammed held the position of Director of the Media Center at the University of Sharjah. <br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(139, '3939440000089904044', 'Gaith Abdulla', 'gaith-abdulla', '<p><b>Gaith Abdulla</b> is a Gulf studies specialist and co-founder of Engage101, a collecting-and-research platform, and Bayt AlMamzar(BAM), an independent art space in Dubai.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(140, '3939440000096360004', 'Alhadi Gebreel', 'alhadi-gebreel', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(141, '3939440000093904026', 'Paulo Sloboda', 'paulo-sloboda', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(142, '3939440000093903008', 'Romina Satvatmanesh', 'romina-satvatmanesh', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(143, '3939440000093883009', 'Nadine Basiony', 'nadine-basiony', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(144, '3939440000093870009', 'Nassimah Francis', 'nassimah-francis', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(145, '3939440000093861007', 'Matthew Corbett', 'matthew-corbett', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(146, '3939440000093855042', 'Ria Samuel', 'ria-samuel', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(147, '3939440000093423060', 'Kethy Kist', 'kethy-kist', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(148, '3939440000093345057', 'John Shenton', 'john-shenton', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(149, '3939440000076466042', 'Rawan Akkila', 'rawan-akkila', '<p>a professional with expertise in education and events management, currently working at <i>Kalimat</i> Group. Her career highlights include curating cultural programs, leading literacy initiatives, and developing student-focused events such as the <i>ELF Reading Caravan</i> and the A<i>bu Dhabi International Book Fair’s Education Program</i>. With a Bachelor of Arts in English Language and Literature, Rawan’s work reflects education to storytelling, learning, and fostering impactful experiences in the education and publishing sectors.<br></p>', NULL, NULL, NULL, NULL, NULL, 'Litfest 2025', 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(150, '3939440000018192006', 'Alyaa AlMansoori', 'alyaa-almansoori', '<p>Emirati Journalist &amp; TV Host <br></p><p>Host/Producer of \"Maktabat\" (2023 <i>Al Owais Creativity Award </i>for Best Cultural Program)<br></p><p>Graduate in International Relations, American University of Sharjah &amp; University of Wollongong Dubai (Cultural Diplomacy Thesis)<br></p><p>Passionate about social sciences, humanities, literature &amp; intellectual discourse.<br></p><p>Bilingual Arabic-English MC &amp; moderator.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(151, '3939440000010809351', 'Waciny Laredj', 'waciny-laredj', '<p>The writer <b>Waciny Laredj</b> is a prominent novelist and academic who works as a professor at the Sorbonne University. He is one of the most important names in contemporary Arabic literature, with over 30 novels translated into more than 20 languages. Some of his most notable works include <i>The Prince</i> (Parts One and Two), <i>The Nights of Asfuria</i>, <i>Hizya</i>, <i>The Balconies of the North Sea</i>, <i>The Tale of the Last Arab</i>, and <i>The Seventh Night After a Thousand</i>. He has received numerous prestigious awards in recognition of his literary career, including the Sheikh Zayed Book Award, the Arab Creativity Award, the Katara Prize for Arabic Fiction, the Sultan Qaboos Award, and the Nabaa Arab Award, reflecting his esteemed position and deep contributions to Arabic literature.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(152, '3939440000054456001', 'Rashed bin Shabib', 'rashed-bin-shabib', NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(153, '3939440000086955121', 'Micallar Walker', 'micallar-walker', '<p><b>Micallar Walker</b> is a marketing consultant with expertise delivering impactful campaigns in the UK, Middle East, and North Africa. Formerly Head of Marketing for Front Row Filmed Entertainment, and Head of Events for Picturehouse Cinemas prior to that, she brings over 20 years of experience to inform marketing strategies and campaigns. Micallar\'s consultancy work includes working with Fane Productions, as well as Picturehouse Cinemas, where she provides ongoing support to reach and develop Black audiences. In 2021, Micallar founded award-winning inclusive marketing agency Dark Matter to connect Black audiences with culture and the arts.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(154, '3939440000076414027', 'Marwa Melhem', 'marwa-melhem', '<p><b>Marwa Melhem</b> is a writer, activist, and director of cultural events. She is the Head of Arabic Programming at Emirates Literature Foundation and Emirates Airline Festival of Literature. She has received several literary awards, including the Sharjah Creativity Award in 2018, the Goethe Institute Short Story Award, and the Anna Lindh Foundation and Mediterranean Institute Short Story Award. Her first short story collection, <i>Third Eye</i>, was published by the Sharjah Book Authority. She has also published stories and poems on various Arab and international platforms. She also works in editing, translation, and journalism.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(155, '3939440000093416081', 'Abdulaziz Mohamad Ali', 'abdulaziz-mohamad-ali', '<p><b>Abdulaziz Mohamad Ali </b>He is a writer and the founder of Qissa Publishing and Distribution House. He has three published works and has battled cancer five times. Qissa Publishing House has successfully published over 100 titles in less than three years.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(156, '3939440000094679001', 'Fatma AlKhatib', 'fatma-alkhatib', '<p><b>Fatma AlKhatib</b> has 17 years of experience as a diagnostic radiologic technologist. Additionally, she has worked in editing, proofreading and organizing cultural events. In 2021, she founded Sedra Publications, which translates prominent international books into Arabic, becoming a leading local and Arab publisher participating in Gulf and Arab book fairs. <br></p><p><br></p><p>Since 2022, she has served on the Emirates Publishers Association\'s board and participated in international exhibitions.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(157, '3939440000090014003', 'Mohamed Kandil', 'mohamed-kandil', '<p><b>Mohammed Al Mansi Qindeel </b> <b>​</b>is the CEO of Dar Molhimon Publishing &amp; Distribution, E90digital, Little Puffin, and Mokabook. Before becoming the CEO in 2016, Mohamed was a digital marketing manager in his previous company and was responsible for developing strategies that promoted the company or brand\'s products.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(158, '3939440000081025001', 'Su Bridgman JD', 'su-bridgman-jd', '<p><b>Su Bridgman JD </b> is a communication industry specialist and the founder and CEO of SpeakFluence Global. Her book <i>The CQ Edge</i> is an Amazon bestseller. Bridgman pioneered Communication Intelligence (CQ) to address public speaking fears and social anxieties. Her work is particularly relevant in the AI-impacted digital age. Following a successful launch in Times Square, she leads discussions on empowering individuals through innovative communication strategies.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(159, '3939440000080813001', 'Rana Almutawa', 'rana-almutawa', '<p><b>Rana Almutawa </b> is an Assistant Professor at NYU Abu Dhabi. She received her PhD from the University of Oxford in 2021. Her book, <i>Everyday Life in the Spectacular City</i>, was published with University of California Press in 2024.<br></p><p><br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(160, '3939440000010821206', 'Noura Al Khoori', 'noura-al-khoori', '<p><b>Noura Al Khoori </b> is an environmentalist by education who combines writing for children with volunteer community work in lactation, focusing on motherhood and early childhood. Passionate about weaving the natural environment and local culture into her stories, she regularly holds school readings, workshops, and book fair activities across the UAE. Noura is also a translator between Arabic and English, specialising in children\'s literature.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(161, '3939440000090138033', 'Chloe Pierre', 'chloe-pierre', '<p><b>Chloe Pierre</b> is a globally published and recognised author of <i>Take Care</i>, a wellness guide which highlights Black and Women of Colour\'s wellbeing and a necessary gaze barely seen within the wellness landscape. She is also the Founder of disruptive wellness platform thy.self which aims to actualise self-care both online and in real life as well as diversify the wellness community internationally. thy.self is broadening access to wellness to communities of people previously unable, unaware, and underrepresented within the wellness industry as well as creating a safe space to open conversations around cultural issues for overall wellbeing and prioritising diversity.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(162, '3939440000058458003', 'Moxie T Anderson', 'moxie-t-anderson', '<p>Southern by the grace of grits, <b>Moxie T Anderson</b> is an avid horror and crime fan and writer who lives with a very patient rescue mutt, a very assertive (former) street cat who beats up the very patient mutt, and one very patient partner who encourages her in all her goals. She has lived in Texas, Louisiana and Tennessee and loves the South, despite its flaws. Anderson is a recipient of the 2021 The First Chapter ELF Seddiqi Writers\' Fellowship and was fortunate to complete her novel <i>The Seven </i>under the mentorship of brilliant UK crime writer Mark Billingham. She is currently represented by Luigi Bonomi of LBA.<br></p>', NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(163, '3939440000011233022', 'Fatima Almazrouei', 'fatima-almazrouei', '<p><b>Fatima Almazrouei</b> is a writer, novelist, poet, short story author, and researcher in heritage and history. She is the Head of the Historical Archives Department at the National Archives and Library. She holds a Bachelor\'s degree in History and Archeology from the United Arab Emirates University and a Master\'s degree in Political Science from Zayed University. <br></p><p>Fatima writes in various fields, including novels, historical research, criticism, essays, cinema, theater, children\'s stories, and poetry. She has published over 20 works in poetry, theater, short stories, novels, and essays. She has won several prestigious awards in literature and culture, including:<br></p><p>The Al Owais Award for Best Creative and Cultural Work in 2013 for her novel Al-Atama (The Darkness).<br></p><p>The Sheikha Shamsa bint Suhail Award for Literature and Culture in 2013.<br></p><p>The Emirates Novel Award in 2017 for her novel My Other Story.<br></p><p>She also writes columns for Al-Bayan newspaper and Al-Ain News.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(164, '3939440000010791022', 'Alex Broun', 'alex-broun', '<p><b>Alex Broun</b>, originally from Australia, is a leading writer, director, and producer in the GCC, specializing in theatre, opera, and musicals. Highlights include productions such as <i>torn</i>, <i>Blind City</i>, and <i>Madama Butterfly</i>. In 2023, he directed the sold-out <i>Sing-along for Saudi</i> at Ithra in Dammam, a key National Day event. Broun is also a globally recognised 10-minute playwright, with over 100 plays produced in 40+ countries.<br></p>', NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(165, '3939440000010825011', 'Adel Khozam', 'adel-khozam', '<p><b>Adel Khozam</b>&nbsp; is considered today one of the most prominent Arab poets active internationally. He is one of the founders of the modernist poetry movement and free verse poetry. He has represented the United Arab Emirates at dozens of literary events and festivals for nearly 40 years. He has published 20 books, including poetry, novels, and philosophy, and has won prestigious global awards in poetry and literature, including the Best International Poet Award for 2021 from China, the Gold Medal from the World Writers Organization, the Italian Tulliola Prize, and the Silk Road Festival Award sponsored by the United Nations. In 2024, he launched the global poetic epic \"Manseera,\" co-authored by 86 poets from 50 countries, marking a first in global poetry. <br></p><p><br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(166, '3939440000010813196', 'Nathalie Handal', 'nathalie-handal', '<p>Poet, playwright, nonfiction and literary travel writer, <b>Nathalie Handal </b>was raised in Latin America, France and the Middle East, and educated in Asia, the United States, and the United Kingdom. Her poetry collections are <i>Life in a Country Album</i>, <i>The Republics</i>, <i>Poet in Andalucía</i>, and <i>Love and Strange Horses</i>, winner of the Gold Medal Independent Publisher Book Award. She is the author of eight plays and editor of two anthologies including the groundbreaking classic <i>The Poetry of Arab Women: A Contemporary Anthology</i>, winner of the PEN Oakland Josephine Miles Book Award. She writes the literary travel column \'The City and the Writer\' for Words without Borders. She is a professor at Columbia University, and a Visiting Writer at the American University of Rome.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(167, '3939440000016159017', 'Mustafa Alrawi', 'mustafa-alrawi', '<p><b>Mustafa Alrawi</b> is a journalist, writer, and broadcaster. He is a regular contributor to <i>The National</i>, Axios.com and <i>Monocle Magazine</i> and Radio. He has interviewed renowned individuals such as comedian Trevor Noah, Pulitzer Prize-winner Daniel Yergin, and inventor Tony Fadell. Mustafa was an inaugural First Chapter ELF Seddiqi Writers’ Fellow in 2022. His latest work is <i>How to Solve a Murder in Mesopotamia</i>, an interactive whodunit gamebook, with a hint of Murdle.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(168, '3939440000010813181', 'Mohammed Ahmed Al Murr', 'mohammed-ahmed-al-murr', '<p><b>HE Mohammed Ahmed Al Murr</b>, former President of the Federal National Council and current Chairman of the Mohammed bin Rashid Al Maktoum Library Foundation, has profoundly influenced UAE cultural and literary movements since the 1980s. Recognised as a key cultural figure, his works span literature, poetry, Arabic calligraphy, and the arts. HE Al Murr has published over 20 books, including <i>Mona Lisa’s Wink </i>and <i>Stories from Dubai</i>, translated into languages like English and Hindi, with some texts included in UAE university curricula. He also helped establish prominent cultural institutions, including the Etihad Museum, Opera House, Sheikh Zayed Book Award, and Horouf Arabia magazine.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(169, '3939440000010814022', 'Afra Atiq', 'afra-atiq', '<p>Dr <b>Afra Atiq</b> is an Emirati poet, scholar, and teaching artist. She has spent the last 10 years at the intersection of education and culture. She completed her PhD in Creative Industries at UAE University and has a Master’s Degree in Diplomacy. Her artistic work explores a range of topics including heritage, culture, and legacy. Dr Afra has been awarded for her poetry and featured on stages across the world. She writes and performs in English, Arabic and French. Her debut poetry collection,&nbsp;<i>Of Palm Trees and Skies</i>, was published in 2024.&nbsp;<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(170, '3939440000033691718', 'Shaikha Almteiri', 'shaikha-almteiri', '<div><b>Shaikha Almeteiri</b> holds a BA in Arabic language and a MA in Library and Information Science. She is also a PhD candidate in History and Islamic Civilization. <br></div><div><br></div><div>Almeteiri is the Head of the Department of National Culture and Documents at the Juma Al Majid Centre for Culture and Heritage. She holds the title of Abu Dhabi Ambassador in the celebrity category. She writes eloquent poetry and has received numerous awards including the Sheikha Shamsa Bint Suhail Award for Creative Women, the Italian Golden Feather Award, and the Arab Achievers Award in Sharm El Sheikh 2016. She was the runner up for the Prince of Poets competition in 2019. She won first place in the 2022 Sharjah Prize for Gulf Women\'s Creativity in Poetry. Her poems has been translated into English, French, German, Portuguese and Russian.<br></div>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(171, '3939440000086997058', 'Nima Elnour', 'nima-elnour', '<p><b>Nima Elnour</b> is a Sudanese American poet, content creator, and creative visionary excelling in executing her creative visions and bringing words to life. Nima has been writing poetry since 2017 and started performing in 2022. She derives inspiration from her unique experience as a Sudanese American expat in Dubai. Her work focuses on themes such as love, kinship, and often encompasses a self-critical tone. Her first published spoken word piece in collaboration with the YUSU BAME network titled \'The Blacker the Berry\' in 2020. Nima is currently working on her first poetry book.<br></p>', NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(172, '3939440000086645002', 'Adrianne Kalfopoulou', 'adrianne-kalfopoulou', '<p><b>Adrianne Kalfopoulou</b> is an Associate Professor of Creative Writing at RIT-Dubai and the author of three poetry collections, including <i>A History of Too Much </i>(2018). She has also published three prose books and has a forthcoming hybrid essay collection, <i>The Re in Refuge</i>, set for release in May 2025 by Red Hen Press. Adrianne’s work has garnered a Best of American Essays citation and multiple Best of the Net nominations. Her writing has appeared in <i>Harvard Review Online</i>, <i>Critical Muslim</i>, <i>The Beloit Poetry Journal</i>, and more.<br></p>', NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(173, '3939440000086908066', 'Mohamed Amir', 'mohamed-amir', '<p><b>Mohamed Amir</b> is a poet who channels his childhood struggles and personal hardships into profound expressions. Raised in isolation, he found solace in spoken word to give voice to the emotions he could never articulate. His debut poem, \'The Man in the Other Room\', captivated audiences at Basement open mic, earning a standing ovation for its vulnerability. His poetry unearths raw themes such as the effects of trauma, and the loss of innocence. When he’s not wiping a tear off his notebook, Amir is pursuing a BBA in International Business and directs student initiatives to mentor and uplift his juniors<br></p>', NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(174, '3939440000010822281', 'Shamma Albastaki', 'shamma-albastaki', '<p><b>Shamma Albastaki</b> is an award-winning poet from Dubai, known for her evocative work on culture and identity. She holds an MA from Harvard University, where her poetry collection <i>Al-Majaz: A Crossing </i>won the CMES Best Thesis Prize, and a BA in Literature and Sociology from NYU Abu Dhabi. An excerpt from her upcoming debut collection <i>House to House </i>received the ADMAF Creativity Award in 2019. Shamma also holds a PgD in Diplomacy and has served as an ambassador for the Louvre Abu Dhabi. She co-founded the JARA Collective and currently leads the UAE Pavilion’s strategic narrative for Expo 2025 in Osaka.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(175, '3939440000017060009', 'Turki Alzaabi', 'turki-alzaabi', '<p>\"Turki Al Zaabi is a writer and a lecturer in the field of reading. He loves reading world literature and other books in various fields from different cultures and in different languages, as he is fluent in Arabic, English, French and Italian. He has presented lectures and participated in seminars and meetings to talk about the importance of reading for the society at book fairs and festivals. <br></p><p><br></p><p>Al Zaabi has been hosting and moderating sessions at the Emirates Airline Festival of Literature since 2017. In recent years, he has moderated several conversations with major authors, including Ibrahim Nasrallah, Khaled Khalifa, Youssef Rakha, Dima Wannous, Walid Taher, Hamad Al Hammadi, Reem Al Kamali, Hussein Al Mutawa, Ali Al Shaali, Nadya Alnajjar, Ibrahim Khadim, Salha Obaid, Abdullah Aljumaa and many others. Al Zaabi reviews books and gives short readings on Instagram, Snapchat and other social media platforms. He published his historical social novel Oraim in 2021.\"<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(176, '3939440000010811251', 'Mounir ElHayek', 'mounir-elhayek', '<p><b>Mounir ElHayek</b> is a Lebanese novelist with a PhD in Arabic Language and Literature. His novels include <i>Infertile Diaries</i>, <i>The Cigarette Butt Collector</i>, <i>Grave No. 779</i>, and <i>Dubai Metro</i>. His critical works include <i>The Literary Quality of Place in the Palestinian Novel</i>. He writes articles for various literary publications in the Arab world, including <i>Al-Akhbar </i>and <i>Al-Diyar </i>newspapers in Lebanon, <i>Akhbar Al-Adab </i>in Egypt, and <i>Al-Bayan </i>in the UAE. He is the Head of the Arabic Language Department at Deira International School and a lecturer at Saint Joseph University in Dubai.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(177, '3939440000016841008', 'Hareth Al Bustani', 'hareth-al-bustani', '<p><b>Hareth Al Bustani</b> is a Senior Cultural Consultant for Burson\'s Arts &amp; Culture Practice. An Emirati, he has crafted and executed holistic communications strategies for some of the region\'s most ambitious arts and culture projects, including Noor Riyadh, the world\'s largest light art festival; Zarqa Al Yamama, the first ever Saudi opera; Diriyah Art Futures, the MENA region\'s first New Media Arts centre; and Dhai Dubai, the first Emirati-led light art festival. He previously worked as a journalist, notably as Arts &amp; Culture Editor at <i>The National</i>, and authored the Amazon history bestseller <i>Nero and the Art of Tyranny</i>.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(178, '3939440000032755030', 'Lucy Chow', 'lucy-chow', '<p><b>Lucy Chow</b> is a recognized leader in the UAE\'s entrepreneurial ecosystem. Her book <i>Changing The Game</i> explores digital technologies and their impact on the future of work. Named a LinkedIn TopVoice and one of <i>CEO Middle East</i>\'s Influential Women, Chow was also a contributing author to <i>Life on the Move</i> and <i>The Possibilities Project</i>. She’s been recognized by <i>Arabian Business</i> as a top female business leader.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(179, '3939440000044031001', 'Zainab Al Qaisi', 'zainab-al-qaisi', '<p><b>Dr Zainab Al-Qaisi</b> holds a PhD in English Literature with a dissertation titled \'Mapping Resistance in Palestinian American Poetry: Generated Memory Maps and the Third Space\' from the University of Jordan. Dr Al-Qaisi works as a translator and literary editor and has been extensively editing with <i>Wasafiri </i>magazine since 2022. She is the founder and CEO of two startups: Naqsh, a community platform for children\'s and young adult literature since 2020, and the Writing Room since 2021. Her interests include literary and cultural studies, comparative studies in women’s studies, generated memory, and third space theory. She is a researcher in contemporary poetry and human geography studies.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(180, '3939440000010792046', 'Ali AlShaali', 'ali-alshaali', '<p><b>Ali AlShaali</b> is an Emirati poet with a prominent presence in the cultural and literary scene. He has published five poetry collections: <i>Nahla and Rababa</i>, <i>Faces and Other Tired Ones</i>, <i>The Earth Has One Soul</i>, <i>Guide Me to the Cave</i>, and <i>The Grass Resembles Us and the Clouds</i>. He also released a novel titled <i>The Living Neighborhood </i>and a short story collection titled <i>Lives with a Pomegranate Flavor</i>, in addition to an essay collection titled <i>Rooms with Windows</i>. He received special recognition from His Highness Sheikh Dr Sultan bin Muhammad Al Qasimi, Ruler of Sharjah, for his creative contributions in poetry and literature. He is a graduate of the International Writers\' Fellowship Program in Iowa and the Publishers\' Fellowship at the Frankfurt Book Fair. Additionally, he is a publisher who founded Al Hudhud Publishing and Distribution in 2011, which includes Al Hudhud House for Children and Young Adults, Al Loha House for Adults, and Flamingo Library.<br></p>', 'Litfest 2025', 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(181, '3939440000084609001', 'Shanti Allard', 'shanti-allard', '<p><b>Shanti Allard</b>, a 16-year-old author and illustrator from Abu Dhabi’s Raha International School, blends her love for nature, art, and poetry in her debut book, <i>Touched by the Roots</i>. Through evocative poems and illustrations, Shanti highlights the UAE’s mangroves, inviting readers of all ages to appreciate and reflect on the beauty around us. She hopes her work inspires environmental awareness and encourages people to find deeper meaning by connecting with nature. Beyond her creative pursuits, Shanti enjoys playing guitar, football, traveling, trying new cuisines, and, of course, reading. Her ultimate dream is to share her work widely and contribute positively to the planet.<br></p>', NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55');
INSERT INTO `authors` (`id`, `authorid`, `full_name`, `author_slug`, `author_blurb`, `author_as_year`, `moderator_as_year`, `launchpad_young_author_as_year`, `launchpad_author_as_year`, `performer_as_Year`, `Host_as_Year`, `Website_Status`, `image`, `created_at`, `updated_at`) VALUES
(182, '3939440000083585017', 'Lamya Alsaiqal', 'lamya-alsaiqal', '<p><b>Lamya Alsaiqal</b> is an Emirati poet and presenter of events and television programs, known for her distinctive poetic works. She has a poetry collection titled <i>Lijam Al-Saada</i>, which reflects a part of her literary and poetic creativity. Lamya has a prominent presence in the Emirati cultural scene, contributing significantly to organising and presenting numerous cultural and media events, making her a prominent figure in the literary and television landscape in the UAE.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(183, '3939440000011238028', 'Amal Al Sahlawi', 'amal-al-sahlawi', '<p><b>Amal Al Sahlawi</b> is an Emirati poet from the Emirate of Sharjah, writing both classical Arabic poetry and free verse. She published a collection titled <i>Kan \'Alay An Awajilak</i>, which received wide acclaim across the Arab world. Her poem \'Ghara\'ib Al-\'Umr\' gained fame when it was sung at the Metropolitan Museum in New York, and the song was published on the museum\'s YouTube channel. Emirati opera singer Fatima Al-Hashimi also performed another song inspired by one of her poems about the late Sheikh Zayed bin Sultan. Al Sahlawi has participated in numerous prestigious cultural and poetry events, such as the Guadalajara Book Fair in Mexico, the BRICS Youth Poetry Festival in China, and various events across the Gulf region. Her poems are known for addressing contemporary feminist and philosophical issues, reflecting the concerns of modern humanity and telling its story with a profound emotional depth.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(184, '3939440000084620001', 'Olivia Palk', 'olivia-palk', '<p>Born in South Africa in April 2008, <b>Olivia Palk</b> has lived in the UAE since 2018 and is now a student at Raha International School. An avid reader and writer, she enjoys creating stories in mystery, romance, fantasy, and fiction. Olivia is also a passionate pianist, a beginner flautist, and finds music to be a relaxing escape. Beyond writing and music, she loves acting in theatre and playing sports like netball and touch rugby. Her belief in perseverance, along with the support of family and friends, fuels her dedication to personal growth and inspires her to always do her best.<br></p>', NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(185, '3939440000076886001', 'Hawra Al-nadawi', 'hawra-al-nadawi', '<p><b>Hawra Al-nadawi</b> is a novelist from Iraq, born in Baghdad, where she left with her family after 1991 and settled in Denmark. She grew up speaking multiple languages and learned to read and write Classical Arabic at home with the help of her parents. Her first novel, <i>Under the Copenhagen Sky</i>, was published in 2010 and was included in the longlist for the 2012 International Prize for Arabic Fiction. She released her second novel, <i>Qasamət</i>, in 2017. She also has translations from Danish and writes essays and short stories. She is currently working on a novel and a book on minorities and identity.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(186, '3939440000080064001', 'Noura Alkarbi', 'noura-alkarbi', '<p><b>Noura Alkarbi</b> is an academic and the head of the Department of Community Relations for Scientific Research at the University of Sharjah. She holds a PhD in Sociology from Complutense University in Madrid, Spain, and was sponsored by the Scholarships Office of the Presidential Court. Her previous experience includes working in the Research Department of the Supreme Council for Family Affairs in Sharjah, serving as the official youth representative for the UAE in the Arab Youth Council at the League of Arab States, and being an ambassador for the Sheikha Fatima bint Mubarak Award for Arab Youth. She has published several research papers on issues of tolerance, women\'s issues, and social policies, and has made cultural contributions, including supporting the Million Tolerant Document initiative. She is a member of the Zayed International Ambassadors\' Body in Spain and a volunteer member of the European Arab Foundation in Granada. She has received numerous awards, including the UAE Humanitarian Work Award, the UAE Youth Award, the Distinguished Scholarship Award from the Ministry of Interior, the Young Emirati Researchers Award, and the Sharjah Voluntary Work Award.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(187, '3939440000080501001', 'Sawsane Benarafa', 'sawsane-benarafa', '<p><b>Sawsane Benarafa</b> is the author of the historical novel <i>Who Remembers the Pirates of Salé</i>?, published by the Parisian publishing house L\'Harmattan. She grew up in Morocco and developed an early interest in her cultural heritage, which inspired stories based on her interactions with multiple cultures, due to her living in several countries. Sawsane is fluent in three languages, enriching her storytelling style. She currently resides in the United Arab Emirates, where she is working on developing narratives related to the world of perfumes. Her works reflect her passion for building cultural connections and her ability to bring history to life through engaging storytelling.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(188, '3939440000084074001', 'Nahla Al Fahad', 'nahla-al-fahad', '<p><b>Nahla Al Fahad</b> is a filmmaker and producer from Dubai, and a member of the Advisory Council for Content Industry within the Dubai Media Council. She is considered a pioneer in the field of filmmaking and content creation in the UAE and the Gulf, having distinguished herself through her work in feature films and documentaries. She earned a Master\'s degree with honors in creative management and change from Hamdan Bin Mohammed Smart University, as well as a Bachelor\'s degree with honors in business administration and marketing from the University of Dubai, in addition to specialised certifications in filmmaking and documentary production from the United States. She has directed many important documentary works, including the film <i>Hijab</i>, which participated in Arab and international festivals, and her new Emirati film <i>Behind the Wall of Silence</i>, which represents her first feature-length work in the field of cinematic direction.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(189, '3939440000010809241', 'Nadia Al Najjar', 'nadia-al-najjar', '<p><b>Nadia Al Najjar</b> is an Emirati writer, holding a Bachelor\'s degree in computer science. She has publications in the fields of novels, short stories, and children\'s literature. She is an advisory member of the UAE Board on Books for Young People. She has received several awards, including the Sharjah International Book Fair Award for Best Emirati Book, the UAE Novel Award, the Al Owais Award, the Dr Abdulaziz Al-Mansour Award, and several of her books have been nominated for the Sheikh Zayed Book Award. Her story \'The Spotted Tiger\' was included in the Arabic language curriculum for grade 4 in the United Arab Emirates.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(190, '3939440000089408056', 'Hamdan Bin Shfayan Alameri', 'hamdan-bin-shfayan-alameri', '<p><b>Hamdan Bin Shfayan Alameri</b> is an Emirati writer and trainer who holds a Master\'s degree with honors in artificial intelligence and big data from ESCP University. The writer and novelist Ahlam Mosteghanemi described him as a profound author who blends philosophy and questions in his literary works during his participation in a writing retreat. He represented the UAE at many international forums, serving as the head of several cultural delegations. He has also received the International Peace Award and other prestigious accolades, earning recognition from many of the UAE’s Sheikhs for his academic excellence and diverse activities. His play won the Abu Dhabi Award for Culture and Arts, while his short film script <i>Mar...Zoqoh </i>won the Short Arab Film Award, and his book <i>Creative Footprint </i>received the Storytelling Award. His national music videos have garnered millions of views.<br></p>', NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(191, '3939440000089660004', 'Yazan Issa', 'yazan-issa', '<p><b>Yazan Issa</b> is a Syrian poet and cultural activist residing in the United Arab Emirates. He studied industrial automation engineering and continued his education with an MBA. He has won several local and international poetry awards, including the Sharjah Award for Arab Creativity in its 27th edition. He has made his presence felt in the Syrian and Arab poetry scene and is also known as a cultural activist, presenter, and host in many Arab cultural forums. His poetry collection <i>Wings Trying to Understand the Wind </i>was published by the Department of Culture in Sharjah, and he has contributed to several Arab newspapers and media platforms.<br></p>', NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(192, '3939440000089694001', 'Zeina Chams', 'zeina-chams', '<p><b>Zeina Shams</b> is of Syrian nationality, born in Damascus in 1986, and has lived in the United Arab Emirates since 1996. She studied at the American University in Sharjah, in the media department, and later obtained a Master\'s degree in Translation and Interpretation with honours in 2015 from the American University in Sharjah. Shams has cultural, literary, and artistic interests, including playing the violin, ballet dancing, in addition to reading and writing.<br></p>', NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(193, '3939440000089650002', 'Hala Maher', 'hala-maher', '<p><b>Hala Maher</b> is a short story writer and book review blogger. She published a short story collection titled <i>In Waiting</i>, and a short story titled \'A Rose in the Wind\', which won fourth place in the \'Voices on Air\' program organized by Monte Carlo International Radio in collaboration with Al-Arabi magazine in Kuwait. She began her literary career driven by her passion for book reviews as a hobby, which later transformed into a printed work through the Dubai International Writing Program. She is currently working on two new novels: <i>The Black Jasmine </i>and <i>A Woman in Exile</i>.<br></p>', NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(194, '3939440000089433038', 'Hessa Abdulla', 'hessa-abdulla', '<p><b>Hessa Abdulla</b> is an Emirati writer who writes short stories in the fields of fantasy, crime, and horror, in addition to free verse poetry and prose reflections in three languages: Arabic, English, and Urdu. She has recently published a short story collection titled <i>The View from the Mirror </i>by Ghaf Publications. She also released a collection of prose texts titled <i>7 Years of Autumn </i>by Austin Macauley Publishers, as well as a short story collection by Qandeel Publishing as part of her participation in a short story course with the Mohammed bin Rashid Al Maktoum Knowledge Foundation. Several of her stories have also been published in various publications, such as the e-magazine <i>Sikka</i>, the anthology <i>We Are All Sidra</i>, <i>We All Love the Sea </i>by the UAE Writers Union, and the anthology <i>The Blackboard </i>by Ghaf Publishing.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(195, '3939440000086491005', 'Razmig Bedirian', 'razmig-bedirian', '<p><b>Razmig Bedirian</b> is a Syrian-Armenian writer who grew up in the UAE. Besides his efforts in fiction, he has worked as a journalist in several local publications and has taught creative writing at NYU in New York. Razmig is an arts and culture writer at <i>The National</i>.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(196, '3939440000010806257', 'Sultan Sooud AlQassemi', 'sultan-sooud-alqassemi', '<p><b>Sultan Sooud AlQassemi</b> is an Emirati columnist and researcher on social, political, and cultural affairs in the Arab Gulf States. He founded the Barjeel Art Foundation in 2010, an independent initiative aimed at fostering intellectual development in the Arab art scene. Sultan has taught Politics of Modern Middle Eastern Art at various universities across Europe and the USA. In 2023, he completed a fellowship at the Wissenschaftskolleg zu Berlin and is currently a Research Associate at the SOAS Middle East Institute in London.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(197, '3939440000086057001', 'Naseem Akhtar Khan', 'naseem-akhtar-khan', '<p>Brigadier (retired) <b>Naseem Akhtar Khan </b>served in the Pakistan Army and Inter-Services Intelligence (ISI) for over four decades (1969-2010), a period marked by significant regional security developments with lasting implications for Pakistan. His career spanned both military and intelligence roles, providing firsthand experience in peace and combat operations. Known as an invisible warrior, he conducted covert operations and gathered intelligence from enemy strongholds. A three-year diplomatic assignment abroad further enriched his understanding of strategic and political maneuvering, offering readers a unique perspective on critical regional and international issues.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(198, '3939440000083606009', 'Surya Ramkumar', 'surya-ramkumar', '<p><b>Surya Ramkumar</b> is a Dubai-based writer and sustainability advocate. Her debut novel <i>The Sky Has Moved Away</i> (2023) is the first climate fiction from the region and became an Amazon bestseller. Her other works include <i>Silent Eloquence</i> (2020) and <i>Strategy for Life</i> (2024). Her short stories have been featured in several anthologies, and her writing explores the intersections of motherhood, business, and climate.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(199, '3939440000084729001', 'Sandy Hani', 'sandy-hani', NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(200, '3939440000084626003', 'Omar Alameeri', 'omar-alameeri', NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:55', '2025-02-01 12:38:55'),
(201, '3939440000010817026', 'Abraham Verghese', 'abraham-verghese', '<p><b>Abraham Verghese</b> is a physician and writer. He is the Linda R Meier and Joan F Lane Provostial Professor and Vice Chair of the Department of Medicine at Stanford University. His novel <i>Cutting for Stone</i> spent a year on the <i>New York Times</i> bestseller list. His latest novel, <i>The Covenant of Water</i>, debuted on the 2023 <i>New York Times</i> bestseller list, was selected as an Oprah Book Club Pick, and will soon be adapted into a Netflix series. Verghese is an elected member of the Institute of Medicine and the American Academy of Arts and Sciences. In 2016, former US President Barack Obama awarded him the National Humanities Medal.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(202, '3939440000010818231', 'Samar Mahfouz Barraj', 'samar-mahfouz-barraj', '<p><b>Samar Mahfouz Barraj</b> is a pioneering Lebanese writer and translator in the field of children\'s and YA literature. She has been nominated for the prestigious Hans Christian Andersen Prize in 2024, the highest honour in the field of children\'s literature.<br></p><p><br></p><p>She began her literary career after graduating from the American University of Beirut, where she worked in the field of education for years. Since then, she has published more than 80 books for children, and translated 126 books from several languages into Arabic, which contributed to enriching the Arabic library for children. Samar\'s books are distinguished by their smooth style and topics close to a child’s world, which made them very popular with younger and older readers alike. Many of her books were shortlisted for awards, and many going on to win, including <i>When My Friend Got Sick</i>, <i>My Grandma Will Always Remember Me</i>, <i>A Red Line</i>, <i>My Friend</i>, and <i>Alif, Ba, ..Ya</i>.<br></p><p><br></p><p>In addition to writing, Samar offers intensive creative writing workshops for children and trains teachers and librarians on the importance of reading and encouraging it.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(203, '3939440000078832001', 'May Chebaklo', 'may-chebaklo', '<p><b>May Chebaklo</b> is a special educator who holds a master’s degree in education and is currently preparing her second master’s thesis in special education. She has extensive experience in teaching the Arabic language to children of all ages and from different nationalities. She worked in various schools and institutions in Lebanon and the United Arab Emirates. May wrote a collection of children\'s books in Arabic. She also participated in developing several curricula based on her long experience in the field of education, in addition to providing workshops for teachers and children. She worked as a coordinator and conducted many interviews with many Lebanese and Arab media outlets. May speaks Arabic, English, and French fluently, and her hobbies include creative writing, storytelling, playwriting, theatre acting, and travel.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(204, '3939440000086984018', 'Zoe Mohammed', 'zoe-mohammed', '<p><b>Zoe Mohammed</b> is a self-published poetess whose debut collection <i>I\'m Breaking the Silence, the Stigma, and the Bank </i>explores mental health issues and various social, professional, and personal challenges. With an academic background in linguistics and a passion for storytelling, she blends raw emotions to spark conversations around difficult topics, offering readers a deeper connection to life’s complexities. Since childhood, she has dreamed of becoming an author, and after exploring diverse professional experiences, she is now fulfilling that dream by publishing her writings. Zoe is now focused on expanding her literary projects hoping to inspire reflection.<br></p>', NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(205, '3939440000076617001', 'Chigozie Obioma', 'chigozie-obioma', '<p><b>Chigozie Obioma</b> was born in Akure, Nigeria. His two novels, <i>The Fishermen</i> (2015) and <i>An Orchestra of Minorities</i> (2019) were finalists for the Booker Prize and have been translated into 30 languages. He has won an <i>LA Times</i> book prize, the prestigious Internationaler Literaturpris, FT/Oppenheimer prize for fiction, an NAACP Image award and has been nominated for two dozen prizes for fiction. He was named one of <i>Foreign Policy</i>’s 100 Leading Global Thinkers in 2015 and served as a judge of the Booker Prize in 2021. His work has appeared in the <i>New York Times</i>, <i>Guardian</i>, <i>Financial Times</i>, <i>Paris Review</i>, <i>Granta</i>, and elsewhere. He is the Helen S Lanier Professor of Creative Writing and English at the University of Georgia and the program director of the Oxbelly Fiction Writers retreat. His third novel, <i>The Road to the Country</i>, was published in 2024.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(206, '3939440000080959001', 'Ella Phillips', 'ella-phillips', '<p><b>Ella Phillips</b> is an artist, creative consultant, mother and gardener. She has over a decade’s experience in museum and gallery education, championing creative learning and equity in the cultural sector. She writes children\'s fiction and collaborates with her partner, Darryl, on non-fiction. As co-founders of Electric Future Foods, they inspire plant-based eating through workshops and events, sharing their love for nature and family. From growing vegetables on their allotment to hosting Urban Garden days, they embrace a hands-on approach to food. Their co-authored book, <i>From Plant to Plate</i>, is a magical guide to growing and cooking together as a family.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(207, '3939440000080956001', 'Darryl Gadzekpo', 'darryl-gadzekpo', '<p><b>Darryl Gadzekpo</b> is an author, chef, and passionate gardener dedicated to sharing the joy of growing food. Co-founder of Electric Future Foods, an organisation designed to imagine better food systems. Darryl would like to inspire people to be more self-sufficient. Together with his partner Ella, he co-authored <i>From Plant to Plate</i>, a guide for families to grow, cook, and enjoy their own food while learning about soil and gut health. Beyond the garden, Darryl also works in music as an A&amp;R and PR executive for a renowned independent jazz and soul record label.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(208, '3939440000076137014', 'Des Fitzgerald', 'des-fitzgerald', '<p><b>Des Fitzgerald</b> is a writer and scholar interested in how we think about cities and especially why we think urban spaces are so bad for human psychology. He teaches sociology at the Radical Humanities Laboratory at University College Cork, and is the author of <i>The City of Today is a Dying Thing</i> as well as the co-author of <i>The Urban Brain</i>. He has been named a New Generation Thinker by the BBC, and is a recipient of the Philip Leverhulme Prize for sociology.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(209, '3939440000084057001', 'Harshita Gupta', 'harshita-gupta', '<p><b>Harshita Gupta</b> is a versatile artist and entrepreneur who began as a radio personality and now dominates social media with her comedy content, featured in outlets such as <i>Hindustan Times </i>and <i>Brut India</i>. In 2024, she launched her clothing brand, Chikankari Hues, spotlighting traditional artisans on a global stage. Harshita ranked 9th on <i>Forbes</i>’ List of Digital Stars in 2023 and has collaborated with over 200 brands, including Dubai Tourism and Netflix. Her storytelling on <i>Tape a Tale </i>has reached millions, and she made a cameo in TVF’s <i>Sister</i>. She is now a published author with Penguin India.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(210, '3939440000078069001', 'Zoulfa Katouh', 'zoulfa-katouh', '<p><b>Zoulfa Katouh</b> is the bestselling and award-winning author of the critically acclaimed debut <i>As Long as the Lemon Trees Grow</i> which has been translated into 24 languages. It was nominated for the Yoto Carnegie Medal and was a Governor General\'s Award finalist. Katouh is a pharmacist who finds stories within the sciences and Studio Ghibli inspiration in the nature surrounding her. A dream of hers is to get Kim Namjoon to read one of her books. She currently resides in Switzerland along with her ever-growing stack of books.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(211, '3939440000079006001', 'Zeinab Badawi', 'zeinab-badawi', '<p><b>Zeinab Badawi</b> is a Sudanese-born broadcaster, academic, and public figure. She holds a BA Hons from Oxford and an MA from SOAS. Her work includes a 20-part BBC series on Africa\'s history. She\'s President of SOAS and serves on boards like the Royal Foundation and MINDS. Badawi has received awards, honorary doctorates, and the British Academy\'s President Medal.<br></p>', 'Litfest 2025', 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(212, '3939440000084054001', 'Yousef Kandakji', 'yousef-kandakji', '<p><b>Yousef Kandakji</b> is a Palestinian literary agent from the city of Nablus, and he represents his brother, novelist Basel Khendakji, who won the International Prize for Arabic Fiction 2024. Yousef has been representing him while he is in prison. He owns a bookstore in Palestine and has worked in the cultural and literary field for over 15 years, contributing to the promotion of Palestinian and Arab literature.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(213, '3939440000010823237', 'Walid Taher', 'walid-taher', '<p><b>Walid Taher</b>, a graduate of Faculty of Fine Arts Helwan University, is a renowned Egyptian children\'s author and illustrator. With over 70 children\'s books published internationally, he has captivated young audiences around the world with his vibrant illustrations and engaging stories.<br></p><p><br></p><p>Taher\'s work has won him numerous accolades, including the Etisalat Award (2010-2016), the Honour List Bologna (2004), the Mahmod Koheil Award (2018), and the Sharjah Book Fair Award (2014). His contributions to children\'s literature have been recognized by the Egyptian Journalists Syndicate, earning him first prizes in 2004 and 2006.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(214, '3939440000076865001', 'Waleed Hashim', 'waleed-hashim', '<p><b>Waleed Hashim</b>, a Bahraini writer, began his literary attempts at an early age and completed his first novel, <i>I Wasn\'t There</i>, during his middle school years in 1996. He continued his higher education studies in the United Kingdom and holds a Bachelor\'s degree in English and Welsh Law from the London School of Economics and Political Science (LSE). He currently leads a career as an energy teacher in the field of self-development, as well as being a novelist, a licensed lawyer in the Kingdom of Bahrain, and a legal consultant. His second novel, <i>Passing Through Another Life</i>, won the State Award for Distinguished Writers in 2007. His book <i>Layla, the Baroness of Bukit </i>is his fifth novel-length work, and the second in the Layla, the Duchess of Qalali series, which he completed in 2023.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(215, '3939440000080140001', 'Vashti Hardy', 'vashti-hardy', '<p><b>Vashti Hardy</b> is a bestselling children\'s author whose renowned middle grade fantasies are published across the world in several languages. Her debut <i>Brightstorm</i> was shortlisted for the Waterstones Children’s Book Prize, and her second, <i>Wildspark</i>, won the Blue Peter Book Award ‘Best Story’. The Brightstorm trilogy continues with <i>Darkwhispers</i>, <i>Firesong</i> and <i>Serpent of the Sands</i>. Her latest book <i>North and the Only One</i> is a powerful adventure and AI fable, set in a thrilling and surprising world raising big questions about what it means to be human.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(216, '3939440000083590012', 'Vanessa Woolf', 'vanessa-woolf', '<p><b>Vanessa Woolf</b> tells stories that are real, magical, and engaging, often incorporating props and music. She performs nationally and internationally, both live and virtually. Her clients include the Royal Academy of Arts, Sharjah Children\'s Reading Festival, Shakespeare’s Globe, National Geographic, the London Eye, Royal College of Music, Historic Royal Palaces, The Royal Parks, and Harrods. Woolf has delivered a TEDx talk on the power of wonder, appeared on national and international TV, and performed at hundreds of literary festivals.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(217, '3939440000076116042', 'Tricia Hersey', 'tricia-hersey', '<p><b>Tricia Hersey</b> has over 20 years of experience as a multidisciplinary artist, writer, theologian and community organiser. She is the visionary and founder of The Nap Ministry, the originator of the ‘rest as resistance’ and ‘rest as reparations’ frameworks, creating sacred spaces where the liberatory power of rest can take hold in collaboration with communities all over the world. She is the author of the New York Times bestselling book <i>Rest is Resistance: A Manifesto</i> and <i>We Will Rest!: The Art of Escape</i>.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(218, '3939440000076117021', 'Subhadra Das', 'subhadra-das', '<p><b>Subhadra Das</b> is a writer, historian, broadcaster and comedian who explores the relationship between science and society. She specialises in the history and philosophy of science with a focus on the history of scientific racism and eugenics. Previously, she served as a Curator of the Science Collections at University College London for nine years. Das has written and presented podcasts, performed stand-up comedy, curated museum exhibitions, and appeared on radio and TV. Her debut book <i>Uncivilised: Ten Lies That Made The West</i> was published in 2024.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(219, '3939440000076634006', 'Steven Mithen', 'steven-mithen', '<p><b>Steven Mithen</b> is Professor of Early Prehistory at the University of Reading, UK who previously taught at the University of Cambridge. He has undertaken long-term field projects in southern Jordan and Western Scotland, exploring hunter-gatherer and early Neolithic communities. Mithen was elected as a Fellow of the British academy and appointed as Reading’s Deputy Vice Chancellor. His books include <i>The Prehistory of the Mind</i>, <i>After The Ice: A Global Human History 20,000-5000 BC</i>, <i>The Singing Neanderthals</i> and his latest <i>The Language Puzzle</i>.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(220, '3939440000079074001', 'Steve Mushin', 'steve-mushin', '<p><b>Steve Mushin</b> is an industrial designer and inventor. He collaborates with scientists around the world to devise ludicrous sounding, but theoretically possible inventions to rewild cities into ecosystems for all species. Stephen is the author and illustrator of <i>Ultrawild: An Audacious Plan to Rewild Every City on Earth</i>. Containing 100+ inventions, <i>Ultrawild</i> has won Best Designed Children\'s Non-Fiction book at the 2024 Australian Book Design Awards, and is nominated for the 2024 Elsie Locke Award For Nonfiction. Stephen works between New Zealand and Australia. In 2015 he received an Australian Design Honours award for his work in sustainable futures thinking.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(221, '3939440000078824005', 'Shaikha Alzeyara', 'shaikha-alzeyara', '<p><b>Shaikha Alzeyara</b> is a graduate of Qatar University, College of Arts and Sciences, and holds accreditation in teaching philosophical thinking to children. She is a linguistic and educational supervisor for the educational cartoon \'Siraj\', a member of several juries for children\'s writing competitions, and has organised a number of workshops on writing, as well as designed special reading programs. She won the Sharjah Children\'s Book Award in the Young Adult category for 2022. She received the Best Annual Book Award in the Mind, Body, and Spirit category for 2021 and the Purple Dragonfly Honorary Award for Best Illustrations of the Year. Her novel <i>45 Hours Under the Snow </i>made it to the shortlist for the Etisalat Award in 2022. She has over fifty productions in children\'s literature, including stories, novels, and plays.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(222, '3939440000083677006', 'Sandra Mikhail', 'sandra-mikhail', '<p><b>Sandra Mikhail</b> is an internationally recognized dietitian, author, and founder of Nutrition A-Z, known as \'The Gut Health Dietitian making poo talk salon-chic\'. She specializes in gut health, sports nutrition, and eating disorders. Holding qualifications from Monash University, ETH Zurich, and the International Olympic Committee, she has consulted for brands like FC Zurich, She\'s Mercedes, CNN, and Adobe. A mental health advocate, Sandra was personally invited by Arianna Huffington to contribute to <i>Thrive</i>. She is the author of <i>The Gut Chronicles </i>and co-hosts <i>The Gastroenterologist </i><i>and His Daughter </i>podcast.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(223, '3939440000083596025', 'Ross Welford', 'ross-welford', '<p><b>Ross Welford</b> is a best-selling British author of books for children. His debut novel, <i>Time Travelling With A Hamster</i> has been followed by eight more, to critical and popular acclaim, including the follow-up story, <i>Time Travelling With A Tortoise</i>. When not writing, Ross tours the UK and the world presenting writing masterclasses and his unique show, \"Magic And Science\". Ross is a skilled magician and a member of the prestigious Magic Circle. He lives in London, UK, with his wife, family and pets.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(224, '3939440000080455004', 'Rasha Samir', 'rasha-samir', '<p><b>Rasha Samir</b> is a novelist and journalist for <i>Al-Fajr</i> newspaper. She holds a Master\'s degree in dentistry from Cairo University and is a member of the Egyptian Writers Union. She has published six short story collections and five novels: <i>Jowari Al-Ishq</i>, <i>Sa\'alqak Hunaak</i>, <i>Al-Mas\'hoora</i>, <i>Li-Al-Qalb Marssi Akheer</i>, and <i>Banaat Fi Hekaayaat</i>. She is responsible for managing the Ihsan Abdel Quddous Cultural Salon and the founder of the Kataa\'ban wa Kitaab cultural initiative. She is a member of the jury for the Ihsan Abdel Quddous Literary Award and a member of the Farouk Hosni Cultural Foundation. She also manages the book club at Al-Jazeera Sports Club. She has participated in seminars at international book fairs, including those in Sharjah, Abu Dhabi, Morocco, Jordan, Tunisia, Cairo, Bahrain, Jeddah, the Ibrahim Center in Bahrain, and a seminar at the Egyptian Cultural Bureau in the United Kingdom. Her novels have been discussed and critiqued by Dr Salah Fadl, Dr Jaber Asfour, Gamal Al-Ghitani, Dr Zahi Hawass, Saad Al-Hamaideen, and others.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(225, '3939440000083929001', 'Rana Idriss', 'rana-idriss', '<p><b>Rana Idriss</b>, the General Director of Dar Al Adab since 1985, has played a pivotal role in enriching the Arab cultural and literary scene. She studied anthropology at the American University of Beirut and continued her studies at New York University. She has served on the judging panels of several prestigious literary awards, including the Kadmos Award with the French Embassy in Beirut, the Goethe Award for Best Short Story in Beirut, and the Creative Writing Workshop under the supervision of Najwa Barakat. She has received several awards, including the Best Publisher Award (Commander Rank) from Morocco, Best Arabic Publisher from the Sharjah International Book Fair, and Dar Al Adab reached the shortlist for the Sheikh Zayed Book Award. She also received the International Publishing Excellence Award from the London Book Fair in the Adult Books category in 2020. She served as a member of the Board of Trustees of the International Prize for Arabic Fiction from 2019 to 2022.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(226, '3939440000083513016', 'Pip Williams', 'pip-williams', '<p><b>Pip Williams</b> is an Australian author known for her debut novel <i>The Dictionary of Lost Words</i>, a <i>New York Times</i> bestseller and Reese Witherspoon book club pick, translated into over 30 languages. The novel won multiple awards and has been adapted for stage and screen. Williams\' second novel, <i>The Bookbinder of Jericho</i>, continues her tradition of powerful storytelling and has been translated into multiple languages.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(227, '3939440000078852001', 'Mohanad Science', 'mohanad-science', '<p>A pioneer in STEM education, <b>Mohanad Science</b> is an Egyptian science communicator with 13 years of experience inspiring young minds across the Arab world. <br></p><p><br></p><p>Beyond his dynamic performances across more than 3500 shows and workshops, Mohanad is a renowned STEM Kits designer, a TEDx speaker, and a dedicated educator. He has successfully trained over 700 educators to become exceptional science teachers, empowering them to spark curiosity and creativity in their students.<br></p><p><br></p><p>Mohanad\'s influence extends far beyond the classroom, as he is a sought-after content creator with a substantial social media following of over 199,000 STEM enthusiasts.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(228, '3939440000083710006', 'Mohammad Al Mansi Qindeel', 'mohammad-al-mansi-qindeel', '<p><b>Mohamed Kandeel</b> is a distinguished Egyptian writer and novelist and one of the most prominent names in contemporary Arabic literature. He graduated from the Faculty of Medicine in Mansoura, Egypt, where he worked as a doctor in rural areas for several years before dedicating himself to writing. He has authored many novels that gained wide popularity, including <i>A Moon Over Samarkand</i>, <i>A Cloudy Day in the Western Desert</i>, and <i>I Loved</i>, some of which were adapted into television productions. He served as the senior editor at the Kuwaiti magazine <i>Al-Arabi</i>, where he conducted cultural surveys around the world. In addition to his novels, he has made literary contributions for children, written scripts for cinema, and authored several books reflecting his deep passion for the history of the Arab world. He has received several local awards in recognition of his creative works that blend history with literary narration.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(229, '3939440000084051001', 'MJ Arlidge', 'mj-arlidge', '<p><b>MJ Arlidge</b> has worked in television for over 25 years, specializing in high-end drama production, including prime-time series such as <i>Eastenders</i>, <i>Silent Witness</i>, and ITV\'s hit show <i>Innocent</i>. In 2015, his audiobook exclusive <i>Six Degrees of Assassination </i>became an Audible No 1 bestseller. His debut novel, <i>Eeny Meeny</i>, was the UK\'s best-selling crime debut of 2014 and has been followed by 11 more Helen Grace thrillers, all of which are <i>Sunday Times </i>bestsellers.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(230, '3939440000076124029', 'Megan Hess', 'megan-hess', '<p><b>Megan Hess</b> was destined to draw. After working in graphic design and art direction, her career in fashion illustration has seen her creating for renowned clients all over the world, including portraits for Vanity Fair, animations for Prada in Milan, the windows of Bergdorf Goodman in New York, and live illustrating for fashion shows such as Christian Dior Couture. Hess is the author of numerous bestselling fashion books and the sensational children\'s book <i>Claris: The Chicest Mouse in Paris</i>, alongside her new series, Young Queens Collection.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(231, '3939440000083589006', 'Mateo Askaripour', 'mateo-askaripour', '<p><b>Mateo Askaripour</b>’s debut novel <i>Black Buck</i> humorously tackles racism in corporate America. A <i>New York Times</i> bestseller and a Read with Jenna book club pick, it earned him recognition as one of <i>Entertainment Weekly</i>’s \'10 Rising Stars\' and a recipient of the National Book Foundation’s \'5 Under 35\' award. His second novel, <i>This Great Hemisphere</i>, continues his bold storytelling. He lives in Brooklyn.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(232, '3939440000077568006', 'Majed Alahdal', 'majed-alahdal', '<p><b>Majed Alahdal</b> is a civil engineer and a researcher in cultural history, with an interest in urban studies specialising on the history of food and drink and documenting traditions. His latest publication is <i>The Coffee Anthology: The Poetry of Coffee from the Ninth Hijri Century</i>, with an introduction to the history of coffee. He has also edited several manuscripts on coffee literature, such as <i>The Stirring of Chivalry in the Rule of Coffee</i> by Abu Bakr al-Makki, <i>Repelling the Mistake</i> by Ibn Abd al-Ghafar al-Maliki, and <i>The Essence of the Elite</i> by Abdul Qadir al-Jaziri. His upcoming work is <i>The Tea Anthology</i>. He works in brand management, creative writing, and art direction and has been involved in numerous creative projects for both governmental and private organisations. Some of his dramatic works have won official awards.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(233, '3939440000010823127', 'Luigi Bonomi', 'luigi-bonomi', '<p><b>Luigi Bonomi </b>has worked in publishing for 40 years, first as an editor and publisher and then as a literary agent. He has worked with and discovered some of the biggest authors in the industry, including Peter James, Jack Higgins, Nora Roberts, Simon Scarrow, Alice Roberts, Fern Britton, Ben Miller, and Susan Lewis. In 2005, Bonomi set up his own literary agency, LBA, which last year had 14 titles in the top ten bestseller list, one of which hit the number one slot. He has a passion for discovering and nurturing new writers.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(234, '3939440000078804011', 'Kelly Clancy', 'kelly-clancy', '<p><b>Kelly Clancy</b> is a neuroscientist and physicist with research experience at MIT, Berkeley, UCL, and DeepMind. She studies intelligence principles and has developed brain-computer interfaces to explore agency\'s biological basis. Clancy\'s essays on neuroscience and AI have been published in <i>Wired</i>, <i>Harper\'s</i>, and <i>The New Yorker</i>.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(235, '3939440000079515001', 'Juli Min', 'juli-min', '<p><b>Juli Min</b> is a Korean-American writer based in Shanghai. She holds an MFA from Warren Wilson and studied Russian and comparative literature at Harvard. Her novel <i>Shanghailanders</i> was published in 2024 by Spiegel &amp; Grau (US) and Dialogue Books (UK). Translations are forthcoming in Japanese, German, Spanish, and Norwegian.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(236, '3939440000076909002', 'Joe Roman', 'joe-roman', '<p><b>Joe Roman</b> is a conservation biologist, marine ecologist, and editor ’n’ chef of eattheinvaders.org. He won the Rachel Carson Environment Book Award for Listed: Dispatches from America’s Endangered Species Act. Roman has written for the <i>New York Times</i>, <i>Science</i>, <i>Slate</i>, and other publications. He is a fellow and writer in residence at the Gund Institute for Environment at the University of Vermont. His latest book is <i>Eat, Poop, Die: How Animals Make Our World</i>.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(237, '3939440000076136022', 'Jessamy Hibberd', 'jessamy-hibberd', '<p><b>Dr Jessamy Hibberd</b> is a Chartered Clinical Psychologist, international bestselling author, and speaker. She has written nine books, including <i>The Imposter Cure</i>, described by <i>The Sunday Times</i> as \'the definitive guide to tackling and understanding the psychological mind trap of imposter syndrome.\' Hibberd\'s motto is: \'What we do every day makes the biggest difference. It’s small steps that lead to the greatest changes.\' She shared this message in her TEDx talk ‘Adventure of a Lifetime.’ Her latest book, <i>How to Overcome Trauma and Find Yourself Again: 7 Steps to Grow from Pain</i>, was published in May 2024.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(238, '3939440000077581007', 'Jack Meggitt-Phillips', 'jack-meggitt-phillips', '<p><b>Jack Meggitt-Phillips</b> is the English author of the internationally acclaimed children\'s series The Beast and the Bethany. This story follows a 500-year-old young man, a hungry beast, and a rebellious prankster. The series has been translated into over 30 languages and has a major film deal with Heyday Films. Meggitt-Phillips has performed to sold-out crowds at events like BathFest, Udderbelly, Norway\'s International Festival of Literature, France\'s Salon of Children\'s Literature, and Italy\'s ComicCon.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(239, '3939440000080218001', 'Helen Czerski', 'helen-czerski', '<p>Dr <b>Helen Czerski</b> is a UCL-based physicist and oceanographer studying breaking waves and bubbles. Her research explores how they aid ocean respiration. She\'s also a BBC science broadcaster since 2010. Czerski has received the Institute of Physics Gold Medal, the Marine Pioneer Award, and an honorary doctorate. Her latest book, <i>Blue Machine</i>, details Earth\'s oceanic engine.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(240, '3939440000076093030', 'Harriet Griffey', 'harriet-griffey', '<p><b>Harriet Griffey</b> leads and facilitates Writers’ Retreats. She is a London-based ex-publisher, published author, and journalist with an MA in Modern and Contemporary Literature. She is a former commissioning editor at George Allen &amp; Unwin, past editorial director at Macdonald Publishers, a member of the Royal Society of Literature, and a tutor with Creative Writing Consultancy. Griffey has written over 20 books, and her new book, <i>Write Now: 100 Writing Prompts to Kick-Start Your Creativity</i>, was published in October 2024.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(241, '3939440000076850004', 'Hanno Sauer', 'hanno-sauer', '<p><b>Hanno Sauer</b> is a philosopher and writer. He is currently a professor of philosophy at Utrecht University in The Netherlands, where he teaches ethics and political philosophy. He is the author of numerous academic articles and monographs. His book <i>A World History of Morality</i> became an international bestseller and will appear in more than 20 countries, and his latest book is <i>The Invention of Good and Evil</i>.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58');
INSERT INTO `authors` (`id`, `authorid`, `full_name`, `author_slug`, `author_blurb`, `author_as_year`, `moderator_as_year`, `launchpad_young_author_as_year`, `launchpad_author_as_year`, `performer_as_Year`, `Host_as_Year`, `Website_Status`, `image`, `created_at`, `updated_at`) VALUES
(242, '3939440000087226001', 'Faris Bseiso', 'faris-bseiso', '<p><b>Faris Bseiso</b> is a Palestinian-Syrian entrepreneur and writer. Bseiso is currently the co-founder and CEO of Cipher Media, a licensing marketplace that supplies music to brands and professional sports teams for social media. In the publishing world, Bseiso most recently was a judge and editor for <i>Mudun</i>, the published anthology that followed the Barjeel Art Foundation\'s short story competition. As a writer, Bseiso has published bylines with CNN and Bloomberg, and published short stories in various regional magazines. Now based in New York, Bseiso also serves as an ambassador for Afikra and DJ\'s for Arab events in the city.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(243, '3939440000086093070', 'Farida El Gueretly', 'farida-el-gueretly', '<p><b>Farida El Gueretly</b> is a partnerships, research, and policy specialist with extensive experience, and is currently managing grants and partnerships for the Wikimedia Foundation in the Middle East and North Africa. Holding an MEd in international education policy, she has led capacity-building and evidence generation and use projects focused on social development and education. Skilled in data analysis, program evaluation, and cross-sector collaboration, she is fluent in English and Arabic, with a passion for expanding access to knowledge and learning opportunities for all.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(244, '3939440000083611029', 'Faiza S Khan', 'faiza-s-khan', '<p><b>Faiza S Khan</b> is the Director of Silk Road Slippers Writing Masterclasses, where she teaches creative writing alongside some of the world’s most celebrated authors. A writing coach and mentor, she has worked with bestselling and prize-winning authors during her tenure as a consulting editor at Bloomsbury Publishing and editor-at-large at Random House India. As a freelancer, Faiza collaborates with publishers, authors, and literary agents, as well as cultural institutions including the National Museum of Sweden and the Overseas Museum in Bremen.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(245, '3939440000076580003', 'Emma Dabiri', 'emma-dabiri', '<p><b>Emma Dabiri</b> is an Irish-Nigerian academic, broadcaster and writer who spent over a decade as a teaching fellow in the African department at SOAS. She is author of the Sunday Times bestseller <i>What White People Can Do Next</i>, <i>Don\'t Touch My Hair</i> and <i>Disobedient Bodies</i>. In 2023, she was appointed as a Fellow of the Royal Society of Literature. Dabiri has presented several television and radio programmes including critically-acclaimed documentaries <i>Journeys into Afro-futurism</i> and <i>Britain\'s Lost Masterpieces</i> and the Cannes Silver Lion award-winning <i>Hair Power</i> for Channel 4.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(246, '3939440000078360001', 'Elle McNicoll', 'elle-mcnicoll', '<p><b>Elle McNicoll</b> is a bestselling and award-winning novelist/screenwriter. Her debut, <i>A Kind of Spark</i>, won the Blue Peter Book Award and the Overall Waterstones Children’s Book Prize in 2021. She has been Carnegie-nominated four times and her work has also been adapted for screen, which debuted in 2023. Elle\'s television work was Emmy-nominated and won Best Children’s Programme at the 2024 Broadcast Awards in London. Her debut was named one of the greatest children’s books of all time, and she has been nominated for the Astrid Lindgren Memorial Award twice.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(247, '3939440000083610002', 'Daniel Handler aka Lemony Snicket', 'daniel-handler-aka-lemony-snicket', '<p><b>Daniel Handler</b> is a novelist and author of the Lemony Snicket series. His works include <i>Why We Broke Up</i>, <i>All The Dirty Parts</i>, <i>Bottle Grove</i>, and the memoir <i>And Then? And Then? What Else?</i> As Lemony Snicket, he has written numerous children\'s books like <i>Poison for Breakfas</i>t, <i>All The Wrong Questions</i>, and A Series of Unfortunate Events. He lives in San Francisco with his wife, illustrator Lisa Brown.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(248, '3939440000010821071', 'Fiona Lindsay', 'fiona-lindsay', '<p><b>Fiona Lindsay</b> is a highly experienced creative producer, interviewer and coach. She is regarded as one of the UK’s leading onstage conversation show hosts and her work with creative artists spans radio, film, live and online. <br></p><p><br></p><p>She has created and presented over ten critically acclaimed radio programmes for the BBC, most recently an in-depth portrait of Rufus Norris, the artistic director of London\'s National Theatre.&nbsp;<br></p><p><br></p><p>In May 2023, she launched her new conversation series, <i>Avril Freck: Notes on Love and Being Alone</i>, in London’s West End, which will return with its second season in Spring 2024. Previous sell out conversation shows in the West End that Lindsay created and hosted include <i>Face to Face</i> at the Arts Theatre and Encounters at the Lyric on Shaftesbury Avenue.<br></p><p><br></p><p>Her musical piece <i>SEEN</i>, written in collaboration with composer Joanna Marsh, premiered at the Barbican Centre in London in 2022 and was selected by the BBC to be presented at the Royal Albert Hall as part of their 2023 Proms Season.&nbsp;<br></p><p><br></p><p>She is the co-founder of the world’s leading online Arts Education Platform Digital Theatre+, which reaches over four million students worldwide. As a founding member of the Royal Shakespeare’s education department, Lindsay went on to establish, create and produce a year-round learning events programme.<br></p><p><br></p><p>She is passionate about storytelling and enabling artists to share their process while ensuring that audiences feel immersed in unique, engaging and entertaining occasions.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(249, '3939440000076634001', 'Anil Ananthaswamy', 'anil-ananthaswamy', '<p><b>Anil Ananthaswamy</b> is an award-winning science writer and former staff writer and deputy news editor for New Scientist. He is the author of several popular science books including <i>The Man Who Wasn’t There</i>, which was long-listed for the Pen/E. O. Wilson Literary Science Writing Award. He was a 2019-20 MIT Knight Science Journalism Fellow and the recipient of the Distinguished Alum Award, the highest award given by IIT-Madras to its graduates, for his contributions to science writing. His new book, <i>Why Machines Learn</i>, was published in July 2024.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(250, '3939440000079565001', 'Alison Steadman', 'alison-steadman', '<p><b>Alison Steadman</b> is a renowned British actress known for her work in television, film, and theater. She has appeared in popular shows like <i>Gavin &amp; Stacey</i>, <i>Pride and Prejudice</i>, and <i>Fat Friends</i>. Her film credits include <i>Life Is Sweet</i>, and she has starred in stage productions like <i>Abigail\'s Party</i> and <i>The Rise and Fall of Little Voice</i>. Steadman has won an Olivier, a National Society of Film Critics Award, and was nominated for two BAFTAs. She lives in London with her partner and is a keen birdwatcher and RSPB patron. Steadman was awarded an OBE in 2000.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(251, '3939440000078101001', 'Alexandra Levick', 'alexandra-levick', '<p><b>Alexandra Levick</b> is a senior literary agent at Writers House representing award-winning and bestselling clients across age categories. Previously, Levick worked with the agency at large as the Media Rights Manager for film and tv, and before that, she apprenticed under several senior agents. She has also worked as a bookseller and on the house side of the publishing business in publicity. She holds a Master of Science in Publishing: Digital and Print Media from New York University and a Bachelor of the Arts in English, with a concentration in Creative Writing from the University of Rochester.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(252, '3939440000077423001', 'Alex Latimer', 'alex-latimer', '<p><b>Alex Latimer </b>is the award-winning South African author and illustrator of numerous picture books including <i>Am I Yours?</i>, <i>Lula and the Sea Monster</i>, <i>Mole Hill</i> and <i>Food Fight</i>. His picture books have been translated into dozens of languages and have been published all over the world. <i>Gordon the Meanest Goose on Earth</i> is Latimer\'s first chapter book, a unique and hilarious redemption story, with one mean goose realising that saying sorry is the bravest thing you can do. He lives in Cape Town.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(253, '3939440000084698001', 'Abdulrazak Gurnah', 'abdulrazak-gurnah', '<p><b>Abdulrazak Gurnah</b> is the winner of the Nobel Prize in Literature 2021. He is the author of&nbsp; ten novels: <i>Memory of Departure</i>, <i>Pilgrims Way</i>, <i>Dottie</i>, <i>Paradise </i>(shortlisted for the Booker Prize and the Whitbread Award), <i>Admiring Silence</i>, <i>By the Sea </i>(longlisted for the Booker Prize and shortlisted for the Los Angeles Times Book Award), <i>Desertion </i>(shortlisted for the Commonwealth Writers’ Prize), <i>The Last Gift</i>, <i>Gravel Heart</i>, and <i>Afterlives</i>, which was shortlisted for the Orwell Prize for Fiction 2021 and longlisted for the Walter Scott Prize. He was Professor of English at the University of Kent, and was a Booker Prize judge in 2016. He lives in Canterbury.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(254, '3939440000078800001', 'Abdel Illah Benarafa', 'abdel-illah-benarafa', '<p><b>Abdel Illah Benarafa</b>, who holds a PhD in Semantics from the Sorbonne University in Paris, is currently the Deputy Director-General of the Islamic World Educational, Scientific, and Cultural Organization (ISESCO). He has published a number of books and studies in the fields of culture, history, literature, art, and novels, the latest of which is <i>No Youth but Ali </i>in 2024. His novels <i>Ibn al-Khatib in the Garden of Taha </i>and <i>The Seals </i>reached the final list for the Sheikh Zayed Award in 2013 and 2023. He has also published a series of scholarly investigations into Andalusian heritage books, the latest being the investigation of <i>The Great Diwan of Ibn Arabi</i>, which won the 2024 Arab World Heritage Book of the Year Award from the Arab Manuscripts Institute in Cairo and ALECSO, an organisation affiliated with the Arab League.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(255, '3939440000010820286', 'Peyman Parham Al Awadhi', 'peyman-parham-al-awadhi', '<p><b>Peyman Parham Al Awadhi</b> is an entrepreneur, producer, and Chairman of the World Street Food Organisation. Formerly the CEO of the New Media Academy, the Middle East’s first social media influencer incubator and the UAE\'s fastest-growing media startup in 2020 and 2021, he has held senior roles in multinational companies and UAE government entities across the transport, sports, finance, and media sectors. Passionate about human development, Peyman is actively involved in major education and learning initiatives. An avid content creator, he engages a sizable audience with content on food, travel, and Arab culture.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, 'Litfest 2025', 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(256, '3939440000084590005', 'Hessa Hassan', 'hessa-hassan', '<p><b>Hass Hassan</b> <br></p><p>Writer and media professional at Sharjah TV<br></p><p>Won first place in the Emirate of Ajman and ninth place in the United Arab Emirates in the eighth season of the Reading Challenge, she also won second place in the Emirate of Dubai in the fifth season and tenth place in the Emirate of Ajman in the seventh season of the same challenge, she also won third place in the <i>Aousha bint Khalifa Al Suwaidi</i> competition for the poetry category in the first season,<br></p><p>She participated in many workshops and events in the United Arab Emirates and represented the country in cooperation with the E<i>mirates Red Crescent</i> in the Hashemite Kingdom of Jordan as a safety ambassador for the Dubai Police, and she is a member of the Geniuses Volunteer Team,<br></p><p>As for writing, she published her story First Class Traveler and signed the book at the <i>Sharjah Children\'s Reading Festival</i> and the <i>Abu Dhabi International Book Fair</i><br></p><p>She has a story published in the book <i>The Fifty</i><br></p>', NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(257, '3939440000095206004', 'Mina Al-Oraibi', 'mina-al-oraibi', '<p><b>Mina Al-Oraibi</b> is the Editor in Chief of <i>The National</i>, an English-language regional news outlet based in Abu Dhabi. Mina has over 20 years of experience covering Middle Eastern, European and American affairs. She has conducted multiple high-profile interviews. <br></p><p><br></p><p>Mina was a Senior Fellow at the Institute for State Effectiveness (ISE) and a Yale World Fellow. Mina was the Assistant Editor-in-Chief of <i>Asharq Alawsat</i> from 2011-2015. Prior to that, she was the Washington Bureau Chief for the newspaper. Mina was named as a Young Global Leader by the <i>World Economic Forum</i>.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(258, '3939440000084627003', 'Beesan Osman', 'beesan-osman', '<p>At just 16, <b>Beesan Osman</b> is a trailblazer in technology, space, and computer science, inspiring young minds to pursue their passions fearlessly. A confident media personality and dedicated <i>Sharjah Girl Guide</i> since 2019, she has volunteered over 1,000 hours and received prestigious honors, including the Hamdan Bin Rashid Al-Maktoum Award and the Aoun Award for Community Service (three consecutive wins). <br></p><p><br></p><p>A skilled writer in English and Arabic, Beesan has earned first place in the<i> Little Writer in a Big Book</i> competition and worked as a translator for the <i>UAE Teachers Association</i>. Featured on Dubai TV at EXPO2020, her achievements reflect a commitment to empowering youth and leading by example.<br></p>', NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(259, '3939440000084605004', 'Omar Hussein', 'omar-hussein', '<p><b>Omar Hussein</b>, a 10-year-old Jordanian-Palestinian author, was born in 2012 and lives in Dubai. A student at Deira International School, he won the Secondary English Award for the 2024 academic year. Omar\'s love for reading and writing has led him to participate in competitions hosted by the Emirates Literature Foundation. At just 10, he published his debut book, <i>The Mission Where I Learnt “A Lot”</i>, with Austin Macauley Publishers. Currently, he’s working on the second book in the series and two other projects. Omar aims to address global issues through his writing and enjoys acting, tennis, and Greek mythology.<br></p>', NULL, NULL, 'Litfest 2025', NULL, NULL, 'Litfest 2025', 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(260, '3939440000010818136', 'Khalid Albudoor', 'khalid-albudoor', '<p><b>Khalid Albudoor</b> is an Emirati poet considered one of the pioneers of the modern poetry movement in the UAE. He has published several poetry collections and translations in poetry and philosophy and won the Youssef Al-Khal Poetry Prize in Lebanon in 1992. He is a founding member of the UAE Writers and Authors Union and has participated in numerous literary festivals within the UAE and abroad. He has a strong interest in studying Emirati cultural heritage and is also a documentary filmmaker. He holds a Master\'s degree in screenwriting from the United States, and his films have received awards and recognition locally and internationally. Several cultural institutions have honoured him for his literary contributions, and his unique poetry experience was recognised by the International Academy of Poetry in Italy, which awarded him an honourary diploma in 2016.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(261, '3939440000016128014', 'Lana Shamma', 'lana-shamma', '<p><b>Lana Shamma</b> is a cultural advocate engaged in film, visual arts, and literature, bridging the arts with philanthropy through collaborations with artists, foundations, and community organisations. She is currently part of the Emirates Literature Foundation leadership team, focusing on strategy and development. Previously, Lana led public programs and partnerships at Jameel Arts Centre from its inception and worked in management and outreach at Bloomsbury Qatar Foundation Publishing, as well as in communications at the Doha Tribeca Film Festival.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(262, '3939440000010817086', 'Ebtisam Al-Beiti', 'ebtisam-al-beiti', '<p><b>Ebtisam Al-Beiti</b> is a published Emirati children’s author and early years professional. Ebtisam has published three children\'s books, all of which have the recurring theme of self-belief and positivity in young children. She has been invited to several international literature festivals including the prestigious Bradford Literature Festival in July 2024 and the Toronto International Festival of Authors in September 2024. Ebtisam has also been a panelist in several early years education panels, including a judge at the Top School Awards of Dubai 2021 and The WonderMom Awards 2024. As an advocate for education, Ebtisam has actively contributed to educating young children.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(263, '3939440000086981027', 'Shahd Thani', 'shahd-thani', '<p><b>Shahd Thani</b> is an Emirati romance writer and poet. She was the curator, MC, as well of one of the participating poets for the Ramadan Nostalgia Evening hosted on World Poetry Day in collaboration with House of Wisdom. She is hard at work on her contemporary Emirati romance novel. She is one of the founding members of Untitled Chapters, a hub for women writers. She is passionate about writing and ancestors, and has facilitated two sold out workshops called \'Connecting with Ancestors\'.<br></p>', NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(264, '3939440000084787001', 'Farah Younes', 'farah-younes', '<p><b>Farah Younes</b> is a Syrian qanun player, currently living in the United Arab Emirates. She has performed at numerous prominent musical events in the UAE, such as the National Day celebrations, the Liwa Festival, and the Umm Kulthum hologram concert at the Dubai Opera House. She was honored at the Khamsiyat Ta’a Training and Sustainable Development Conference and the Achievements of Ajman University ceremony.<br></p>', NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(265, '3939440000086960029', 'Aroma', 'aroma', '<p><b>Aroma </b>is a writer who would be lost in translation if it wasn\'t for poetry. Her work has been featured internationally in anthologies and spoken word events, exploring themes of identity, belonging, mental habitats, and the nuances of nature.<br></p>', NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(266, '3939440000087003090', 'Alex', 'alex', '<p><b>Alex</b> is a Dubai-based poet.<br></p>', NULL, NULL, NULL, NULL, 'Litfest 2025', NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(267, '3939440000084081001', 'Maryam AlHashmi', 'maryam-alhashmi', '<p><b>Dr Maryam AlHashmi</b> is a prominent Emirati critic and writer, with significant contributions to literary and philosophical criticism. Some of her important publications are <i>The Eulogy of Cities and Kingdoms Between Baghdad and Andalusia</i>, a comparative study of the poetry of Shadi al-Shirazi and Abu al-Baqa al-Rundi; <i>The Development of the Poetic Movement in the UAE</i>; <i>The Alienation of Al-Madani</i>, which analyses the poetry of Ahmed Amin Al-Madani; <i>Faces of Mariana: Critical Approaches</i>; <i>The Mind Between Talent and Genius</i>; and <i>Narrative Transformations in Emirati Literature</i>. Dr Maryam has received several awards in recognition of her intellectual contributions, including the Rashid bin Saeed Award for Scientific Excellence, the Al Owais Award for Creativity as the Best Emirati Writer, and the Sharjah Award for Gulf Women\'s Creativity in the Critical Studies category. She is a member of several judging panels, including the Al Owais Award for Critical Studies, the Sharjah Book Fair Award, and the Sharjah Award for Gulf Women\'s Creativity, in addition to being a member of the advisory committee for the Al Owais Award.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(268, '3939440000090420002', 'Hazem Ibrahim', 'hazem-ibrahim', '<p><b>Hazem Ibrahim</b> is a Syrian translator with a Bachelor\'s degree in English Language and Literature from Damascus University and a Fulbright Scholarship in Cultural Communication from California State University, Sacramento (CSUS). Hazem has worked as a sworn, simultaneous, and editorial translator in Syria since 2002 and served as Secretary-General of the Central Council for People of Determination in Syria. He has been living in the UAE since 2013, where he worked as an economic media interpreter at CNBC Arabia until 2021 and is currently a senior translator at <i>Asharq Business with Bloomberg </i>and <i>Asharq News</i>. Since 2014, he has been on the editorial and translation board of <i>Harvard Business Review Arabia</i>. Hazem has translated several books, including <i>The Imagination Machine</i>, <i>Strategic Motivation</i>, and <i>Innovate and Move Forward</i>, published by Majarra.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(269, '3939440000010814227', 'Namal Siddiqui', 'namal-siddiqui', '<p><b>Namal Siddiqui</b> is a Pakistani poet, born and raised in the United Arab Emirates. She curates cultural events, consults for brands, and is currently preparing a poetry collection for publication. Her work explores themes of identity, decolonisation, and nature. Additionally, Namal serves as an Adjunct Lecturer in Creative Writing at the Rochester Institute of Technology in Dubai.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(270, '3939440000010819118', 'Hafsa Lodi', 'hafsa-lodi', '<p><b>Hafsa Lodi</b> is an award-winning journalist who has been covering fashion and culture for more than a decade. With a BA in journalism and MA in Islamic law, Hafsa writes frequently about the intersection of faith, fashion, and feminism, and has contributed to <i>The Independent</i>, <i>The National</i>, <i>Mojeh</i>, <i>Vogue Arabia</i>, and more. Her debut non-fiction book <i>Modesty: A Fashion Paradox </i>(Neem Tree Press) launched at the 2020 Emirates Airline Festival of Literature and explores the causes and controversies of modest fashion. <i>Harper’s Bazaar US </i>called it “a well-researched and tender portrait of the politics and people behind a movement\".<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(271, '3939440000010825131', 'Ghaith AlHosani', 'ghaith-alhosani', '<p><b>Ghaith AlHosani</b> is a media professional and intellectual from the United Arab Emirates who has participated in many significant cultural activities both within the country and abroad. He has contributed to organising numerous dialogue sessions with prominent figures and currently hosts the podcast <i>Ihtimal </i>on social media platforms.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(272, '3939440000038172011', 'Anamika Chatterjee', 'anamika-chatterjee', '<p><b>Anamika Chatterjee</b> is a writer, editor, TEDx speaker based in the UAE. In her day job as a journalist, she has written extensively on books, arts, and culture, while actively documenting social and cultural milestones in the region. From Pico Iyer to Nobel laureate Abdulrazak Gurnah, her features on authors attempt to understand the person underneath the writer. In 2021, her piece for <i>Khaleej Times </i>on coping with a parent afflicted by Alzheimer\'s during the pandemic was selected for a talk at the prestigious All India Institute of Medical Sciences Patna\'s TEDx event. She is currently working on her first book of non-fiction.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(273, '3939440000040840040', 'Deema Al Alami', 'deema-al-alami', '<p>With over 16 years of experience in education and an MA from KCL and a BA from AUB, <b>Deema Al Alami</b> is an educator, reading advocate, and children’s book author dedicated to fostering a love of reading. She co-founded the first Annual Arab Child Summit in Expo City Dubai, and appeared on season one of <i>Shark Tank</i>, securing investment. Deema launched the \'From Mother to Author\' program to support aspiring Arab children\'s book authors and co-authored two bestselling children\'s books, including one about body safety in Arabic. She recently published <i>48 Stories of Exile from Palestine</i>. Through her Instagram, she shares book recommendations and literacy tips.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(274, '3939440000064585001', 'Chris Bradley', 'chris-bradley', '<p>A native of the UK, <b>Chris Bradley </b>graduated with business degrees from universities in Britain and France. After his first London-based career in transport and travel, Bradley worked in the energy sector, living internationally with his family. Fluent in French, his interests include exercise, reading, and current affairs, and spending time with his wife and three daughters. Now based in the UAE, Bradley is a trusted leadership advisor to boards and CEOs.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(275, '3939440000087297001', 'Rawaa Talass', 'rawaa-talass', '<p><b>Rawaa Talass</b> is a Tokyo-born, Dubai-based freelance writer and journalist. She has gained two Master’s degrees in art history from the University of Kent (Paris) and the School of Oriental and African Studies (London). Originally from Syria, she has devoted her writing to telling personal and engaging stories of art, culture, and society from the Arab world and wider region. Her writings have been featured in <i>Artsy</i>, <i>The Art Newspaper</i>, <i>Arab News</i>, <i>The New Arab</i>, <i>AD Middle East</i>, <i>Canvas Magazine</i>, <i>Al Arabiya English </i>and <i>The National</i>.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(276, '3939440000089910044', 'Natasha Hatherall-Shawe', 'natasha-hatherall-shawe', '<p><b>Natasha Hatherall-Shawe</b> has spent over 20 years in the marketing and media world and is today Founder and CEO of TishTash, one of the region’s most sought after communications agencies. Born and educated in the UK, she holds a PhD in psychology and marketing and has had a varied career spanning many sectors and including leading global agencies McCann Erickson Worldwide, Euro RSCG and Havas Global, and global corporations L\'Oreal and Diageo.&nbsp; Natasha moved to the region in 2010, setting up her own agency in 2012. Natasha is a passionate advocate for women in business and women\'s health.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(277, '3939440000089921057', 'Rhea Chedid', 'rhea-chedid', '<p><b>Rhea Chedid </b>has been in the content business for the last 8 years wearing different hats. She has worked in podcasting, music as well as crafting content strategies for various brands in the Middle East and Europe. Rhea also hosts and produces her own podcasts, including Her Stage, which was part of the Google Podcast creator program and Who Run the World, which won the International Women’s Podcast Award for moment of comedy gold.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(278, '3939440000090159019', 'Maya Abou Zahr', 'maya-abou-zahr', '<p>In addition to her academic work at UAE University and the American University in Dubai, <b>Maya Abou Zahr </b>is a researcher, writer, book reviewer, editor, peer reviewer, and session facilitator. She has a published book and has written numerous articles on sustainability, medical tourism, the Russia-Ukraine conflict, feminism, and topics related to the Gulf region. Her articles have been published in respected journals such as <i>Contemporary Arab Affairs</i>, Gulf Research Center, <i>Social Affairs</i>, and <i>Al-Mustaqbal Al-Arabi</i>. Maya is a member of the Dubai Quality Group, various cultural and entrepreneurial groups, and has participated in several book clubs like the Women’s Narratives Forum, one of which she founded. She has participated in over 70 seminars and conferences and has led numerous discussion sessions. She enjoys reading and music.<br></p>', NULL, 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(279, '3939440000084554001', 'Afra Rashed Al Dhaheri', 'afra-rashed-al-dhaheri', '<p><b>Afra Rashed Al Dhaheri</b> is an exceptional student at Liwa Al Qattara Al Ain School. Fluent in Arabic and English, she excels academically and has a passion for drawing and colouring. Afra has received numerous accolades, including a Certificate of Excellence and first place in a Library Competition Trivia Quiz Bee. She is also an aspiring author, contributing to <i>The Apple Tree</i> in Arabic and publishing <i>Be a Buddy, Not a Bully </i>in English at the Abu Dhabi Book Fair. Afra dreams of becoming a children\'s author and teacher, while exploring technology and programming.<br></p>', NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(280, '3939440000080163001', 'Amal Ismail', 'amal-ismail', '<p><b>Amal Ismail</b> is a Palestinian poet and translator with 17 published works in poetry, short stories, narrative, knowledge management, innovation, and topics related to motherhood and children. She won the Tullio Italian Prize for Non-Italian Poetry in 2020. She also won the UAE Pioneers Award in the Year of Reading 2016 for her initiative \'Ras Al Khaimah Reads\'. She is a literary editor, writing coach, and evaluator for literary awards and excellence prizes. She is a member of the UAE Writers and Authors Union, the International Arabic Language Union, and the International Association of Arab Translators and Linguists.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(281, '3939440000089912035', 'Oindrila Majumdar', 'oindrila-majumdar', '<p><b>Oindrila Majumdar</b>, a 9th-grade student at Dubai International Academy, is driven by her passion for astrophysics and exploring the universe’s mysteries. Her journey began with an open letter about the UAE Hope Probe, which led to a meeting with Her Excellency Sarah Al Amiri and inspired her to write <i>Astrophysics for Young Minds</i>. Oindrila collaborates with scientists from Princeton, CNRS, and NASA on video columns to ignite young audiences’ interest in science and astronomy. As a keynote speaker at XPANSE, she will share insights into black holes and the future of astrophysics, marking her as a promising voice in the field.<br></p>', NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(282, '3939440000084560001', 'Karim Siddiqi', 'karim-siddiqi', '<p><b>Karim Siddiqi</b>, a 10-year-old from Dubai, UAE, has a remarkable love for reading, especially mystery stories. Inspired by tales of suspense and intrigue, Karim took on the ambitious goal of writing his own book at just nine years old, resulting in <i>The Mansion of Mysteries</i>. His debut showcases both his fascination with the mystery genre and a storytelling talent that captivates readers. Outside his literary pursuits, Karim is an avid football fan who dedicates much of his time to the game. Whether reading, writing, or on the field, Karim\'s creativity and enthusiasm shine in all he does.<br></p>', NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(283, '3939440000076908001', 'Mamdouh Hamada', 'mamdouh-hamada', '<p><b>Mamdouh Hamada</b> is a graduate of the Faculty of Journalism at Belarusian State University with a PhD, and the Belarusian State Academy of Arts with a diploma in film direction. He is the author of 18 books, including research, novels, short story collections, and plays such as <i>The Art of Caricature: From Cave Walls to Newspaper Columns</i>, the novel <i>The Last Station</i>, a series of short story collections under the title <i>Mamdouh Hamada’s Notebooks</i>, and the play <i>The Retired Executioner</i>. He has written screenplays for over 30 television and film works, including <i>Dai’a Day’a</i>, <i>Al-Kharbah</i>, <i>Spot of Light</i>, <i>City of Information</i>, and <i>My Arab Home </i>for children, among others. He currently resides in the United Arab Emirates.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(284, '3939440000083577010', 'Saleha Ghabish', 'saleha-ghabish', '<p><b>Saleha Ghabish</b> holds a Bachelor of Arts in Islamic Studies and Arabic Language, and a Master\'s preliminary degree from the Faculty of Dar Al-Uloom. She serves as the head of the Cultural Office and as a cultural advisor to the Supreme Council for Family Affairs in Sharjah, as well as the managing editor of the family and social magazine <i>Marami</i>, published by the Council. She has published poetry collections, novels, and children\'s and young adult books, and she also heads a publishing house. In addition, she has written plays and television dramas, which have been showcased in several Arab and international countries, with her works translated into many languages. She has received awards as a poet and for her contributions to the cultural development of the UAE. As a result, she was chosen as one of the top 24 Emirati women by the Federal Competitiveness and Statistics Authority. She is a member of the UAE Writers and Authors Union, the UAE Female Writers Association, and serves as a member of advisory boards at multiple universities.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(285, '3939440000087940001', 'Asmaa Al Remeithi', 'asmaa-al-remeithi', '<p><b>Asmaa Al Remeithi</b>, known as \'Asami ART\', is an Emirati artist specializing in manga drawing and graphic design, with over 13 years of experience. She created the character \'Asami\', which reflects details of her daily life, leading to the launch of a successful product line inspired by the character. She won the ADMAF Award in 2016 for her bilingual illustrated book <i>Turning Point</i>. She has published seven books, including graphic novels, coloring books, and art books. Asma is actively involved in organising workshops and exhibitions locally and internationally, and she serves as the community manager for Emirati art, supporting artists and providing platforms for them to showcase their creations and exchange knowledge.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(286, '3939440000089667001', 'Hamda Alblooshi', 'hamda-alblooshi', '<p><b>Hamda Alblooshi</b>&nbsp;is a writer in the field of children\'s literature, passionate about transferring knowledge and developing essential skills for children. She holds a Bachelor\'s degree in Early Childhood Education and has over 20 years of experience as a kindergarten teacher. She is a certified professional trainer and holds a diploma in Montessori Philosophy in American Education. She adopts an educational approach that inspires children and encourages independence and creativity. She is the founder of the \'Saghariya\' project to promote a love of reading among children. She is also the founder of \'Aalamkum Publishing and Distribution\', a company specializing in selling children\'s books and innovative educational tools. Her vision is to leave a mark on the world of childhood and inspire children and educators by offering innovative educational content that blends play and learning in an interactive way.<br></p>', NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(287, '3939440000010812296', 'Salha Obaid', 'salha-obaid', '<p><b>Salha Obaid</b> is an Emirati writer with a degree in electronic engineering, who published her first short story collection titled <i>Alzheimer </i>in 2010, followed by two more collections: <i>The Happiness Messenger </i>and <i>A White Strand Implicitly</i>, with the latter winning the Al Owais Creativity Award in 2016. She also won the UAE Youth Award for Creative Writing in 2017 for her body of work. In 2018, she published her novel <i>Perhaps a Joke</i>, which reached the longlist for the Sheikh Zayed Book Award in 2021. Salha holds a Creative Writing Certificate from the University of Plattsburgh in the Czech Republic in 2017, and she was part of the International Creative Writing Fellowship at the University of Iowa, USA, in the 2021 cohort. In 2022, she released her second novel, <i>The Spice Circle</i>, which made the longlist for the International Prize for Arabic Fiction in 2023.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(288, '3939440000057659008', 'Graeme Wilson', 'graeme-wilson', '<p><b>Graeme Wilson</b> is renowned for his richly detailed, narrative-driven yet academically rigorous biographies of world leaders. His works include the authorised biographies of Founding Father Sheikh Zayed bin Sultan Al Nahyan, Sheikh Khalifa bin Zayed Al Nahyan, and Sheikh Rashid bin Saeed Al Maktoum, as well as the Heads of State of Azerbaijan, Kazakhstan, Oman, Sri Lanka, and the Maldives. As a film producer, Wilson collaborated extensively with Academy Award winner Morgan Freeman. His speeches have been delivered at the United Nations General Assembly and Britain’s House of Commons. He is a Fellow of the Royal Geographical Society in London.<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(289, '3939440000083705004', 'Laaleen Sukhera', 'laaleen-sukhera', '<p>Laaleen Sukhera works in corporate communications and runs the Jane Austen Society of the Middle East, North Africa, and Pakistan (MENAP). Following her fiction debut <i>Austenistan</i> and contributions to transatlantic academic journals, Laaleen is working on a whimsical novel set in Dubai, her chosen home. She also founded DxbSocialLeague, where she enjoys matchmaking like a modern-day Emma Woodhouse. Laaleen is the mother of three young Bennet girls and is represented by WME in Hollywood.<br></p>', 'Litfest 2025', 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(290, '3939440000010809051', 'Allison K Williams', 'allison-k-williams', '<p><b>Allison K Williams</b> has edited and coached authors to publishing deals with Penguin Random House, Knopf, Mantle, St. Martin’s Press, and numerous small presses. An expert in author marketing and community building, her platform includes the Brevity Blog (80k+ followers), Instagram (10k+), a mailing list (12k+), and Facebook (5k+), with publications in the <i>New York Times</i> and appearances on NPR and CBC. Her book, <i>Seven Drafts: Self-Edit Like a Pro from Blank Page to Book</i>, sold on proposal. She leads the Rebirth Your Book writing retreats and co-hosts <i>The Writers Bridge Platform Chat</i>.<br></p>', 'Litfest 2025', 'Litfest 2025', NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(291, '3939440000080935007', 'Emily Dunlay', 'emily-dunlay', '<p><b>Emily Dunlay</b>, born and raised in Dallas, Texas, studied English literature and creative writing at Princeton University. After training as a specialist librarian for antiquarian books, she now resides in Abu Dhabi, United Arab Emirates.&nbsp;<i>Teddy</i> is her first book.&nbsp;<br></p>', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(292, '3939440000084570007', 'Fatima Ali Alzarooni', 'fatima-ali-alzarooni', NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(293, '3939440000084570002', 'Ali Humaid Alloghani', 'ali-humaid-alloghani', NULL, NULL, NULL, 'Litfest 2025', NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58'),
(294, '3939440000010812166', 'Magic Phil', 'magic-phil', '<b>Magic Phil</b> is a children’s TV and radio presenter, magician and children’s author from the northeast of England. He has been based in the UAE for ten years. \n \nHe is the celebrity columnist for <i>Time Out</i> Kids Magazine, where he shares his funny stories, jokes and riddles, He also has his own daily children’s radio show, <i>The Laughternoon Drive</i>, on popular Children’s station Pearl 102 FM. Magic Phil can be seen touring all over the UAE with his hilarious family shows. In December 2020 he performed six sell-out shows on the QE2. Magic Phil can be seen on children’s TV channel Nickelodeon and has also featured on many other live TV shows. \n \nIn 2019 he published his first book, <i>The Dog that Loves Blue</i>, followed by <i>The Camel that Loves Red</i> in 2020. \n \n<i>Magic Phil’s Story Time</i> show is full of colourful props, magic tricks, special and magical characters, songs and NON-STOP audience interaction!', 'Litfest 2025', NULL, NULL, NULL, NULL, NULL, 'Published to Website', NULL, '2025-02-01 12:38:58', '2025-02-01 12:38:58');
