(1, 'Youth Day Pass 2024', 'Day Pass', 'Full access pass to Youth Day on Thursday 1 February.', 'Dubai Festival City', '<p>Join us on Thursday 1 February and be part of important conversations with thought leaders and students from across the world during a day of specially curated events for curious minds. Covering topics from artificial intelligence and innovation to literature and sustainability, all with an anchoring focus on Arabic culture, these talks promise to develop the flexibility and resilience required to keep pace with – or ahead of – the changes that will be inevitably experienced in an increasingly fluid and unpredictable world. For ages 16+.</p>', 125, '20240104120430.jpg', 2, 100, 0, '2023-12-01 23:49:43', '2024-01-04 08:04:30'),
(2, 'Bil Arabi Pass', 'Arabic Session', 'Multi-day pass for access to selected Arabic sessions.', 'Dubai Festival City', '<p>Featuring speakers from the UAE and across the Arab world, our Arabic-language programme showcases the very best of the region\'s writers and thinkers.&nbsp;</p>', 100, '20241105114936.jpg', 2, 29, 1, '2023-12-02 00:08:51', '2024-11-11 07:26:26'),
(3, 'LitFest After Hours Pass 2024', 'Multi-day pass for access to each evening\'s LitFest After Hours programme.', 'Multi-day pass for access to each evening\'s LitFest After Hours programme.', 'Dubai Festival City', '<p>The Festival doesn’t stop once the sun goes down. Over four magical nights, LitFest After Hours will enliven your senses with a feast of performances, games, activities, and experiences. We invite you to wander through each evening\'s cabinet of curiosities. Who knows what you might find.</p><p><a href=\" https://docs.elfdubai.org/external/b66f056fdbfc7c00a875a0b28c0876278ee3ca39871fc88884537ec2f6be46c0\">Browse the LitFest After Hours programme here</a><br>&nbsp;</p>', 120, '20240104135557.jpg', 2, 50, 0, '2023-12-08 05:56:59', '2024-10-16 03:44:15'),
(4, 'Emirati Pass for Dubai culture 2024', 'Emirati Pass for Dubai culture', 'Emirati Pass for Dubai culture', 'Dubai Festival City', '<p>Emirati Pass for Dubai culture</p>', 0, '20240112213807.jpg', 2, 100, 0, '2024-01-12 17:38:07', '2024-01-12 17:38:07'),
(5, 'Creator pass 2024', 'For all social media content creators', 'For all social media content creators', 'Dubai Festival City', '<p>For all social media content creators</p>', 0, '20240113105011.jpg', 2, 100, 0, '2024-01-13 06:50:11', '2024-01-16 05:31:01'),
(6, 'Litfest After Hours Free pass 2024', 'Litfest After Hours Free pass', 'Litfest After Hours Free pass', 'Dubai Festival City', '<p>Litfest After Hours pass</p>', 0, '20240113111931.jpg', 2, 100, 0, '2024-01-13 07:19:31', '2024-01-13 07:22:39'),
(7, 'Youth Ambassador 2024', 'Youth Ambassador', 'Youth Ambassador', 'Dubai Festival City', '<p>Youth Ambassador</p>', 0, '20240127170846.jpg', 2, 100, 0, '2024-01-27 13:08:46', '2024-01-27 14:34:29'),
(8, 'Influencer pass', 'Influencer Pass', 'Influencer Pass - Conversation/ Discovery Talks/ Family Activities', 'Dubai Festival', '<p>Influencer Pass - Conversation/ Discovery Talks/ Family Activities</p>', 0, '20241209145600.webp', 1, 100, 0, '2024-12-09 10:56:00', '2024-12-09 10:56:00'),
