INSERT INTO `sessions` (`id`, `session_name`, `session_id`, `session_slug`, `session_number`, `session_authors`, `session_moderator`, `session_category`, `session_venue`, `age`, `session_website_status`, `session_status`, `session_language`, `session_translation`, `session_blurb`, `session_year`, `session_location`, `session_room`, `session_short_blurb`, `session_trailer`, `no_normal_tickets`, `normal_ticket_price`, `gold_price`, `no_gold_tickets`, `silver_price`, `no_silver_tickets`, `bronze_price`, `no_bronze_tickets`, `session_start_date`, `session_start_time`, `session_end_date`, `session_end_time`, `featuredsession`, `seo_title`, `seo_description`, `det_code`, `pricetype`, `created_at`, `updated_at`) VALUES
(1, 'The Big Sing', '3939440000085341498', 'the-big-sing', '75', NULL, '', 'Special Events', 'InterContinental', NULL, 'Published to Website', '0', 'Multilanguage', NULL, '<div>The LitFest Big Sing returns for a third year. School choirs from across the UAE converge for an enchanting afternoon of mesmerising vocal performances in both Arabic and English, celebrating the diverse musical talents of the region’s young people and showcasing their crystal-clear choral talents and courageous and compelling performance styles.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Story Dunes', '<p>Don’t miss this enchanting afternoon of mesmerising vocal performances in both Arabic and English, celebrating the diverse musical talents of the region’s young people.<br></p>', NULL, 350, 100, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '17:30:00', '2025-02-02', '19:30:00', 0, NULL, NULL, 'SSPECIALEVENTS100', 'J', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(2, 'The Write Path: Faiza S Khan', '3939440000087012110', 'the-write-path-faiza-s-khan', '414', 'Faiza S Khan', '', 'Workshops', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Looking for expert feedback on your novel idea? Sign up for this 10-minute assessment during which publishing expert <b>Faiza S Khan</b> offers advice on your one-page book synopsis and 50-word back cover blurb. With years of experience, Khan will provide insights into your idea’s potential and helpful guidance into what to think about as you pursue your writing and publishing journey. <br></div><div>Faiza S Khan is interested in all genres of commercial and literary fiction as well as intelligent non-fiction written for a commercial audience.<br></div><div><i>The Festival will contact you by mid-January to confirm your 10-minute timeslot within the advertised period.</i><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Waha', '<p>Looking for expert feedback on your novel idea? Sign up for this 10-minute assessment during which publishing expert <b>Faiza S Khan</b> offers advice on your one-page book synopsis and 50-word back cover blurb.<br></p>', NULL, 5, 240, NULL, NULL, NULL, NULL, NULL, NULL, '2026-01-30', '10:00:00', '2026-01-30', '12:00:00', 0, NULL, NULL, 'SWORKSHOPS240', 'O', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(3, 'Workshop: Worldbuilding in Historical Fiction', '3939440000085077981', 'workshop-worldbuilding-in-historical-fiction', '409', 'Rehan Khan;', '', 'Workshops', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Research is an integral part of developing believable historical fiction, but how much do you need to do? How can you identify the conflicts that will animate the setting? What kinds of questions should you ask yourself as you craft the world of your novel so that your characters and place come alive memorably on the page? In this hands-on workshop, writer <b>Rehan Khan </b>(<i>Tomb of Empires</i>) shares tried and true research methods for crafting historical fiction, no matter what era your story is set in. This workshop is for all writers, from beginners to experienced.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Waha', '<p>In this hands-on workshop, writer <b>Rehan Khan </b>(<i>Tomb of Empires</i>) shares tried and true methods for crafting historical fiction, no matter what era your story is set in.<br></p>', NULL, 18, 400, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '14:30:00', '2025-02-01', '17:00:00', 0, NULL, NULL, 'SWORKSHOPS300', 'P', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(4, 'Teen Workshop: How to Ultrawild', '3939440000085077936', 'teen-workshop-how-to-ultrawild', '404', 'Steve Mushin;', '', 'Workshops', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Have you ever wondered what the cities of the future might look like? Or what crazy inventions might help to make those cities a reality? In this dynamic two-hour creative thinking session, led by artist and industrial designer <b>Steve Mushin </b>(<i>Ultrawild</i>), you will get to learn all about transforming cities into futuristic ecosystems of your own. The workshop kicks off with an inspiring discussion exploring real-world inventions, followed by a rapid-fire design session where you get to come up with your own futuristic creations. Come along and sketch, draw in 3D, and create your own ideas to rewild cities, all while developing your own creative skillset.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Waha', '<p>Join artist <b>Steve Mushin </b>to explore real-world innovations and design your own futuristic ecosystems through creative sketching, 3D drawing, and more in this dynamic workshop for teens.<br></p>', NULL, 20, 150, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '16:30:00', '2025-01-31', '18:00:00', 0, NULL, NULL, 'SWORKSHOPS150', 'N', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(5, 'Skies of Poetry', '3939440000092226438', 'skies-of-poetry', '252', 'Dr. Aysha Alshamsi', 'Alaa Maasarani', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'Arabic', NULL, '<div>A special poetry evening at the festival, blending beauty and inspiration with Dr. <b>Aysha AlShamsi</b>. Her verses take us on a unique journey through the realms of words and emotions. With her sweet, life-filled lines, the poet evokes the essence of self, homeland, and humanity in captivating poetic scenes. <br></div><div>Don’t miss the chance to listen to a unique poetic voice that combines depth and simplicity, illuminating our evenings with the spirit of words.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Majlis', '<p>A special poetry evening at the festival, blending beauty and inspiration with Dr. <b>Aysha AlShamsi</b>. Her verses take us on a unique journey through the realms of words and emotions<br></p>', NULL, 150, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '18:30:00', '2025-02-02', '19:15:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(6, 'The Write Path: Luigi Bonomi', '3939440000085341942', 'the-write-path-luigi-bonomi', '412', 'Luigi Bonomi', '', 'Workshops', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Looking for expert feedback on your novel idea? Sign up for this 10-minute assessment during which literary agent <b>Luigi Bonomi</b> offers advice on your one-page book synopsis and 50-word back cover blurb. With years of experience, Bonomi will provide insights into your idea’s potential and helpful guidance into what to think about as you pursue your writing and publishing journey. <br></div><div>*Luigi Bonomi is interested in all genres of commercial fiction as well as intelligent non-fiction written for a commercial audience.<br></div><div><br></div><div>The Festival will contact you by mid-January to confirm your 10-minute timeslot within the advertised period.<br></div><div><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Rimal', '<p>Looking for expert feedback on your novel idea? Sign up for this 10-minute assessment during which literary agent <b>Luigi Bonomi</b> offers advice on your one-page book synopsis and 50-word back cover blurb.<br></p>', NULL, 10, 240, NULL, NULL, NULL, NULL, NULL, NULL, '2026-01-29', '10:00:00', '2026-01-29', '12:00:00', 0, NULL, NULL, 'SWORKSHOPS240', 'O', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(7, 'The Write Path: Alexandra Levick', '3939440000085341933', 'the-write-path-alexandra-levick', '413', 'Alexandra Levick', '', 'Workshops', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Looking for expert feedback on your novel idea? Sign up for this 10-minute assessment during which literary agent <b>Alexandra Levick</b> offers advice on your one-page book synopsis and 50-word back cover blurb. With years of experience, Levick will provide insights into your idea’s potential and helpful guidance into what to think about as you pursue your writing and publishing journey. <br></div><div><br></div><div>Alexandra Levick is interested in picture books, a wide range of middle grade and YA fiction, and more speculative-leaning or genre-bent literary adult works.<br></div><div><br></div><div><i>The Festival will contact you by mid-January to confirm your 10-minute timeslot within the advertised period.</i><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Rimal', '<p>Looking for expert feedback on your novel idea? Sign up for this 10-minute assessment during which literary agent <b>Alexandra Levick</b> offers advice on your one-page book synopsis and 50-word back cover blurb.<br></p>', NULL, 8, 240, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-29', '13:00:00', '2025-01-29', '15:00:00', 0, NULL, NULL, 'SWORKSHOPS240', 'O', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(8, 'Postmodern Prose', '3939440000085341299', 'postmodern-prose', '53', 'Khalid Albudoor; Asmaa Azaizeh', 'Zainab Al Qaisi', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'Arabic', 'Yes', '<div>This engaging session delves into the world of postmodern poetry with poets <b>Khalid </b><b>Albudoor</b> and <b>Asmaa Azaizeh&nbsp;</b>, guiding us through rich and thought-provoking discussions. We’ll explore how this poetic movement creates innovative works that blend depth with beauty, while examining how poets express their experiences and visions through an ongoing dialogue between the self and the world. <br></div><div>The conversation opens doors to reflecting on the profound meanings of words and their layered dimensions. We’ll also highlight the challenges faced by prose poets as they defy traditional standards, making this session a unique opportunity to celebrate the essence of contemporary Arabic poetry in all its richness.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha I', '<p>Join poets <b>Khalid Albudoor</b>&nbsp;and <b>Asmaa Azaizeh&nbsp;</b>in an inspiring discussion on postmodern poetry, as we explore how this movement blends depth with beauty and dive into the many challenges poets face along the way.<br></p>', NULL, 220, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '14:00:00', '2025-02-02', '15:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(9, 'The New CEO: A Masterclass with Dr Ty Wiggins', '3939440000092978012', 'the-new-ceo-a-masterclass-with-dr-ty-wiggins', '92', 'Dr. Ty Wiggins', 'Chris Bradley', 'Workshops', 'InterContinental', NULL, 'Published to Website', '0', NULL, NULL, '<div>A CEO’s first 12-18 months is the most decisive period during their time at the top. Get it right, and you will set the foundation for the bold moves you’ll ultimately be remembered for. Get it wrong, and you may struggle to recover lost ground. <br></div><div><br></div><div>Join Russel Reynolds Associates leadership advisors<b> Chris Bradley</b> and <b>Dr Ty Wiggins</b>, CEO &amp; Transitions Practice Global Lead, for an exclusive masterclass on how new and soon-to-be CEOs can navigate this high-stakes career moment.<br></div><div><br></div><div>Chris and Ty discuss RRA’s latest book, <i>The New CEO: How to Start Well and Perform Quickly (Minus the Common Mistakes)</i>, which offers the inside track on how world-leading CEOs approach their first 18 months in role.<br></div><div><br></div><div>They will discuss:<br></div><div>1. The risks (and rewards) during CEO transitions<br></div><div>2. The biggest surprises new CEOs face<br></div><div>3. The top priorities of new CEOs—where to act fast and slow down<br></div><div>4. Stories from world-leading CEOs on the transition lessons they learned<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Waha', '<p>A CEO’s first 12-18 months is the most decisive period during their time at the top. Join <b>Dr Ty Wiggins</b>, CEO &amp; Transitions Practice Global Lead of Russell Reynolds Associates for an exclusive masterclass on how CEOs can navigate this high-stakes career moment.<br></p>', NULL, 100, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2026-01-29', '09:30:00', '2026-01-29', '11:00:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(10, 'Manseera: A Poetic Epic', '3939440000092226372', 'manseera-a-poetic-epic', '251', 'Adel Khozam; Fiona Sampson; George Wallace', 'Zainab Al Qaisi', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'Arabic & English', NULL, '<div>Join an exceptional session featuring Emirati poet <b>Adel Khozam</b>, British poet Fiona Sampson, and American poet George Wallace (via Zoom) to discuss Manseera, their latest poetic work that revives the epic genre in a contemporary style. During the session, we will explore the meanings of the poetic texts, the creative journey behind the work, and how poetry can connect cultures and express the human experience in its depth and various dimensions.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Amwaj', '<p>Join an exceptional session featuring Emirati poet <b>Adel Khozam</b>, British poet Fiona Sampson, and American poet George Wallace (via Zoom) to discuss Manseera, their latest poetic work that revives the epic genre in a contemporary style.<br></p>', NULL, 80, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '18:30:00', '2025-02-01', '19:15:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(11, 'Workshop: Demystifying Speculative Fiction', '3939440000085077945', 'workshop-demystifying-speculative-fiction', '405', 'Mateo Askaripour', '', 'Workshops', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>What is speculative fiction? Futuristic dystopias, parallel dimensions, alternate histories? Led by New York Times bestselling author and National Book Foundation ‘5 Under 35’ honouree <b>Mateo Askaripour</b>, this workshop will have you diving into the vast worlds of writing speculative fiction, touching on point of view, structure, worldbuilding, dialogue, and more. Askaripour will walk you through how he crafted his latest novel, <i>This Great Hemisphere</i>, while engaging you in writing exercises and lively discussion with the goal of honing your own work and generating original ideas. Writers of all experience levels are welcome. Let the exploration begin!<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Waha', '<p>New York Times bestselling author <b>Mateo Askaripour</b> (<i>This Great Hemisphere</i>) leads a generative workshop on speculative fiction, touching on point of view, structure, worldbuilding, dialogue, and more.<br></p>', NULL, 18, 400, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '09:30:00', '2025-02-01', '12:00:00', 0, NULL, NULL, 'SWORKSHOPS300', 'P', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(12, 'Start Writing Boot Camp', '3939440000085077900', 'start-writing-boot-camp', '400', 'Harriet Griffey', '', 'Workshops', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Have you always wanted to write but don’t know where, or how, to begin? Equip yourself with the skills and knowledge you need to start your creative journey in an immersive two-day workshop with ex-publisher, author, and writing instructor <b>Harriet Griffey</b>. You will learn how to turn sparks of inspiration into narrative outlines, discover your writing voice, become familiar with elements of structure and plot, and learn how to connect with your story quickly, every time you sit down to write. This workshop is suitable for budding authors looking to develop and maintain a confident writing practice.<br></div><div><br></div><div><i>​</i><i>This workshop takes place on both Wednesday 29 and Thursday 30 January. Participants must be able to attend both days of the workshop. </i><i><br></i></div><div><i><br></i></div><div><i>Ticket price includes a voucher for lunch on both days.</i><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Amwaj', '<p>Ready to start writing but don’t know where, or how, to begin? Then join <b>Harriet Griffey</b> for this two-day writers’ boot camp specially designed for budding authors looking to start their writing journey.&nbsp;<br></p>', NULL, 18, 2000, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-29', '10:00:00', '2025-01-29', '16:00:00', 0, NULL, NULL, 'SWORKSHOPS2000', 'Q', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(13, 'Workshop: Drawing Manga', '3939440000085341854', 'workshop-drawing-manga', '450', 'Asmaa Al Remeithi;', '', 'Workshops', 'InterContinental', NULL, 'Published to Website', '0', 'Arabic', NULL, '<div>Artist&nbsp;<b>Asmaa Al Remeithi</b> takes us on an exciting journey into the world of Japanese comic art, where creativity and technology come together in a unique harmony. <br></div><div>This hands-on session is ideal for artists of all levels and fans of this art. It provides an in-depth look at the basics of manga, from character design and facial expressions, to dynamic movements and visual storytelling.<br></div><div>Asma accompanies participants every step of the way,presenting innovative techniques to create engaging characters and bring their stories to life. Join us to discover the secrets of this wonderful art, and begin your creative journey with Asma and enjoy a unique experience!<br></div><div><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Waha', '<p>Artist <b>Asmaa Al Remeithi</b>&nbsp;takes us on an exciting journey into the world of Japanese comic art, exploring character design and expressions, as well as dynamic movements and visual storytelling.<br></p>', NULL, 20, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '18:30:00', '2025-02-01', '19:30:00', 0, NULL, NULL, 'SWORKSHOPS50', 'M', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(14, 'Workshop: The Art of Editing', '3939440000085077972', 'workshop-the-art-of-editing', '408', 'Faiza S Khan', '', 'Workshops', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Ernest Hemingway observed that \"writing is rewriting\". If your first draft is you collecting material, editing and redrafting is when you will sculpt it into a story. <b>Faiza S Khan</b>&nbsp;workshop uses practical exercises followed by feedback tailored to individual participants, drawing on her experience as an editor and mentor working with critically acclaimed authors and an array of international publishing houses, in order for workshop attendees to learn the tricks of the trade that will allow them to craft better stories by approaching their own work like a professional editor.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Waha', '<p>This workshop with former Bloomsbury India editor<b> </b><b>Faiza S Khan</b>&nbsp; will help you refine drafts into polished stories through practical exercises and expert insights drawn from her decades-long career.<br></p>', NULL, 18, 400, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '09:30:00', '2025-02-02', '12:00:00', 0, NULL, NULL, 'SWORKSHOPS300', 'P', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(15, 'Harshita Gupta: Unloved', '3939440000085341800', 'harshita-gupta-unloved', '77', 'Harshita Gupta;', 'Anamika Chatterjee', 'LitFest After Hours', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>There isn’t anyone who hasn’t been shattered by heartbreak. It’s a devastating, yet universal experience, that leaves us feeling lost and alone. In this session, broadcaster and influencer <b>Harshita Gupta </b>gives practical advice and keen insights from her new manifesto <i>Unloved</i>, in conversation with <b>Anamika Chatterjee</b>. Gupta discusses strategies for reclaiming your power, rebuilding your shattered self, embracing a future filled with promise, and how to love oneself through the process of heartbreak. Expect Gupta to bring her whole self to this event, sharing a book that is not only deeply personal but also inspiring and uplifting.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras III', '<p>Heartbreak is a universal experience. In this session, <b>Harshita Gupta </b>shares insights from her memoir <i>Unloved</i>, discussing how to reclaim your power, rebuild yourself, and embrace self-love.<br></p>', NULL, 220, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '19:30:00', '2025-01-31', '20:30:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(16, 'The Department of Speculation', '3939440000085341372', 'the-department-of-speculation', '61', 'Mateo Askaripour; Surya Ramkumar', 'Fiona Lindsay', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Speculative fiction opens up new perspectives to our possible futures. It can also move us to consider the consequences of what is happening in the world right now. Authors&nbsp;<b>Mateo Askaripour </b>(<i>This Great Hemisphere</i>) and <b>Surya Ramkumar </b>(<i>The Sky Has Moved Away</i>) join <b>Fiona Lindsay </b>to discuss their electrifying new books and how the speculative fiction genre is uniquely placed to tackle issues of race, class, identity, and the perpetual power struggle of politics in endlessly inventive ways. Together, they delve into the pleasures and possibilities of writing into the great unknown.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras I', '<p>Speculative fiction authors&nbsp;<b>Mateo Askaripour</b>​, and <b>Surya Ramkumar</b>&nbsp;discuss how the genre can be used to address the issues of today in endlessly inventive ways.<br></p>', NULL, 150, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '14:00:00', '2025-02-02', '15:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(17, 'Workshop: Build Your Author Platform', '3939440000085077990', 'workshop-build-your-author-platform', '410', 'Allison K Williams;', '', 'Workshops', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>You may have heard that it’s valuable to have a strong author platform — but how do you get one without spending all your writing time on social media? In this workshop, editor <b>Allison K Williams </b>demystifies the why and how of building your author platform: from defining your particular literary or commercial position and determining your target audience, to establishing your voice and identifying which marketing channels are right for your work. You’ll leave with a plan for sustainable platform-building in your daily writing life — to help you connect with your community of readers, get published, and drive book sales.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Waha', '<p>Join editor <b>Allison K Williams </b>for a workshop on building your author platform, covering audience targeting, establishing your voice, and choosing marketing channels to connect with readers and drive sales.<br></p>', NULL, 18, 400, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '15:30:00', '2025-02-02', '18:00:00', 0, NULL, NULL, 'SWORKSHOPS300', 'P', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(18, 'Elle McNicoll: Love, Joy & Big-hearted Stories', '3939440000085341236', 'elle-mcnicoll-love-joy-big-hearted-stories', '46', 'Elle McNicoll', 'Laaleen Sukhera', 'Family Activities', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div><b>Elle McNicoll</b>, celebrated author and advocate for neurodiverse representation, joins <b>Laaleen Sukhera</b> to discuss her groundbreaking work, including her small-town coming-of-age romance <i>Some Like It Cold</i> and the acclaimed <i>Keedie</i>. Known for her joyful narratives and authentic portrayal of autistic characters, McNicoll champions stories that reflect the lived experiences of neurodivergent readers. <br></div><div><br></div><div>Hear McNicoll explore the importance of representation, the joy of crafting diverse narratives, and her journey as a writer creating space for neurodiverse voices in contemporary literature.<br></div><div><br></div><div><i>Recommended for ages 14+</i><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Amwaj', '<p>Join bestselling and award-winning Scottish author <b>Elle McNicoll </b>as she discusses her works, including&nbsp;<i>Some Like it Cold</i>, her joyful, big-hearted coming-of-age romance featuring a neurodivergent protagonist. Age 14+<br></p>', NULL, 80, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '12:00:00', '2025-02-01', '13:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(19, 'Workshop: Creating Believable Characters', '3939440000085077918', 'workshop-creating-believable-characters', '402', 'Clare Mackintosh', '', 'Workshops', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>What makes a character memorable? Learn how to craft three-dimensional characters with <i>New York Times</i> and <i>Sunday Times</i> bestselling crime writer <b>Clare Mackintosh</b>, author of <i>I Let You Go</i>, <i>I See You</i>, and <i>Let Me Lie</i>. In this hands-on workshop, you’ll discover how to create complex and believable heroes and villains, and learn how to bring your cast of characters to life. Explore motivation, conflict, character flaws, and redeeming features, and hear why heroes don’t always have to be likeable and why villains can have shades of grey. This workshop is for all writers, from beginners to the experienced.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Waha', '<p>Learn how to craft three-dimensional, fully realised characters in this hands-on workshop with bestselling writer <b>Clare Mackintosh</b>, perfect for writers at all stages of their career.<br></p>', NULL, 18, 400, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '10:00:00', '2025-01-31', '12:30:00', 0, NULL, NULL, 'SWORKSHOPS300', 'P', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(20, 'Kelly Clancy: Playing with Reality', '3939440000085341827', 'kelly-clancy-playing-with-reality', '81', 'Kelly Clancy', 'Julia Wheeler', 'LitFest After Hours', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>“Games have always been about discovering who we are,” says neuroscientist and physicist <b>Kelly</b> <b>Clancy</b>. In her new book <i>Playing with Reality: How Games Shape Our World</i>, Clancy reveals why games matter and just how powerful they can be in influencing how we navigate the world and our place in it. In conversation with <b>Julia Wheeler</b>, Clancy explores the hidden influence of games throughout human history and illuminates how the gamification of modern life can warp our preferences, manufacture our desires, and push us deeper into polarisation. Join Clancy as she considers the question: are we playing games or are games playing us?<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras I', '<p>Neuroscientist <b>Kelly</b> <b>Clancy</b> discusses the hidden influence that games have had on human history — from playful past time to the waging of wars and the rise of artificial intelligence.<br></p>', NULL, 150, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '18:30:00', '2025-02-01', '19:30:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(21, 'Primal Words', '3939440000085341489', 'primal-words', '74', 'Safiya Sinclair; Khairani Barokka; Danabelle Gutierrez', 'Nathalie Handal', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Indonesian poet <b>Khairani Barokka </b>(<i>amuk</i>) writes radical poems of fury and prayer which gesture towards the unbowed resistance of persisting languages and resilient peoples. Dubai-based poet <b>Danabelle Gutierrez </b>(<i>The F Word</i>) writes of the forsaken, fathers, and forgiveness through the lens of the feminine. Jamaican-American poet <b>Safiya Sinclair </b>(<i>Cannibal</i>) writes full-blooded poems exploring history, race relations, womanhood, otherness, and exile. These three vital contemporary poets come together to discuss the themes which unite their extraordinary bodies of work: history and colonialism, displacement and belonging, the feminine and selfhood. With <b>Nathalie Handal</b>.&nbsp;&nbsp;<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Amwaj', '<p>Three vital contemporary poets —&nbsp;<b>Danabelle Gutierrez</b>, <b>Khairani Barokka</b>, and <b>Safiya Sinclair </b>— converge for a wide-ranging conversation about the indelible power of poetry.<br></p>', NULL, 80, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '16:00:00', '2025-02-02', '17:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(22, 'Workshop: Finding Your (Writer\'s) Voice', '3939440000085077963', 'workshop-finding-your-writers-voice', '407', 'Harriet Griffey', '', 'Workshops', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>No matter where you are on your writing journey, you’ve probably wondered: how do I find my voice? The good news is, you already have a voice – and this comprehensive workshop will teach you how to nurture and develop it. Join ex-publisher, author, and journalist <b>Harriet Griffey</b> as she demystifies this essential aspect of a writer’s toolkit, guiding you through discussions, textual analysis, and writing exercises that will help you to identify, understand, and hone your writer’s voice. This workshop is suitable for writers at any stage of their project or career.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Waha', '<p>In this workshop, former publisher, author, and journalist <b>Harriet Griffey</b> will teach you how to identify, understand, and hone your writer’s voice — an essential aspect of a writer’s toolkit.<br></p>', NULL, 18, 400, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '12:30:00', '2025-02-02', '15:00:00', 0, NULL, NULL, 'SWORKSHOPS300', 'P', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(23, 'Teen Workshop: Creating Strange New Worlds', '3939440000085077954', 'teen-workshop-creating-strange-new-worlds', '406', 'Vashti Hardy', '', 'Workshops', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Join bestselling author <b>Vashti Hardy </b>(<i>North and the Only One</i>) for a fun and interactive creative writing workshop where anything is possible. Let your imagination run wild as you uncover the possibilities of worldbuilding, explore the relationship between alternative worlds and your lived experience, and play with the rules of the speculative fiction genre in an accessible and supportive environment. This workshop will help you generate new ideas or expand on concepts and story ideas you’ve already come up with. No experience necessary, just bring an open mind and a healthy dose of imagination.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Waha', '<p>In this creative writing workshop for teens, bestselling author <b>Vashti Hardy </b>(<i>North and the Only One</i>) will lift the curtain on the possibilities of worldbuilding and speculative fiction.<br></p>', NULL, 20, 150, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '12:30:00', '2025-02-01', '14:00:00', 0, NULL, NULL, 'SWORKSHOPS150', 'N', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(24, 'Emma Dabiri: Disobedient Bodies', '3939440000085341899', 'emma-dabiri-disobedient-bodies', '89', 'Emma Dabiri;', 'Chloe Pierre', 'LitFest After Hours', 'InterContinental', NULL, 'Published to Website', '0', 'English', 'Yes', '<div>From Instagram face to looksmaxxing, the pressure to look a certain way can feel like a hall of mirrors that’s impossible to escape from. But what would happen if we decided to just opt out of conventional beauty standards? Join author, broadcaster, and cultural critic <b>Emma Dabiri</b> for a radical, empowering, and deeply personal perspective on how we can learn to love our magnificent, unruly, disobedient bodies. This session is for anyone who longs to break free from the endless cycle of competition and consumerism and discover what it means to reclaim beauty on your own terms. With <b>Chloe Pierre</b>.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras II', '<p>Join author, broadcaster, and cultural critic <b>Emma Dabiri</b> for a radical, empowering, and deeply personal perspective on body image and discover what it means to reclaim beauty on your own terms.<br></p>', NULL, 150, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '19:30:00', '2025-02-01', '20:30:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(25, 'MJ Arlidge: The Art of Suspense', '3939440000085341435', 'mj-arlidge-the-art-of-suspense', '68', 'MJ Arlidge', 'Annabel Kantaria', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div><b>MJ Arlidge </b>spent over two decades as a screenwriter and TV producer, before turning his hand to crime fiction. His first novel, <i>Eeny Meeny</i>, was the UK’s bestselling crime debut of 2014 and introduced readers to protagonist Detective Inspector Helen Grace. Today, Arlidge’s crime novels are known around the world. Not one to shy away from frank discussions, Arlidge sits down to discuss his influences, inspirations, and impressive body of work across page and screen. Don’t miss the opportunity to gain fascinating insights into what goes into writing his macabre masterpieces. With <b>Annabel Kantaria</b>.&nbsp;<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras III', '<p>Join bestselling crime author <b>MJ Arlidge </b>as he discusses his journey from screenwriter to novelist, his inspirations, and the creation of his dark, gripping thrillers beloved by readers worldwide.<br></p>', NULL, 150, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '12:00:00', '2025-02-02', '13:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(26, 'Tricia Hersey: We Will Rest!', '3939440000085250115', 'tricia-hersey-we-will-rest', '7', 'Tricia Hersey', 'Maryam Bartawi', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Stressed, burned out, overworked, and always online: grind culture is here and it’s terrible. In this session, author and founder of The Nap Ministry <b>Tricia Hersey</b> (<i>We Will Rest!</i>) makes a case for the power of rest as a form of resistance — a way to escape the hustle, reject dehumanising systems, and flip the script on constant productivity. Hosted by <b>Maryam Bartawi</b>, this evening of radical relaxation invites you to reclaim rest on your own terms, as Hersey guides you through a meditative and uplifting nap experience. Join her to share in the joy of communal rest and reconnect with what it means to simply do… nothing.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Waha', '<p>Grind culture is here and it’s terrible. Convene with <b>Tricia</b> <b>Hersey</b>, founder of The Nap Ministry, to share in the joy of communal rest and reconnect with what it means to simply do… nothing.<br></p>', NULL, 150, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '18:30:00', '2025-01-31', '20:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(27, 'Amal Ismail on Writing Through Trauma', '3939440000085077891', 'amal-ismail-on-writing-through-trauma', '306', 'Amal Ismail', '', 'Discovery Talks', 'InterContinental', NULL, 'Published to Website', '0', 'Arabic', NULL, '<div><b>Amal Ismail</b> talks on the “Ideas Forum” program about her experience, which she wrote about in her soon-to-be-released book, “The Body Burning Experience\". She is a Palestinian poet and translator residing in the United Arab Emirates <br></div><div>The story revolves around an incident in which a pressure cooker exploded while she was cooking for her husband and three daughters in 2022. This incident causes her second and third degree burns to her upper body. After a medical error, she underwent a harsh experience that lasted a year of intensive treatment. Today, Amal shares this experience with us in a sarcastic narrative framework, as expected from her – she is a storyteller of the highest order.<br></div><div><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Khor Pavilion', '<p>Writer <b>Amal Ismai</b><b>l </b>tells us about her latest book,which represents a sensitive personal experience about an incident she was exposed to, in which a pressure cooker exploded while she was cooking, resulting in her suffering severe burns. <br></p><p><br></p>', NULL, 150, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '17:00:00', '2025-02-02', '17:45:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(28, 'Rehan Khan: The Rise and Fall of Empires', '3939440000085341471', 'rehan-khan-the-rise-and-fall-of-empires', '72', 'Rehan Khan;', 'Chris Bradley', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div><i>Tomb of Empires </i>is a swashbuckling historical fiction novel set in 90 BCE, in an ancient world shaped by ruthless ambition, violence, and the capricious whims of fate. This epic tale intertwines the stories of Zaim, a prince of the Nabataean Arabs who governs the spice routes from Aden to Gaza, Apollonia, the daughter of a powerful emperor, and Chao, a matchless general of the Han Chinese army on a perilous mission to chart the route west to the Middle Sea. Local author <b>Rehan Khan </b>discusses this ambitious story of heroic deeds and ferocious battles with <b>Chris Bradley</b>.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Amwaj', '<p>Acclaimed writer <b>Rehan Khan </b>discusses <i>Tomb of Empires</i>, his historical fiction epic set in an ancient world shaped by clashing cultures, ruthless ambition, and the capricious whims of fate.<br></p>', NULL, 80, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '12:00:00', '2025-02-02', '13:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(29, 'The Blue Dot: Environments and Ecosystems', '3939440000085341426', 'the-blue-dot-environments-and-ecosystems', '67', 'Dr. Helen Czerski; Joe Roman', 'Amandeep Bhangu', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Understanding how environmental systems shape our physical world can illuminate our place in it — and help us avoid environmental disaster. In this mind-expanding session, physicist <b>Helen Czerski</b> (<i>Blue Machine: How Oceans Shape the World</i>) and biologist <b>Joe Roman</b> (<i>Eat, Poop, Die: How Animals Make the World</i>) take a deep dive into the engines that drive the natural world, from the awe-inspiring power of the ocean to the complex dynamics of animal life. Offering profound insights into the story of life on earth, this session reveals how these extraordinary systems shape our planet — and our lives.&nbsp;<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras III', '<p>Physicist <b>Helen Czerski </b>(<i>Blue Machine</i>) and biologist <b>Joe Roman</b> (<i>Eat, Poop, Die</i>) take a deep dive into the engines that drive the natural world.<br></p>', NULL, 150, 75, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '10:00:00', '2025-02-02', '11:00:00', 0, NULL, NULL, 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(30, 'Chigozie Obioma: The Road to the Country', '3939440000084859002', 'chigozie-obioma-the-road-to-the-country', '42', 'Chigozie Obioma;', 'Faiza S Khan', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div><b>Chigozie Obioma</b> is the two-time Booker Prize-shortlisted author of critically acclaimed novels <i>The Fisherman </i>and <i>An Orchestra of Minorities</i>. In his third book, <i>The Road to the Country</i>, he brings to visceral life the story of a young man in search of his brother against the backdrop of the 1960s Nigerian civil war. Obioma joins <b>Faiza S Khan</b><b>&nbsp;</b>for a conversation about his latest masterpiece described as “a sweeping, heart-racing, mystical novel” (<i>New York Times</i>) and “a powerful testimony to the importance of stories: the stories that came before us, the stories we create for our own selves, and the stories left behind” (<i>Chicago Review of Books</i>).<br></div><div><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras III', '<p>Two-time Booker Prize-shortlisted novelist <b>Chigozie Obioma</b> discusses his latest masterpiece, <i>The Road to the Country</i> — a visceral story of a man in search of his brother during the 1960s Nigerian civil war.<br></p>', NULL, 150, 75, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '12:00:00', '2025-02-01', '13:00:00', 0, NULL, NULL, 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(31, 'Juli Min: Shanghailanders', '3939440000085341381', 'juli-min-shanghailanders', '62', 'Juli Min', 'Julia Wheeler', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Debut Korean-American author <b>Juli Min</b> sits down with <b>Julia Wheeler</b>&nbsp;to discuss her kaleidoscopic novel <i>Shanghailanders</i>. Centered on the changing fortunes of a cosmopolitan Shanghai family against a backdrop of global upheaval, Min tells her story backward through time: beginning in 2040 and moving through our present and into the recent past. Both a sharp chronicle of contemporary China and a dazzling portrait of a family making and remaking itself across the years, <i>Shanghailanders</i> is a poignant story of love, secrets, home, and belonging from a vital new voice in literature.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras I', '<p>Hear from <b>Juli Min</b> about her kaleidoscopic debut novel, <i>Shanghailanders</i> — both a sharp chronicle of contemporary China and a dazzling portrait of a family making and remaking itself across the years.<br></p>', NULL, 150, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '16:00:00', '2025-02-02', '17:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(32, 'Daniel Handler: And Then? And Then? What Else?', '3939440000085341335', 'daniel-handler-and-then-and-then-what-else', '57', 'Daniel Handler aka Lemony Snicket;', 'Mustafa Alrawi', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Join bestselling author <b>Daniel Handler AKA Lemony Snicket</b>, as he recounts the twists and turns of his writing career live on stage and discusses his new memoir <i>And Then? And Then? What Else?</i>. A love letter to the consoling and terrifying power of books, Handler’s latest work traces his life through morbid poetry collections, eccentric acting troupes, hazy midnight taxi rides, second-hand bookstores, and psychiatric units, offering an idiosyncratic, poignant exploration of reading, writing, and why we tell stories. With all the dry wit and brilliance you would expect, don’t miss the opportunity to spend an absurdly entertaining evening with one of the most beloved figures in literature today. With <b>Mustafa Alrawi</b>.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha III', '<p>In an Emirates LitFest highlight, <b>Daniel Handler AKA Lemony Snicket</b> makes an exclusive appearance to discuss <i>And Then? And Then? What Else? </i>— his absurdly entertaining and heartfelt memoir.<br></p>', NULL, 200, 75, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '15:00:00', '2025-02-02', '16:00:00', 0, NULL, NULL, 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(33, 'Writers\' Corner: Screenwriting 101', '3939440000085250179', 'writers-corner-screenwriting-101', '14', 'MJ Arlidge;', '', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>What’s the difference between writing a novel and writing a screenplay? How is writing for an established television series different from creating an original pilot? What are the elements that make a good script stand out from the rest? And what should you know about kickstarting your screenwriting career in what is currently a challenging TV environment? Screenwriting professional <b>MJ Arlidge</b> demystifies the industry and provides practical tips and guidance for anyone with an interest in writing for the screen&nbsp;— join him for an illuminating presentation followed by an extended audience Q&amp;A.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Amwaj', '<p>Screenwriting pro <b>MJ Arlidge</b> explores novel vs screenplay writing, creating original pilots, and standing out in today’s TV landscape. Join for insights and practical tips, plus an extended audience Q&amp;A.<br></p>', NULL, 80, 75, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '17:00:00', '2025-01-31', '18:00:00', 0, NULL, NULL, 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(34, 'A Star Sparkle', '3939440000094213065', 'a-star-sparkle', '288', 'Shaikha Alzeyara', '', 'Family Activities', 'InterContinental', NULL, 'Published to Website', '0', 'Arabic', NULL, '<div>Join author <b>Shaikha Alzeyara</b> for a captivating reading session of her enchanting story, \"A Star Sparkle\". In this session, children and their families will embark on a magical journey with a child who discovers a world where technology and gadgets make life easier. However, this false comfort can cause him to forget the value of hard work and effort. <br></div><div>The story explores important themes about the significance of human relationships, the blessings of our senses, and how technology can distract us from appreciating what truly matters in life. The session will also offer fun activities and games, allowing children to engage with the story while learning valuable lessons about cooperation and the importance of relationships.<br></div><div>Don\'t miss this chance to enjoy an educational and fun experience with the whole family.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Waha', '<p><span class=\"font\" style=\"font-family: DejaVuSans, sans-serif;\">Join author&nbsp;<b>Shaikha Alzeyara</b> for a captivating reading session of her enchanting story, </span><i><span class=\"font\" style=\"font-family: DejaVuSans, sans-serif;\">\"A Star Sparkle\"</span></i><span class=\"font\" style=\"font-family: DejaVuSans, sans-serif;\">. In this session, children and their families will embark on a magical journey with a child who discovers a world where technology and gadgets make life easier. However, this false comfort can cause him to forget the value of hard work and effort.</span><br></p><p><br></p>', NULL, 35, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '15:00:00', '2025-01-31', '15:45:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(35, 'Hanno Sauer: The Invention of Good and Evil', '3939440000085341890', 'hanno-sauer-the-invention-of-good-and-evil', '88', 'Hanno Sauer', 'Rehan Khan', 'LitFest After Hours', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Where do our values come from? What is the origin of right and wrong, good and bad? And how is morality evolving in the modern world? Join philosopher <b>Hanno Sauer</b> for an incisive look at some of the most significant and transformative moral changes that have shaped human history. Witty and engaging, Sauer brings to light the foundational values that shape our societies and shows how humanity invents and reinvents concepts of good and evil over time — moving philosophy out of the abstract and into the stuff that shapes our cities, laws, and lives. With <b>Rehan Khan</b>.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Amwaj', '<p>How has the concept of morality evolved over time? Join philosopher <b>Hanno Sauer</b> for an incisive look at the historical moments that have transformed our modern understanding of ‘good’ and ‘evil’.<br></p>', NULL, 220, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '19:30:00', '2025-02-01', '20:30:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29');
