(36, 'Writers\' Corner: How to Get a Literary Agent', '3939440000085341480', 'writers-corner-how-to-get-a-literary-agent', '73', 'Luigi Bonomi', '', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>So you’ve written a manuscript. Now what? In this information-filled session, literary agent <b>Luigi Bonomi </b>addresses some of the most commonly asked questions from authors looking to be represented, like: how do you approach an agent? What makes a manuscript grab an agent’s attention among so many others? What can a good agent do that you can’t? You’ll work on your covering letter, learn how to craft a compelling synopsis, and discover exactly what needs to be in your submission package. There’ll be plenty of time for tailored exercises, plus an opportunity to ask Bonomi your most burning questions.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Amwaj', '<p>Join literary agent <b>Luigi Bonomi </b>for an informative session on securing representation, including tips on approaching agents, crafting compelling submissions, and refining your cover letter and synopsis.<br></p>', NULL, 80, 75, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '14:00:00', '2025-02-02', '15:00:00', 0, NULL, NULL, 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(37, 'Witness: How a Nation Creates Its Own Future', '3939440000093978552', 'witness-how-a-nation-creates-its-own-future', '98', 'Najeeb Al Ali', 'Amandeep Bhangu', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', NULL, NULL, '<div>Join us for a special event celebrating the publication of <i>Witness: How a Nation Creates Its Own Future</i> that chronicles the United Arab Emirates’ extraordinary journey. <br></div><div><br></div><div>Explore the visionary leadership of Sheikh Zayed, the Founding Father, whose enduring value have shaped the nation’s past, present, and future. Discover the UAE’s transformation through the lens of Expo 2020 Dubai, how this landmark event bridges history with the future, reflecting the nation\'s innovation and global impact, under the stewardship of His Excellency Sheikh Nahayan Mubarak Al Nahyan.<br></div><div><br></div><div>Join the conversation as the panelists discuss the UAE’s legacy of education, culture, and tolerance, and its remarkable story of progress over the last fifty years.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha II', '<p>Join us to celebrate the publication of&nbsp;<i>Witness: How a Nation Creates Its Own Future</i>, exploring the UAE’s journey of vision and innovation, it\'s rich heritage and dynamic future.<br></p>', NULL, 200, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '17:00:00', '2025-02-01', '17:45:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(38, 'A Thousand and One Nights of Stories', '3939440000087321155', 'a-thousand-and-one-nights-of-stories', '198', 'Waciny Laredj', 'Fatima Al Hammadi', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'Arabic', 'Yes', '<div>&nbsp;Professor <b>Waciny Laredj</b>&nbsp;shares with us his unique journey in the world of novels and literature. We will listen to his stories about his career as a novelist. How his works were influenced by a mixture of Arab heritage and literary modernity. <br></div><div>Through this session, <b>Waciny Laredj</b>&nbsp;reveals the backstage of his creativity, and the development of his narrative style that blends ancient tales with contemporary visions that reflect human reality and challenges.<br></div><div>This will be an opportunity to discover the worlds that the writer built in his novels. How he was able to weave stories that take readers on a deep journey into worlds full of imagination and contemplation.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha I', '<p>Professor <b>Waciny Laredj​</b> shares with us his unique journey in the world of novels and literature. We will hear his stories about his career as a novelist. How his works were influenced by a mixture of Arab heritage and literary modernity.<br></p>', NULL, 200, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '18:30:00', '2025-02-02', '19:30:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(39, 'From Pain to Purpose', '3939440000085341363', 'from-pain-to-purpose', '60', 'Clare Mackintosh; Dr. Jessamy Hibberd', 'Amandeep Bhangu', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Life is filled with harrowing experiences — that much is certain. <b>Clare Mackintosh</b> (<i>I Promise It Won’t Always Hurt Like This</i>) and<b> Jessamy Hibberd</b> (<i>How to Overcome Trauma and Find Yourself Again</i>) talk to <b>Amandeep Bhangu&nbsp;</b>about working through, and living beyond, times of severe hardship. Drawing on psychology, neuroscience, and their own experiences of grief and healing, these two panellists offer compassionate, wise, and honest advice on getting through our darkest times — and how trauma can be a catalyst for a valuable reassessment of life and a newfound discovery of meaning<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras I', '<p><b>Clare Mackintosh</b>, and <b>Jessamy Hibberd</b> draw on expert analysis and their own experiences of trauma and hardship to offer compassionate, wise, and honest advice on getting through our darkest times.<br></p>', NULL, 150, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '12:00:00', '2025-02-02', '13:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(40, 'Urban Reality: Stories from the City', '3939440000085341146', 'urban-reality-stories-from-the-city', '35', 'Dr. Rana Almutawa; Steve Mushin; Des Fitzgerald', 'Gaith Abdulla', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>What should the city of the future look like? And what can we do to make our most ambitious urban design dreams into reality? In what promises to be a lively and thought-provoking conversation, panellists <b>Des Fitzgerald</b> (<i>The City of Today is a Dying Thing</i>), <b>Rana AlMutawa</b> (<i>Everyday Life in the Spectacular City</i>), and <b>Steve Mushin</b> (<i>Ultrawild</i>) tackle questions of home and belonging, adaptation and resilience, seen through an urban lens. These visionary thinkers consider the past, present, and future of urban life, offering three very different perspectives on what it means to dwell in a city. With <b>Gaith Abdulla</b>.&nbsp;<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras I', '<p><b>Des Fitzgerald</b> (<i>The City of Today is a Dying Thing</i>), <b>Rana</b> <b>AlMutawa</b> (<i>Everyday Life in the Spectacular City</i>), and <b>Steve Mushin</b> (<i>Ultrawild</i>) come together to consider the past, present, and future of urban life.<br></p>', NULL, 150, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '14:00:00', '2025-02-01', '15:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(41, 'The Authority of Artificial Intelligence', '3939440000085341453', 'the-authority-of-artificial-intelligence', '70', 'Kelly Clancy; Anil Ananthaswamy', 'Amandeep Bhangu', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>We\'re living through a revolution: increasingly, AI is involved in the making of life-altering decisions, whether that’s approving bank loans or determining if a tumour is cancerous. But can we trust the authority of machines, like we do financial managers or doctors? Science journalist <b>Anil Ananthaswamy</b> (<i>Why Machines Learn</i>) and neuroscientist <b>Kelly Clancy</b> (<i>Playing with Reality</i>) sit down with <b>Amandeep Bhangu</b>&nbsp;to discuss the practical and ethical ramifications of machine-learning and the existential questions that may arise from the answers that AI provides. Expect a lively, provocative debate on a subject with far-reaching implications for all our futures.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras III', '<p>Can we trust artificial intelligence? <b>Anil Ananthaswamy</b> (<i>Why Machines Learn</i>) and&nbsp;<b>Kelly Clancy</b> (<i>Playing with Reality</i>) discuss the ramifications of putting our faith in machine-learning.&nbsp;<br></p>', NULL, 150, 75, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '16:00:00', '2025-02-02', '17:00:00', 0, NULL, NULL, 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(42, 'Najwa Zebian: The Only Constant', '3939440000085341218', 'najwa-zebian-the-only-constant', '44', 'Najwa Zebian', 'Anamika Chatterjee', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', 'Yes', '<div>How do we best deal with changes, both big and small, in our lives? In <i>The Only Constant</i>, author and educator <b>Najwa Zebian</b> guides readers through the changes we must make (or those we need to endure) on the journey to our most authentic lives. A rallying call to accept ourselves for who we really are, <i>The Only Constant</i> weaves together personal narrative and practical advice to help us find our way through the messiness of life. Join Zebian and <b>Anamika Chatterjee</b>&nbsp;as they discuss finding beauty in uncertainty and how embracing change can set us on the path to creating the life we truly desire.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras II', '<p>Renowned author and educator <b>Najwa Zebian</b> takes to the stage to offer sage advice on how to navigate the changes we must make (or those we need to endure) on the journey to our most authentic selves.<br></p>', NULL, 150, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '11:00:00', '2025-02-02', '12:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(43, 'Safiya Sinclair: A Jamaican Memoir', '3939440000085341191', 'safiya-sinclair-a-jamaican-memoir', '40', 'Safiya Sinclair', 'Hafsa Lodi', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', 'Yes', '<div>Join author <b>Safiya Sinclair</b> in conversation with <b>Hafsa Lodi</b> to celebrate the publication of her new book, <i>How To Say Babylon: A Jamaican Memoir</i>. Shortlisted for the 2024 Women’s Prize for Non-Fiction, this dazzling work explores Sinclair’s childhood in an insular and strictly patriarchal Rastafarian family, where she was expected to be obedient, silent, subservient to men, and content to live in almost complete isolation from the outside world. Exploring freedom, identity, and the transformative power of literature and poetry, this astonishing memoir brilliantly recounts Sinclair’s struggle to break free of her rigid upbringing and navigate the world on her own terms.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras II', '<p>Women’s Prize for Non-Fiction-shortlisted author <b>Safiya Sinclair</b> takes to the stage to discuss <i>How to Say Babylon</i>, her dazzling memoir exploring freedom, identity, and the transformative power of literature.<br></p>', NULL, 150, 75, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '17:00:00', '2025-02-01', '18:00:00', 0, NULL, NULL, 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(44, 'Emily Dunlay: A Scandal in Rome', '3939440000085341182', 'emily-dunlay-a-scandal-in-rome', '39', 'Emily Dunlay', 'Annabel Kantaria', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', 'Yes', '<div>Italy, 1969: When Teddy Huntley Carlyle arrives in Rome from Dallas, Texas, with her diplomat husband, she is eager for her life to begin. She will be her most beautiful, luminous self, wear the right clothes, and charm her husband’s colleagues. But when an embassy party goes horribly wrong, Teddy’s carefully constructed world comes crashing down and sets a twisty plot filled with suspense, glamour, and intrigue in motion. Join novelist <b>Emily Dunlay</b> as she speaks to <b>Annabel Kantaria</b> about bringing mid-century Italy to life in <i>Teddy</i>, her electrifying debut.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras II', '<p>Debut novelist <b>Emily Dunlay</b> lifts the curtain on the story of <i>Teddy</i> — an electrifying novel filled with intrigue set in mid-century Italy and described as <i>Lessons in Chemistry</i> meets <i>Mad Men</i>.<br></p>', NULL, 150, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '15:00:00', '2025-02-01', '16:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(45, 'Clare Mackintosh: It Won\'t Always Hurt Like This', '3939440000085341155', 'clare-mackintosh-it-wont-always-hurt-like-this', '36', 'Clare Mackintosh', 'Natasha Hatherall-Shawe', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>When bestselling writer <b>Clare Mackintosh</b> lost her five-week-old son, she searched for help in books. All of them wanted to tell her what she should be feeling and when she should be feeling it, but as she soon found out, there are no neat, labelled stages for grief or easy ways to relieve us of our pain. Here, Mackintosh sits down with <b>Natasha Hatherall-Shawe</b>&nbsp;to discuss the book she wrote in response to her own grief: a deeply personal meditation on learning to abide by life’s darkest moments and finding the way back to self-understanding, healing, and hope.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras I', '<p>Bestselling writer <b>Clare Mackintosh</b> speaks about the devastating experience of losing her five-week-old son, and the healing and hope she discovered through writing about her grief.<br></p>', NULL, 150, 75, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '16:00:00', '2025-02-01', '17:00:00', 0, NULL, NULL, 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:29', '2025-02-02 09:54:29'),
(46, 'Anthony Sattin: The Wanderers Who Shaped Our World', '3939440000085250143', 'anthony-sattin-the-wanderers-who-shaped-our-world', '10', 'Anthony Sattin;', 'Fiona Lindsay', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Take a tour through the history of movement and migration with journalist and author <b>Anthony</b> <b>Sattin</b>. In this wide-ranging discussion, Sattin discusses his acclaimed book, <i>Nomads: The Wanderers Who Shaped Our World</i>, and offers a spirited defence of how nomads have fostered and refreshed civilisation throughout history. Tracing the epic paths of wanderers through multiple continents and across more than 12,000 years, Sattin’s sweeping narrative reconnects us with a deeply human need for exploration and discovery. This session will delight any thoughtful traveller, armchair or otherwise. With <b>Fiona Lindsay</b>.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras III', '<p>Join <b>Anthony</b> <b>Sattin</b> for a tour of movement and migration as chronicled in <i>Nomads</i>, his acclaimed new book offering a spirited defence of how wanderers have fostered and refreshed civilisation throughout history.<br></p>', NULL, 150, 75, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '15:00:00', '2025-01-31', '16:00:00', 0, NULL, NULL, 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(47, 'Kohl Ithmid', '3939440000093457061', 'kohl-ithmid', '280', 'Fatima Almazrouei', 'Hazem Ibrahim', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', NULL, NULL, '<div>Join an exceptional session about the book Kohl Ithmid by Dr. <b>Fatima Al Mazrouei</b>, which presents a collection of traditional historical stories narrated in a style inspired by the tales of grandmothers and figures who lived in the UAE during the 1950s, 60s, and 70s. The book reflects significant events in the country’s history and highlights prominent Emirati figures, especially women, through stories that touch on human emotions, customs, traditions, and professions that shaped life during that era. <br></div><div>Kohl Ithmid connects the past with the present through stories filled with love and nostalgia, exploring how characters interacted with the land and society while reviving traditions that were part of everyday life in the UAE.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Majlis', '<p>Join a session about Kohl Ithmid by Dr. <b>Fatima Al Mazrouei</b>, a collection of historical stories reflecting life in the UAE during the 1950s and 60s, highlighting notable women and traditions.<br></p>', NULL, 75, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '17:00:00', '2025-02-01', '17:45:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(48, 'The Snowman Without a Nose', '3939440000085341619', 'the-snowman-without-a-nose', '208', 'Magic Phil', '', 'Family Activities', 'InterContinental', '4+', 'Published to Website', '0', 'English', NULL, '<div>Join the hilarious <b>Magic Phil </b>in his new heartwarming and magical show based on his new book, <i>The Snowman Without a Nose</i>! Perfect for little ones, this enchanting tale follows a lovable snowman who’s missing his nose, and it’s up to Magic Phil (and you!) to help him find it! With comedy, magic tricks, and lots of interactive fun, this show will leave children smiling from ear to ear. A delightful blend of winter magic and festive cheer, it\'s the perfect event for the whole family. Don’t miss out on this snowy adventure full of giggles and surprises!<br></div><div><br></div><div><i>Recommended for ages 4+ </i><i><br></i></div><div><i><br></i></div><div><i>Children under the age of 12 must be accompanied by a ticket-holding adult.</i><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Khor Pavilion', '<p>Join <b>Magic Phil </b>to help a snowman find his nose in this fun, magical adventure packed with comedy and surprises. Perfect for the whole family, it\'s a seasonal show full of laughs and wonder. For ages 4+<br></p>', NULL, 100, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '09:30:00', '2025-02-01', '10:15:00', 0, NULL, NULL, 'SFAMILYACTIVITIES50', 'E', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(49, 'From Plant to Plate', '3939440000085341592', 'from-plant-to-plate', '204', 'Darryl Gadzekpo; Ella Phillips', '', 'Family Activities', 'InterContinental', '8+', 'Published to Website', '0', 'English', NULL, '<div>Get ready to dig into fun with <b>Darryl Gadzekpo </b>and <b>Ella Phillips</b>, champions of sustainability and authors of <i>From Plant to Plate</i>, a vibrant children’s cookbook that shows you how to grow your own ingredients (no garden necessary!) and transform them into tasty meals. Gadzekpo and Phillips will provide tips on planting seeds, choosing the right soil, and nurturing your plants until they’re ready for harvest. They will also share their infectious passion for taking care of the planet — and yourself — through cooking and eating delicious, healthy, and homegrown produce.<br></div><div><br></div><div><i>Recommended for ages 8+ </i><i><br></i></div><div><i><br></i></div><div><i>Children under the age of 12 must be accompanied by a ticket-holding adult.</i><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha II', '<p>Join <b>Darryl Gadzekpo </b>and <b>Ella Phillips </b>as they share how to grow ingredients without a garden and turn them into tasty meals. Get green-fingered as you begin your own produce planting journey! For ages 8+<br></p>', NULL, 220, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '11:00:00', '2025-02-01', '11:45:00', 0, NULL, NULL, 'SFAMILYACTIVITIES50', 'E', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(50, 'The Treasure of Shabhana', '3939440000085341764', 'the-treasure-of-shabhana', '225', 'Noura Al Khoori', '', 'Family Activities', 'InterContinental', '8+', 'Published to Website', '0', 'Arabic', NULL, '<div>Join writer <b>Noura Al Khoori</b> for an exciting interactive session! Dive into a world of adventure as she reads from <i>The Treasure of Al-Shabhana</i>, a story blending imagination and creativity. This immersive experience includes games and challenges designed to uncover hidden treasures and spark creative thinking. You’ll also discover fascinating facts about the Ghaf tree, the UAE’s national tree, learning about its environmental significance and role in sustainability. This unique session combines reading and learning, promoting teamwork and strategic thinking through interactive play. Don’t miss out on this enriching experience filled with fun and knowledge! <br></div><div><br></div><div><i>Recommended for ages 8+</i><i><br></i></div><div><i><br></i></div><div><i>Children under the age of 12 must be accompanied by a ticket-holding adult.</i><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Majlis', '<p>Join <b>Noura Al Khoori</b> for a world of adventures, imagination, creativity, and games, all inspired by new book&nbsp;<i>The Treasure of Al-Shabhana</i>. For ages 8+<br></p>', NULL, 75, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '15:30:00', '2025-02-02', '16:15:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(51, 'The Debutants', '3939440000085250106', 'the-debutants', '6', 'Juli Min; Emily Dunlay; Sara Hamdan', 'Veronica Sullivan', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', 'Yes', '<div>In <i>Teddy</i>, <b>Emily Dunlay </b>conjures up the world of 1960s Italy and a tale of glamour, politics, and intrigue. In <i>Shanghailanders</i>, <b>Juli Min </b>tells the decades-spanning, multigenerational story of the Yang family — starting in 2040 and winding back through the years to 2014. <i>In What Will People Think?</i>, <b>Sara Hamdan</b> explores Mia’s secret comedy career, forbidden office crush, and a long-guarded family secret in a funny, heartfelt coming-of-age story. Characterised by carefully crafted plots and vividly drawn settings, all three novels explore themes of identity, belonging, relationships, and resilience, offering nuanced portrayals of characters navigating both personal and external challenges in their search for meaning and connection. Dunlay, Hamdan and Min sit down with <b>Veronica Sullivan</b> to discuss their extraordinary debut novels.&nbsp;<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha I', '<p>Three highly lauded debut novelists — <b>Emily Dunlay </b>(<i>Teddy</i>), <b>Sara Hamdan </b>(<i>What Will People Think?</i>) and&nbsp;<b>Juli Min </b>(<i>Shanghailanders</i>) — take to the stage to discuss their nuanced portrayals of characters in search for meaning and connection.<br></p>', NULL, 150, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '15:00:00', '2025-01-31', '16:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(52, 'The Illustrators\' Showdown', '3939440000085341719', 'the-illustrators-showdown', '220', 'Maitha Al Khayat; Alex Latimer', 'Eve Wersocki-Morris', 'Family Activities', 'InterContinental', '6+', 'Published to Website', '0', 'English', NULL, '<div>Get ready for an epic showdown between renowned children\'s book illustrators <b>Alex Latimer </b>and <b>Steven Lenton</b>. Watch as they go head-to-head, bringing characters and stories to life on the spot, based on audience suggestions. Experience the thrill of live drawing, while learning illustration tips and tricks from these creative masters. Who will win the ultimate artistic showdown? That’s for the audience to decide! This exciting, interactive event will spark creativity and inspire budding young artists. <br></div><div>Recommended for ages 6+<br></div><div>Children under the age of 12 must be accompanied by a ticket-holding adult.<br></div><div><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha II', '<p>Get ready for an epic showdown between renowned children\'s book illustrators <b>Alex Latimer </b>and <b>Maitha Al Khayat</b>. Who will win? That is for you to decide! For ages 6+<br></p>', NULL, 220, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '16:15:00', '2025-02-02', '17:00:00', 0, NULL, NULL, 'SFAMILYACTIVITIES50', 'E', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(53, 'Arabic Poetry and Qanoon Night', '3939440000085341001', 'arabic-poetry-and-qanoon-night', '22', 'Asmaa Azaizeh; Amal Al Sahlawi; Abdulatif Yousef; Dr. Afra Atiq; Lamya Alsaiqal; Farah Younes', 'Alyaa AlMansoori', 'Special Events', 'TODA', NULL, 'Published to Website', '0', 'Arabic', NULL, '<div>It has been said that poetry was created for love, to say what ordinary words cannot. <br></div><div><br></div><div>Accompanied by authentic Arabic qanun music and the captivating performance of <b>Abdulatif&nbsp;Yousef,&nbsp;Dr. Afra Atiq,&nbsp;Amal Al Sahlawi,&nbsp;Asmaa Azaizeh,&nbsp;Farah Younes,&nbsp;&nbsp;Haneen Al Sayegh and Lamya Alsaiqal</b> come together in a poetic debate centered around love and ruled by poems of passion and love.<br></div><div><br></div><div>Between their different visions of love and its words, we spend a special evening at the Theater of Digital Art (ToDA) with the splendor of music and the eloquence of words.<br></div>', 'Litfest 2025', 'Souk Madinat Jumeirah', 'TODA Theatre', '<p>Accompanied by authentic Arabic qanun music and the captivating performance of artist <b>Abdulatif&nbsp;Yousef,&nbsp;</b>Dr. <b>Afra Atiq,&nbsp;<b>Amal Al Sahlawi</b>,&nbsp;<b>Asmaa Azaizeh</b>,</b>&nbsp;<b>Farah Younes</b><b>,</b>&nbsp;&nbsp;<b>Haneen Al Sayegh</b> and <b>Lamya Alsaiqal</b>&nbsp;come together in a poetic debate.<br></p>', NULL, 100, 120, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '20:00:00', '2025-01-31', '21:00:00', 0, '.', NULL, 'SSPECIALEVENTS120', 'K', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(54, 'LitFest Launch Pad', '3939440000085250215', 'litfest-launch-pad', '18', 'Hamdan Bin Shfayan Alameri; Hamda Alblooshi; Hala Maher; Yazan Issa; Zeina Chams', 'Esra AlMulla', 'Free Events', 'InterContinental', NULL, 'Published to Website', '0', 'Arabic', NULL, '<div>As every year, the festival celebrates new literary voices, providing a unique platform to showcase the latest releases and debut creative works. <br></div><div>This year, we meet a talented group of writers: <b>Hamdan Bin Shfayan</b>&nbsp;<b>Alameri</b>, <b>Hamda&nbsp;Alblooshi</b>, <b>Hala Maher</b>, <b>Yazan Issa</b>, and <b>Zeina Chams</b>. Get ready to dive into their stories and explore their exciting journeys toward creating their latest books.<br></div><div>Join us to discover inspiring new stories up close!<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Khor Pavilion', '<p>This year, we meet <b>Hamdan bin Shafyan Al Ameri</b> ,<b>Hamda&nbsp;Alblooshi</b>, <b>Hala Maher</b>, <b>Yazan Issa</b>, and <b>Zeina Chams</b>, as they share their stories and unique journeys in creating their recently published books.<br></p>', NULL, 100, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '17:00:00', '2025-01-31', '18:00:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(55, 'The Beast\'s Final Feast', '3939440000085341710', 'the-beasts-final-feast', '219', 'Jack Meggitt-Phillips', '', 'Family Activities', 'InterContinental', '8+', 'Published to Website', '0', 'English', NULL, '<div>Ebenezer Tweezer has remained young for 512 years by feeding a magical beast in his attic all manner of things: monkeys, statues, even the occasional cactus! Though now the beast is hungry for a child... And so Ebenezer finds Bethany, a rude, snotty-nosed prankster just perfect for gobbling up. That is, until she becomes something he didn’t quite expect — his friend. Join <b>Jack Meggitt-Phillips</b>, the wickedly funny and multi-award-winning author of <i>The Beast and the Bethany </i>series, for a hilarious peek into his charming world full of unlikely friendships and mischievous mayhem. And come prepared with your most evil laugh to see if you can scare The Beast!<br></div><div><br></div><div><i>Recommended for ages 6+ </i><i><br></i></div><div><i><br></i></div><div><i>Children under the age of 12 must be accompanied by a ticket-holding adult.</i><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha II', '<p>Join <b>Jack Meggitt-Phillips</b>, the wickedly funny and award-winning author of <i>The Beast and the Bethany</i> series, for a hilarious peek into his magical world full of unlikely friendships and mischievous mayhem. For ages 8+<br></p>', NULL, 220, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '14:30:00', '2025-02-02', '15:15:00', 0, NULL, NULL, 'SFAMILYACTIVITIES50', 'E', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(56, 'Naseem Khan: The Inside Story of Pakistan\'s Secret Services', '3939440000085250170', 'naseem-khan-the-inside-story-of-pakistans-secret-services', '13', 'Naseem Akhtar Khan;', 'Mustafa Alrawi', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>As a Brigadier, <b><b>Naseem Akhtar Khan</b> </b>had almost four decades’ association with the Pakistan army; more than half of which were in handling security management and counterintelligence at operational and strategic levels. His book, <i>Caught in the Crossfire</i>, gives an insider’s account of the complex dynamics of warfare and geopolitics in a region short of neither foreign threat nor internal vulnerabilities. In this fascinating session, Khan joins <b>Mustafa Alrawi&nbsp;</b>to share eye-opening insights into the high-stakes world of national security and intelligence. An essential session for anyone interested in defence, strategic studies, and geopolitical affairs.&nbsp;<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Amwaj', '<p>Brigadier <b>Naseem Akhtar Khan </b>shares insights from his book <i>Caught in the Crossfire</i>, offering an insider’s view into Pakistan’s secret service, and the dynamics of warfare and geopolitics that have shaped the nation.<br></p>', NULL, 80, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '15:00:00', '2025-01-31', '16:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(57, 'Welcome Aboard the Night Train of Sleepless Thoughts: The First Journey', '3939440000096835278', 'welcome-aboard-the-night-train-of-sleepless-thoughts-the-first-journey', '103', 'Amal Al Sahlawi', '', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'Arabic', 'Yes', '<div>Can fleeting moments transform into timeless literature? In this session, we delve into poet <b>Amal Al-Sahlawi</b>’s concept of \'transient writings,\' introduced in her new book. Through her words, the hidden philosophies and profound meanings within everyday details come to light. How does this unique literary approach blend narrative with reflection, and reality with thought? How does it open a window to contemplating brief, almost forgotten moments that hold immense significance? Join us for an enriching discussion that explores how literature can reshape our perception of life, turning the ordinary into the extraordinary, and uncover the secrets and philosophical depths of this remarkable literary genre.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras II', '<p>We delve into poet <b>Amal Al-Sahlawi</b>’s concept of \'transient writings,\' introduced in her new book. Through her words, the hidden philosophies and profound meanings within everyday details come to light. How does this unique literary approach blend narrative with reflection, and reality with thought?<br></p><p><br></p>', NULL, 150, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '17:00:00', '2025-02-02', '18:00:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(58, 'Anil Ananthaswamy: Why Machines Learn', '3939440000085341128', 'anil-ananthaswamy-why-machines-learn', '33', 'Anil Ananthaswamy', 'Chris Bradley', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>In his new book, <i>Why Machines Learn</i>, acclaimed science writer <b>Anil Ananthaswamy </b>offers deeply examined insight into the fundamental maths behind artificial intelligence and illustrates how machine learning will continue to transform everyday activities and revolutionise our social and economic lives. He joins <b>Chris Bradley</b><b>&nbsp;</b>to discuss how we should make the most of this wondrous technology, its limitations of which we should be aware, and the mathematics and creativity that underpin the inevitability of a future shaped by learning machines.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras I', '<p>Science writer <b>Anil Ananthaswamy </b>(<i>Why Machines Learn</i>) discusses the maths behind artificial intelligence and illustrates how machine learning will continue to transform our social and economic lives.<br></p>', NULL, 150, 75, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '10:00:00', '2025-02-01', '11:00:00', 0, NULL, NULL, 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(59, 'Writers\' Corner: An Insider\'s Guide to Publishing', '3939440000085250224', 'writers-corner-an-insiders-guide-to-publishing', '19', 'Alexandra Levick; Luigi Bonomi; Faiza S Khan', 'Allison K Williams', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Publishing a book is no easy feat, and the work isn\'t complete once the final word has been written. What follows is a complex web of pitching, contracting, branding, marketing, and selling your book to the world, in which it competes with thousands of other books it is being published alongside. How can you navigate through the red tape and break through? Join literary agents <b>Alexandra Levick </b>(The Writer’s House) and <b>Luigi Bonomi</b> (LBA Literary Agency) and former editor of Bloomsbury India and publishing consultant <b>Faiza S Khan</b> for a wide-ranging conversation about the things you need to know to succeed on the hard road to publishing. With&nbsp;<b>Allison K Williams</b>​.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Khor Pavilion', '<p>Hear from three publishing professionals — literary agents <b>Alexandra Levick</b> and <b>Luigi Bonomi</b> and former editor of Bloomsbury India <b>Faiza S Khan</b> — about the business of getting your book published.<br></p>', NULL, 100, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '15:00:00', '2025-01-31', '16:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(60, 'Megan Hess: Fashion in Colour', '3939440000085250152', 'megan-hess-fashion-in-colour', '11', 'Megan Hess', 'Hafsa Lodi', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Fashion has proven itself one of the most influential visual phenomena throughout history, and color has played a major role — arousing emotions, establishing harmony, and creating contrasts to help people define themselves and their place in the world by what they wear. Join renowned illustrator, bestselling author, and style aficionado <b>Megan Hess</b> and <b>Hafsa Lodi</b> for a deep dive into <i>Fashion in Colour</i>, Hess\' compendium exploring the surprising influence that hues have had in shaping the story of vogue, all the while being treated to a selection of her signature and stunning illustrations from the book.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras III', '<p>Renowned illustrator and bestselling author <b>Megan Hess</b> talks about <i>Fashion in Colour</i>, her stunning compendium exploring the surprising influence that hues have had in shaping the history of vogue.<br></p>', NULL, 150, 75, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '17:00:00', '2025-01-31', '18:00:00', 0, NULL, NULL, 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(61, 'Ammar Shams: Take Me to Dubai', '3939440000085341462', 'ammar-shams-take-me-to-dubai', '71', 'Dr. Ammar Shams', 'Fiona Lindsay', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>When did you last do something for the very first time? This question has driven <b>Ammar Shams</b> for the past twenty years, inspiring him to take risks, learn constantly, and approach life with boundless interest. Recently, it led him to become a taxi driver in Dubai, where he connects with passengers from all walks of life, sharing in their stories, hopes, and dreams. Shams joins <b>Fiona Lindsay</b> to reflect on the transformative power of curiosity and his unique journey, demonstrating how living with an open mind can lead to unexpected discoveries and enrich our understanding of the world.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Amwaj', '<p><b>Ammar Shams</b> discusses his fascinating experience being a Dubai taxi driver and the insights he gained by connecting with diverse lives and stories.<br></p>', NULL, 80, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '10:00:00', '2025-02-02', '11:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(62, 'Pip Williams: Of Women and Words', '3939440000085341082', 'pip-williams-of-women-and-words', '30', 'Pip Williams;', 'Namal Siddiqui', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Bestselling author <b>Pip Williams </b>writes the kind of historical fiction that brings the past to vivid, immersive life. Both her debut novel, <i>The Dictionary of Lost Words</i>, and her latest release, <i>The Bookbinder of Jericho </i>, invite us into the richly imagined inner lives of women striving to forge their own paths in an indifferent world. Exploring the breadth of women’s experiences that have too long been excluded from the history books, she talks with <b>Namal Siddiqui</b> about working with archives, the power of fiction to illuminate the possible, and the fascinating inspirations behind her lyrical and deeply thought-provoking books.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha III', '<p><b>Pip Williams</b>, the critically acclaimed author of <i>The Dictionary of Lost Words </i>and <i>The Bookbinder of Jericho</i>, takes to the stage to discuss the inspirations behind her lyrical and thought-provoking books.&nbsp;<br></p>', NULL, 200, 75, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '14:00:00', '2025-02-01', '15:00:00', 0, NULL, NULL, 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(63, 'Murder, We Wrote', '3939440000085341836', 'murder-we-wrote', '82', 'MJ Arlidge; Fiona Lindsay; Clare Mackintosh', 'Roland Gulliver', 'LitFest After Hours', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Brace yourself for a night of criminal fun as screenwriter <b>MJ Arlidge</b> and special guests <b>Clare Mackintosh</b> and <b>Fiona Lindsay</b> pen a new crime novel live on stage. The shocking twist? The authors are at the audience’s mercy, as you get to decide the key elements that will make the plot start ticking. Driven by audience suggestions, you’ll help create a suspenseful crime story with a proper beginning, middle, and end&nbsp;— plus a twist that no one will see coming. Will you make it out alive? There’s only one way to find out…<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras III', '<p>Join <b>MJ Arlidge</b> and guests for a thrilling night of live crime writing, where the audience controls the plot twists in an interactive, suspenseful story creation.<br></p>', NULL, 150, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '18:30:00', '2025-02-01', '19:30:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(64, 'Media and the Middle East', '3939440000085341354', 'media-and-the-middle-east', '59', 'Hala Gorani; Mina Al-Oraibi', 'Mustafa Alrawi', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>They’ve been on the ground in some of the most dangerous places in the world, reported on upheavals and uprisings, financial crashes and natural disasters, viral moments and world-changing events. In this lively panel discussion, editor-in chief of <i>The National</i>&nbsp;<b>Mina Al-Oraibi</b>&nbsp;and Emmy-award winning journalist <b>Hala Gorani </b>(<i>But You Don’t Look Arab</i>) sit down with <b>Mustafa Alrawi </b>to discuss their careers reporting in and on the Middle East, the evolving role of media in shaping narratives across the region, and the stories behind the headlines.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras I', '<p>A lively panel discussion with editor-in-chief of <i>The National</i> <b>Mina Al-Oraibi&nbsp;</b>and Emmy Award-winning journalist <b>Hala Gorani </b>about their careers reporting in and on the Middle East.<br></p>', NULL, 150, 75, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '10:00:00', '2025-02-02', '11:00:00', 0, NULL, NULL, 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(65, 'Walid Hashim on the Secrets Behind Crime Novels', '3939440000085077864', 'walid-hashim-on-the-secrets-behind-crime-novels', '303', 'Waleed Hashim', '', 'Discovery Talks', 'InterContinental', NULL, 'Published to Website', '0', 'Arabic', NULL, '<div>Do you know Laila and Dhiyab? <br></div><div>They are the characters of the Bahraini writer <b>Waleed Hashim</b>&nbsp;crime comedy series, which is the first of its kind in the Arab world.<br></div><div>Do you know Tayseer then?<br></div><div>Maybe not, but you are about to get to know characters that are both disturbing and interesting. Characters with dozens of dialects in a novel series full of funny scenes and sarcastic comedic paradoxes in the context of a crime in which the writer challenges you to identify the killer.<br></div><div>Waleed Hashim talks to you about the secret that combines the two opposites: comedy and horror, which made the dialogue<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Khor Pavilion', '<p>Characters with dozens of dialects in a novel series full of funny scenes and sarcastic comedic paradoxes in the context of a crime in which the writer <b>Waleed Hashim</b> challenges you to uncover the killer.<br></p>', NULL, 100, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '17:00:00', '2025-02-01', '17:45:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(66, 'Subhadra Das: Ten Lies That Made the West', '3939440000085341782', 'subhadra-das-ten-lies-that-made-the-west', '76', 'Subhadra Das;', 'Micallar Walker', 'LitFest After Hours', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Is the West really as civilised as it likes to think it is? In this witty, biting, and illuminating session, join author <b>Subhadra Das</b> (<i>Uncivilised: Ten Lies That Made the West</i>) and <b>Micallar Walker</b> for an irreverent tour through the idea of Western civilisation, and the lies, exaggerations, and misdirections that underpin it. Das brings her varied experience as a writer, historian, and comedian to bear as she takes aim at the West’s hypocrisy and makes a case for the histories, knowledges, and ingenuity of peoples and cultures long dismissed as “uncivilised”. You will never look at history in the same way again.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha II', '<p>Join writer, historian, and comedian <b>Subhadra Das</b> for an irreverent tour through the idea of Western civilisation, and all the lies, exaggerations, and misdirections that underpin it.&nbsp;<br></p>', NULL, 220, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '18:30:00', '2025-01-31', '19:30:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(67, 'History Lessons', '3939440000085341444', 'history-lessons', '69', 'Abraham Verghese; Pip Williams', 'Julia Wheeler', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Both <b>Abraham Verghese </b>(<i>The Covenant of Water</i>) and <b>Pip Williams </b>(<i>The Dictionary of Lost Words</i>, <i>The Bookbinder of Jericho</i>) write complex, multilayered works of historical fiction, centred around telling the stories of marginalised voices within the epic sweep of history. Speaking with <b>Julia Wheeler</b>, these highly acclaimed authors come together to discuss bringing bygone eras to life, giving voice to those who have been foot-noted and forgotten, and how writing about forgotten chapters of the past can illuminate the concerns of the present.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras III', '<p><b>Abraham Verghese</b> (<i>The Covenant of Water</i>) and <b>Pip Williams </b>(<i>The Dictionary of Lost Words</i>) come together to discuss the complex task of illuminating marginalised voices against the epic sweep of history.<br></p>', NULL, 150, 75, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '14:00:00', '2025-02-02', '15:00:00', 0, NULL, NULL, 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(68, 'Shaikha Al Marri: Book Launch of Journey to the Skies', '3939440000098409063', 'shaikha-al-marri-book-launch-of-journey-to-the-skies', '739', 'Shaikha Al Marri', 'Waleed Eltayeb Gubara', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', NULL, NULL, '<div>Join us for the launch of&nbsp;<b>Shaikha Al Marri\'s </b>debut book, <i>Journey to the Skies</i>, which is more than a memoir of a young Emirati woman chasing her dream of flying planes. It is a heartfelt tribute to hope, determination, and the power of holding onto one\'s dreams. Across its pages, Shaikha takes us from her childhood days, when \"giant metal birds\" in the vast blue sky captivated her imagination, to the moment she fulfilled her ambition of becoming a licensed commercial airline pilot for Emirates. Through moving storytelling, she highlights how her tenacity, unwavering confidence in her own abilities, and the steadfast support and love of her family carried her through difficult times and challenges that were very close to dashing her dreams altogether. <br></div><div><br></div><div>Through the inclusion of personal photographs, Journey to the Skies grants a close-up view of Shaikha\'s most cherished moments and reflections. The combination of images and written narrative pulls readers into her emotional highs and lows—from quiet self-doubt and moments of inspiration to the exhilaration of finally soaring in the cockpit and realising the childhood dream that had guided her for so long.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras I', '<p><i>Journey to the Skies</i> by <b>Shaikha Al Marri</b> is an inspiring memoir of her path to becoming a commercial pilot for Emirates. Blending personal stories and photos, she shares how determination, self-belief, and family support helped her overcome challenges, proving that no dream is beyond reach.<br></p>', NULL, 200, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '16:00:00', '2025-01-31', '16:30:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(69, 'Into the Hardy-verse', '3939440000085341701', 'into-the-hardy-verse', '218', 'Vashti Hardy', '', 'Family Activities', 'InterContinental', '8+', 'Published to Website', '0', 'English', NULL, '<div>Join <b>Vashti Hardy </b>for an exploratory journey through her breathtaking middle grade fantasy stories including the explorers and sapient animals of The Brightstorm Chronicles, the ghosts in machines of <i>Wildspark</i>, the sentient trees of <i>Crowfall</i>, the AI humanoids of <i>North and the Only One</i>, the ancient inventions of her new Relic Hunters series, and more. You will gain an insight into where her ideas come from plus how she builds worlds that transport readers into the adventures of a lifetime. With many take away writing tips, including how to create fantasy world maps, readers will come away inspired and ready to create their own unique and adventure-filled stories.<br></div><div><br></div><div><i>Recommended for ages 8+ </i><i><br></i></div><div><i><br></i></div><div><i>Children under the age of 12 must be accompanied by a ticket-holding adult.</i><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha II', '<p>Join <b>Vashti Hardy </b>for a journey through her fantasy worlds like The Brightstorm Chronicles and <i>Wildspark </i>and learn how she builds immersive stories and creates fantasy maps! For ages 8+<br></p>', NULL, 220, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '12:45:00', '2025-02-02', '13:30:00', 0, NULL, NULL, 'SFAMILYACTIVITIES50', 'E', '2025-02-02 09:54:30', '2025-02-02 09:54:30');
INSERT INTO `sessions` (`id`, `session_name`, `session_id`, `session_slug`, `session_number`, `session_authors`, `session_moderator`, `session_category`, `session_venue`, `age`, `session_website_status`, `session_status`, `session_language`, `session_translation`, `session_blurb`, `session_year`, `session_location`, `session_room`, `session_short_blurb`, `session_trailer`, `no_normal_tickets`, `normal_ticket_price`, `gold_price`, `no_gold_tickets`, `silver_price`, `no_silver_tickets`, `bronze_price`, `no_bronze_tickets`, `session_start_date`, `session_start_time`, `session_end_date`, `session_end_time`, `featuredsession`, `seo_title`, `seo_description`, `det_code`, `pricetype`, `created_at`, `updated_at`) VALUES
(70, 'Steven Mithen: The Language Puzzle', '3939440000085341200', 'steven-mithen-the-language-puzzle', '41', 'Steven Mithen', 'Nizar Habash', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>How did the ape-like calls of our prehistoric ancestors turn into the sophisticated vocabularies of the thousands of languages in existence today? Join award-winning archaeologist <b>Steven Mithen</b> (<i>The Language Puzzle</i>) for a fascinating conversation about how and why language has evolved, and what we can learn about our current moment in time by examining the ways in which language has informed human thought and culture over millennia. Mithen will join <b>Nizar Habash</b> for a profound conversation about his work, drawing on the latest discoveries in linguistics, archaeology, genetics, and psychology to piece together the puzzle of who we are — and what we might become — through language.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras III', '<p>Award-winning archaeologist <b>Steven Mithen</b> discusses his latest book, <i>The Language Puzzle</i> — an intriguing investigation into how and why language has evolved, and the way language has, in turn, evolved humanity.<br></p>', NULL, 150, 75, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '10:00:00', '2025-02-01', '11:00:00', 0, NULL, NULL, 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(71, 'Emirati Publishers\' Showcase', '3939440000085250206', 'emirati-publishers-showcase', '17', 'Mohamed Kandil; Mohamed Almatrooshi; Abdulaziz Mohamad Ali; Fatma AlKhatib', 'Shaikha Almteiri', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'Arabic', NULL, '<div>A distinguished group of publishing pioneers in the UAE will gather to discuss the key challenges and opportunities that define their unique industry.<br></div><div>In this interactive session, the speakers will offer valuable insights on a range of topics, including the economic viability of book publishing, digital publishing paths, and ways to bring their works to a global audience.<br></div><div>The discussion will also cover market trends and how publishers and influencers are responding to the evolving demands and rapid transformations of the industry.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha I', '<p>A distinguished group of publishing pioneers in the UAE will gather to discuss the key challenges and opportunities that define their unique industry. Speakers will offer valuable insights on a range of topics, including the economic viability of book publishing, digital publishing paths, and ways to bring their works to a global audience.<br></p>', NULL, 70, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '11:00:00', '2025-01-31', '12:00:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(72, 'Nadhim Zahawi: The Boy From Baghdad', '3939440000087321020', 'nadhim-zahawi-the-boy-from-baghdad', '199', 'Nadhim Zahawi', 'Faisal J. Abbas', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Born and raised in Baghdad, <b>Nadhim Zahawi</b> arrived in the UK aged 12, after his family was forced to flee their home under threat from Saddam Hussein’s regime. In conversation with <b>Faisal J. Abbas</b>, Zahawi discusses his childhood journey from Iraq to Britain, his remarkable career in international business and politics, and the policies and people that have shaped and shaken his adoptive homeland. With candour and clarity, Zahawi offers a personal exploration of a tumultuous time in British politics and considers questions about identity, belonging, and the evolution of a nation.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha II', '<p><b>Nadhim Zahawi</b> shares his journey from Baghdad to Britain, his political and business career, and reflections on identity and belonging in a changing UK.<br></p>', NULL, 150, 75, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '16:00:00', '2025-01-31', '17:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(73, 'Stories and Languages', '3939440000085341755', 'stories-and-languages', '224', 'Ebtisam Al-Beiti; Samar Mahfouz Barraj', '', 'Family Activities', 'InterContinental', '6+', 'Published to Website', '0', 'Multilanguage', NULL, '<div>In this warm and joyful session, authors&nbsp;<b>Ebtisam Al-Beiti&nbsp;</b>and <b>Samar Mahfouz Barraj<b>&nbsp;</b></b>take us on an enchanting journey through their stories: <i>A Very Strange Night</i> and <i>Citrus the Smoothie Sloth</i>. Blending both Arabic and English, children dive into two captivating worlds, moving between thrilling events and savouring the beauty of each language. This session offers rich moments that make reading a unique, joy-filled experience.<br></div><div><i>Recommended for ages 6+<br></i></div><div><i>Children under the age of 12 must be accompanied by a ticket-holding adul</i>t.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Majlis', '<p>Authors <b>Ebtisam Al-Beiti&nbsp;</b>and <b>Samar Mahfouz Barraj</b>&nbsp;take us on an adventure through two enchanting stories: A Very Strange Night and Citruss the Smoothie Sloth. Presented in both Arabic and English. For ages 6+<br></p>', NULL, 75, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '14:30:00', '2025-02-02', '15:15:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(74, 'Revelatory Fictions', '3939440000085341390', 'revelatory-fictions', '63', 'Abdulrazak Gurnah; Chigozie Obioma', 'Allison K Williams', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>As the world grows increasingly divided, empathy seems to be in short shrift. Can reading fiction help? Award-winning novelists <b>Abdulrazak Gurnah </b>and <b>Chigozie Obioma </b>come together in this session to discuss writing with intent and the role fiction plays in illuminating the human condition. Known for bringing a kaleidoscope of perspectives and provocations to the page, these two extraordinary authors join <b>Allison K Williams&nbsp;</b>to consider fiction as a tool for resistance and critique, and as a conduit for revelation and truth. This is an opportunity to hear powerful and personal testimony on the importance of storytelling, now more than ever.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha III', '<p>Join award-winning novelists <b>Abdulrazak Gurnah </b>and <b>Chigozie Obioma </b>as they explore how fiction fosters empathy, resists division, and illuminates the human condition in a powerful conversation.<br></p>', NULL, 200, 75, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '13:00:00', '2025-02-02', '14:00:00', 0, NULL, NULL, 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(75, 'Discover Your Story', '3939440000085341746', 'discover-your-story', '223', 'Sarah Laura Nesti Willard; Shereen Malherbe', '', 'Family Activities', 'InterContinental', '4+', 'Published to Website', '0', 'English', NULL, '<div>Creative duo <b>Shereen Malherbe </b>and <b>Sarah Laura Nesti Willard </b>create heart-warming illustrated stories of identity and belonging, such as <i>The Girl Who Slept Under the Moon</i>, <i>The Girl Who Stitched the Stars</i>, and <i>The Girl Who Lives Between Two Worlds</i>. In this interactive session, you’ll enjoy a reading by Shereen, an introduction to the art of illustration by Sarah, and a fun and inclusive workshop to create a story and illustrations that are unique to you. At the end of this session, you’ll get to take home your very own mini storybook!<br></div><div><br></div><div><i>Recommended for ages 4+</i><br></div><div><br></div><div><i>Children under the age of 12 must be accompanied by a ticket-holding adult.</i><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Majlis', '<p>In this interactive session with storyteller <b>Shereen Malherbe </b>and illustrator <b>Sarah Laura Nesti Willard</b>, create your own heart-warming tales and drawings that are unique to you. For ages 4+<br></p>', NULL, 75, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '12:45:00', '2025-02-02', '13:30:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(76, 'That\'s Not My... Dog', '3939440000085341565', 'thats-not-my-dog', '202', 'Vanessa Woolf', '', 'Family Activities', 'InterContinental', 'All ages', 'Published to Website', '0', 'English', NULL, '<div>Join us for a fun-filled exploration of the global hit series, That\'s Not My... perfect for curious little hands! These interactive, touch-and-feel board books introduce young readers to a world of textures, colours, and simple yet engaging stories. In this exciting session, led by Britain\'s favourite storyteller <b>Vanessa Woolf</b>, toddlers will be engrossed in a sensory adventure. Whether it\'s a shaggy dog or a bumpy dinosaur, your child will love discovering what’s next. Ideal for ages 0–4, this event is sure to set your child on their reading journey.<br></div><div><i><br></i></div><div><i>Children under the age of 12 must be accompanied by a ticket-holding adult.</i><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Majlis', '<p>Storyteller <b>Vanessa Woolf </b>invites you to explore textures and colours through the globally bestselling, interactive, touch-and-feel book series That\'s Not My...<br></p>', NULL, 75, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '10:00:00', '2025-01-31', '10:45:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(77, 'Anecdotes of Arab Anglophiles', '3939440000085341209', 'anecdotes-of-arab-anglophiles', '43', 'Faisal J. Abbas; HE Mohammed Ahmed Al Murr', 'Fiona Lindsay', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Join acclaimed journalist <b>Faisal J Abbas</b> as he shares witty and urbane insights into life as an Arab in London, as chronicled in his book, <i>Anecdotes of an Arab Anglophile</i>. Filled with entertaining anecdotes covering history, politics, and even religion, the editor-in-chief of <i>Arab News </i>sits down with <b>Fiona Lindsay</b>​ and special guest <b>HE&nbsp;</b><b>Mohammed Ahmed Al Murr</b>, who delights in visiting and discovering the treasures that Britain has to offer, to delve into the journey from Anglophobe to Anglophile and offer an inquisitive, bemused, and affectionate assessment of British foibles and idiosyncrasies. With Abbas’ distinctive style and flair for telling stories, this session offers a frank, insightful, and altogether entertaining study of the cultural and social contrasts between British and Arab cultures.&nbsp;<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras III', '<p><b>Faisal J Abbas</b>, editor-in-chief of Arab News, discusses <i>Anecdotes of an Arab Anglophile</i> — his witty, inquisitive, and affectionate book chronicling his experience of being an Arab in London, with special guest <b>HE&nbsp;</b><b>Mohammed Ahmed Al Murr</b>.&nbsp;<br></p>', NULL, 150, 75, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '14:00:00', '2025-02-01', '15:00:00', 0, NULL, NULL, 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(78, 'Colm McLouglin: A Tribute to A Life Well Spent', '3939440000092234068', 'colm-mclouglin-a-tribute-to-a-life-well-spent', '90', 'Graeme Wilson; Niall McLoughlin; Ramesh Cidambi; HE Alison Milton', 'Isobel Abulhoul', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', NULL, NULL, '<div>Join us for a special tribute celebrating the extraordinary legacy of <b>Colm McLoughlin,</b> former CEO of Dubai Duty Free, one of the UAE’s leading pioneers, and a steadfast supporter of the Emirates LitFest. <br></div><div><br></div><div>Over four remarkable decades, Colm was instrumental in transforming Dubai Duty Free and shaping the duty-free industry in the region, driving unprecedented growth and success. Beyond his business achievements, Colm was a passionate patron of the arts. His steadfast support helped elevate the LitFest to international prominence, mirroring Dubai’s rise as a global hub. Last year, his remarkable memoir <i>A Life Well Spent</i> had been launched at the 2024 Emirates LitFest.<br></div><div><br></div><div>Colm McLoughlin’s impact reaches far beyond business, leaving a lasting imprint on culture, community, and the arts. We warmly invite you to join us in reflecting on his remarkable contributions.<br></div><div><br></div><div>We are honored to welcome <b>H.E. Alison Milton</b>, Ambassador of Ireland to the UAE, who will share insights into Colm’s influence and his strong ties to Ireland.&nbsp;<b>Ramesh Cidambi</b>, Managing Director, Dubai Duty Free will speak about his experience of working with Colm over 30 years and his leadership style.&nbsp;<b>Graeme Wilson</b>, acclaimed author, documentary producer, and Colm’s biographer, will offer a personal perspective on Colm’s remarkable life and achievements. Adding a heartfelt family tribute, <b>Niall McLoughlin</b>, Colm’s son, will reflect on his father’s enduring legacy. The event will be hosted by <b>Isobel Abulhoul OBE</b>, Founder, Advisor, and Trustee of the Emirates Literature Foundation.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Amwaj', '<p>Join us for a special tribute celebrating the extraordinary legacy of Colm McLoughlin, former CEO of Dubai Duty Free, a pioneering leader and steadfast supporter of the Emirates LitFest.<br></p><p><br></p><p><br></p><p>Over four decades, Colm transformed Dubai Duty Free and championed the arts, helping elevate the LitFest globally. His memoir, <i>A Life Well Spent</i>, was launched at the 2024 Emirates LitFest.<br></p><p><br></p><p><br></p><p>The event will feature reflections from H.E. Alison Milton, Ramesh Cidambi, Graeme Wilson, and Niall McLoughlin, and will be hosted by Isobel Abulhoul OBE.<br></p><p><br></p>', NULL, 80, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '10:00:00', '2025-02-01', '10:30:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(79, 'Godfrey is a Frog', '3939440000085341737', 'godfrey-is-a-frog', '222', 'Alex Latimer', '', 'Family Activities', 'InterContinental', '4+', 'Published to Website', '0', 'English', NULL, '<div>Godfrey has gone through some big changes growing up — first he was an egg, then he was a tadpole. And now he’s a frog. But compared to the bears with their big claws, and the deer with their impressive antlers, and the herons with their majestic wings, Godfrey doesn’t feel all that special. What is so exciting about being a frog? <b>Alex</b> <b>Latimer</b>, award-winning author and illustrator of the acclaimed picture books <i>Never Follow a Dinosaur</i> and <i>Mole Hill</i>, takes to the stage to lead an interactive drawing activity and share the uplifting story of Godfrey — who is really quite spectacular, in his own amphibious way.<br></div><div><br></div><div><i>Recommended for ages 4+ </i><i><br></i></div><div><i><br></i></div><div><i>Children under the age of 12 must be accompanied by a ticket-holding adult.</i><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Majlis', '<p>In this interactive event, <b>Alex</b> <b>Latimer</b> brings to life the story of Godfrey — a frog who doesn’t feel all that special, but who discovers just how extraordinary he can be if only he learns to accept himself. For ages 4+<br></p>', NULL, 75, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '11:00:00', '2025-02-02', '11:45:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(80, 'My Family\'s Secret Superpowers', '3939440000085341647', 'my-familys-secret-superpowers', '211', 'Helen Farmer', '', 'Family Activities', 'InterContinental', '4+', 'Published to Website', '0', 'English', NULL, '<div>Ruby and her family like ‘untangling the knots’ over dinner. They talk about their worries and share ideas on what might help. Ruby sometimes feels wobbly when she does new things — her heart beats like a drum and it feels like there are a hundred butterflies in her tummy. And she’s not alone! Mum, Dad, and big sister Olive also have times when they don’t feel so good. Join <b>Helen Farmer</b> to discover the secret superpower that helps Ruby and her family feel better and more confident, and learn some relatable tips and tricks that will help you to ‘untangle the knots’ too!<br></div><div><br></div><div><i>Recommended for ages 4+ </i><i><br></i></div><div><i><br></i></div><div><i>Children under the age of 12 must be accompanied by a ticket-holding adult.</i><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Majlis', '<p>Join acclaimed local broadcaster and children’s author <b>Helen Farmer</b> for the launch of her new book and discover your own secret superpower to help you get through times that don’t feel so good. For ages 4+<br></p>', NULL, 75, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '12:30:00', '2025-02-01', '13:15:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(81, 'Fresh Air, Fresh Lyrics', '3939440000085341872', 'fresh-air-fresh-lyrics', '86', 'Najwa Zebian; Alex; Zoe Mohammed; Dr. Adrianne Kalfopoulou; Aroma; Nima Elnour; Sarah AlNuaimi; Mohamed Amir', 'Trixie Danielle', 'LitFest After Hours', 'InterContinental', NULL, 'Published to Website', '0', 'Multilanguage', NULL, '<div>Join us for a relaxed evening celebrating the region’s rich poetic tradition and spoken word scene. Enjoy an eclectic mix of local talent, plus a special performance from an international guest.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Majlis', '<p>Join us for a relaxed evening celebrating the region’s rich poetic tradition and spoken word scene. Enjoy an eclectic mix of local talent, plus a special performance from an international guest.<br></p>', NULL, 200, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '18:30:00', '2025-02-01', '19:30:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(82, 'The Pearl Diver\'s Daughter and the Cowrie Necklace', '3939440000085341665', 'the-pearl-divers-daughter-and-the-cowrie-necklace', '213', 'Maitha Al Khayat; Hessa Almehairi', '', 'Family Activities', 'InterContinental', '14+', 'Published to Website', '0', 'Arabic', NULL, '<div>Join award-winning Emirati creatives <b>Maitha Alkhayat</b> and <b>Hessa Al Muhairi</b> for an exclusive look at their groundbreaking YA fantasy novel, The Pearl Diver’s Daughter &amp; the Cowrie Necklace. Winner of the Etisalat Award for Young Adult Literature, this captivating tale weaves Emirati heritage with fantasy and adventure.<br></div><div>Enjoy an inspiring session with trivia, live drawing, readings, and Q&amp;A celebrating the creativity of Emirati storytelling<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Majlis', '<p>Join award-winning Emirati creatives <b>Maitha Alkhayat</b> and <b>Hessa Al Muhairi </b>for an exclusive look at their groundbreaking YA fantasy novel, The Pearl Diver’s Daughter &amp; the Cowrie Necklace.&nbsp;<br></p>', NULL, 75, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '15:30:00', '2025-02-01', '16:15:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(83, 'Business Breakfast: Women in Leadership', '3939440000085250197', 'business-breakfast-women-in-leadership', '16', 'Maha Abouelenein; Dr. Jessamy Hibberd; Su Bridgman JD', 'Lucy Chow', 'Special Events', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Start your day with some of the brightest minds in business, with a focus on women in leadership. Special guests <b>Jessamy</b> <b>Hibberd</b> (<i>The Imposter Cure</i>), <b>Maha Abouelenein</b> (<i>7 Rules of Self-Reliance</i>), and <b>Su Bridgman JD </b> (<i>The CQ Edge</i>) sit down to discuss the challenges and opportunities facing the sector, bringing insider perspectives, key insights, and an eye on what’s next. Delving into topics like self-reliance, conquering imposter syndrome, and strategies for effective communication, this session illuminates new leadership pathways in a rapidly changing world. <b>Lucy Chow</b> convenes this one-hour panel discussion, followed by a light breakfast spread and networking.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Khor Pavilion', '<p><b>Jessamy Hibberd </b>(<i>The Imposter Cure</i>), <b>Maha Abouelenein</b> (<i>7 Rules of Self-Reliance</i>), and <b>Su Bridgman JD </b> (<i>The CQ Edge</i>) sit down to discuss the challenges and opportunities facing women in business.<br></p>', NULL, 100, 150, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '09:00:00', '2025-01-31', '10:30:00', 0, NULL, NULL, 'SCONVERSATIONS150', NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(84, 'Time Travelling with a Tortoise', '3939440000085341692', 'time-travelling-with-a-tortoise', '217', 'Ross Welford', '', 'Family Activities', 'InterContinental', '8+', 'Published to Website', '0', 'English', NULL, '<div>In <b>Ross Welford</b>’s bestselling children\'s book <i>Time Travelling with a Hamster</i>, his daring hero Al Chaudhury journeyed to the past to save his father’s life. Now everything is back to normal… Or is it? It turns out meddling with time doesn’t always work out the way you hope. Join Welford as he introduces <i>Time Travelling with a Tortoise</i>, the thrilling and hilarious next chapter of Al Chaudhury’s time-hopping adventure, and help him answer the question: if you could change the past, knowing it would also change the present, would you?<br></div><div><br></div><div><i>Recommended for ages 8+ </i><i><br></i></div><div><i><br></i></div><div><i>Children under the age of 12 must be accompanied by a ticket-holding adult.</i><br></div><div><br></div><div><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha II', '<p>Join <b>Ross Welford </b>as he introduces <i>Time Travelling with a Tortoise</i>, the exciting sequel to <i>Time Travelling with a Hamster</i>. Al Chaudhury’s time-travel adventure continues with big questions and hilarious twists! For ages 8+<br></p>', NULL, 220, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '11:00:00', '2025-02-02', '11:45:00', 0, NULL, NULL, 'SFAMILYACTIVITIES50', 'E', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(85, 'Fashionable Adventures', '3939440000085341638', 'fashionable-adventures', '210', 'Megan Hess', 'Helen Farmer', 'Family Activities', 'InterContinental', '4+', 'Published to Website', '0', 'English', NULL, '<div><b>Megan Hess</b> creates stories for little people with big dreams — be that discovering their inner power or setting off on a fashionable caper in a faraway city! The author and illustrator of The Young Queens Collection and the Claris: The Chicest Mouse in Paris series joins <b>Helen Farmer</b> to talk about her beautifully illustrated tales that are bursting with style and flair. Prepare to be swept away to places beyond your wildest imagination with these big-hearted stories of plucky heroines, fashionable adventures, and modern queens.<br></div><div><br></div><div><i>Recommended for ages 4+ </i><i><br></i></div><div><i><br></i></div><div><i>Children under the age of 12 must be accompanied by a ticket-holding adult.</i><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Majlis', '<p>Ready for a fashionable adventure? Celebrated children’s author <b>Megan Hess</b> takes to the stage to share her beautifully illustrated stories featuring plucky heroines and modern queens. For ages 4+<br></p>', NULL, 75, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '11:00:00', '2025-02-01', '11:45:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(86, 'Charan Ranganath: Why We Remember', '3939440000085341137', 'charan-ranganath-why-we-remember', '34', 'Dr. Charan Ranganath', 'Julia Wheeler', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Memory is more than a record of the past. It plays a powerful role in nearly every aspect of our lives, from learning, decision-making, and responding to and healing from trauma. At the forefront of research into why we remember, pioneering neuroscientist and psychologist <b>Charan Ranganath</b> is working to radically reframe the way we think about our recollections. He joins host <b>Julia Wheeler</b> to reveal the surprising ways our brains use information from our past to define our present and imagine the future, and suggests what we might glean about ourselves and the people around us if only we better understood the power — and quirks — of memory.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras I', '<p>Hear from neuroscientist and psychologist <b>Charan Ranganath</b> (<i>Why We Remember</i>) and learn what we might glean about ourselves and the people around us if only we better understood the power — and quirks — of memory.<br></p>', NULL, 150, 75, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '12:00:00', '2025-02-01', '13:00:00', 0, NULL, NULL, 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(87, 'Children Take Over LitFest: Arabic Edition', '3939440000085077672', 'children-take-over-litfest-arabic-edition', '200', 'Ali Humaid Alloghani; Beesan Osman; Fatima Ali Alzarooni; Hessa Hassan; Omar Alameeri; Sandy Hani', '', 'Family Activities', 'InterContinental', 'All ages', 'Published to Website', '0', 'Arabic', NULL, '<div>Join us to celebrate some of Dubai’s youngest and brightest authors. These budding writers will discuss their creative processes, read excerpts from their books, and share what inspires them. <br></div><div><br></div><div><i>Children under the age of 12 must be accompanied by a ticket-holding adult.</i><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha I', '<p>Join us to celebrate some of Dubai’s youngest and brightest authors. These budding writers will discuss their creative processes, read excerpts from their books, and share what inspires them.<br></p>', NULL, 220, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-30', '17:00:00', '2025-01-30', '18:00:00', 0, '.', NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(88, 'That\'s Not My... Tiger', '3939440000085341628', 'thats-not-my-tiger', '209', 'Vanessa Woolf', '', 'Family Activities', 'InterContinental', 'All ages', 'Published to Website', '0', 'English', NULL, '<div>Join us for a fun-filled exploration of the global hit series, That\'s Not My... perfect for curious little hands! These interactive, touch-and-feel board books introduce young readers to a world of textures, colours, and simple yet engaging stories. In this exciting session, led by Britain\'s favourite storyteller <b>Vanessa Woolf</b>, toddlers will be engrossed in a sensory adventure. Whether it\'s a shaggy dog or a bumpy dinosaur, your child will love discovering what’s next. Ideal for ages 0–4, this event is sure to set your child on their reading journey.<br></div><div><br></div><div><i>Children under the age of 12 must be accompanied by a ticket-holding adult.</i><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Majlis', '<p>Storyteller <b>Vanessa Woolf</b> invites you to explore textures and colours through the globally bestselling, interactive, touch-and-feel book series That\'s Not My...<br></p>', NULL, 100, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '09:00:00', '2025-02-01', '09:45:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(89, 'Collective Portrait of The Gulf', '3939440000085341019', 'collective-portrait-of-the-gulf', '23', 'Abdulatif Yousef; Salha Obaid; Waleed Hashim', 'Shaikha Almteiri', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'Arabic', 'Yes', '<div>We open the doors to a rich dialogue between diverse voices from the Gulf countries, exploring the unique differences and profound similarities that shape the region’s identity. Writers <b>Abdulatif Yousef</b>,<b> Mohamed Alyahyai</b>, and <b>Salha Obaid</b> come together to provide insightful perspectives on the varied cultural and artistic expressions in their respective countries, and how these elements contribute to the development of a broader, collective Gulf identity. <br></div><div>We will shed light on the multifaceted aspects that enrich the cultural landscape of the Gulf, examining how these unique traits intersect to create a vibrant and harmonious fabric. This is an opportunity to gain a deeper understanding of the cultural and creative legacy that defines this part of the world.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha I', '<p>Writers <b>Abdulatif Yousef</b>,<b> Mohamed Alyahyai</b>, and <b>Salha Obaid</b> come together to provide insightful perspectives on the varied cultural and artistic expressions in their respective countries, and how these elements contribute to the development of a broader, collective Gulf identity.<br></p>', NULL, 198, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '10:00:00', '2025-02-01', '11:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(90, 'Pens, Punchlines, & Possibilities', '3939440000085250079', 'pens-punchlines-possibilities', '3', 'Dr. Maryam AlHashmi; Nabil Suleiman; Dr. Abdel Illah Benarafa', 'Aysha Alshamsi', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'Arabic', 'Yes', '<div>In this roundtable discussion session, we are joined by a group of Arab writers and thinkers: writer <b>Mohamed Alyahyai</b>&nbsp;writer and critic <b>Maryam AlHashmi,</b> writer <b>Nabil Suleiman</b>&nbsp;and Dr. <b>Abdel Illah&nbsp;Benarafa</b>, to explore the role of the Arab writer and intellectual in the current scene. <br></div><div>We delve into their personal experiences and perceptions of the evolution of the role of the writer throughout history. What are the ways in which literature interacts today with the major transformations that the Arab world is going through?<br></div><div>Has the role of the intellectual changed in the era of globalization and digital revolutions?<br></div><div>How can literature be a tool for change or a mirror that reflects what is happening?<br></div><div>Prepare for an open dialogue that addresses the challenges and opportunities of the Arab intellectual in shaping the cultural and political future in our region, in light of the different contexts from the Gulf to the ocean.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha I', '<p>In a roundtable discussion, writer <b>Mohamed Alyahya</b><b>i</b> , writer and critic <b>Maryam AlHashmi</b>, writer <b>Nabil Suleiman</b>, and Dr. <b>Abdel Illah&nbsp;Benarafa</b> discuss the role of the Arab writer and intellectual in the current scene and how literature can be a tool for change or a mirror that reflects the reality of what is happening.<br></p>', NULL, 198, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '17:00:00', '2025-01-31', '18:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(91, 'Desert Stanzas', '3939440000085250047', 'desert-stanzas', '1', 'Khairani Barokka; Safiya Sinclair; Shamma Albastaki; Abdulatif Yousef; Asmaa Azaizeh; Khalid Albudoor; RUMInation', 'Shahd Thani', 'Special Events', 'Caravanserai', NULL, 'Published to Website', '0', 'Multilanguage', NULL, '<div>Experience an unforgettable night of poetry and spoken word, set against mystical dunes and a starlit sky. This special event embodies the heart of the Festival — gathering to celebrate stories, exclaim in joy, and marvel at the profound power of words to bridge time, space, and human experience. Join an extraordinary line-up of international and local voices as we come together fora night of connection, celebration, and enchantment. Buffet dinner included.<br></div>', 'Litfest 2025', 'Exit 29, Jebel Ali, Lehbab Rd, Dubai', 'Desert Camp', '<p>Experience an enchanting night of poetry under the stars, celebrating storytelling\'s power to connect across time and space, featuring international and local voices in a magical desert setting.<br></p>', NULL, 100, 425, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-30', '19:00:00', '2025-01-30', '21:00:00', 0, NULL, NULL, 'SSPECIALEVENTS425', 'L', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(92, 'That\'s Not My... T Rex', '3939440000085341574', 'thats-not-my-t-rex', '203', 'Vanessa Woolf', '', 'Family Activities', 'InterContinental', 'All ages', 'Published to Website', '0', 'English', NULL, '<div>Join us for a fun-filled exploration of the global hit series, That\'s Not My... perfect for curious little hands! These interactive, touch-and-feel board books introduce young readers to a world of textures, colours, and simple yet engaging stories. In this exciting session, led by Britain\'s favourite storyteller <b>Vanessa Woolf</b>, toddlers will be engrossed in a sensory adventure. Whether it\'s a shaggy dog or a bumpy dinosaur, your child will love discovering what’s next. Ideal for ages 0–4, this event is sure to set your child on their reading journey.<br></div><div><br></div><div><i>Children under the age of 12 must be accompanied by a ticket-holding adult.</i><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Majlis', '<p>Storyteller <b>Vanessa Woolf </b>invites you to explore textures and colours through the globally bestselling, interactive, touch-and-feel book series That\'s Not My...<br></p>', NULL, 100, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '15:00:00', '2025-01-31', '15:45:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(93, 'Shereen Malherbe: The Holy Land and Me', '3939440000085341254', 'shereen-malherbe-the-holy-land-and-me', '48', 'Shereen Malherbe', 'Deema Al Alami', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>In 2023, British Palestinian author <b>Shereen Malherbe </b>appeared in the BBC documentary <i>The Holy Land and Us</i>, an experience which led her to discover details of her family history in Palestine of which she had been previously unaware. The drive to preserve this history is at the heart of her moving new book, <i>Yassini Girls </i>— a multigenerational novel that explores trauma, belonging, and the vital importance of preserving tradition and honouring the past to secure our present. Malherbe sits down with <b>Deema Al Alami&nbsp;</b>to discuss resistance, resilience, and her most personal writing project yet.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Amwaj', '<p>British Palestinian author <b>Shereen Malherbe </b>speaks about <i>Yassini Girls</i>, her moving, multigenerational novel that explores trauma, belonging, and the importance of preserving tradition and honouring the past.<br></p>', NULL, 80, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '16:00:00', '2025-02-01', '17:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(94, 'Fantasy or History', '3939440000085341791', 'fantasy-or-history', '78', 'Dr. Rasha Samir; Ahmed AlSadek; Hessa Abdulla', 'Maya Abou Zahr', 'LitFest After Hours', 'InterContinental', NULL, 'Published to Website', '0', 'Arabic', NULL, '<div>Three prominent writers come together to reveal their literary visions in blending fantasy and reality, and highlight the power of narrative in evoking history and mythology. <br></div><div><b>Rasha Samir</b> presents her novel “The Enchanted”, which explores the depth of Amazigh civilization, starting from Morocco to the Siwa Oasis. She discusses the ability of fantasy literature to reflect an exciting and multi-dimensional history. As for <b>Ahmed AlSadek</b>, he reviews his experience with dual genre literature in his novel “The World’s Circle”, where philosophy and fantasy intertwine, presenting a new vision that breaks the traditional boundaries of literary genres.<br></div><div><b>Hessa Abdullah</b>&nbsp;shares her vision of myths and legends in the UAE, delving into the depths of local traditions and their impact on cultural identity.<br></div><div>Join us on a literary journey that will take you to new worlds!<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Amwaj', '<p>Writers&nbsp;<b>Ahmed AlSadek</b>,&nbsp;<b>Hessa Abdullah</b> and <b>Rasha Samir </b> come together to explore the exciting dimensions between fantasy and reality. They offer unique insights into fantasy, history, and mythology, revealing how these elements intertwine to form rich cultural identities.<br></p>', NULL, 81, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '18:30:00', '2025-01-31', '19:30:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(95, 'That\'s Not My... Flamingo', '3939440000085341728', 'thats-not-my-flamingo', '221', 'Vanessa Woolf', '', 'Family Activities', 'InterContinental', 'All ages', 'Published to Website', '0', 'English', NULL, '<div>Join us for a fun-filled exploration of the global hit series, That\'s Not My... perfect for curious little hands! These interactive, touch-and-feel board books introduce young readers to a world of textures, colours, and simple yet engaging stories. In this exciting session, led by Britain\'s favourite storyteller <b>Vanessa Woolf</b>, toddlers will be engrossed in a sensory adventure. Whether it\'s a shaggy dog or a bumpy dinosaur, your child will love discovering what’s next. Ideal for ages 0–4, this event is sure to set your child on their reading journey.<br></div><div><br></div><div><i>Children under the age of 12 must be accompanied by a ticket-holding adult.</i><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Majlis', '<p>Storyteller <b>Vanessa Woolf </b>invites you to explore textures and colours through the globally bestselling, interactive, touch-and-feel book series That\'s Not My...<br></p>', NULL, 100, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '09:00:00', '2025-02-02', '09:45:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(96, 'An Evening with Abdulrazak Gurnah', '3939440000085341272', 'an-evening-with-abdulrazak-gurnah', '50', 'Abdulrazak Gurnah', 'Zeinab Badawi', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Spend an illuminating evening with master storyteller <b>Abdulrazak Gurnah</b>, as he celebrates the publication of his upcoming book, <i>Theft</i>. Awarded the Nobel Prize in Literature in 2021, Gurnah is widely recognised as one of the world’s most pre-eminent post-colonial writers. His uncompromising and compassionate novels, such as <i>Paradise</i>, <i>Afterlives</i>, <i>Desertion</i>​, and <i>By the Sea </i>powerfully explore themes of exile, identity, and belonging. In this must-see conversation with <b>Zeinab Badawi</b>, Gurnah shares the full range of his creativity and humanity, reflecting on his remarkable life and career, and the themes to which he keeps returning.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha II', '<p>Nobel Prize-winning author <b>Abdulrazak Gurnah</b>, widely recognised as one of the world’s pre-eminent writers, takes to the LitFest stage in this special event celebrating his remarkable life and career.<br></p>', NULL, 200, 100, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '19:30:00', '2025-02-01', '20:30:00', 0, NULL, NULL, 'SCONVERSATIONS100', 'D', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(97, 'Hanno Sauer on Global Morality', '3939440000085077873', 'hanno-sauer-on-global-morality', '304', 'Hanno Sauer', '', 'Discovery Talks', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>In his recent book <i>The Invention of Good and Evil</i>, philosopher <b>Hanno Sauer</b> lays out the history of morality and its evolution over time. In this fascinating and original presentation, Sauer turns his attention to the future, considering how our world faces increasingly global challenges and must therefore respond with globally coordinated solutions. As pandemics, nuclear war, climate change, and geopolitical conflicts spread across nations and borders, the world must learn to work together to find common solutions, scaling up cooperation to ever larger groups. Drawing on his expert knowledge of the history of morality, Sauer offers insight into what this global cooperation might look like.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Khor Pavilion', '<p>Philosopher <b>Hanno Sauer</b> looks to the future and considers how global challenges require global cooperation — and the role that morality will play in finding common solutions to our most pressing issues.<br></p>', NULL, 150, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '11:00:00', '2025-02-02', '11:45:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(98, 'Sandra Mikhail on Loving Your Gut', '3939440000085077882', 'sandra-mikhail-on-loving-your-gut', '305', 'Sandra Mikhail', '', 'Discovery Talks', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>How much do you really know about your gut? In this frank and illuminating Discovery Talk, dietitian and author of <i>The Gut Chronicles </i><b>Sandra Mikhail </b>delves into the importance of personalised nutrition and gut health, with a focus on the gut microbiome — that diverse ecosystem of microbes that influence everything from digestion to mental health. Come along to this free session to learn how to nourish your microbiome through targeted food and lifestyle choices, identify health misinformation spread on social media, and unlock the true potential of a happy and healthy gut.&nbsp;<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Khor Pavilion', '<p>Join dietitian <b>Sandra Mikhail </b>as she explores the gut microbiome’s impact on health, offering insights into nutrition, debunking health myths, and sharing tips to nourish your gut for overall well-being.<br></p>', NULL, 150, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '15:00:00', '2025-02-02', '15:45:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(99, 'Laaleen Sukhera on 250 Years of Jane Austen', '3939440000085077849', 'laaleen-sukhera-on-250-years-of-jane-austen', '302', 'Laaleen Sukhera', '', 'Discovery Talks', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>What makes the author of just six completed novels a global icon 250 years after her birth in a quiet Hampshire village? How did an Austen adaptation lead to one of the sultriest moments in television history? And why on earth is Jane Austen’s face on Britain’s £10 note? In this Discovery Talk, founder of the Jane Austen Society MENAP and editor of <i>Austenistan</i>, <b>Laaleen Sukhera</b>, delivers a whimsical, personalised take on the writer’s life and legacy, from 1775 to 2025. Suitable for Austen aficionados and newbies of all ages. Bonnets and top hats optional.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Khor Pavilion', '<p><b>Laaleen Sukhera</b>, a self-professed Jane Austen aficionado, delivers a whimsical Discovery Talk on the writer’s life and legacy, and her enduring impact on art and society. Bonnets and top hats optional.<br></p>', NULL, 100, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '15:00:00', '2025-02-01', '15:45:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(100, 'Jessamy Hibberd on the Problems of Overthinking', '3939440000085077825', 'jessamy-hibberd-on-the-problems-of-overthinking', '300', 'Dr. Jessamy Hibberd', '', 'Discovery Talks', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Most of us believe that rumination is a positive coping method that helps us work through our problems. But there’s a fine line between thinking deeply and veering into overthinking — and as anyone who’s been caught in a doom spiral knows, overthinking can be a dangerously seductive habit and tricky to find your way out of. In this insightful talk, bestselling author <b>Jessamy Hibberd</b> brings her experience as a clinical psychologist to bear, as she explores the problems of overthinking and outlines a five-step process designed to help break the overthinking habit for good.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Khor Pavilion', '<p>Clinical psychologist and author <b>Jessamy Hibberd </b>delivers a Discovery Talk on rumination — and the fine line between thinking deeply and veering into the dangerously seductive habit of overthinking.<br></p>', NULL, 100, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '11:00:00', '2025-02-01', '11:45:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(101, 'Unlocking Insights from The Business of Philanthropy', '3939440000096030061', 'unlocking-insights-from-the-business-of-philanthropy', '100', 'Sultan Sooud AlQassemi; Fadi Ghandour; Isobel Abulhoul', 'Badr Jafar', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', NULL, NULL, '<div>As the world grapples with the $5 to $7 trillion needed annually to achieve the UN’s 2030 Sustainable Development&nbsp;Goals (SDGs), an unprecedented scale of philanthropic capital is emerging, with an estimated $2 trillion deployed&nbsp;globally each year, including $250 billion to $1 trillion in Zakat and Sadaqah from Muslim-majority countries. While&nbsp;access to capital is not the primary barrier, the focus must shift to its strategic and coordinated deployment to&nbsp;maximise impact. High-growth markets, contributing over 60% of global GDP and home to the fastest-growing&nbsp;economies, are poised to become key drivers of social innovation, fueled by the largest intergenerational wealth&nbsp;transfer in history. With $83 trillion set to transition globally in the next two decades, including $1 trillion in the Middle&nbsp;East alone within six years, the next generation has a unique opportunity to leverage this wealth and innovative tools&nbsp;to address systemic challenges. <br></div><div><br></div><div><br></div><div><br></div><div>Strategic philanthropy holds immense potential to drive large-scale social change, yet its impact is often constrained&nbsp;by a lack of data, research, and leadership. Addressing the world’s most intractable problems requires collaboration&nbsp;between philanthropy, government, and business. This event delves into the key insights of The Business of Philanthropy - a series of global conversations initiated in 2021 by HE&nbsp;<b>Badr Jafar</b> and culminating in the publication of the book - which explores the evolving landscape of philanthropy&nbsp;with a focus on growth markets. Drawing on insights from over 50 leaders across business, philanthropy, and&nbsp;social sectors, HE Badr Jafar will be in conversation with <b>Isobel Abulhoul, Fadi Ghandour and Sultan Sooud Al Qassemi</b> to discuss the intersection of business principles and philanthropic practice.<br></div><div><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha II', '<p>Achieving the UN\'s 2030 SDGs requires $5–7 trillion annually, with $2 trillion in global philanthropic capital offering immense potential. This session explores insights from <i>The Business of Philanthropy</i> by <b>HE&nbsp;Badr Jafar</b>, focusing on high-growth markets and philanthropy’s role in driving systemic change.<br></p>', NULL, 200, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '10:30:00', '2025-01-31', '11:30:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(102, 'Unqualified But Here For It', '3939440000085341863', 'unqualified-but-here-for-it', '85', 'Mateo Askaripour; Alison Steadman; Harshita Gupta', 'Danabelle Gutierrez', 'LitFest After Hours', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Help! Is there a writer in the house? In this riotous after-dark session, join some of LitFest’s most brilliant minds as they dish out relationship advice, ponder career crises, and try to answer a constellation of burning questions – submitted by you. An all-star line-up of LitFest guests join host <b>Danabelle Gutierrez </b>to give completely unqualified advice on your trickiest conundrums about love, life, and modern manners. Anonymously submit your questions and watch the chaos unfold…<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Khor Pavilion', '<p>An all-star line-up of LitFest guests join host <b>Danabelle Gutierrez </b>to give completely unqualified advice on your trickiest conundrums about love, life, and modern manners.<br></p>', NULL, 100, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '19:30:00', '2025-02-01', '20:30:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30');
