(103, 'Stories of Letters', '3939440000085341656', 'stories-of-letters', '212', 'May Chebaklo', '', 'Family Activities', 'InterContinental', '6+', 'Published to Website', '0', 'Arabic', NULL, '<div>Did you know that every letter in our beautiful alphabet has its own unique and exciting story? Join author <b>May Chebaklo</b> on an adventure where we’ll uncover fascinating tales and reveal the secrets of letters in a way we’ve never experienced before! But it’s not just about stories — there will be challenges and interactive games that enrich our knowledge and bring plenty of fun to our journey. Get ready to explore the world of letters and celebrate our wonderful language in a joyful, lively atmosphere.<br></div><div><i>Recommended for ages 6+<br></i></div><div><i>Children under the age of 12 must be accompanied by a ticket-holding adult.</i><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Majlis', '<p>Each letter in our wonderful alphabet has a story to tell. In the series Tales of the Letters, author <b>May Chebaklo</b> takes us on adventures where we uncover new and exciting aspects of the Arabic letters, with fun challenges and games to test our knowledge. For ages 6+<br></p>', NULL, 75, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '14:00:00', '2025-02-01', '14:45:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(104, 'Nizar Qabbani: Endless love', '3939440000085341107', 'nizar-qabbani-endless-love', '32', NULL, '', 'Special Events', 'InterContinental', NULL, 'Published to Website', '0', NULL, NULL, '<div>Celebrate the life and poetry of <b>Nizar Qabbani</b>, the Syrian poet representing love and nationhood. In this special event, we invite you to enter&nbsp; his world through theatrical interpretations where his renowned poems will bear moments of love, loss, and freedom that define his work.<br></div><div> <br></div><div>Music and singing are at the core of the performance, incorporating some of the Arab world’s most beloved songs, whose lyrics are composed of Qabbani’s words. The audience will experience the beauty of his poetry in a dynamic artistic presentation that blends live performance with direct audience interaction. This evening is not just a tribute to Nizar Qabbani\'s poetry, but a journey through his words that continue to resonate in our collective memory.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha III', '<p>Celebrate the life and poetry of <b>Nizar Qabbani</b>, the Syrian poet representing love and nationhood. In this special event, we invite you to enter&nbsp;his world through theatrical interpretations where his renowned poems will bear moments of love, loss, and freedom that define his work. <br></p><p><br></p>', NULL, 200, 75, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '19:30:00', '2025-02-01', '20:30:00', 0, NULL, NULL, 'SSPECIALEVENTS75', 'H', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(105, 'Dubai: Home of Creativity', '3939440000085341952', 'dubai-home-of-creativity', '714', 'Nabil Suleiman; Mamdouh Hamada; Amal Ismail; Hawra Al-nadawi', 'Ghaith AlHosani', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'Arabic', NULL, '<div>In a world of geopolitical turmoil and conflict, creatives in various fields face major challenges in finding a safe and stable environment that allows them to focus on their creativity away from the pressures of life. <br></div><div>To provide this safe environment, the UAE has allocated a special category for intellectuals within the long-term golden residency system. The golden residency provides them the opportunity to focus on their creative production.<br></div><div>This topic will bring together four writers who have obtained the golden residency in the UAE: <b>Mamdouh&nbsp;Hamada</b>, <b>Nabil Suleiman</b>, <b>Hawra Al-nadawi</b>, and <b>Amal Ismail</b>.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Story Dunes', '<p>Amidst geopolitical conflicts,<b> Mamdouh Hamad</b>a, <b>Nabil Suleiman</b>, <b><b>Hawra Al-nadawi</b>​</b>, and <b>Amal Ismail</b> discuss the importance of the UAE’s golden residency and the benefits of providing a safe environment for creatives to work and produce. <br></p><p><br></p>', NULL, 140, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2026-01-29', '11:30:00', '2026-01-29', '12:30:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(106, 'Alison Steadman: Out of Character', '3939440000085341345', 'alison-steadman-out-of-character', '58', 'Alison Steadman', 'Fiona Lindsay', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div><b>Alison Steadman</b> is one of Britain\'s best-loved actors, whose credits include <i>Nuts in May</i>, <i>Abigail’s Party</i>, <i>Pride and Prejudice</i>, and <i>Gavin and Stacey</i>. Now, join her for a special in-conversation event with <b>Fiona Lindsay</b>, as she shares compelling stories and anecdotes from her life and 60-year-plus career: from growing up in post-war, working-class Liverpool, to finding acclaim and recognition for her TV and theatre career, to the challenges of juggling family life. Filled with candour and warmth, this discussion is an ode to Steadman’s incredible life in and out of character. Don’t miss your chance to hear from this gifted and uproariously funny storyteller in her own words.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha III', '<p>In this not-to-be-missed event, UK national treasure and one of the world’s most gifted and uproariously funny storytellers, <b>Alison Steadman</b>, shares the story of her life with characteristic candour and warmth.<br></p>', NULL, 200, 75, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '17:00:00', '2025-02-02', '18:00:00', 0, NULL, NULL, 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(107, 'Breaking the Mould', '3939440000085341173', 'breaking-the-mould', '38', 'Tricia Hersey; Emma Dabiri; Subhadra Das', 'Hafsa Lodi', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', 'Yes', '<div>It seems the world is governed by systems beyond our control — outmoded ideas about history, productivity, beauty, and how to be. These prevailing notions shape our daily lives in profound ways, often leading us down well-trodden paths and limiting our senses of self-worth and confidence. Can we push back against convention and choose to take the road less travelled? In this timely panel conversation, <b>Emma Dabiri</b> (<i>Disobedient Bodies</i>), <b>Subhadra Das</b> (<i>Uncivilised: Ten Lies That Made the West</i>), and <b>Tricia Hersey</b> (<i>We Will Rest!</i>) discuss how their work interrogates the dominant narratives by which we live and creates space for new ideas and ways of being. With <b>Hafsa Lodi</b>.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras II', '<p><b>Emma Dabiri </b>(<i>Disobedient Bodies</i>), <b>Subhadra Das</b> (<i>Uncivilised</i>), and <b>Tricia</b> <b>Hersey</b> (<i>We Will Rest!</i>) discuss interrogating the dominant narratives by which we live to create space for new ideas and ways of being.<br></p>', NULL, 150, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '13:00:00', '2025-02-01', '14:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(108, 'Zeinab Badawi: An African History of Africa', '3939440000085341091', 'zeinab-badawi-an-african-history-of-africa', '31', 'Zeinab Badawi', 'Hareth Al Bustani', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Africa has a storied history — from its ancient civilisations to its medieval empires, through to the globally consequential periods of change it has experienced in recent centuries. But for too long, the continent’s history has been dominated or simply ignored by western narratives. <b>Zeinab Badawi</b>, eminent broadcaster, journalist, and filmmaker, has lifted the curtain on Africa’s absorbing past by travelling through more than 30 countries and speaking with countless historians, anthropologists, archaeologists, and storytellers to set the record straight. She is joined by <b>Hareth Al Bustani</b> to recount what she has learned as chronicled in her book, <i>An African History of Africa</i>.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha III', '<p><b>Zeinab Badawi</b> — an award-winning broadcaster, journalist, and filmmaker — discusses <i>An African History of Africa</i>, her thoroughly researched and engrossing book about the continent which birthed humanity.<br></p>', NULL, 200, 75, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '16:00:00', '2025-02-01', '17:00:00', 0, NULL, NULL, 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(109, 'All That Glitters', '3939440000085341809', 'all-that-glitters', '79', 'Alex Broun; Moxie T Anderson; Basel Yafi; John Shenton; Kethy Kist; Matthew Corbett; Nadine Basiony; Nassimah Francis; Paulo Sloboda; Ria Samuel; Romina Satvatmanesh', '', 'Special Events', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>What happens when you combine a cast of overly dramatic actors all convinced of their own greatness, an ambitious and controlling director, a long-suffering assistant, and a locked-down film set? Oh, and did we mention the dead body? In this glittering murder mystery, everyone has a motive and no one is safe. As the bodies continue to pile up, only one thing is certain: someone is getting ready for their close up. Will you solve the mystery? Or will you be wrongfully accused? Perhaps we’ll find out that it was you all along. In any case, you’re invited to a dinner with the stars. Lights, camera...action.<br></div><div><br></div><div>Written by&nbsp;<b>Moxie T Anderson</b><br></div><div><br></div><div>Directed by&nbsp;<b>Alex Broun</b><br></div><div><br></div><div><b><i>​</i></b><i>Dinner and a welcome drink are included in the price of the ticket. </i><i><br></i></div><div><i><br></i></div><div><i>After your booking, a member of the Emirates Airline Festival of Literature team will be in touch to discuss any dietary requirements and seating arrangements.</i><br></div><div><b>​</b><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha III', '<p>Join a star-studded murder mystery dinner where a dramatic cast, a controlling director, and a dead body create chaos. With everyone a suspect, can you solve the case before you\'re next? Lights, camera...action!<br></p>', NULL, 150, 425, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '20:15:00', '2025-01-31', '22:30:00', 0, NULL, NULL, 'SSPECIALEVENTS425', 'L', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(110, 'Maha Abouelenein\'s 7 Rules of Self-Reliance', '3939440000085341164', 'maha-aboueleneins-7-rules-of-self-reliance', '37', 'Maha Abouelenein', 'Tracy Harmoush', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', 'Yes', '<div>In <i>7 Rules of Self-Reliance</i>, globally renowned strategic communications and personal branding expert <b>Maha Abouelenein</b> condenses decades of experience to teach you how to deploy your greatest asset — yourself — to achieve your dreams. Inspired by her father’s teachings and drawing from personal anecdotes and professional encounters, Abouelenein has devised a robust framework for navigating the demands of a rapidly changing world and recognising when to create and seize opportunities, whether in your personal, professional, or creative life. She&nbsp;will share her practical and empowering tools to thrive, no matter your circumstances.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras II', '<p>Learn from globally renowned strategic communications and personal branding expert <b>Maha Abouelenein</b> (<i>7 Rules of Self-Reliance</i>) about how to deploy your greatest asset — yourself — to achieve your dreams.<br></p>', NULL, 150, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '11:00:00', '2025-02-01', '12:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(111, 'The Bethlehem Banquet', '3939440000085341845', 'the-bethlehem-banquet', '83', 'Fadi Kattan', 'Peyman Parham Al Awadhi', 'Special Events', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div><i>Bethlehem</i>, the new book by Franco-Palestinian chef <b>Fadi Kattan</b>, is more than a simple collection of recipes. Rather, it honours the people, places, and produce of Bethlehem’s land, taking readers on a walk through the city and the hills, the desert, the olive and orange groves and the farms that Palestinians call home. In this special event, comprising dinner and conversation, Kattan joins <b>Peyman Parham Al Awadhi </b>to discuss his personal journey as an author and chef, and to celebrate the region’s terroir, its standout ingredients, its traditions, and its resilience. Don’t miss this poignant ode to Palestinian cuisine and culture.<br></div><div><br></div><div><i>Dinner and a welcome drink are included in the price of the ticket. </i><i><br></i></div><div><i><br></i></div><div><i>After your booking, a member of the Emirates Airline Festival of Literature team will be in touch to discuss any dietary requirements and seating arrangements.</i><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Zaytoun Restaurant', '<p>Join chef <b>Fadi Kattan</b> as he discusses <i>Bethlehem</i>, his book celebrating Palestinian cuisine, culture, and the land’s rich terroir. Enjoy dinner and an inspiring culinary journey.<br></p>', NULL, 160, 425, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '20:30:00', '2025-02-01', '22:30:00', 0, NULL, NULL, 'SSPECIALEVENTS425', 'L', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(112, 'Zoulfa Katouh: Love and Loss in Syria', '3939440000085341245', 'zoulfa-katouh-love-and-loss-in-syria', '47', 'Zoulfa Katouh', 'Rhea Chedid', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Praised for its ‘evocation of place and time, its rawness and its twist’ (The Times), <i>As Long as the Lemon Trees Grow</i> by the bestselling and award-winning author <b>Zoulfa Katouh</b> charts a breathtaking story of loss and love in Syria. Set during the country’s civil war, 18-year-old Salama Kassab navigates a life of pain and hardship, kept company by Khawf — a hallucination borne from the horrors she’s seen. <b>Rhea Chedid</b> speaks with Katouh about this tender and heart wrenching coming-of-age novel about resilience, faith, and the risks we must sometimes take in pursuit of hope.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Amwaj', '<p>Bestselling and award-winning author <b>Zoulfa Katouh</b> discusses <i>As Long as the Lemon Trees Grow</i>, her tender and heart wrenching coming-of-age novel set against the backdrop of Syria’s civil war.<br></p>', NULL, 85, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '14:00:00', '2025-02-01', '15:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(113, 'Arabs Through Global Eyes', '3939440000085341399', 'arabs-through-global-eyes', '64', 'Sawsane Benarafa; Saleha Ghabish; Aissa Nassiri', 'Aysha Alshamsi', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'Arabic', 'Yes', '<div>How does Arabic literature shape the image of Arabs in the world? What role does translation play in promoting cultural dialogue between people? <br></div><div>In this special session, <b>Aissa Nassiri</b>&nbsp;, <b>Sawsane&nbsp;Benarafa</b>, and <b>Saleha Ghabish</b>&nbsp;come together to explore the profound impact of Arabic literature on the international scene.<br></div><div>We discuss the new and authentic images that literature offers of Arabs, far from stereotypes, and the vital role of translation in conveying the essence of Arabic works to audiences around the world.<br></div><div>Get ready for rich discussions on the role of literature and translation in building bridges of understanding and communication between different cultures. What is the power of literature as a tool for shaping awareness and broadening horizons?<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras II', '<p>With <b>Aissa Nassiri</b> , <b>Sawsane&nbsp;Benarafa</b>, and<b> Saleha Ghabish</b>, we understand the role of Arabic literature in shaping the image of Arabs in the eyes of the world and the extent to which translation contributes to conveying the spirit and authenticity of Arabic literary works to audiences around the world. <br></p><p><br></p>', NULL, 315, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '13:00:00', '2025-02-02', '14:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(114, 'A World of Bridges', '3939440000085341281', 'a-world-of-bridges', '51', 'Noura Alkarbi; Dr. Abdel Illah Benarafa', 'Rafia Ghubash', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'Arabic', 'Yes', '<div>When Dr.&nbsp;<b>Abdel Illah&nbsp;Benarafa</b> wrote his latest novel, “There is No Hero But Ali,” was he seeking to build a space of understanding around one of the most controversial figures in Islamic history? How was Dr. <b>Noura Alkarbi</b>&nbsp;able to work on the issue of tolerance and human rapprochement in a changing environment such as that of university youth? <br></div><div><br></div><div>Our speakers will discuss a real and tangible contemporary vision that aims to achieve a world of tolerance, human understanding, and peace.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha I', '<p>Dr. <b>Abdel Illah&nbsp;Benarafa</b> ,and Dr. <b>Noura Alkarbi</b>&nbsp;discuss a real and tangible contemporary vision that aims to achieve a world of tolerance, human understanding and peace. <br></p><p><br></p>', NULL, 198, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '10:00:00', '2025-02-02', '11:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(115, 'A Sip Through Time', '3939440000085250188', 'a-sip-through-time', '15', 'Majed Alahdal', 'Hazem Ibrahim', 'LitFest After Hours', 'InterContinental', NULL, 'Published to Website', '0', 'Arabic', NULL, '<div>An immersive coffee tasting experience exploring the secrets of its production and preparation. We delve into the world of coffee through an interesting comparison between traditional Arabic coffee rituals and contemporary favorites. <br></div><div><b>Majed Alahdal</b>,,author of “Diwan Al-Qahwa”, provides deep insights into the journey and identity of coffee, reviewing the historical challenges it has faced, including prohibition and cultural restrictions. How can coffee combine history, heritage and innovation in every cup?<br></div><div><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Khor Pavilion', '<p><b>Majed Alahdal</b>&nbsp;author of “Diwan Al-Qahwa,” offers insights into coffee’s journey and identity, including challenges throughout history.<br></p>', NULL, 140, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '18:30:00', '2025-01-31', '19:30:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(116, 'Making Science Fun!', '3939440000085341601', 'making-science-fun', '206', 'Mohanad Science', '', 'Family Activities', 'InterContinental', '8+', 'Published to Website', '0', 'English', NULL, '<div>Join <b>Mohanad Science</b> as he transforms everyday science into thrilling, interactive adventures in a session crafted just for kids. From surprising experiments to hands-on activities, each moment invites you to view the world around you with new curiosity. Ever wondered how a simple balloon can move an object, or how water can change forms? Mohanad brings answers to life in a fun, lively way, turning science lessons into unforgettable experiences. Whether you’re full of questions or just ready for some amazing surprises, this special session promises excitement and discovery for all!<br></div><div><br></div><div><i>Recommended for ages 8+ </i><i><br></i></div><div><i><br></i></div><div><i>Children under the age of 12 must be accompanied by a ticket-holding adult.</i><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha II', '<p>Join <b>Mohanad Science</b> for a lively, hands-on adventure, where everyday science transforms into something extraordinary, and surprising experiments reveal a fresh perspective on the world around you! For ages 8+<br></p>', NULL, 220, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '12:30:00', '2025-02-01', '13:15:00', 0, NULL, NULL, 'SFAMILYACTIVITIES50', 'E', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(117, 'Living Legends', '3939440000085341408', 'living-legends', '65', 'Mamdouh Hamada; Nadia Al Najjar', 'Mounir ElHayek', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'Arabic', 'Yes', '<div>Join a special session featuring writer <b>Haneen Al Sayegh</b>, screenwriter<b> Mamdouh Hamada</b>,&nbsp; and novelist <b>Nadia&nbsp;Al Najjar</b> as they talk about the art of creating characters that come to life on paper and emulate reality on screen. How do writers continue to craft characters that go beyond stories to become part of our psyche, whether in literature or television? <br></div><div>Get ready to discover the secrets that make these characters stay with us long after the pages of a book are turned or the last episode of a series ends.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras II', '<p>Join a special session featuring writer <b>Haneen Al Sayegh</b>, screenwriter <b>Mamdouh Hamada</b>, and novelist <b>Nadia&nbsp;Al Najjar</b>, as they talk about the art of creating characters that come to life on paper and emulate reality on screen.<br></p>', NULL, 315, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '15:00:00', '2025-02-02', '16:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(118, 'Cultural Initiatives of the UAE', '3939440000085341317', 'cultural-initiatives-of-the-uae', '55', 'Isobel Abulhoul; HE Dr. Ali Bin Tamim; HE Marwa Al Aqroubi', 'Salha Obaid', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'Arabic', 'Yes', '<div>This panel discussion highlights the pioneering cultural initiatives launched by the United Arab Emirates to support intellectuals—from literary fellowship programs that open new horizons for writers to awards celebrating excellence and innovation, as well as grants that provide valuable opportunities to showcase talent.<br></div><div>H.E. Dr. <b>Ali Bin Tamim</b>, Chairman of the Abu Dhabi Arabic Language Centre; H.E. <b>Marwa Al Aqroubi</b>, Director of the House of Wisdom project; H.E. <b>Ibrahim Al Hashemi</b>, Executive Director of the Sultan Bin Ali Al Owais Cultural Foundation; and <b>Isobel Abulhoul</b>, Founder, Advisor, and Board Member of the Emirates Literature Foundation, will discuss the impact of these programs in enriching the cultural landscape and fostering literary production both locally and globally.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha I', '<p>In a rich discussion, H.E. Dr. <b>Ali Bin Tamim</b>, H.E. <b>Marwa Al Aqroubi</b>, H.E. <b>Ibrahim Al Hashemi</b>, and <b>Isobel Abulhoul</b> share insights on the key cultural initiatives launched by the United Arab Emirates to support writers and intellectuals. From literary fellowship programs and various awards to cultural grants that empower creatives, they explore the significance of these initiatives in enhancing creative production both locally and globally. <br></p>', NULL, 198, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '12:30:00', '2025-02-02', '13:30:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(119, 'Alexander McNabb: The Children of the Seven Sands', '3939440000085341326', 'alexander-mcnabb-the-children-of-the-seven-sands', '56', 'Alexander McNabb', 'William Zimmerle', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Join author <b>Alexander McNabb</b> for an insightful discussion on his new book, <i>The Children of the Seven Sands</i>. McNabb takes us on a journey through the UAE’s rich and complex history, from its early role as the land of Magan in ancient trade networks to its emergence as a modern nation. Tracing 130,000 years of survival in one of the world’s harshest environments, he explores the region’s pivotal role in the rise of civilisation, the development of pre-Islamic cities, and the seafaring legacy that shaped global trade. With over 35 years of experience in the Middle East, McNabb offers a unique perspective on how this small desert region went from ancient copper traders to the founding of the UAE in 1971.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras III', '<p>Join author <b>Alexander McNabb</b> for a discussion on his book <i>The Children of the Seven Sands</i>. McNabb explores the UAE’s history, from ancient trade routes to its modern transformation.<br></p>', NULL, 200, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '16:00:00', '2025-02-01', '17:00:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(120, 'A Brave New World', '3939440000085341308', 'a-brave-new-world', '54', 'Ahmed AlSadek; Aissa Nassiri; Hawra Al-nadawi; Nahla Al Fahad', 'Turki Alzaabi', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'Arabic', 'Yes', '<div>As technology accelerates and the world as we know it changes, a fundamental question arises: How will the arts respond to this rapid transformation? In this inspiring session, a group of young artists, writer <b>Ahmed AlSadek</b>, writer and poet <b>Aissa&nbsp;Nassiri</b>, writer <b>Hawra&nbsp;Al-nadawi</b>, and film director <b>Nahla&nbsp;Al Fahad</b>, come together to explore the impact of these developments on the creative scene. Will the roles of writers, artists, and filmmakers change to become more profound and complex? <br></div><div>We delve into how the new generation of creatives are preparing to face the challenges that lie ahead, while highlighting the opportunities that the digital age offers. It is a thought-provoking session that opens up new horizons for artistic and cultural creativity, as we reshape the features of the arts in a changing world.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha I', '<p>As technology accelerates and the world as we know it changes, an important question arises: how will the arts respond to these changes? Young artists <b>Ahmed AlSadek</b>,, <b>Aissa&nbsp;Nassiri</b>, <b>Hawra&nbsp;Al-nadawi</b>, and <b>Nahla&nbsp;Al Fahad</b>,&nbsp;come together to explore the impact of these developments on their creativity and the art scene in general.<br></p>', NULL, 198, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '16:00:00', '2025-02-02', '17:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(121, 'Abraham Verghese: The Covenant of Water', '3939440000085250242', 'abraham-verghese-the-covenant-of-water', '21', 'Abraham Verghese', 'Amandeep Bhangu', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>His 2009 novel, <i>Cutting for Stone</i>, established <b>Abraham Verghese</b> as a writer in masterful command of language and narrative, catapulting the physician and author into the echelons of “literary phenomenon”. In his new novel <i>The Covenant of Water</i>, Verghese turns his gaze towards Kerala, India, where he brings to life Big Ammachi—a matriarch trying to solve the mystery of why at least one person in every generation of her family dies by drowning. Verghese joins <b>Amandeep Bhangu</b> to discuss his deeply moving family saga—a tale of heartbreaking loss and unthinkable change punctuated by fantastic moments of humour and grace.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Story Dunes', '<p>Literary phenomenon <b>Abraham Verghese</b> speaks about <i>The Covenant of Water</i>, his deeply moving and bestselling family saga set in Kerala, India, and praised by Oprah Winfrey as “unputdownable”.<br></p>', NULL, 680, 100, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '19:00:00', '2025-01-31', '20:00:00', 0, NULL, NULL, 'SCONVERSATIONS100', 'D', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(122, 'In the Footsteps of a Storyteller', '3939440000085250161', 'in-the-footsteps-of-a-storyteller', '12', 'Mohammad Al Mansi Qindeel', 'Ali AlShaali', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'Arabic', 'Yes', '<div>Discover the magic of literature through the eyes of one of the most prominent writers in the Arab world, Dr. <b>Mohammed Al Mansi&nbsp;Qindeel&nbsp;</b> <br></div><div>In this inspiring session, we accompany Qandil on a journey through time, where the threads of reality intertwine with imagination, and epic characters live their daily lives. How did his personal experiences and his love of history and cultural heritage shape his works that captivate minds and enrich hearts?<br></div><div>Join us to discover the secrets of the stories that shaped his literary career. Enjoy a conversation about passion, creativity, and the constant search for beauty between the pages of books.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha I', '<p>Discover the beauty of literature through the eyes of one of the most prominent writers in the Arab world, Dr. <b>Mohammed Al Mansi&nbsp;Qindeel</b>. We unveil his personal experiences, his love of history and cultural heritage, and the secret behind his works that captivate minds and enrich hearts. <br></p><p><br></p>', NULL, 198, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '19:30:00', '2025-01-31', '20:30:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(123, 'Meet Lemony Snicket!', '3939440000085341674', 'meet-lemony-snicket', '214', 'Daniel Handler aka Lemony Snicket', 'Jack Meggitt-Phillips', 'Family Activities', 'InterContinental', '8+', 'Published to Website', '0', 'English', NULL, '<div>Look away, we implore you. Your life will be much more enjoyable if you stop reading this immediately. Still here? Well, we warned you. Brace yourself for a morning of misery and woe as <b>Lemony Snicket </b>— or perhaps his alter ego Daniel Handler? — takes to the LitFest stage in this special event for curious children and adults alike. The narrator of the compulsively readable A Series of Unfortunate Events (adapted for film in 2004, and more recently as a Netflix series) sits down with <b>Jack Meggitt Phillips </b>in a rare in-person event. Fans of Lemony Snicket will be over the moon, a phrase that here means exceedingly pleased.<br></div><div><br></div><div><i>Recommended for ages 10+ </i><i><br></i></div><div><i><br></i></div><div><i>Children under the age of 12 must be accompanied by a ticket-holding adult.</i><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Story Dunes', '<p>Brace yourself for a morning of misery and woe as <b>Lemony Snicket </b>— narrator of the compulsively readable A Series of Unfortunate Events — takes to the LitFest stage. For ages 8+<br></p>', NULL, 680, 75, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '10:00:00', '2025-02-01', '11:00:00', 0, NULL, NULL, 'SFAMILYACTIVITIES75', 'F', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(124, 'I Don\'t Lie, I Write...', '3939440000085341046', 'i-dont-lie-i-write', '26', 'Dr. Rasha Samir; Ali AlShaali; Nabil Suleiman', 'Marwa Melhem', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'Arabic', 'Yes', '<div>Is Pain Really the Engine of Creativity? <br></div><div>In this session, we explore the uncomfortable and dark sides of writing, which often remain hidden behind the beauty of texts. We discuss what is known as the ugly side of literature, such as the internal struggles that writers suffer from, anxiety, feelings of isolation, and the psychological pain that may accompany the creative process.<br></div><div>Does literature sometimes reflect the harsh realities of life, such as loss, failure, or social crises? How do these elements affect the vision of writers? What they choose to present to the reader? Are these feelings drained during the writing process?<br></div><div>Writer <b>Rasha Samir</b>, writer and poet <b>Ali AlShaali</b>, and Dr. <b>Nabil Suleiman</b> join us in a deep and frank conversation, where we understand how these aspects can shape literary works and make them more realistic, while we ask: Can literature be a tool to transform pain into hope?<br></div><div><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha I', '<p>In a deep and candid session with <b>Rasha Samir</b>,<b> Ali</b> <b>AlShaali</b> and<b> Nabil&nbsp;Suleiman</b>, we understand the internal struggles that writers suffer from, such as anxiety, feelings of isolation, and the psychological pain that may accompany the creative process. We search for an answer to the most important question: Can literature be a tool to transform pain into hope?<br></p>', NULL, 198, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '16:00:00', '2025-02-01', '17:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(125, 'Children Take Over LitFest: English Edition', '3939440000085077699', 'children-take-over-litfest-english-edition', '201', 'Aashi Singh; Afra Rashed Al Dhaheri; Karim Siddiqi; Oindrila Majumdar; Olivia Palk; Omar Hussein; Ralf Tawk; Shanti Allard; Umair Kidwai', '', 'Family Activities', 'InterContinental', 'All ages', 'Published to Website', '0', 'English', NULL, '<div>Join us to celebrate some of Dubai’s youngest and brightest authors. These budding writers will discuss their creative processes, read excerpts from their books, and share what inspires them. <br></div><div>Children under the age of 12 must be accompanied by a ticket-holding adult.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha II', '<p>Join us to celebrate some of Dubai’s youngest and brightest authors. These budding writers will discuss their creative processes, read excerpts from their books, and share what inspires them.<br></p>', NULL, 220, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-30', '17:00:00', '2025-01-30', '18:00:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(126, 'Tickling the Dark Side', '3939440000085341055', 'tickling-the-dark-side', '27', 'Ahmed AlSadek; Mamdouh Hamada;', 'Turki Alzaabi', 'LitFest After Hours', 'InterContinental', NULL, 'Published to Website', '0', 'Arabic', 'Yes', '<div>Laughter has the power to mitigate the effects of everything we don\'t like in this world, and that\'s why comedy exists! <br></div><div>The artist who can make others laugh at life\'s hardships, and turn sarcasm into a weapon against ugliness, is undoubtedly a true artist who possesses one of the deepest secrets of genius creativity.<br></div><div>Scriptwriter <b>Mamdouh Hamada</b>, the creator behind a number of famous TV series such as \"Dayaa Dayaa/The Lost Village\" and \"Baqa\'a Daw/Spotlight\", and writer <b>Ahmed AlSadek</b>, author of \"Ten Failed Suicide Attempts\", tell us what happens when comedy meets reality, how what is known as “black comedy” comes to light.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha I', '<p>Screenwriter <b>Mamdouh Hamada</b> and writer <b>Ahmed AlSadek</b>&nbsp;tell us what happens when comedy meets reality, and how what is known as “black comedy” comes to light. <br></p><p><br></p>', NULL, 198, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '18:30:00', '2025-02-01', '19:30:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(127, 'The Everlasting Walk', '3939440000085341037', 'the-everlasting-walk', '25', 'Waciny Laredj; Mohammad Al Mansi Qindeel', 'Salha Obaid', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'Arabic', 'Yes', '<div>Prof. <b>Waciny Laredj</b>&nbsp;and Dr. <b>Mohammed Al Mansi&nbsp;Qindeel</b>&nbsp;join us to explore how cities and places intertwine with the literary threads, becoming an integral part of the spirit of the text. <br></div><div>The two writers take us on a deep journey, revealing the impact of travel and movement on narrative. How experiences and places form a world that transcends reality to reflect the spirit of characters and events in stories.<br></div><div>We learn about the role of cities as incubators of literary memory and how their streets and alleys become characters that speak between the lines, making this session a unique experience to explore literature from the perspective of the places and journeys that inspire it.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha I', '<p>Prof. <b>Waciny Laredj</b> and Dr. <b>Mohammed Al Mansi&nbsp;Qindeel</b> join us to explore together how cities and places intertwine with literary threads, becoming an integral part of the spirit of the text.<br></p>', NULL, 198, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '14:00:00', '2025-02-01', '15:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(128, 'Humanising Knowledge', '3939440000085341290', 'humanising-knowledge', '52', 'Farida El Gueretly; Rotana Al Hasanat', 'Duaa Khidir', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'Arabic', NULL, '<div>Join speakers <b><b>Farida El Gueretly</b> </b>and <b>Rotana Al Hasanat</b>&nbsp;for an inspiring exploration of the Wikimedia Foundation’s mission to create a world where everyone can freely share and access knowledge. Discover how this collaborative platform is empowering individuals and communities worldwide to share information freely and contribute to a more equitable and informed society. <br></div><div>This session will delve into the opportunities and challenges within the Wikimedia movement and inspire attendees to get involved and contribute to building a more open and inclusive world of knowledge.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Khor Pavilion', '<p>we will embark on an exploratory journey with experts<b> Farida El Gueretly&nbsp;</b>&nbsp;and <b>Rotana Al Hasanat</b> into the mission of the Wikimedia Foundation, which aims to create a world where everyone can&nbsp; freely share and access knowledge.<br></p>', NULL, 140, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '13:00:00', '2025-02-01', '14:00:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(129, 'The Absent Winner', '3939440000085250125', 'the-absent-winner', '8', 'Yousef Kandakji; Rana Idriss', 'Alyaa AlMansoori', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'Arabic', 'Yes', '<div>In a fascinating session that takes us deep into the human experience, we uncover the story of imprisoned writer, Basem Khandakji, and his International Prize for Arabic Fiction-winning novel \"A Mask, the Colour of the Sky\", but what does it mean for Basem to win behind bars. What are the details that have not yet been told about this amazing achievement? <br></div><div>Join <b>Yousef&nbsp;Kandakji</b>, the writer’s brother, and <b>R</b><b>ana Idriss</b>, Basem’s publisher, as they explore the complex emotions and challenges the writer faced while writing his novel. How did he receive the news of his win, which came so long after the announcement? What is the hidden story behind the scenes of this success?<br></div><div>A session full of hope, perseverance, and nostalgia, in which we discover how hopes and dreams intertwine with pain and suffering.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras II', '<p>On behalf of his brother, the imprisoned writer Basem Khandaqji, <b>Yousef&nbsp;Kandakji</b>&nbsp;and publisher <b>Rana Idriss</b>&nbsp;share with us the story of the missing writer and his novel that crossed prison bars, as we await the release of the second part of this story.<br></p>', NULL, 315, 75, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '16:00:00', '2025-01-31', '17:00:00', 0, NULL, NULL, 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(130, 'To Be the First: The Story of His Highness Sheikh Mohammed bin Rashid Al Maktoum', '3939440000085250088', 'to-be-the-first-the-story-of-his-highness-sheikh-mohammed-bin-rashid-al-maktoum', '4', 'Graeme Wilson', 'Ahmed & Rashed bin Shabib', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Experience an extraordinary journey through the life of <b>His Highness Sheikh Mohammed bin Rashid Al Maktoum</b>, a leader who has transformed Dubai from modest beginnings into a thriving global city. <i>To Be the First</i>, his authorised biography by <b>Graeme Wilson</b>, chronicles Sheikh Mohammed’s ambitious path from his early life in a simple adobe house to becoming the UAE\'s Vice President, Prime Minister, and Dubai’s visionary ruler. Wilson discusses Sheikh Mohammed’s impact, from sealing the act of union and spearheading Dubai’s rise as a hub of peace, tolerance, and opportunity, to his inspiring story of ambition, resilience, and exemplifying the transformative power of purposeful leadership.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras I', '<p><b>Graeme Wilson</b> speaks about <i>To Be the First</i>, the authorised biography of <b>HH Sheikh Mohammed</b> which chronicles his remarkable life and Dubai’s extraordinary journey from humble origins to global city.<br></p>', NULL, 315, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '17:00:00', '2025-01-31', '18:00:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(131, 'Hala Gorani: But You Don\'t Look Arab', '3939440000085341073', 'hala-gorani-but-you-dont-look-arab', '29', 'Hala Gorani', 'Rawaa Talass', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div>Emmy Award-winning Syrian-American journalist <b>Hala Gorani</b> has lived in or travelled to most corners of the world, fluently speaks three languages, and has enjoyed a career as one of the world’s most respected international reporters—her decades-spanning work changing both her own life and those of the people and communities on which she has reported, particularly those in the Middle East. Gorani takes to the stage with <b>Rawaa Talass</b> to discuss <i>But You Don’t Look Arab</i>, her memoir which lays bare her life and career, delves into her family history, and considers the questions which continue to linger in her mind: Who is she? And where does she belong?<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha III', '<p>Emmy Award-winning Syrian-American journalist <b>Hala Gorani</b> takes to the stage to discuss <i>But You Don’t Look Arab</i> — a chronicle of her remarkable life and career, and her search for belonging.<br></p>', NULL, 432, 75, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '12:00:00', '2025-02-01', '13:00:00', 0, NULL, NULL, 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(132, 'Book Launch: Voices of Future Generations for the Middle East Region', '3939440000085077780', 'book-launch-voices-of-future-generations-for-the-middle-east-region', '828', NULL, '', 'Family Activities', 'InterContinental', NULL, 'Published to Website', '0', 'Multilanguage', NULL, '<div>A year in the making, the winning stories of the fifth round of Voices of Future Generations for the Middle East Region will soon be available for all to read in Young Voices of Arabia 2024: a beautifully produced collection illustrated by locally based artists. All twenty-two winning stories — eleven originally written in Arabic, eleven in English — have been translated and the collection is available in both languages. <br></div><div><br></div><div>We invite you to join us for this very special book launch. Featuring<b> Mohammed Hamdan Siddiqui </b>and <b>Lujain, Wissam Al-Halabi</b> first-place winners of the Arabic and English competitions, this is your chance to show support for all the talented and hard-working young people who contributed stories inspired by the UN Sustainable Development Goals.<br></div><div>We look forward to seeing you and introducing you to the exciting adventures that the winners have dreamed up!<br></div><div><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha III', '<p>A year in the making, the winning stories of the fifth round of Voices of Future Generations for the Middle East Region will soon be available for all to read in Young Voices of Arabia 2024: a beautifully produced collection illustrated by locally based artists.<br></p><p>&nbsp;Featuring<b> Mohammed Hamdan Siddiqui </b>and <b>Lujain, Wissam Al-Halabi</b>​. We look forward to seeing you and introducing you to the exciting adventures that the winners have dreamed up!', NULL, 400, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '11:00:00', '2025-02-02', '12:00:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(133, 'Mudun: Short Stories from the Arab World', '3939440000085341227', 'mudun-short-stories-from-the-arab-world', '45', 'Sultan Sooud AlQassemi; Reem Khorshid; Faris Bseiso; Razmig Bedirian', 'Lana Shamma', 'Conversations', 'InterContinental', NULL, 'Published to Website', '0', 'English', NULL, '<div><i>Mudun: Short Stories from the Arab World</i> is a standout short story anthology, bringing together some of the most exciting contemporary writers from across the region. In this special event, join <b>Lana Shamma </b>alongside the anthology’s editors&nbsp;— <b>Sultan Sooud AlQassemi</b>, <b>Faris Bseiso</b>, <b>Razmig Bedirian</b>, and <b>R</b><b>eem Khorshid</b> — to celebrate the incredible work published in its pages, as well as the ongoing work of the Barjeel Art Foundation in supporting emerging talent through the Mudun Short Story Prize. Don’t miss this occasion of literary celebration and discovery.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha III', '<p>Join the editors of <i>Mudun: Short Stories from the Arab World </i>for an event celebrating contemporary writers, the anthology\'s remarkable stories, and the Barjeel Art Foundation\'s Mudun Short Story Prize.<br></p>', NULL, 432, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '10:00:00', '2025-02-01', '11:00:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(134, 'Fringe Stage: Spotlighting Young Performers', '3939440000085077798', 'fringe-stage-spotlighting-young-performers', '226', NULL, '', 'Family Activities', 'InterContinental', 'All ages', 'Published to Website', '0', 'Multilanguage', NULL, '<div>The LitFest Fringe returns in 2025 to showcase and celebrate the dazzling talents of young performers, dancers, musicians, poets and storytellers from throughout the UAE! <br></div><div><br></div><div><i>Children under the age of 12 must be accompanied by a ticket-holding adult.</i><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Story Dunes', '<p>The LitFest Fringe returns in 2025 to showcase and celebrate the dazzling talents of young performers, dancers, musicians, poets and storytellers from throughout the UAE!<br></p>', NULL, 680, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '12:00:00', '2025-02-02', '16:00:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30');
