(135, 'Diary of a Wimpy Kid: Hot Mess', '3939440000085341683', 'diary-of-a-wimpy-kid-hot-mess', '216', 'Jeff Kinney', '', 'Family Activities', 'InterContinental', '6+', 'Published to Website', '0', 'English', NULL, '<div>Get up close with Diary of a Wimpy Kid writer and illustrator <b>Jeff Kinney</b>, as he introduces the 19th book in his blockbuster series: the side-splitting and relatable <i>Hot Mess</i>! Greg Heffley is back for another adventure that mixes heaps of family, a tiny beach house, and sweltering heat — it’s a recipe for disaster. Speaking of recipes, the secret ingredients behind his Gramma’s famous meatballs have been closely guarded for years. Can Greg unpack all his family’s mysteries before their vacation is over? Or will he just stir the pot? Kinney will be serving up laughs and celebrating the latest Wimpy Kid book, while satisfying your craving for family fun. Audience members will have a chance to join Jeff on stage for a family-style feast of friendly competition.<br></div><div><br></div><div><i>Recommended for ages 6+ </i><i><br></i></div><div><i><br></i></div><div><i>Children under the age of 12 must be accompanied by a ticket-holding adult.</i><br></div><div><i>​</i><br></div><div><i>NB: There will be no book signing for this event. Pre-signed books will be available for purchase in the festival bookshop.</i><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Story Dunes', '<p><span class=\"highlight\" style=\"background-color:transparent\"><span class=\"colour\" style=\"color:rgb(0, 0, 0)\"><span class=\"font\" style=\"font-family:inherit\"><span class=\"size\" style=\"font-size: 13.3333px; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; box-sizing: border-box; font-style: normal; font-variant-ligatures: none; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; white-space: pre-wrap; text-decoration-color: initial;\">Join Diary of a Wimpy Kid author </span></span><b><span class=\"font\" style=\"font-family:inherit\"><span class=\"size\" style=\"font-size: 13.3333px; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; box-sizing: border-box; font-style: normal; font-variant-ligatures: none; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; white-space: pre-wrap; text-decoration-color: initial;\">Jeff Kinney</span></span></b><span class=\"font\" style=\"font-family:inherit\"><span class=\"size\" style=\"font-size: 13.3333px; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; box-sizing: border-box; font-style: normal; font-variant-ligatures: none; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; white-space: pre-wrap; text-decoration-color: initial;\"> as he introduces <i>Hot Mess</i>, the 19th book in his series! Expect laughs, family fun, and a chance to join him on stage for messy mischief and hijinks. For ages 6+</span></span></span></span><br></p>', NULL, 600, 100, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '10:00:00', '2025-02-02', '11:00:00', 0, NULL, NULL, 'SFAMILYACTIVITIES100', 'G', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(136, 'Diary of a Wimpy Kid: Hot Mess', '3939440000085341583', 'diary-of-a-wimpy-kid-hot-mess-1', '205', 'Jeff Kinney', '', 'Family Activities', 'InterContinental', '6+', 'Published to Website', '0', 'English', NULL, '<div>Get up close with Diary of a Wimpy Kid writer and illustrator <b>Jeff Kinney</b>, as he introduces the 19th book in his blockbuster series: the side-splitting and relatable <i>Hot Mess</i>! Greg Heffley is back for another adventure that mixes heaps of family, a tiny beach house, and sweltering heat — it’s a recipe for disaster. Speaking of recipes, the secret ingredients behind his Gramma’s famous meatballs have been closely guarded for years. Can Greg unpack all his family’s mysteries before their vacation is over? Or will he just stir the pot? Kinney will be serving up laughs and celebrating the latest Wimpy Kid book, while satisfying your craving for family fun. Audience members will have a chance to join Jeff on stage for a family-style feast of friendly competition.<br></div><div><br></div><div><i>Recommended for ages 6+ </i><i><br></i></div><div><i><br></i></div><div><i>Children under the age of 12 must be accompanied by a ticket-holding adult.</i><br></div><div><br></div><div><i>​NB: There will be no book signing for this event. Pre-signed books will be available for purchase in the festival bookshop.</i><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Story Dunes', '<p>Join Diary of a Wimpy Kid author <b>Jeff Kinney </b>as he introduces <i>Hot Mess</i>, the 19th book in his series! Expect laughs, family fun, and a chance to join him on stage for messy mischief and hijinks. For ages 6+<br></p>', NULL, 600, 100, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '16:00:00', '2025-01-31', '17:00:00', 0, NULL, NULL, 'SFAMILYACTIVITIES100', 'G', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(137, 'Fringe Stage: Spotlighting Young Performers', '3939440000085077753', 'fringe-stage-spotlighting-young-performers-1', '215', NULL, '', 'Family Activities', 'InterContinental', 'All ages', 'Published to Website', '0', 'Multilanguage', NULL, '<div>The LitFest Fringe returns in 2025 to showcase and celebrate the dazzling talents of young performers, dancers, musicians, poets and storytellers from throughout the UAE! <br></div><div><br></div><div><i>Children under the age of 12 must be accompanied by a ticket-holding adult.</i><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Story Dunes', '<p>The LitFest Fringe returns in 2025 to showcase and celebrate the dazzling talents of young performers, dancers, musicians, poets and storytellers from throughout the UAE!<br></p>', NULL, 680, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '13:00:00', '2025-02-01', '17:00:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
