(139, 'LitFest After Hours: Comedy by the Creek', '3939440000098101980', 'litfest-after-hours-comedy-by-the-creek', '116', 'Shaddy Gaad; Miqdaad Dohadwala; Salman Qureshi; Liz Gonzales', '', 'LitFest After Hours', 'InterContinental', NULL, 'On Hold', '0', NULL, NULL, NULL, 'Litfest 2025', 'Dubai Festival City', 'Khor Pavilion', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '21:00:00', '2025-02-01', '22:00:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(140, 'How to Grow a Dragon', '3939440000085341610', 'how-to-grow-a-dragon', '207', 'Steven Lenton', '', 'Cancelled', 'InterContinental', '4+', 'On Hold', '0', 'English', NULL, '<div>Come along for this magical illustration journey with acclaimed illustrator <b>Steven Lenton</b>, featuring his enchanting How to Grow a... series of books. In <i>How to Grow a Dragon</i>, the audience will dive into the world of Sarah and Mr Pottifer’s plant shop, where dragons grow from trees — but not without a little chaos. Steven will guide the audience in creating their own visionary illustrations inspired by the story’s themes of problem-solving, kindness, and resourcefulness. This is an event designed to inspire creativity so don\'t forget to bring along your imagination!<br></div><div><br></div><div><i>Recommended for ages 4+ </i><i><br></i></div><div><i><br></i></div><div><i>Children under the age of 12 must be accompanied by a ticket-holding adult.</i><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha II', '<p>Join acclaimed children\'s illustrator <b>Steven Lenton </b>for an interactive draw-along event. Learn drawing tips and create your own dragon (or whatever mystical beast you wish!) through hands-on drawing exercises. For ages 4+<br></p>', NULL, 220, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '14:00:00', '2025-02-01', '14:45:00', 0, NULL, NULL, 'SFAMILYACTIVITIES50', 'E', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(141, 'Blame it on Mum', '3939440000085341028', 'blame-it-on-mum', '24', 'Dr. Rasha Samir; Haneen Al Sayegh', 'Esra AlMulla', 'Cancelled', 'InterContinental', NULL, 'On Hold', '0', 'Arabic', 'Yes', '<div>Does the great aura that we surround mothers with sometimes become a great burden? At what point does social responsibility become exaggerated? <br></div><div>Many childhood complexes and their consequences are attributed to mothers. Have societal expectations burdened the maternal role that our mothers play by nature, with the knowledge and tools they have available?<br></div><div>Writers <b>Haneen Al Sayegh</b>&nbsp;, author of the novel \"Women\'s Charter\", and writer <b>Rasha Samir</b>, author of \"Girls in Tales\", discuss the image of motherhood and its impact on identity and human relationships. Join them to ask your questions and thoughts on such a sensitive and realistic topic.<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha I', '<p>Writers <b>Haneen Al Sayegh </b>and <b>Rasha Samir</b>&nbsp;discuss the image of motherhood and its impact on identity and human relationships. They also discuss the extent of the burdens placed on mothers.<br></p>', NULL, 198, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '12:00:00', '2025-02-01', '13:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
