(151, 'LitFest After Hours: Phat G', '3939440000098135037', 'litfest-after-hours-phat-g', '117', NULL, '', 'LitFest After Hours', 'InterContinental', NULL, 'On Hold', '0', NULL, NULL, NULL, 'Litfest 2025', 'Dubai Festival City', 'Al Majlis', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '21:40:00', '2025-02-01', '22:00:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(152, 'Modern Issues', '3939440000092226306', 'modern-issues', '250', 'Fatima Bint Ali', 'Alaa Maasarani', 'Cancelled', 'InterContinental', NULL, 'On Hold', '0', 'Arabic', NULL, '<div>This session celebrates the release of author <b>Fatima Bint Ali</b> new book, Contemporary Issues, which sheds light on some of the most pressing challenges of modern times, such as the crises of modernity and postmodernity, the dominance of market society, human alienation, and the decline of values under the sway of technology. With an engaging style and deep analysis, the author opens a window to philosophical solutions aimed at restoring balance and elevating humanity. Join the discussion to discover how thought can serve as a gateway to overcoming our contemporary crises and moving toward a broader, more humane horizon<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Waha', '<p>This session celebrates the release of author <b>Fatima Bint Ali </b>new book, Contemporary Issues, which highlights the key challenges of the modern era. With an engaging style and deep analysis, the author explores philosophical solutions to restore balance and elevate humanity.<br></p>', NULL, 80, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '18:30:00', '2025-01-31', '19:30:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
