(156, 'LitFest After Hours: RIRI', '3939440000098101743', 'litfest-after-hours-riri', '112', 'Riri', '', 'LitFest After Hours', 'InterContinental', NULL, 'On Hold', '0', NULL, NULL, NULL, 'Litfest 2025', 'Dubai Festival City', 'Al Majlis', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '21:20:00', '2025-01-31', '22:00:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(157, 'Shamma Albastaki: House to House بيت لبيت', '3939440000085341417', 'shamma-albastaki-house-to-house-byt-lbyt', '66', 'Shamma Albastaki', '', 'Cancelled', 'InterContinental', NULL, 'Cancelled', '0', 'Arabic', 'Yes', '<div><b>Shamma Albastaki</b>’s poetry captures the essence of human experience. Her highly anticipated and genre-blending debut collection, House to House, chronicles the lives of Dubai’s creek communities from the 1940s to the 1980s, drawing from conversations about the day-to-day lives of those who lived through a time of remarkable transformation. In conversation with Sultan Sooud AlQassemi, Albastaki reveals how poetry becomes a tool to archive and celebrate collective memory, and how by documenting stories from the past and connecting them to her present she shakes up the locus of our individual and shared histories<br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Ras II', '<p><b>Shamma Albastaki</b>’s poetry captures the essence of human experience. Her highly anticipated and genre-blending debut collection, House to House, chronicles the lives of Dubai’s creek communities from the 1940s to the 1980s, drawing from conversations about the day-to-day lives of those who lived through a time of remarkable transformation.<br></p>', NULL, 150, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-02', '17:00:00', '2025-02-02', '18:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(158, 'CANCELLED: Of the Land: Stories from Palestine', '3939440000085341064', 'cancelled-of-the-land-stories-from-palestine', '28', NULL, '', 'Cancelled', 'InterContinental', NULL, 'Cancelled', '0', 'English', NULL, NULL, 'Litfest 2025', 'Dubai Festival City', 'Al Baraha III', NULL, NULL, 200, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-02-01', '10:00:00', '2025-02-01', '11:00:00', 0, NULL, NULL, NULL, NULL, '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(159, 'CANCELLED: Beyond the Classroom', '3939440000085250070', 'cancelled-beyond-the-classroom', '2', 'Shamma Bint Mohammed Bin Khaled Al Nahyan', 'Rafia Ghubash', 'Cancelled', 'InterContinental', NULL, 'Cancelled', '0', 'Arabic', NULL, '<div>In a rapidly evolving and changing world, the responsibility of raising children and preparing them for the future is becoming increasingly serious and complex. What are the most important questions we should be discussing when thinking about the world our children are entering? <br></div><div><br></div><div>Her Highness Sheikha Dr. Shamma bint Mohammed bin Khalid Al Nahyan discusses her vision on science and culture in shaping the educational experiences and educating the future of the emerging generations.<br></div><div><br></div><div>How can the education sector confront the difficult challenges that stand in its way? How can its curricula and technologies keep pace with rapid development, while preserving the region’s cultural identity and heritage?<br></div><div><br></div><div>Join a valuable session with a cultural figure and one of the most important leaders of thought and education in the UAE.<br></div><div><br></div>', 'Litfest 2025', 'Dubai Festival City', 'Al Baraha III', '<p>Her Highness Sheikha Dr. Shamma bint Mohammed bin Khalid Al Nahyan, a thought and education leader in the UAE, discusses her visions on science, culture, and the impact of current educational and pedagogical experiences in shaping the future of generations.<br></p>', NULL, 220, 50, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '15:00:00', '2025-01-31', '16:00:00', 0, NULL, NULL, 'SCONVERSATIONS50', 'A', '2025-02-02 09:54:30', '2025-02-02 09:54:30'),
(160, 'CANCELLED: Taking the Temperature', '3939440000085250097', 'cancelled-taking-the-temperature', '5', NULL, '', 'Cancelled', 'InterContinental', NULL, 'Cancelled', '0', 'English', NULL, NULL, 'Litfest 2025', 'Dubai Festival City', 'Al Ras I', NULL, NULL, 150, 75, NULL, NULL, NULL, NULL, NULL, NULL, '2025-01-31', '15:00:00', '2025-01-31', '16:00:00', 0, NULL, NULL, 'SCONVERSATIONS75', 'C', '2025-02-02 09:54:30', '2025-02-02 09:54:30');
